EVT1914_2008008_DESC;News of the Russian Tsar's abdication was welcome news in the United States where the Russian absolute monarchy was almost held in such low esteem it was nearly as bad as that,of Germany.  With the Tsar gone there was no reason left why the United States could not join the war since they would not be seen any longer as supporting the Russian monarchy.,;;Im Mдrz 1917 dankte Zar Nikolaus II., nach schweren Demonstrationen in Petrograd und immer mehr Unruhen im Land, ab. Die Regierungsgewalt ьbernahm eine schwache Ьbergangsregierung, die sich die Macht mit den Petrograder Sowjets teilte. Diese Entscheidung fьhrte zu Konfusion und Chaos, sowohl beim Volk als auch bei der Armee, die immer ineffektiver wurde.;;;;;;;;;;;x,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,;
