EVT1914_2019506_DESC;Weakened by recent events, Konstantinos suffers from Pleurisy and Pneumonia. He can die at anytime! Event worse, Venizйlos states that the queen hurt him after an argument where she tried to convince her husband to join the Germans. A ship is sent to the Tinos island to bring the Madonna, known for its healing purposes, back to Greece, and save the King.;Affaibli par les йvйnements rйcents, Konstantinos est frapp?par une pleurйsie doublйe d'une pneumonie. Il peut mourir ?tout instant ! Pire encore, les vйnizйlistes affirment que le roi a йt?bless?par la reine aprиs une dispute au cours de laquelle elle tendait de convaincre son mari de s'allier ?l'Allemagne. Un navire est envoy?sur l'оle de Tinos pour ramener la Vierge ?l'Enfant, aux vertues guйrissantes, pour soigner le roi et le sauver.;Durch die Ereignisse der letzten Zeit geschwдcht erkrankte Kцnig Konstantinos an einer Lungen- und Rippenfellentzьndung. Mit seinem Tod muss jeden Moment gerechnet werden. Zu allem Ьberfluss behaupten Anhдnger des Premierministers, da?der Kцnig von seiner Frau verletzt wurde, weil er sich weigerte, den Mittelmдchten beizutreten. Es wurde bereits ein schiff zur Insel Tinos gesandt, um dort die Madonnenstatue abzuholen, der heilende Wirkung nachgesagt wird.;Osіabiony ostatnimi wydarzeniami, Konstantyn cierpi na zapalenie opіucnej. W kaїdej chwili moїe umrze? Co gorsza, zwolennicy Venizelosa utrzymuj? їe krуlowa wdaіa si?w sprzeczk?na temat przyі№czenia si?do wojny po stronie Niemiec, co bardzo rozzіoњciіo krуla. Na wysp?Tinos wysіano statek, by przywiуz?pos№g Madonny, znany ze swoich wіaњciwoњci leczniczych, by uchroni?krуla.;Debilitado por los recientes eventos, el Rey Konstantinos ha caнdo enfermo de Pleuritis y Neumonнa. Йl puede morir en cualquier momento! Aun peor, Venizelos afirma que la Reina Sofнa le ha herido en una discusiуn domйstica, cuando le intentaba convencer a su marido de unirse al Imperio Alemбn. Un Barco ha sido enviado a la Isla de Tinos para traer al Icono la Madonna de la Panagia Evangelistria, Virgen Patrona de Grecia a la que se le atribuyen habilidades milagrosas, para que salve a nuestro Rey.;Indebolito dagli ultimi avvenimenti, Costantino soffre di pleurite e polmonite. Pu?morire in qualsiasi momento! Ancora peggio, i seguaci di Venizelos affermano che la regina gli ha dato fastidio dopo una discussione, nella quale ha cercato di convincere il marito ad unirsi ai tedeschi. Una nave ?stata inviata all'isola di Tinos per portare la Madonna, conosciuta per i suoi scopi curativi, in Grecia, per salvare il re.;;;;;;Из-за недавних событи? подорвавши?ег?здоровье, король Константин заболе?плеврито??пневмонией. Он може?умерет??любо?время ! ?ожидании самого худшег? Венизело?заяви? чт??болезн?монарх?виновата ег?супруг? королева София. Якоб?Константин заболе?именно посл?спор??жено? пытавшей? убедит?ег?вступить ?войн?на сторон?Германии. Быстроходное судн? на которо?король отправил? на остров Тино? чтоб?поклониться икон?Богородицы, известно?чудотворными исцелениями,  возвращает? наза??Грецию. Буде?надеять?. чт?чудо поможе?Константин?..;x;;
