EVT1914_2019507_DESC;After having touched the Madonna, the King felt better. A medical surgeon was still necessary to allow the King to govern his country again.;Le Roi se sentit mieux aprиs avoir embrass?l'icфne. Une opйration chirurgicale fut toutefois nйcessaire pour permettre au roi de reprendre ses fonctions.;Nachdem Kцnig Konstantinos die Madonnenstatue berьhrt hatte, fьhlte er sich schon wesentlich besser. Trotzdem benцtigte er nach wie vor medizinische Hilfe, um sein Land wieder regieren zu kцnnen.;Po dotkniкciu pos№gu Madonny krуl poczu?si?lepiej. Przy asyњcie lekarzy krуl moїe powrуci?do rz№dzenia krajem.;Luego de haber tocado a la Madonna, interminables horas de oraciуn y?muchos doctores?el Rey al fin ha recuperado la fuerza, para volver a dirigir los destinos de nuestra naciуn.;Dopo aver toccato la Madonna, il re si sent?meglio. Un chirurgo fu tuttavia necessario per lasciargli governare nuovamente il paese.;;;;;;Посл?паломничеств??чудотворно?икон?Богородицы, здоровье коро? Константин?пошл?на поправку. Однако ем?вс?ещ?необходи?медицински?уход, чтоб?ка?можн?скорее вернуться ?управлению делами государств?;x;;
