EVT1914_2019508_DESC;With the beginning of the Dardanelles operations, King Konstantinos sees an opportunity to free Greece from Ottoman rule. His military staff is however strongly opposed to this idea. Ioannis Metaxas, the Chief of Staff, threatens to resign if Greece goes to war. Venizelos is pro-Entente and will of course support the war, but will be forced to resign if Greece stays neutral.;Avec le dйclenchement de l'opйration des Dardanelles, le roi Konstantinos entrevoit l'opportunit?de libйrer les populations grecques du joug ottoman. Son Etat-Major est en revanche fermement oppos??toute entrйe en guerre. Son chef, Ioannis Metaxas, menace mкme de dйmissionner si la Grиce entre en guerre. Venizelos, pro-Entente, est bien sыr partisan de l'entrйe en guerre, ?tel point que si la Grиce maintient sa neutralit? il sera forc?de dйmissionner.;Durch die Operationen zur Rьckgewinnung der Dardanellen gedachte Kцnig Konstantinos, griechische Landsleute von der osmanischen Herrschaft zu befreien. Sein Generalstab war allerdings entschieden gegen den Kriegseintritt Griechenlands und Ioannis Metaxas, der Generalstabschef, drohte sogar mit seinem Rьcktritt. Premierminister Venizelos hingegen war durchaus fьr einen griechischen Kriegseintritt auf Seiten der Entente, wьrde aber seinerseits entlassen, wenn Griechenland neutral bliebe. ;Wraz z pocz№tkiem operacji w Dardanelach, krуl Konstantyn upatruje szans wyzwolenia Grekуw spod tureckiego panowania. Jego kadra wojskowa silnie si?jednak sprzeciwia tym planom. Ioannis Metaxas, szef sztabu, grozi rezygnacj?w razie przyst№pienia Grecji do wojny. Venizelos sprzyja Ententcie i oczywiњcie wspiera pomys?przyі№czenia si?do wojny, lecz bкdzie zmuszony ust№pi?ze stanowiska jeњli Grecja pozostanie neutralna.;Con el inicio de las operaciones en los Dardanelos, el Rey Konstantinos ve esto como una oportunidad para liberar Grecia de la influencia Otomana de una vez por todas. Su alto mando militar en cambio, se opone a esta idea. Ioannis Metaxas, Jefe del alto mando militar, amenaza con renunciar si Grecia va a la Guerra, Eleftherios Venizelos, como buen pro-britбnico, apoya la guerra con los ojos cerrados, pero ser?forzado a dimitir si Grecia se mantiene neutral.;Con l'inizio delle operazioni di Dardanelli, il re Costantino vide l'opportunit?di liberare i greci dal dominio ottomano. Il suo staff militare ?per?fortemente contrario a questa idea. Ioannis Metaxas, il Capo di Stato Maggiore, minaccia di dimettersi se la Grecia entrer?in guerra. Venizelos, invece, ?pro-Intesa e d? ovviamente, il suo sostegno alla guerra, ma sar?costretto a dimettersi se la Grecia rimane neutrale.;;;;;;Посл?начала Дарданелльской операции, король Константин увидел возможност?освободить исконн?гречески?территории от турецког?владычеств? Однако  военны?крайне оппозиционно настроен??отношени?этой идеи. IНачальни?Генерального штаб? Иоанни?Метаксас, пригрози?уйти ?отставку, если Грец? вступи??войн? ?свою очеред? симпатизирующи?'Антант? премье?минист?Элефтериос Венизело?такж?пригрози?отставко? ?случае ,если Грец? не вступи??войн??останется нейтрально?;x;;
