EVT1914_2019509_DESC;Following Venizelos dismissal, the new prime minister Dimitrios Gounaris proposes a plan to the Entente. Greece agrees to join their side in exchange for protection against Bulgaria. If Bulgaria is still neutral, the Entente is likely to reject our proposal.;Aprиs la dйmission de Vйnizelos, Dimitrios Gounaris propose un nouveau plan ?l'Entente. La Grиce rejoint leur camp en йchange d'une protection contre la Bulgarie. Si la Bulgarie est encore neutre, l'Entente refusera certainement ce plan.;Nach der Entlassung Venizelos durch den Kцnig schlug der neue Premierminister, Dimitrios Gounaris, der Entente einen neuen Plan vor. Wenn die Entente Giechenland gegen Bulgarien verteidigen wьrde, trдte Griechenland der Entente bei. Allerdings ist es ziemlich wahrscheinlich, da?die Entente diesen Plan ablehnt, wenn Bulgarien weiterhin neutral bleibt.;Wkrуtce po odwoіaniu Venizelosa, nowy premier Dimitros Gounaris proponuje Entencie plan, Grecja zgadza si?wі№czy?si?do wojny po jej stronie w zamian za ochron?przeciwko Buіgarii. Jeњli Buіgaria pozostaje wci№ї neturalna, Ententa prawdopodobnie odrzuci nasz?propozycj?;Luego de la caнda del gobierno de Venizelos, el nuevo Primer Ministro, Dimitrios Gounaris propone un plan a la Entente. Grecia accede a declarar a la guerra al Imperio Alemбn y sus aliados a cambio de protecciуn contra Bulgaria. Si Bulgaria sigue neutral, la Entente probablemente rechazara la propuesta.;Dopo le dimissioni di Venizelos, il nuovo Primo Ministro Dimitrios Gounaris propone un piano per l'Intesa. La Grecia accetta di unirsi al loro fianco in cambio di una protezione contro la Bulgaria. Se la Bulgaria ?ancora neutrale, ?probabile che l'Intesa rifiuti la nostra proposta.;;;;;;Посл?отставки Венизелоса, новы?премье?минист?Димитрио?Гунари?предложи?представителя?'Антант? план. Грец? согласна присоединить? ?войн?на их сторон??обме?на защиту от Болгарии. Однако если Болгар? по-прежнему нейтральна, держав?'Антант? скорее всег?отклоня?наше предложени?;x;;
