EVT1914_2019510_DESC;Those elections saw a large victory for Elefthйrios Venizйlos, still popular among Greek citizens. Konstantinos is forced to call him back as his Prime Minister.;Ces йlections ont vu une large victoire d'Elefthйrios Venizйlos, toujours trиs populaire parmi les citoyens grecs. Le roi Konstantinos est oblig?de le rappeler au poste de Premier Ministre.;Aus den Wahlen von 1915 ging Venizelos als klarer Sieger hervor. Kцnig Konstantinos musste den bei den Bьrgern sehr beliebten Politiker notgedrungen wieder zum Premierminister bestimmen.;Te wybory oznaczaіy wielkie zwyciкstwo Eleftheriosa Venizelosa, wci№ї popularnego wњrуd greckiego spoіeczeсstwa. Konstantyn zmuuszony jest powoіa?go ponownie na stanowisko premiera.;Estas elecciones fueron una gran victoria para Elefthйrios Venizйlos, aun popular entre la ciudadanнa griega, el Rey se ha visto obligado a llamarlo otra vez, muy a su pesar, a formar gobierno;Tali elezioni sono state una grande vittoria per Eleftherios Venizelos, ancora popolare tra i cittadini greci. Costantino ?costretto a richiamarlo come suo primo ministro.;;;;;;Недавн?прошедши?выборы принесли убедительную победу Элефтериос?Венизелосу, которы?по-прежнему остает? попу?рным сред?простого народа. Ка?следстви? король Константин вынужден внов?назначит?ег?на пост премье?министра Греции.;x;;
