EVT1914_2019513_DESC;The Entente leaders ask us to demobilize our troops, as we are actually not at war against Bulgaria. We have nothing to lose if we keep our troops mobilized as they don't have the means to attack us, but they'll be upset.;Les chefs de l'Entente nous demandent de dйmobiliser nos troupes, йtant donn?qu'aucune opйration n'est menйe contre la Bulgarie. Nous n'avons toutefois rien ?perdre ?ne pas dйmobiliser, ils n'ont pas les moyens de nous attaquer. Ils seront en revanche dйзus.;Die Fьhrer der Entente bitten uns, die Mobilmachung unserer Truppen rьckgдngig zu machen, da wir nicht mit Bulgarien im Krieg sind. Wenn wir diese Bitte ablehnen, kann uns nichts passieren, da die Entente nicht die Mцglichkeiten hat uns zu schaden. Allerdings werden sie dann ziemlich erbost sein.;Dowуdcy Ententy ї№daj?od nas demobilizacji wojsk, jako їe nie jesteњmy faktyycznie w stanie wojny z Buіgari? Jeњli pozostawimy nasze wojska w peіnym stanie nic nie stracimy, gdy?nie maj?oni moїliwoњci interwencji militarnej, lecz na pewno nadszarpniemy tym nasze stosunki.;La Entente nos ha exigido la desmovilizaciуn de nuestro ejйrcito, al no estar en guerra con Bulgaria. No tenemos nada que perder mientras no decidan atacarnos, pero si permanecemos movilizados, se enfurecerбn?I leader dell'Intesa ci chiedono di smobilitare le nostre truppe, in quanto non siamo in guerra contro la Bulgaria. Non abbiamo nulla da perdere se vogliamo mantenere le nostre truppe mobilitate, in quanto non hanno i mezzi per attaccarci, ma li irriteremo.;;;;;;Лидеры 'Антант? потребовал?от на?демобилизовать арми?по?предлого?того, чт?мы не находимся ?сост?ни?войн??Болгарие? Мы ничего не поте?ем, если откажемся от демобилизаци?арми?,поскольк?держав?'Антант? не имею?возможност?напаст?на на? однако этот демарш вызове??ни?сильно?недовольство...;x;;
