EVT1914_2019517_DESC;In order to expel the Entente from Thessalonique, we can grant military access to Bulgaria and allow them to encircle the city.;Pour expulser l'Entente de Thessalinique, nous pouvons accorder ?la Bulgarie l'accиs militaire pour leur permettre d'encercler la ville.;Um die Entente aus Thessaloniki zu vertreiben, kцnnten wir Bulgarien Durchmarschrechte gewдhren, damit es die Stadt einschliessen kann.;Aby pozby?si?Ententy z Salonik, moїemy pozwoli?na przemarsz wojsk buіgarskich i  umoїliwi?im na okr№їenie miasta.;Para expulsar a los soldados  de la Entente que ocupan Tesalуnica sin nuestro consentimiento, podemos dar acceso militar al Reino de Bulgaria, para que en una rбpida acciуn puedan rodear la ciudad.;Al fine di espellere l'Intesa da Salonicco, si pu?concedere l'accesso militare alla Bulgaria e consentire loro di circondare la citt?;;;;;;Для того, чтоб?изгнат?войска 'Антант? из Салони? мы може?предоставить Болгарии проход по территории Греции ? позволит?болгарским войска?окружить горо?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
