EVT1914_2019518_DESC;An arsonist which we suspect was a French agents set alight the forest near the royal palace in Tatoi. In the confusion, Queen Sophie carried her youngest daughter, princess Catherine, for more than a mile as she fled the area. Several members of the royal family, including King Konstantinos himself, are hurt and the lord's residence is almost completely destroyed. Worse, around sixteen soldiers and palace staff have been killed.;Un incendie criminel, probablement dйclench?par des agents de Paris, se produit dans la forкt qui entoure le palais royal de Tatoi. Dans la confusion de l'йvйnement, la reine Sophie sauve sa plus jeune fille, la princesse Catherine, et parcourt plus de deux kilomиtres dans les bois avec l'enfant dans les bras. Plusieurs membres de la famille royale, dont Constantin lui-mкme, sont blessйs et la rйsidence des souverains est en grande partie dйtruite par les flammes. Surtout, seize (ou dix-huit, selon les sources) soldats et autres membres du personnel du palais sont tuйs.;Ein GroЯbrand, vermutlich von franzцsischen Agenten gelegt, brach in einem Wald nahe dem kцniglichen Palast in Tatoi aus. In Panik rannte Kцnigin Sophie mit Prinzessin Katharina auf dem Arm, mindestens einen Kilometer weit, um sich in sicherheit zu bringen. Mehrere Mitglieder der kцniglichen Familie, einschliesslich des Kцnigs selbst, wurden verletzt. Die kцnigliche Residenz wurde ein Opfer der Flammen und vцllig zerstцrt. Schlimmer noch ist aber der Tod von insgesamt 16 Bediensteten und Mitgliedern der Wache. Wir sind ьber diesen feigen Akt entsetzt.;Zdradziecki ogie? prawdopodobnie podіoїony przez agentуw francuskich, wybuch?w lesie w pobliїu paіacu krуlewskiego w Tatoi. W chaosie poїaru krуlowa Zofia uratowaіa najmіodsz?cуrk? ksiкїniczk?Katarzyn? uciekaj?caі№ mil?z dzieckiem na rкku. Wielu czіonkуw rodziny krуlewskiej, w tym sam Konstantyn, odniosіo obraїenia, a rezydencja jest niemal doszczкtnie zniszczona. Co gorsza, straty w їoіnierzach i sіuїbie wyniosіy szesnaњcie do osiemnastu osуb.;Un incendio criminal, seguramente perpetrado por agentes franceses, inicio en el bosque cerca de palacio, en Tatoi. En la confusiуn, la Reina Sofнa logro salvar a su hija mas pequeсa, la princesa Catalina, y corri?cerca de dos kilуmetros para ponerse ambas a salvo. Varios miembros de la familia real, incluyendo al Rey Konstantinos, estбn heridos y la residencia real fue reducida a unas pocas tablas quemadas. Lo peor fue que a la hora de cuantificar las pйrdidas, dieciocho personas, entre soldados y demбs personal de palacio, fueron encontradas chamuscadas entre los escombros?Un incendio doloso, probabilmente appiccato da agenti francesi, comincia nella foresta vicino al palazzo reale di Tatoi. Nella confusione, la regina Sofia salva la figlia pi?giovane, la principessa Caterina, e corre pi?di un chilometro e mezzo portandola. Diversi membri della famiglia reale, tra cui Costantino stesso, si sono fatti male e la residenza del re ?quasi completamente distrutta. Oltre a questo, sono stati uccisi sedici (o diciotto) tra soldati e personale del palazzo.;;;;;;Поджог, по всей видимост?инициированный французскими агентами, приводит ?сильнейшем?пожару ?лесу, неподалеку от Королевского дворца 'Тато?. ?создавшейся суматохе, королева София схватила на руки свою младшу?дочь, принцесс?Екатерин? ?выскочив из дворца, бежала боле?мили, спас? ребенк? Нескольк?членов королевско?семь? ?то?числ?король Константин получили травмы ?ожог? ?резиденц? монарх?почт?полность?уничтожена огне? Хуже того, погибл?шестнадцат?(ил?восемнадцать) челове?из числ?охраны ?дворцово?прислуги.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
