EVT1914_2020501_DESC;The Central Powers ask us to join their war against Serbia in exchange of Serbian lands we rightfully claim. We would be at war against the entire Entente, though.;Les Puissances Centrales nous proposent de les rejoindre dans leur guerre contre la Serbie, en l'йchange de terres serbes sur lesquelles nous avons des revendications lйgitimes. Nous entrerions en guerre contre la totalit?de l'Entente.;Die Mittelmдchte schlagen uns vor, da?wir ihnen im Krieg gegen Serbien zur Seite stehen. Im Gegenzug wьrden wir die rechtmдssig uns zustehenden, von Serbien besetzten Gebiete als Entschдdigung erhalten. So gut dieses Angebot auch klingt, die Annahme wьrde uns in einen Krieg gegen die gesamte Entente stьrzen.;Paсstwa centralne proponuj?nam, byњmy doі№czyli do wojny przeciw Serbii w zamian za ziemie serbskie bкd№ce przedmiotem naszych uzasadnionych ї№da? To oznacza jednak wojn?przeciw caіej Entencie.;La Triple Alianza nos ofrece una alianza contra nuestros mortales enemigos, los Serbios, a cambio de territorios que son nuestros por derecho y nos fueron arrebatados, nuestro pueblo clama venganza despuйs de la humillaciуn de 1913?Gli Imperi Centrali ci hanno chiesto un'alleanza nella loro guerra contro la Serbia in cambio delle terre serbe che giustamente pretendiamo. In questo modo entreremmo per?in guerra con tutta l'Intesa.;;;;;;Центральны?держав?предлагают на?присоединить? ?их войн?против Сербии ?обме?на сербские земл? которы?принадлежа?на?по прав? Однако этот ша?втяне?на??войн?против всей 'Антант?...;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
