EVT1914_2020503_DESC;The Treaty of Neuilly-sur-Seine was signed between the Entente and Bulgaria. Bulgaria was forced to give some provinces to the Kingdom of Serbs, Croats and Slovenes and some more to Greece, losing access to the Aegean Sea.;Le trait?de Neuilly-sur-Seine a йt?sign?entre l'Entente et la Bulgarie.. La Bulgarie a йt?forcйe ?donner plusieurs provinces au Royaume des Serbes, Croates et Slovиnes et йgalement ?la Grиce, perdant l'accиs ?la mer Йgйe.;Der Vertrag von Neuilly-sur-Seine, abgeschlossen am 27. November 1919, ist einer der Pariser Vorortvertrдge, die den Ersten Weltkrieg formal beendeten. Er wurde zwischen dem Kцnigreich Bulgarien auf der einen und den Siegermдchten auf der anderen Seite abgeschlossen. Im Zuge dieses Vertrages musste Bulgarien den Landstreifen entlang der Дgдiskьste an Griechenland abtreten und einer Begrenzung seiner Streitkrдfte auf 20.000 Mann zustimmen. Ausserdem wurde eine Konvention unterzeichnet, die einen Austausch der griechichen und bulgarischen Bevцlkerung ermцglichte.;Traktat w Neuilly-sur-Seine zosta?podpisany pomiкdzy Entent? a Buіgari? Buіgaria zostaіa zmuszona do oddania cz?ci prowincji Krуlestwu Serbуw, Chorwatуw i Sіoweсcуw i wiкkszych poіaci ziem Grecji, trac№c tym samym dostкp do Morza Egejskiego.;El Tratado de Neuilly-sur-Seine fue un tratado de paz firmado entre la Entente y el Reino de Bulgaria. De acuerdo con lo estipulado en el tratado, Bulgaria reconocнa el nuevo Reino de Yugoslavia, pagaba 400 millones de dуlares en concepto de indemnizaciуn y reducнa su ejйrcito a 20.000 efectivos. Ademбs, perdнa una franja de terreno occidental en favor de Yugoslavia y cedнa Tracia occidental al Reino de Grecia, por lo que quedaba sin acceso al Mar Egeo.;Il trattato di Neuilly-sur-Seine fu firmato tra l'Intesa e la Bulgaria. La Bulgaria fu costretta cedere alcune province al Regno dei Serbi, Croati e Sloveni e altre ancora alla Grecia, perdendo cos?l'accesso al Mar Egeo.;;;;;;Нейиский догово?бы?подписан ?пригород?Па