EVT1914_2022501_DESC;The Treaty of Trianon, between the Entente and Hungary, forced Hungary to renounce to three quarters of its lands and two thirds of its population. Transylvania was given to Romania and other provinces were given to Czechoslovakia and the Kingdom of Serbs, Croats and Slovenes.;Le Trait?de Trianon, sign?entre les puissances de l'Entente et la Hongrie, a forc?celle-ci ?renoncer aux trois quarts de son territoire et des deux tiers de sa population. La transylvaine a йt?donnйe ?la Roumanie et les autres provinces furent donnйes ?la Tchйcoslovaquie et au Royaume des Serbes, Croates et Slovиnes.;Der Vertrag von Trianon reduzierte Ungarn flдchenmдssig um ein Drittel und seine Bevцlkerung um drei Fьnftel. Transsylvanien wurde Teil des neu gebildeten Rumдniens.;Traktat w Trianon, podpisany pomiкdzy Entent? a Wкgrami, zmusza?Wкgrуw do zrzeczenia si?trzech czwartych swej powierzchni i dwуch trzecich ludnoњci. Siedmiogrуd przekazano Rumunii, a inne ziemie oddano Czechosіowacji i Krуlestwi Serbуw, Chorwatуw i Sіoweсcуw.;El Tratado de Trianon fue un tratado de paz firmado entre la Entente y Hungrнa el tratado establecнa la nueva situaciуn de los estados que habнan de reemplazar al antiguo reino de Hungrнa, despuйs de la desapariciуn del Imperio austrohъngaro. Hungrнa cederнa Transilvania a los rumanos, Croacia, Voivodina, y Bosnia serian anexadas por el Reino de los Serbios, croatas y eslovenos. Eslovaquia pasarнa a Checoslovaquia y la ciudad de Fiume seria disputada por los serbios y los italianos. Con esto hemos perdido mбs de la mitad de nuestro territorio, y prбcticamente, nuestras ganas de existir como estado?Il Trattato di Trianon, tra l'Intesa e l'Ungheria, obblig?l'Ungheria a rinunciare a tre quarti delle sue terre e due terzi della sua popolazione. La Transilvania fu data alla Romania mentre altre province furono cedute alla Cecoslovacchia e al Regno dei Serbi, Croati e Sloveni.;;;;;;Трианонски?догово?бы?подписан ?Большо?Трианонско?дворце Версаля межд?странами Антант??потерпевше??мирово?войн?поражени?Австро-Венгрией. Согласно договору, Венгрия лишилась 2/3 территории ?населения. Трансильвания ?восточная част?Баната были присоединены ?Румыни? Хорват?, Бачк??западн? част?Баната вошл??состав Королевств?Сербов, Хорватов ?Словенце? ?Словак? ?Подкарпатская Русь - ?состав Чехословакии.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
