EVT1914_2023500_DESC;In their offensive, Russia managed to invade Hungarian lands. A weakened Austria-Hungary allows us to reclaim Transylvania back. The Entente understood this and asks us to join their alliance.;Dans leur offensive, la Russie est parvenue ?conquйrir des territoires hongrois. Une Autriche-Hongrie affaiblie nous permet de rйclamer la Transylvanie. L'Entente l'a bien compris et nous propose de rejoindre leur alliance.;Die Offensive des russischen Reiches fьhrte bis auf ungarischen Boden. Der geschwдchte Zustand Цsterreich-Ungarns ermцglicht uns, Transylvanien zurьck zu fordern. Die Entente hat dies genau erkannt und schlдgt uns daher vor, ihrem Bьndnis beizutreten.;W ramach swojej ofensywy, Rosjanom udaіo si?przenieњж front na teren Wкgier. Osіabione Austro-Wкgry gotowe s?ust№pi?z terenu Siedmiogrodu. Ententa proponuje nam w tym momencie sojusz.;En su arrolladora ofensiva, Rusia ha invadido territorio hъngaro. Una debilitada Austria-Hungrнa nos permite reclamar nuestras tierras en Transilvania. La Entente comprende esto y nos la ha ofrecido a cambio de una alianza. ;Nella loro offensiva, la Russia ?riuscita a invadere le province Ungheresi. Un'Austria-Ungheria debole potrebbe permetterci di riprenderci la Transilvania. L'Intesa lo ha capito e ci ha chiesto di allearci con loro.;;;;;;?результате успешног?наступления, русско?арми?удалос?перейт?Карпат??вторгнуться ?венгерские земл? Ослабление Австро-Венгри?позволит на?вернут?обратн?Трансильвани? 'Антант? понимает эт??предлагает присоединить? ?их ал?нс?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
