EVT1914_2023502_DESC;Our armies have been defeated and we can no longer protect our territory against enemy invasions. Our government has therefore initiated negotiations and signed an armistice which should be soon followed by a peace treaty;Nos armйes ont йt?dйfaites et nous ne pouvons plus protйger notre territoire contre les invasions ennemies. Notre gouvernement a donc entam?des nйgociations et sign?une armistice qui devrait bientфt кtre suivie d'un trait?de paix.;Unsere Armeen wurden geschlagen und sind nicht mehr in der Lage, unser Territorium zu schьtzen. Unsere Regierung hat Verhandlungen begonnen und einem Waffenstillstand zugestimmt, bis ein Friedensvertrag ausgearbeitet ist.;Nasze armie zostaіy pokonane i nie moїemy dіuїej chroni?naszego terytorium przed wrogimi inwazjami. Nasz rz№d zapocz№tkowa?dlatego negocjacje i podpisa?zawieszenie broni, ktуre wkrуtce powinno doprowadzi?do trwaіego pokoju.;Nuestro ejйrcito ha sido derrotado y ya no puede defender a nuestra naciуn de las invasiones enemigas. Nuestro gobierno ha iniciado negociaciones de Paz y ha firmado el armisticio, que esperamos pronto sea seguido por un Tratado de Paz, La guerra ha terminado, La madre patria ha caнdo y estamos a merced del enemigo, que Dios tenga misericordia de nosotros?Le nostre armate sono state sconfitte, e non possono pi?proteggere il nostro territorio dal nemico. Il governo ha quindi iniziato i negoziati e firmato un armistizio, che dovrebbe essere presto seguito da un trattato di pace.;;;;;;Наша армия разбит??мы не може?больше защищать нашу земл?от иностранного вторжения. Наше правительств?инициировало переговоры ?подписал?перемири? за которы?вскоре последуе?мирный догово?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
