EVT1914_2023503_DESC;The Treaty of Bucharest was signed between the Central Powers and Romania. Romania was forced to cede Southern Dobruja to Bulgaria, the passes of the Carpathian Mountains to Austria-Hungary and had to lease its oil wells to Germany for 90 years. The Central Powers recognized the Union of Bessarabia with Romania.;Le Trait?de Bucarest a йt?sign?entre les Puissances Centrales et la Roumanie. La Roumanie a йt?forcйe de cйder le sud de la rйgion de Dobruja ?la Bulgarie, les montagnes des Carpates ?l'Autriche-Hongrie et prкte son pйtrole ?l'Allemagne pour 90 ans. Les Puissances Centrales reconnurent l'union entre la bessarabie et la Roumanie. ;Mit dem Vertrag von Bukarest am 7. Mai 1918 zwischen den Mittelmдchten und Rumдnien schied Rumдnien aus dem Krieg aus. Gleichzeitig mit dem Abzug der Besatzungstruppen des deutschen Reiches musste Rumдnien die Dobrudscha an Bulgarien abtreten und dem deutschen Reich Nutzungsrechte an seinen Цlvorkommen zugestehen.;Traktat w Bukareszcie zosta?podpisany miкdzy paсstwami centralnymi, a Rumuni? Rumunia zostaіa zmuszona odda?poіudniow?Dobrudїк Buіgarii, przejњcia w Karpatach Austro-Wкgrom, jak rуwnie?wydzierїawi?na 90 lat swoje pola naftowe Niemcom. Paсstwa centralne uznaіy uni?Rumunii z Besarabi?;El Tratado de Bucarest fue un tratado de paz firmado entre la Triple Alianza y el Reino de Rumania. De acuerdo con lo estipulado en el tratado, Rumanнa cederнa Dobrudja a Bulgaria, los pasos de montaсa de los Cбrpatos a Austria-Hungrнa y el alquiler de los pozos petroleros rumanos a Alemania hasta el aсo 2008, aun as? las potencias centrales reconocieron la Uniуn de Besarabia con Rumanнa.;Il trattato di Bucharest fu firmato tra gli Imperi Centrali e la Romania. La Romania fu costretta a cedere la Dobrugia Meridionale alla Bulgaria, i passi delle montagne dei Carpazi all'Austria-Ungheria e affittare i propri pozzi petroliferi alla Germania per 90 anni. Gli Imperi Centrali riconobbero l'Unione della Bessarabia con la Romania.;;;;;;Бухарестский догово?бы?подписан межд?Центральными державам??потерпевше??мирово?войн?поражени?Румынией. Согласно договору, ?Болгарии отходи?Южная Добруджа, проход чере?Карпатские горы - ?Австро-Венгри? Кром?того Румыния передает Германии ?аренду на 90 ле?свои нефтяны?скважины. Вместе ?те? Центральны?держав?признают унию Бессарабии ?Румынией.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
