EVT1914_2024501_DESC;The Treaty of Saint-Germain-en-Laye was signed by the victorious Entente on the one hand and by the new Republic of Austria on the other. The new Republic of Austria recognized the independence of Hungary, Czechoslovakia, Poland, and the State of Serbs, Croats and Slovenes. An important article of the treaty required Austria to refrain from compromising its independence, which meant that Austria could not enter into political or economic union with Germany.;Le Trait?de Saint-Germain-en-Laye a йt?sign?entre l'Entente victorieuse et la Rйpublique d'Autriche de l'autre cфt?.La nouvelle Rйpublique d'Autriche reconnut l'indйpendance de la Hongrie, la Pologne, la Tchйcoslovaquie, du Royaume des Serbes, Croates et Slovиnes. Un article important du trait?exige que l'Autriche ne doit pas atteindre ?son indйpendance, ce qui signifie que l'Autriche ne peut pas entrer dans une union politique ou йconomique avec l'Allemagne.;Im Vertrag von Saint-Germain-En-Laye wurde Цsterreich-Ungarn zu zahlreichen Gebietsabtretungen an die Siegermдchte des Weltkrieges gezwungen. De Facto bedeutete dieser Vertrag das Ende Цsterreich-Ungarns.;Traktat w Saint-Germain-en-Laye zosta?podpisany przez zwyciкsk?Entent?z jednej strony, a nowopowstaі№ Republik?Austriack?z drugiej. Republika Austriacka uznaіa niepodlegіoњж Wкgier, Czechosіowacji, Polski i paсstwa Serbуw, Chorwatуw i Sіoweсcуw. Waїnym elementem traktatu by?zakaz rezygnacji przez Austri?z niepodlegіoњci na rzecz innego paсstwa, ktуry mia?blokowa?uni?ekonomiczn?i polityczn?z Niemcami.;El Tratado de Saint-Germain-en-Laye fue firmado entre la Entente y Austria. En este tratado se establecнa el desmembramiento de la antigua monarquнa de los Habsburgo y Austria qued?limitada a algunas zonas en las que se hablaba solamente el alemбn. Reconocнa la independencia de Hungrнa y la creaciуn de los nuevos estados de y Yugoslavia. Tambiйn se estableci?la cesiуn del Trentino, Tirol del Sur, Trieste, Istria, varias islas de Dalmacia y el Friuli al Reino de Italia, Galicia-Lodomeria a Polonia. Una clбusula importante era la prohibiciуn de revisar o revocar la independencia de Austria, esto con el fin de impedir una uniуn polнtica o econуmica con Alemania.;Il Trattato di Saint-Germain-en-Laye fu firmato dalle potenze dell'Intesa da un lato e la nuova Repubblica Austriaca dall'altro. La Repubblica Austria riconobbe l'indipendenza di Ungheria, Cecoslovacchia, Polonia e il Regno di Serbi, Croati e Sloveni. Un importante articolo del trattato impediva inoltre all'Austria di compromettere la propria indipendenza e quindi vietava un'unione politica o economica con la Germania.;;;;;;Се?Жерменский мирный догово?бы?подписан ?парижско?предместье Се?Жермен-ан-Ле межд?странами 'Антант? ?новообразованной республико?Австрия. Согласно договору Австрия признала отделени?от не?Венгри? Чехословакии, част?польских территорий, такж?согласилас?на территориальны?уступк??пользу Королевств?Сербов, Хорватов ?Словенце? ?такж?Румыни? Кром?того, впоследствии ?Женеве бы?подписан дополнительный  протокол, запретивши?Австри?любо?сближени??Германие? ?то?числ???форм?политическог?ил?экономического союз?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
