EVT1914_2038501_DESC;As Germany foresaw it, the United States of America sided with the Entente. It's time now to decide whether we help Germany or not.;Comme l'Allemagne l'avait prйvu, les Etats-Unis se sont ralliйs ?l'Entente. Nous devons maintenant dйcidre de l'aider ou non.;Es kam so, wie es das deutsche Reich vorhergesehen hat. Die Vereinigten Staaten von Amerika treten der Entente und damit dem Weltkrieg bei. Wir mьssen uns jetzt entscheiden, ob wir dem deutschen Reich helfen oder nicht.;Jak Niemcy to przewidzieli, Stany Zjednoczone Ameryki Pуіnocnej opowiedziaіy si?po stronie Ententy. Czas zadecydowa? czy pomoїemy Niemcom, czy nie;Como Alemania predijo, los Estados Unidos se han unido a la Entente. Es hora de decidir si ayudaremos o no al Imperio Alemбn.;Come la Germania aveva previsto, gli Stati Uniti d'America si sono schierati con l'Intesa. ?giunto il momento di decidere se aiutare la Germania o no.;;;;;;Ка??предсказывал?Герман?, САСШ выступил?на сторон?'Антант?. Поэтом?пришло время решить, буде?ли мы помогать Германии ил?не?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
