EVT1914_2038502_DESC;The United States keep on occupying Veracruz despite the settlement of the Matamoros issue. Our staff consider the option to drive them out by force.;Les Etats-Unis poursuivent l'occupation de Veracruz en dйpit du rиglement de l'incident de Matamoros. Notre Etat major considиre de plus en plus la possibilit?de les expulser par la force.;Trotz der Beilegung des Matamoros Zwischenfalls beenden die Vereinigten Staaten die Besetzung von Vera Cruz nicht. Unser Generalstab denkt darьber nach, die Gringos mit Gewalt aus der Stadt zu werfen.;Stany Zjednoczone utrzymuj?okupacj?Veracruz pomimo rozwi№zania incydentu w Matamoros. Nasz sztab rozwaїa moїliwoњж pozbycia si?ich stamt№d siі№.;Los Estados Unidos siguen controlando la provincial de Veracruz, aunque hace tiempo se solucion?el incidente de Tampico. Nuestro alto mando militar opina que ya es tiempo que se vayan?Gli Stati Uniti continuano a occupare Veracruz nonostante la soluzione della questione di Matamoros. Il nostro staff sta considerando la possibilit?di scacciarli con la forza.;;;;;;Американские войска продолжают оккупировать Веракрус, несмот? на урегулирование инцидент??Тампик? На?Геншта?рассматривае?возможност?их изгнан? пр?помощи военно?силы.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
