EVT1914_2038503_DESC;The United States launched an operation against Mexican rebels and crossed the border. They asked us to give them access to our railway to ensure they correctly supply their troops. We must keep in mind that accepting this proposal may make us look weak in the eyes of the United States, something the rebels will use against us to rally partisans.;Les Etats-Unis ont lanc?une opйration militaire contre les rebelles au nord du pays et ont travers?la frontiиre. Ils nous demandent l'accиs ?nos lignes de chemin de fer pour assurer un ravitaillement correct de leurs troupes. Il faut garder ?l'esprit qu'accepter cette proposition pourrait faire apparaоtre notre pouvoir comme faible vis-?vis des amйricains, ce que les rebelles pourraient utiliser contre nous.;Die Vereinigten Staaten haben eine Operation gegen die mexikanischen Rebellen gestartet und die Grenze ьberquert. Wenn wir ihnen den gewьnschten Zugriff auf unser Transportwesen einrдumen, stehen wir in ihren Augen als Schwдchlicnge dar, was wiederum die Partisanen zu erhцhten Aktivitдten uns gegenьber ermuntern wьrde.;Stany Zjednoczone rozpoczкіy akcj?przeciwko meksykaсskim rebeliantom i przekroczyli nasz?granic? Poprosili nas o udostкpnienie linii kolejowych w celu uіatwienia transportu wyposaїenia i zapasуw. Nasza zgoda moїe obnaїy?nasz?sіaboњж wobec potкїnego s№siada i bкdzie to z pewnoњci?wykorzystane przez rebeliantуw do zachкcenia jeszcze bardziej licznej grupy partyzantуw.;Los Estados Unidos han lanzado una operaciуn militar contra partisanos mexicanos en la frontera. Nos piden libre acceso a nuestras tierras para garantizar un suministro adecuado a sus soldados. Pero hay que tomar en cuenta que nos har?ver dйbiles frente a los Estados Unidos, lo que podrнa ser utilizado por los rebeldes para ganar mбs apoyos a su causa.;Gli Stati Uniti hanno lanciato un'operazione contro i ribelli messicani ed attraversato il confine. Ci hanno chiesto di dare loro accesso alla nostra ferrovia per assicurare