erto y los Aislacionistas han ganado poder.;Il RMS Lusitania, ufficialmente una nave civile che trasportava passeggeri tra l'Inghilterra e gli Stati Uniti ?stata affondata da un sottomarino tedesco questa mattina. 123 americani sono morti. Ma il peggio ?che il Regno Unito ha usato questa nave per trasportare segretamente armi, munizioni e rifornimenti dagli Stati Uniti. Il Congresso ?scioccato e gli interventisti hanno acquisito una certa importanza.;;;;;;Сегодня утро?британский пассажирский лайнер 'Лузитания' бы?потоплен немецкой подводно?лодкой U-20. Судн?затонуло за 18 мину??13 км. от берего?Ирландии. Из 1959 челове? бывших на борт?погибл?1198, из ни?123 гражданина САСШ. Однако само?страшное ?то? чт?Соединенно?Королевств?использовало этот корабл?для тайной перевозк?оруж? ?боеприпасо?из Соединенны?Штатов. Конгресс прибывае??шоке, ?сторонники изоляционизма увеличиваю?свое вл?ни?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
