EVT1914_2049502_DESC;The Kaiser stated today that his submarines will attack any ship heading towards or coming from England, event those from neutral nations. Our trade may suffer a lot from such a decision.;Le Kaiser annonce aujourd'hui que tout convoir provenant ou se rendant en Angleterre sera attaqu? y compris ceux des nations neutres. Nos lignes commerciales vont beaucoup souffrir d'une telle dйcision.;Der Kaiser hat heute verlauten lassen, das Seine U-Boote jedes Schiff, da?von oder nach GroЯbritannien unterwegs ist, angreifen werden. Dies betrifft auch Schiffe neutraler Staaten.;Cesarz niemiecki ogіosi?dzi? їe okrкty podwodne bкd?atakowa?kaїdy statek kieruj№cy si?do lub z Wielkiej Brytanii, nawet jeњli bкdzie to statek kraju neutralnego. Nasz handel powaїnie na tym ucierpi;El Kбiser ha dado la orden para que sus submarinos ataquen cualquier barco que salga o se dirija hacia las Islas Britбnicas, aun si son de naciones neutrales. Esta decisiуn puede que nos afecte mucho.;Oggi il Kaiser ha dichiarato che i suoi sottomarini attaccheranno qualsiasi nave che stia andando o ritornando dall'Inghilterra, anche quelle provenienti da nazioni neutrali. Il nostro commercio potrebbe soffrire molto da tale decisione.;;;;;;Сегодня Кайзер Вильгель?заяви??то? чт?германские подводны?лодк?буду?атаковат?любы?корабл? идущих ?направлени?Британских островов, ?то?числ??принадлежащи?нейтральны?страна? Наша страна може?существенн?пострадать от этог?решения.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
