EVT1914_2049510_DESC;The Matamoros incident which occurred in April 1914 led to the American intervention in Veracruz. Nine sailors of a whaler were put under arrest near Matamoros, the Mexicans thought they were attacked by American soldiers. The situation was very confused since none of the Mexicans could speak English and the sailors were unable to speak Spanish. Due to the very high risks of war between Mexico and the United States, the ABC countries (Argentina, Brazil and Chile) offered their help in mediating between the two countries. The issue has finally been settled, the sailors went back to their ship and the leader of Matamoros Garrison apologized.;L'incident de Matamoros s'est produit en avril 1914 et a provoqu?l'intervention amйricaine ?Veracruz. Neuf marins d'un baleiniers ont йt?arrкtйs. La garnison mexicaine ?Matamoros craignait une attaque, et le fait que personne dans cette garnison ne parle anglais ou que les marins ne parlent Espagnol ou Mexicain ajouta un peu plus de confusion ?la situation. Devant le risque йlev?de conflit entre les Etats-Unis et le Mexique, les pays ABC (Argentine, Brйsil, Chili) ont propos?leur aide, notamment en tant que mйdiateurs entre les deux pays. L'incident est finalement clos, les marins ont pu regagner leur navire et le chef de la garnison de Matamoros a prйsent?ses excuses.;Der Matamoros Zwischenfall, der sich im April 1914 ereignete, fьhrte zu einer Intervention der Vereinigten Staaten in Vera Cruz. Neun Seeleute eines Walfдngers wurden bei Matamoros inhaftiert, weil die Mexikaner der Ansicht waren, sie wдren von US Soldaten ьberfallen worden. Da die Seeleute kein spanisch und die Mexikaner kein englisch sprachen, war eine Aufklдrung dieser Situation unmцglich. Da zu dieser Zeit bereits starke Spannungen zwischen Mexiko und den Vereinigten Staaten bestanden, vermittelten die ABC Staaten ( Argentinien, Brasilien, Chile ) in diesem Konflikt. Letzten Endes stellte sich alles als Missverstдndnis heraus, die 9 Seeleute wurden freigelassen und der Kommandeur der Garnison von Matamoros entschuldigte sich.;Incydent w Matamoros, ktуry mia?miejsce w kwietniu 1914 r., doprowadzi?do amerykaсskiej interwencji w Veracruz. Dziewiкciu marynarzy statku wielorybniczego zostaіo aresztowanych w okolicach Matamoros, pod podejrzeniem ataku na statek meksykaсski. Sytuacja byіa trudna, gdy?їaden z Meksykanуw nie potrafi?rozmawia?po angielsku i їaden z wielorybnikуw nie zna?hiszpaсskiego. Z powodu bardzo wysokiego ryzyka wojny amerykaсsko-meksykaсskiej kraje ABC (Argentyna, Brazylia, Chile) zaoferowaіy swoj?mediacj? Sprawa znalazіa ostateczne rozwi№zanie, marynarze powrуcili z powrotem na statek, a dowуdca garnizonu w Matamoros wystosowa?przeprosiny.;El incidente de Tampico ocurri?en abril de 1914 y llevo a la intervenciуn estadounidense en Veracruz. Nueve marineros de un ballenero fueron arrestados cerca de la localidad de Tampico, los mexicanos alegaban que fueron atacados por soldados estadounidenses. Esta fue una situaciуn muy confusa, debido a que ninguna de las dos partes hablaba el idioma de la otra. Debido al riesgo de otra guerra entre Mйxico y Estados Unidos, Argentina, Chile y Brasil se ofrecieron como mediadores en el conflicto. El incidente fue finalmente resuelto, los marineros fueron liberados y el oficial a cargo de la guarniciуn de Tampico ofreci?sus disculpas. ;L'incidente di Matamoros ?avvenuto nell'aprile del 1914 ed ha portato all'intervento americano a Veracruz. Nove marinai di una baleniera sono stati messi agli arresti vicino a Matamoros, i messicani pensavano che fossero stati attaccati da soldati americani. La situazione era molto confusa in quanto nessuno dei messicani era in grado di parlare inglese ed i marinai non erano in grado di parlare spagnolo o messicano. A causa dei rischi molto elevati di guerra tra il Messico e gli Stati Uniti, i paesi ABC (Argentina, Brasile e Cile), offrirono il loro aiuto nella mediazione tra i due paesi. La questione ?stata finalmente risolta, i marinai sono tornato alla loro nave e il comandante del presidio di Matamoros si ?scusato.;;;;;;Инцидент ?Тампик?произоше??апреле 1914 года ?повлек за собо?американскую оккупаци?Веракрус? 9 апре? ?мексиканском порт?Тампик? гд?ввид?военного положения запрещалас?высадк?иностранны?войс? местны?власти арестовали 8 мо?ко?из команд?американског?крейсера 'Дельфи?. Ситуац? была очен?путанн? поскольк?ни один из мексиканце?не говори?по-английск? ?матрос?не знал?испанского языка. Из-за очен?высокого риск?начала войн?межд?Мексикой ?САСШ, 'страны АБ? (Аргентин? Бразил? ?Чили) предложили свое дипломатическо?посредничество межд?двумя странами. Командующи?мексиканским?войсками ?Тампик?приказал немедленно освободить американце?(которы? таки?образо? пробыл?по?аресто?всег?1,5 часа) ?принёс свои извинения.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
