EVT1914_2049511_DESC;Since the Matamoros issue have been settled, our troops can leave Veracruz without consequences. Note that staying in Mexico for too long may upset our neighbor.;Puisque l'incident de Matamoros est rйsolu, nos troupes peuvent quitter Veracruz sans consйquences fвcheuses. A noter que rester trop longtemps en territoire mexicain pourrait contrarier notre voisin.;Da der Matamoros Zwischenfall zwischenzeitlich geklдrt wurde, kцnnen unsere Truppen die Stadt wieder rдumen. Sollten wir das nicht bald tun, sind weitere Spannungen mit unserem Nachbarn so gut wie sicher.;Poniewa?problemy w Matamoros doczekaіy si?rozwi№zania, nasze wojska mog?ju?opuњci?Veracruz. Pozostawanie w Meksyku zbyt dіugo moїe rozzіoњci?naszego s№siada.;Desde que el asunto del incidente se resolvi? nuestras tropas pueden abandonar Veracruz sin consecuencias. Toma en cuenta que quedarse mбs tiempo puede molestar a nuestro vecino.;Poich?la questione di Matamoros ?stata risolta, le nostre truppe possono lasciare Veracruz senza conseguenze. Si noti che se queste staranno in Messico per troppo tempo potrebbero irritare il nostro vicino.;;;;;;Поскольк?инцидент ?Тампик?бы?успешн?урегулирован, наши войска могу?покинуть Веракрус. Обратите внимание на то, чт?слишко?долгое пребывание ?Мексик?може?вызват?недовольство нашего соседа.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
