EVT1914_2049512_DESC;Some minor cities near the Mexican border have been raided by Pancho Villa's partisans. Fortunately, our troops garrisoning the area managed to repel the Mexicans before they reached Tuscon.;Plusieurs villages mineurs ?la frontiиre mexicaine ont йt?attaquйs par des partisans de Pancho Villa. Heureusement, nos troupes prйsentes sur place ont pu repousser les mexicains avant qu'ils n'atteignent Tucson.;Einige kleinere Stдdte im Grenzgebiet zu Mexiko wurden von Pancho Villas Partisanen ьberfallen. Glьcklicherweise waren unsere in dem Gebiet stationierten Truppen in der Lage ihn zurьckzuschlagen, bevor er Tucson erreichen konnte.;Miasteczka przy granicy z Meksykiem zostaіy najechane przez rebeliantуw Pancho Villi. Na szcz?cie nasze wojska garnizonowe byіy w stanie odeprze?atak, zanim dotar?on do zamierzonego celu.;Algunas ciudades pequeсas cerca de la frontera con Mйxico han sido asaltadas por los partidarios de Pancho Villa. Afortunadamente, nuestras tropas de guarniciуn en la zona lograron repeler a los mexicanos antes de llegar a Tucson.;Alcune citt?minori nei pressi del confine con il Messico sono state assalite dai partigiani di Pancho Villa. Fortunatamente, le nostre truppe che presidiavano la zona sono riuscite a respingere i i messicani prima che questi raggiungessero Tucson.;;;;;;Нескольк?мелких городише? расположенны?вблизи мексиканской границ?подверглис?набегу партизан Панч?Виль? ?счасть? наши?гарнизонны?войска? расквартированны??этом районе, удалос?отбросит?мексиканце?прежде, че?он?достигли Tаксона.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
