EVT1914_2049513_DESC;Pancho Villa's partisans launched a raid in our territory. Since they did not find any opposition, they plundered each village they encountered, including Tucson! We must send troops in the area to fight them!;Des partisans de Pancho Villa ont men?un raid sur notre territoire. Ne rencontrant aucune opposition, ils ont pill?et dйvast?tout les villes rencontrйes, Tuscon incluse ! Nous devons envoyer des troupes sur place pour nous dйfendre !;Pancho Villas Partisanen haben einen Angriff auf unser Gebiet durchgefьhrt. Da unsererseits keine Truppen in der Nдhe waren, plьnderten sie jede Stadt, die sie erreichten konnten. Leider schliesst das auch Tucson ein. Wir mьssen dringend Truppen in diese Gegend verlegen.;Nasze terytorium zostaіo najechane przez rebeliantуw Pancho Villi. Nie napotkali oni wiкkszego oporu i spl№drowali caі№ okolic? Musimy umieњci?wiкcej wojska, by broni?naszych miasteczek!;Partisanos de Pancho Villa han lanzado un as alto a nuestro territorio. Como no encontraron resistencia, saquearon cada pueblo que encontraron, incluida Tucson ! Debemos enviar tropas para detenerlos !;I partigiani di Pancho Villa hanno fatto un raid nel nostro territorio. Dal momento che non hanno trovato alcuna opposizione, hanno saccheggiato ogni villaggio che hanno incontrato, inclusa Tucson! Dobbiamo inviare truppe nella zona per combatterli!;;;;;;Партизан?Панч?Виль?начали набе?на нашу территорию. Не встретив никакого сопротивления, он?разграбили приграничные деревн??ворвалис??Таксон !  Мы должны срочно направит??этот райо?войска для борьбы ?ними !;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
