EVT1914_2049522_DESC;Mexican Rebels are launching raids along the border and plundering our cities. We can keep on trying to defend ourselves or teach Villa a lesson he will never forget. Since we are directly protecting our interests, Congress is not opposed to this limited conflict.;Les rebelles mexicains lancent sans arrкt des raids le long de la frontiиre et pillent nos villes. Nous pouvons continuer ?nous dйfendre, ou passer ?l'attaque et donner une bonne leзon ?Villa. Puisqu'il s'agit de protйger nos intйrкts et notre territoire, le Congrиs ne s'opposera pas ?cette intervention.;Mexikanische Rebellen ьberfallen und plьndern immer wieder unsere Stдdte im Grenzgebiet. Wir kцnnen weiterhin nur reagieren und uns verteidigen oder selber in die Offensive gehen und Villa eine Lektion erteilen, die er so schnell nicht vergessen wird. Da wir nichts anderes wollen als unser Leben zu schьtzen, wird der Kongress sicherlich einer Sдuberungsaktion zustimmen.;Meksykaсscy rebelianci organizuj?najazdy wzdіu?granicy i pl№druj?nasze miasta. Moїemy dalej prуbowa?si?broni?lub da?Villi nauczk? jakiej nigdy nie zapomni. Poniewa?chronimy nasze interesy, Kongres nie bкdzie przeciwny wywoіaniu ograniczonego konfliktu.;Rebeldes Mexicanos han hecho incursiones a lo largo de la frontera y han saqueado nuestros pueblos y ciudades. Podemos seguir a la defensiva o darle a Villa una lecciуn que jamбs olvidara. Desde que han afectado nuestros intereses, el Congreso no se entrometer?en este pequeсo conflicto.;I ribelli messicani stanno lanciando incursioni lungo la frontiera e saccheggiando le nostre citt? Noi possiamo continuare a difendere noi stessi od impartire a Villa una lezione che non dimenticher?mai. Dal momento che stiamo tutelando direttamente i nostri interessi, il Congresso non si opporr?a questo conflitto limitato.;;;;;;Мексиканские повстанц?производя?грабительски?набеги на наши приграничные города. Мы може?продолжать отбивать нападения либо преподат?Панч?Виль?урок, которого он никогд?не забуде? Поскольк?мы непосредственн?защищаем свои интересы, Конгресс не возражае?против этог?ограниченног?конфликт?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
