EVT1914_2049523_DESC;In order to improve supplies transportation for this operation, we can ask the Mexican Government to give us access to their railway network.;Pour amйliorer nos lignes de ravitaillement, nous pouvons demander aux Mexicains l'accиs ?leur rйseau ferr?;Um unsere Transportsituation fьr Nachschub zu verbessern, kцnnen wir die Mexikaner bitten, uns Zugang zu ihrem Schienennetz zu gewдhren.;W celu poprawy naszych moїliwoњci transportowych dla operacji przeciwko Pancho Villi, moїemy poprosi?rz№d Meksyku o zgod?na uїycie ich sieci kolejowej. In order to improve supplies transportation for this operation, we can ask the Mexican Goverment to give us access to their railway network.;Para mantener un eficiente control de suministros para nuestra ofensiva, podemos proponer al gobierno mexicano un tratado de Libre Acceso a su territorio.;Al fine di migliorare il trasporto di rifornimenti per questa operazione, possiamo chiedere al governo messicano di darci l'accesso alla loro rete ferroviaria.;;;;;;?це??повышения эффективност?перевозк?припасов, необходимы?для операции против повстанцев Панч?Виль? мы може?попросит?правительств?Мексик? предоставить на?доступ ?свое?железнодорожно?сети.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
