EVT1914_2049525_DESC;The uncooperative behavior of the Mexican Government is unacceptable. Many Generals in our staff call for a full-scale invasion, allowing us to deal with the rebels more efficiently. The Congress is not a problem for this conflict.;Le manque de coopйration du gouvernement Mexicain est inacceptable. De plus en plus de gйnйraux appellent ?l'invasion pure et simple du Mexique, nous permettant de rйgler le problиme des rebelles plus efficacement.;Das unkooperative Verhalten Mexikos lдsst uns keine Wahl. Um den Partisanenbanden Pancho Villas Einhalt gebieten zukцnnen, mьssen wir die Wurzel des Ьbels packen. Um dies zu ermцglichen plдdieren viele unserer Generдle fьr eine regelrechte Invasion Mexikos.;Niechкtne nam nastawienie meksykaсskiego rz№du jest nie do zaakceptowania. Wielu generaіуw w naszym sztabie optuje za inwazj? ktуra pozwoli nam skutecznie wytrzebi?rebeliantуw. Kongres nie bкdzie stanowi?problemu w tym wypadku.;La actitud poco cooperativa del gobierno mexicano es totalmente inaceptable. Muchos generales de nuestro estado mayor abogan por una invasiуn total de Mйxico, para eliminar a los rebeldes por completo. Como dijimos antes, el Congreso no se entrometer?;Il comportamento non collaborativo del governo messicano ?inaccettabile. Molti generali chiedono un'invasione su larga scala, che ci permetter?di trattare con i ribelli in modo pi?efficiente. Il Congresso non ?un problema in questo conflitto.;;;;;;Поведени?мексиканског?правительств? отказавшегося от сотрудничества ?САСШ, являет? недопустимым. Многие генералы нашего Генштаба выступаю?за полномасштабно?вторжени??Мексик? которо?позволит ра??навсегда покончит??Панч?Вильей ?ег?бандитам? Конгресс не буде?препятствоват?этом?конфликт?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
