EVT1914_2049526_DESC;Events in Europe may force us to reconsider our position towards Mexico. A withdrawal from northern Mexico and an agreement with Mexico may free some troops for the main fight against Central Powers.;Les йvйnements en Europe pourraient nous forcer ?reconsidйrer notre position vis-?vis du Mexique. Un retrait des troupes du nord du Mexique et un accord avec le gouvernement Mexicain pourrait libйrer des troupes pour le front europйen.;Die Ereginisse in Europa lassen uns unsere Strategie in Mexiko nochmal ьberdenken. Es ist mцglichweise ratsam, Mexiko wieder zu rдumen und einen Verhandlungsfrieden anzustreben, um Truppen fьr den Einsatz gegen die Mittelmдchte frei zu bekommen.;Wydarzenia w Europie mog?zmusi?nas do przemyњlenia naszej pozycji wobec Meksyku. Wycofanie z pуіnocnego Meksyku i porozumienie z rz№dem tego kraju moїe zwolni?cz??naszych їoіnierzy potrzebnych na froncie walki z paсstwami centralnymi.;El cambio de situaciуn en Europa nos fuerza a reconsiderar nuestra posiciуn en relaciуn al asunto mexicano. Una retirada del norte de Mйxico y un acuerdo con su gobierno nos permitirбn retirar algunas tropas de la zona para luchar en el frente principal, contra la Triple Alianza.;Gli Eventi in Europa potrebbero costringerci a riconsiderare la nostra posizione verso il Messico. Un ritiro dal nord del Messico e un accordo con il medesimo potr?liberare alcuni soldati, necessari alla lotta contro gli Imperi Centrali.;;;;;;События ?Европе могу?заставит?на?пересмотреть дипломатическу?позици?по отношени??Мексик? Выво?войс?из северной Мексик??заключение соглашен? ?мексиканским правительством позволит на?высвободит?военны?силы, стол?нужные для борьбы Центральными Державам?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
