EVT1914_2049530_DESC;The United States presidential election of 1916 took place while Europe was embroiled in World War I. Public sentiment in the still neutral United States leaned towards the British and French (allied) forces, due to the harsh treatment of civilians by the German Army, which had invaded and occupied large parts of Belgium and northern France. However, despite their sympathy with the allied forces most American voters wanted to avoid involvement in the war, and preferred to continue a policy of neutrality. The campaign pitted incumbent President Woodrow Wilson, the Democratic candidate, against Supreme Court Justice Charles Evans Hughes, the Republican candidate. After a hard-fought contest, Wilson defeated Hughes by a narrow margin. Wilson was helped by his campaign slogan 'He kept us out of war'.;L'йlection prйsidentielle des Йtats-Unis de 1916 prit place pendant que l'Europe йtait embourbйe dans la premiиre guerre mondiale. L'opinion publique (malgr?la neutralit?des Йtats-Unis) s'йtait tournйe en faveur de la Grande-Bretagne et de la France, ?cause du mauvais traitement inflig?aux civils par l'armйe allemande. Malgr?leur sympathie pour les forces alliйes, la plupart des citoyens amйricains ont votйs pour йviter l'engagement dans la guerre, et continuer une politique de neutralit? L'йlection a vu s'affronter le prйsident Woddrow Wilson, le candidat dйmocrate, contre le juge suprкme Charles Evans Hughes, le candidat des rйpublicains. Aprиs une campagne вprement disputйe, Wilson fut йlu par une faible marge. Il a йt?grandement aid?par son slogan de campagne ' Il nous a gard?hors de la guerre?;Die US Prдsidentschaftswahlen im Jahre 1916 fanden statt, wдhrend in Europa der Krieg tobte. Wegen des harten Vorgehens des deutschen Reiches gegen die Zivilisten in den von ihm eroberten Gebieten in Belgien und Nordfrankreich tendierte die цffentliche Meinung leicht zur Entente. Trotz dieser Symphatien fьr Frankreich und GroЯbritannien bevorzugte der GroЯteil der Bevцlkerung aber weiterhin eine neutrale Position gegenьber den Konfliktparteien. Der Wahlkampf zwischen dem amtieren Prдsidenten Woodrow Wilson ( Demokrat ) und seinem republikanischen Herausforderer, Richter im obersten Gericht Charles Evans Hughes, wurde ausserordentlich hart gefьhrt. Am Ende gewann Wilson knapp gegen seinen Herausforderer, vor allem wegen des Wahlkampfthemas 'Er hдlt uns aus dem Krieg heraus'.;Wybory prezydenckie w Stanach Zjednoczonych w 1916 r. miaіy miejsce w momencie, gdy Europa byіa pogr№їona w I Wojnie Њwiatowej. Publiczny sentyment we wci№ї neutralnych Stanach Zjednoczonych by?po stronie si?brytyjskich i francuskich, z powodu ostrego traktowania cywilуw przez armi?niemieck? ktуra najechaіa i okupowaіa znaczne tereny Belgii i pуіnocnej Francji. Jednakїe, pomimo sympatii dla si?alianckich, wiкkszoњж amerykaсskich wyborcуw chciaіa unikn№ж zaangaїowania w wojn?i preferowaіa kontynuacj?polityki neutralnoњci. Kampania postawiіa naprzeciw siebie dotychczasowego prezydenta Woodrowa Wilsona, kandydata demokratуw, przeciwko sкdziemu S№du Najwyїszego, Charlesowi Evansowi Hughesowi, kandydatowi republikanуw. Po zaїartej walce, Wilson wygra?z Hughesem niewielk?przewag?liczby gіosуw. Wilson pomуg?sobie w kampanii hasіem 'To on uchroni?nas przed wojn?';La Elecciуn presidencial de 1916 se llev?a cabo en los Estados Unidos de Amйrica, en medio de un clima de Guerra, La opiniуn publica del aun neutral Estados Unidos se alienaba lentamente a la Entente debido al tratamiento que los alemanes daban a los civiles. Pero la gran mayorнa de los votantes querнan evitar a toda costa el involucramiento de su paнs en una Guerra. La campaсa fue un duelo entre el Presidente Woodrow Wilson, por el partido Demуcrata contra el Jefe de la Suprema Corte de Justicia, el Republicano Charles Evans Hughes. Tras la contienda, Wilson derroto a Hughes por una нnfima mayorнa. Wilson debi?su triunfo a su eslogan de campaсa 'Los mantendr?fuera de la Guerra'.;Le elezioni presidenziali statunitensi del 1916 hanno avuto luogo mentre l'Europa era coinvolta nella pиrima guerra mondiale. Il sentimento prevalente negli ancora neutrali Stati Uniti era di amicizia verso i britannici ed i francesi (alleati), a causa del duro trattamento riservato ai civili da parte dell'esercito tedesco, che aveva invaso ed occupato gran parte del Belgio e della Francia settentrionale. Tuttavia, nonostante la loro solidariet?con gli alleati, la maggior parte degli elettori americani ha voluto evitare il coinvolgimento nella guerra, ed ha preferito continuare una politica di neutralit? La campagna fu combattuta tra Woodrow Wilson, il candidato democratico, ed il giudice della Corte Suprema Charles Evans Hughes, il candidato repubblicano. Dopo una gara molto combattuta, Wilson ha sconfitto Hughes con uno stretto margine. Wilson ?stato aiutato dal suo slogan della campagna 'Ci ha tenuti fuori dalla guerra'.;;;;;;Президентски?выборы ?САСШ 1916 года проходил?на фоне полыхающей ?Европе Первой мирово?войн? Общественное мнение ?ещ?нейтральны?Соединённы?Штатах скло?лось на сторон?Британии ?Франци? во  многом из-за жестоког?обращения германской арми??граждански?населением оккупированных Бельги??северной Франци? Однако, несмот? на симпатию ?'Антант?, большинств?американских избирателе?хотели избежать участия ?мирово?войн??выступал?за продолжени?политики нейтралитета. На выбора?друг друг?противостояли кандидат от Демократическо?партии, действующи?президен?Вудр?Вильсо??кандидат от Республиканско?партии, судья Верховного суда, Чарльз Эван?Хьюз. Посл?упорно?борьбы, Вильсо?победила Хьюз??небольши?разрывом по голоса? ?этом ем?существенн?помо?ег?предвыборный лозунг: 'Он удержа?на?вн?войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
