EVT1914_2049533_DESC;The United States offered a white peace, recognizing our gain so far in this war. It's the perfect opportunity to end the war and consolidate our rule in our newly acquired provinces.;Les Etats-Unis offrent une paix blanche, reconnaissance nos gains dans cette guerre. C'est l'opportunit?parfaite de termienr la guerre et de consolider notre dominance dans les nouvelles provinces gagnйes.;Die Vereinigten Staaten bieten uns einen weissen Frieden und erkennen den aktuellen Grenzverlauf an. Das ist die perfekte Gelegenheit, diesen Krieg zu beenden und unsere Herrschaft in den besetzten Gebieten zu festigen.;Stany Zjednoczone oferuj?powrуt do stanu sprzed wojny, akceptuj№c nasze zdobycze na kontynencie. To doskonaіa okazja, by zakoсczyc wojn?i skonsolidowa?nasz?wіadz?w nowo nabytych prowincjach.;El Presidente de los Estados Unidos de Amйrica, como representate del pueblo estadounidense, ofrece a su Majestad Imperial, el Kбiser del Imperio Alemбn, una paz blanca, reconociendo sus conquistas y las de sus aliados en esta guerra, sean cuales fueren, a cambio de una paz firme y duradera? Esta es una gran oportunidad para consolidar nuestra posiciуn en los nuevos territorios que hemos conquistado, ademбs de demostrar al mundo que hemos derrotado a la potencia mбs poderosa de Amйrica.;Gli Stati Uniti hanno offerto una pace bianca, riconoscendo le acquisizione che abbiamo ottenuto finora in questa guerra. E' la perfetta opportunit?per terminare la guerra e consolidare il nostro dominio nelle province che abbiamo appena ottenuto.;;;;;;Штат?предлагают на?белы?ми? понимая бесполезност?дальнейшей конфронтации. Эт?можн?считат?хороши?шансом закончит?войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
