EVT1914_2058500_DESC;After Prince Vidit I left Albania, Essad Toptani took over power for a short time. After Toptani was expelled, the unity of the young country broke apart and now several local warlords rule in Albania. The Serbian troops are nearly defeated and decided to retreat into Albania, pursued by the Austro-Hungarian army. How will Albanian warlords react?;Suite au dйpart du Prince Vidit I d'Albanie, Essad Toptani prit le pouvoir pour un court moment. Aprиs l'expulsion de Toptani, l'unit?du jeune pays s'est bris? et plusieurs seigneurs de la guerre locaux se partagent dйsormais l'Albanie. Les troupes serbes sont quasiment vaincues, et ont dйcid?de faire retraite en Albanie, poursuivies par l'armйe austro-hongroise. Quelle sera la rйaction des seigneurs de la guerre ?;Nachdem Fьrst Wilhelm zu Wied Albanien verlassen hatte ьbernahm fьr kurze Zeit Essad Toptani die Macht im Land. Nachdem dieser vertrieben wurde zerfiel das junge Land. Nun regierten verschiedene lokale Warlords das Land. Die serbische Armee steht kurz vor einer endgьltigen Niederlage, so dass man sich entschied den Rьckzug durch Albanien anzutreten. Wie werden die albanischen Warlords reagieren?;Po tym jak ksi№ї?Vidit I opuњci?Albani? Essad Toptani przej№і na krуtko po nim wіadz? Po tym jak Toptaniego wygnano, jednoњж mіodego kraju zostaіa zіamana i aktualnie Albania podzielona jest na terytoria pozostaj№ce pod kontrol?lokalnych wataїkуw. Serbskie wojska s?niemal rozbite i zdecydowaіy si?na ucieczk?do Albanii przed napieraj№c?armi?austro-wкgiersk? Jak zareaguj?albaсscy wataїkowie?;Despuйs de que el Prнncipe Vidit I abandonase Albania, Essad Toptani tom?el poder por un breve tiempo. Despuйs de que Toptani fuese expulsado, la unidad del joven paнs se hizo pedazos, y ahora varios caudillos gobiernan en Albania. Las tropas serbias estбn prбcticamente derrotadas y decididas a retirarse a Albania, perseguidas por el ejйrcito austrohъngaro. їCуmo reaccionarбn los caudillos albaneses?;Dopo che il Principe Vidit I lasci?l'Albania, Essad Toptani prese il potere per un breve periodo. Dopo l'espulsione di Toptani, l'unit?del giovane paese and?in pezzi, ed ora i signori della guerra spadroneggiano in Albania. Le truppe serbe sono state quasi sconfitte ed hanno deciso di ritirarsi in Albania, inseguite dalle truppe austro-ungariche. Come reagiranno i signori della guerra albanesi?;;;;;;Посл?того, ка?князь Види?I остави?Албани? Эсса?Топтан?захватил власть на короткое время. Посл?изгнан? Топтан? единство молодо?страны распалос? ?теперь нескольк?местны?полевы?командиров правя??Албани? Сербские войска почт?побежден??решили отступит??Албани? преследуемые австро-венгерской армией. Ка?реагироват?албански?полевы?командирам?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
