EVT1914_2084504_DESC;After Prince Vidit I left Albania, Essad Toptani took over power for a short time. After Toptani was expelled, the unity of the young country broke apart and now several local warlords rule in Albania. So we have free hand to lead our troops through.;Suite au dйpart du Prince Vidit I d'Albanie, Essad Toptani prit le pouvoir pour un court moment. Aprиs l'expulsion de Toptani, l'unit?du jeune pays s'est bris? et plusieurs seigneurs de la guerre locaux se partagent dйsormais l'Albanie. Nous avons les mains libres pour y mener nos troupes.;Nachdem Prinz Vidit I Albanien verlassen hatte, ergriff Essad Toptani fьr kurze Zeit die Macht. Nach seiner Entlassung zerbrach der noch junge Staat in mehrere Teile, so das unsere Truppen nun unbehelligt das Land durchqueren kцnnen.;Po tym jak ksi№ї?Vidit I opuњci?Albani? Essad Toptani przej№і na krуtko po nim wіadz? Po tym jak Toptaniego wygnano, jednoњж mіodego kraju zostaіa zіamana i aktualnie Albania podzielona jest na terytoria pozostaj№ce pod kontrol?lokalnych wataїkуw. Mamy wiкc woln?rкk?i moїliwoњж przeprowadzenia przez ten kraj naszych wojsk.;Despuйs de que el Prнncipe Vidit I abandonase Albania, Essad Topani tom?el poder por un breve tiempo. Despuйs de que Topani fuese expulsado, la unidad del joven paнs se hizo pedazos, y ahora varios caudillos gobiernan en Albania. De modo que somos libres de conducir nuestras tropas a su travйs de su paнs.;Dopo che il Principe Vidit I lasci?l'Albania, Essad Toptani prese il potere per un breve periodo. Dopo l'espulsione di Toptani, l'unit?del giovane paese and?in pezzi, ed ora i signori della guerra spadroneggiano in Albania. Abbiamo quindi via libera per attraversarne il territorio.;;;;;;Посл?того, ка?князь Види?I остави?Албани? Эсса?Топтан?захватил власть на короткое время. Посл?изгнан? Топтан? единство молодо?страны распалос? ?теперь нескольк?местны?полевы?командиров правя??Албани? Таки?образо? мы може?провести наши войска сквозь эт?страну.;x;;,,,,,,,,,,,,,,,,,,,,