EVT1914_2084508_DESC;After the fall of the Austro-Hungarian Empire, the Kingdom of Serbia obtained many of its provinces and gained control over Montenegro. This lead to the birth of the Kingdom of Serbs, Croats and Slovenes.;Aprиs la chute de l'empire d'Autriche-Hongrie, le Royaume de Serbie a obtenu plusieurs de ses provinces et a gagn?le contrфle sur le Montйnйgro. Cela ?amen??la crйation du Royaume des Serbes, Croates et Slovиnes.;Nach dem Zusammenbruch der Doppelmonarchie Цsterreich-Ungarn bekam das Kцnigreich Serbien nicht nur seine angestammten Gebiete zurьck, sondern auch Teile von Montenegro. Diese Neuverteilung der Gebiete fьhrte zur Grьndung des Kцnigreichs der Serben, Kroaten und Slowenen.;Po upadku Cesarstwa Austro-Wкgierskiego, Krуlestwo Serbii uzyskaіo wiele jego prowincji i kontrol?nad Czarnogуr? Doprowadziіo to do powstania Krуlestwa Serbуw, Chorwatуw i Sіoweсcуw.;Despuйs de la caнda del Imperio Austro-Hъngaro, el Reino de Serbia obtuvo muchas de sus provincias y obtuvo el control sobre Montenegro. Esto condujo al nacimiento del Reino de los Serbios, Croatas y Eslovenos. ;Dopo la caduta dell'impero austro-ungarico, il Regno di Serbia ottenuto molte delle sue province e acquisito il controllo del Montenegro. Questo ha portato alla nascita del Regno dei Serbi, Croati e Sloveni. ;;;;;;Посл?капиту?ци?Австро-Венгерской Импери? Королевств?Серб? получило значительную част?ее балканских провинци? ?такж?контроль на?Черногорие? Эт?привел??рождению Королевств?Сербов, Хорватов ?Словенце?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
