EVT1914_2104515_DESC;Strikes grow stronger at Petrograd. Students, employees, workers of nearby towns join Petrograd's workers. Aside for calls for employment, peace and bread, more and more people call for a Republic. Completely overwhelmed, Cossacks regiments refuse to intervene, and are congratulated by the crowd.;Les mouvements de contestation s'amplifient ?Petrograd o?les йtudiants, employйs et ouvriers des villes voisines rejoignent les ouvriers. La contestation prends un ton politique, appelant ?la Rйpublique en plus du pain et de la paix. Les rйgiments de Cosaques, dйbordйs, prйfиrent ne pas intervenir et en sont fйlicitйs par la foule.;Die Streiks nahmen an Umfang und Heftigkeit zu, nachdem auch Studenten, Bьrger und die Arbeiter nahegelegener Stдdte sich beteiligten. Neben Beschдftigung, Frieden und Brot verlangten jetzt aber auch mehr und mehr der Streikenden eine neue Regierungsform, die Republik. In Anbetracht des ungleichen Zahlenverhдltnisses weigerten sich die in Petrograd stationierten Kosakenregimenter, gegen die protestierende Bevцlkerung vorzugehen.;Strajki nasilaj?si?w Piotrogrodzie. Studenci, robotnicy i chіopi z pobliskich wsi i miasteczek doі№czaj?si?do aktywistуw w Piotrogrodzie. Obok ї№da?zatrudnienia, pokoju i chleba, coraz wiкcej osуb ї№da powoіania republiki. Regimenty Kozakуw odmawiaj?interwencji i s?witani owacyjnie przez tіum.;Las protestas crecen a un ritmo exponencial. Estudiantes, empleados, obreros e incluso personas de otras ciudades se han unido a la Huelga. Claman por empleo, paz, pan y ъltimamente por la caнda del Zar y la proclamaciуn de una Repъblica. Completamente desbordados, los Cosacos se rehъsan a cargar contra el pueblo y peor aъn, se les han unido?Gli scioperi si rafforzano a Pietrogrado. Studenti, impiegati, operai delle citt?vicine si uniscono ai lavoratori di Pietrogrado. A parte le richieste per l'occupazione, la pace ed il pane, sempre pi?persone chiedono anche una Repubblica. Completamente travolti, i reggimenti cosacchi si rifiutano di intervenire, unendosi alla folla.;;;;;;Забастовки ?Петрограде становятся вс?боле?массовым? Студенты, служащие, крестьяне из близлежащи?деревень присоеди?ют? ? петроградски?рабочи? Теперь помимо требований 'Хлеб?', 'Мира!', 'Свобод?', вс?больше люде?выступаю?за свержени?самодержав?. Казачь?полк?отказались разгонять митингующи? че?вызвал??толп?симпатию.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
