EVT1914_2104516_DESC;All went wrong in the last days. In Petrograd, strikes became open riots. The Czar is furious.;Tout a dйgйrйn?ces derniers jours. Les manifestations sont devenues des rйvoltes ouvertes. Le Tsar est furieux.;In den letzten Tagen wurde alles schlimmer und schlimmer. Aus den Streiks wurde ein offener Aufstand. Der Zar ist ausser sich.;W ostatnich dniach sprawy przybraіy bardzo zіy obrуt. Piotrogrуd opanowany jest przez otwarte zamieszki. Car jest wњciekіy.;Todo ha empeorado en los ъltimos dнas. Las protestas de Petrogrado se han convertido en una rebeliуn abierta contra la autoridad imperial, el Zar est?furioso. Esto puede socavar aъn mбs nuestra ya debilitada estabilidad?;Tutto ?andato storto negli ultimi giorni. A Pietrogrado, scioperi divennero scontri aperti. Lo Zar ?furioso.;;;;;;Обстановка ?Петрограде выходи?из-по?контро?. Забастовки перерастаю??массовые беспорядк? Императо?Никола?II ?ярост?!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
