EVT1914_2104517_DESC;Nicholas II asked the troops to crush the rebellion. The first day, Tsar's regiments opened fire against workers. At dusk, some soldiers deserted and joined the strikes while at night, mutinies sparked, and finally the whole garrison joined the rebellion. The Tzar has no choice but to flee.;Nicolas II a ordonn??ses troupes d'йcraser la rйbellion. Le premier jour, les rйgiments ouvrent le feu sur les manifestants. En fin de journйe, plusieurs soldats changent de camps, et la nuit, les mutinieries frappent la garnison. Finalement, ce sont prиs de 150.000 hommes qui rejoigent les manifestants. Le Tsar n'a d'autre choix que de fuir.;Nicolas II befahl seinen Truppen, die Aufstдnde mit Waffengewalt niederzuschlagen. Am ersten Tag des Einsatzes erцffneten die zaristischen Truppen das Feuer auf streikende Arbeiter. Mit der Dдmmerung begannen dann die ersten Soldaten zu desertieren, bis sich nach kurzer Zeit die gesamte Petrograder Garnison den Aufstдndischen angeschlossen hatte. Dem Zar blieb nichts anderes als die Flucht ьbrig.;Mikoіaj II wysіa?wojska, by zdіawiіy rebeli? Pierwszego dnia carskie regimenty otworzyіy ogie?do robotnikуw. Jednak o zmierzchu cz??їoіnierzy przeszіa na stron?rewolucjonistуw i w koсcu po stronie robotnikуw opowiedzia?si?caіy garnizon. Car nie ma wyboru i musi ucieka?;Nikolai II orden?al ejйrcito aplastar la rebeliуn. El primer dнa, los regimientos del Zar abrieron fuego contra el pueblo. En la tarde, algunos soldados desertaron y se unieron a la protesta y en la noche estallo el motнn en el cual todos los regimientos involucrados en la represiуn se unieron a la rebeliуn. El Zar y su familia se han visto obligados a huir rбpidamente de la capital, antes de ser ajusticiados por la turba?Nicola II ha chiesto alle truppe di schiacciare la ribellione. Il primo giorno, reggimenti dello Zar hanno aperto il fuoco contro i lavoratori. Al crepuscolo, alcuni soldati disertori si sono uniti allo sciopero, mentre durante la notte, si sono 