EVT1914_2104520_DESC;Russia's Military staff advise the Tzar to abdicate 'to save the country'. General Alexeiev finally convinced him, stating that Nicholas' abdication will allow the war against Germany to continue. His brother, Great Duke Mikhail Alexandrovitch Romanov, inherited the throne but abdicated almost instantly. In a few hours, the Old Regime has fallen.;L'Etat major russe a conseill??Nicholas II d'abdiquer pour 'sauver l'indйpendance du pays'. Le Gйnйral Alexeiev a convaincu le Tsar en affirmant que son abdication permettrait de poursuivre la guerre. Son frиre, Mikhaпl Alexandrovitch Romanov, hйrite du trфne mais y abdique aussitфt. En quelques heures, le rйgime tsariste s'effondre.;Der Generalstab des russischen Reiches legte dem Zaren die Abdankung nahe, um das Land zu retten. Schliesslich war es General Alexeiev, der den Zaren ьberzeugen konnte, da?seine Abdankung die Fortfьhrung des Krieges gegen das deutsche Reich erst ermцglichen wьrde. GroЯherzog Mikhail Alexandrovitch Romanov erbte den Thron durch Nicolas II Abdankung, dankte aber auch sofort ab. Innerhalb weniger Stunden war das alte Regierungssystem nur noch Geschichte.;Rosyjski sztab radzi carowi abdykacj?by uchroni?kraj przed klкsk? Genera?Aleksjejew ostatecznie przekonuje cara do abdykacji twierdz№c, їe tylko ten ruch pozwoli na kontynuacj?wojny z Niemcami. Carski brat, wielki ksi№їe Micha?Aleksandrowicz Romanow, dziedziczy tron, ale i on niemal natychmiast abdykuje. W ci№gu kilku godzin Stary Porz№dek znajduje swуj kres.;El estado mayor ruso, aconsejo al Zar abdicar 'para salvar al Imperio'. El general Alexeiev finalmente le convenci? declarando que su abdicaciуn permitirнa seguir la guerra contra el Imperio Alemбn. Su hermano, el Gran Duque Mikhail Romanov, que reinarнa con el nombre de Mikhail II, abdico casi inmediatamente. En unas pocas horas, el antiguo rйgimen de casi 200 aсos, habнa colapsado.;I consiglieri militari russi chiesero allo Zar di abdicare 'per salvare il Paese'. Il Generale Alexeiev, finalmente, lo convinse, affermando che l'abdicazione di Nicola consentir?il proseguimento della guerra contro la Germania. Suo fratello, il Gran Duca Michele Aleksandrovic Romanov, erediter?il trono, ma abdicher?quasi istantaneamente. In poche ore, l'antico regime ?caduto.;;;;;;Военны?генералите?посоветова?Царю отречь? от престола, 'чтоб?спасти Россию ?династию'. Наконе? генералу Алексеев?удалос?убедит?ег? заяви? чт?отречени?позволит продолжить войн?против Германии. Никола?II отрекся ?пользу своего брат? Великого кня? Михаил?Александровича, которы? однако, вскоре такж?отказался от престола. Таки?образо? буквальн??течени?нескольких часо?старый режи?перестал существовать....;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
