EVT1914_2104521_DESC;Alexandr Federovicth Kerensky is the first SR (socialist-revolutionary) to become Prime Minister. He forms a government with a socialist majority, and represents a hope for many former demonstrators.;Alexandr Federovicth Kerensky est le premier SR (socialiste-rйvolutionnaire) ?devenir Premier Ministre. Il rйunit un gouvernement ?majorit?socialiste, et suscite ainsi l'espoir de nombreux anciens manifestants.;Alexandr Federovicth Kerensky ist der erste sozialistische Revolutionдr, der Premierminister wurde. Er bildete eine Regierung mit einer sozialistischen Mehrheit und stellte fьr den GroЯteil der Aufstдndischen die Hoffnung auf Besserung der Zustдnde dar.;Aleksander Fiodorowicz Kiereсski jest pierwszym eserowcem (socjalist?rewolucjonist?, ktуry zostaje premierem. Tworzy on rz№d z wiкkszoњci?socjalistyczn?i reprezentuje nadziej?wielu demonstrantуw.;Alexandr Federovich Kerensky, fue el primer 'eserri' (social-revolucionario) que se convirti?en primer ministro. Formo un gobierno de mayorнa socialista y representa una esperanza para muchos ex-manifestantes.;Alexandr Kerensky Federovicth ?il primo SR (socialista-rivoluzionario) a diventare Primo Ministro. Former?un governo con una maggioranza socialista, e rappresenter?una speranza per molti ex manifestanti.;;;;;;Александ?Федорови?Керенски?становит? первым эсером (социалисто?революционером), за?вшим пост министра-председате? ( премье?министра) Временного правительств? Он формируе?правительств??социалистическим большинством, которо?становит? надеждой для многих демонстранто?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
