EVT1914_2104522_DESC;Lenin came back from Switzerland. He is clearly against the Kerensky government and seeks a Republic of the Soviets. We did not need such a radical agitator?Lйnine est revenu de Suisse. Il s'oppose clairement au gouvernement Kerensky et souhaite une Rйpublique des Soviets. Nous n'avions pas besoin d'un agitateur aussi radical.;Lenin ist aus seinem Schweizer Exil zurьckgekehrt. Er ist ein entschiedener Gegner der Kerensky Regierung und verfolgt die Idee der Einrichtung des basisdemokratischen Sowjet-Systems fьr ganz Russland. Ein solch radikaler Agitator ist das letzte was wir jetzt brauchen. ;Lenin powrуci?ze Szwajcarii. Opowiada si?jasno przeciw rz№dowi Kiereсskiego i wzywa do powoіania Republiki Sowietуw. Nie chcemy tu takiego radykalnego agitatora?Lenin ha vuelto de Suiza. Esta claramente en contra del gobierno de Kerensky y busca la creaciуn de una Republica de los Soviets. No necesitamos a un simple agitador radical?Lenin torn?dalla Svizzera. Egli ?chiaramente contro il governo Kerensky e cerca una Repubblica dei Soviet. Non abbiamo bisogno di un agitatore radicale ...;;;;;;Лени?возвратился ?Россию из Швейцари? Выступ? по?лозунгам? 'Никако?поддержк?Временному правительств? ?'Вся власть - Совета? он провозгласил курс на перехо?власти ?Совета??пролетариату. На?не нужн?таки?радикальны?агитатор?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
