EVT1914_2104523_DESC;Lenin's extreme policies are getting more and more popular, both among Mensheviks and the general population. With Trotsky's supporters behind Lenin, the Bolsheviks are now a majority in the Petrograd Soviet.;Les demandes extrкmes de Lйnine sont de plus en plus populaires, chez les Mensheviks comme chez les Bolchйviques. Trotsky l'a rejoint, et les Bolchйviques sont dйsormais majoritaires au Soviet de Petrograd.;Lenins extreme Forderungen finden immer mehr Anhдnger, sowohl unter der Bevцlkerung als auch unter den Menschewiki, die ursprьnglich seine дrgsten politischen Gegner waren. Die Menschewiki ( Minderheitler ) waren ursprьnglich der gemдssigte Flьgel der sozialdemokratischen Partei Russlands, die auf Reformen im zaristischen Russland setzen, wдhrend Lenins Bolschewiki ( Mehrheitler ) aus derselben Partei stammten, aber von vorneherein fьr eine Revolution und die Abschaffung der Monarchie waren. Trotzky nahm Lenin in Empfang und zusammen mit den Bolschewiki hatten die beiden die Mehrheit im Sowjet der Stadt Petrograd.;Daleko id№ce ї№dania Lenina przysparzaj?mu rosn№cej popularnoњci, zarуwno wњrуd mienszewikуw, jak i caіego spoіeczeсstwa. Trocki doі№cza do Lenina i bolszewicy stanowi?teraz wiкkszoњж w piotrogrodzkim sowiecie.;Las demandas extremas de Lenin se hacen cada vez mбs y mбs populares, entre los Mencheviques y el pueblo por igual. Trotsky se ha reunido con Lenin y ahora los Bolcheviques son mayorнa en el Soviet de Petrogrado.;Le richieste estreme di Lenin stanno diventando sempre pi?popolari, sia tra i menscevichi che tra la popolazione. Trosky si ?unito a Lenin ed i bolscevichi sono ormai la maggioranza nel Soviet di Pietrogrado.;;;;;;Лозунг?Ленина становятся вс?боле??боле?попу?рным? ка?сред?меньшевико? та??сред?населения. Троцки??Лени?сумели сплотить вокруг се? большевико? получивших большинств??Петроградско?Совете.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,