EVT1914_2104524_DESC;Peasants from the Russian Empire don't want to wait anymore for a long-time promised agrarian reform, which Kerensky postpones every day. They have taken arms and invaded their lord's lands in order to share them among the peasantry. Soldier, who often come from the countryside, leave their regiments to be able to gain their share.;Les paysans de l'Empire refusent d'attendre plus longtemps une rйforme agraire promise par Kerensky mais sans cesse repoussйe. Ils ont pris les armes et envahi les terres de leurs seigneurs pour procйder ?leur partage. Apprenant cela, les soldats, souvent issus de la paysannerie, dйsertent leurs rйgiments pour obtenir une partie de ces terres.;Die Bauern des russischen Reiches wollen nicht lдnger auf die immer wieder versprochene Landreform warten, die Kerenski ein ums andere mal verschiebt. Sie haben die Waffen gegen ihre Herren erhoben und besetzten die Lдndereien, um sie unter sich aufzuteilen. Viele Soldaten, die meistens ebenfalls vom Lande stammen, desertieren, um sich ihren Anteil an der Beute zu sichern.;Chіopi w Imperium Rosyjskim nie bкd?czekali ju?dіuїej na obiecywan?od lat reform?roln? ktуr?rz№d Kiereсskiego wci№ї odkіada na przyszіoњж. Chwycili wiкc za bro?i napadli na ziemie ich panуw, by sami rozdzieli?je miкdzy siebie. Interweniuj№cy їoіnierze, sami wywodz№cy si?przewaїnie z prowincji sympatyzuj?z szalej№cymi masami.;Los campesinos del Imperio Ruso se han cansado de esperar la ya muy vieja promesa de una reforma agraria, la misma que Kerensky pospone siempre que puede. Se han alzado en armas y han asaltado las tierras de su seсor para repartirlas entre el campesinado. Muchos soldados, que son en su mayorнa del campo, han abandonado sus regimientos para reclamar sus derechos, junto a su pueblo.;I contadini dell'Impero russo non vogliono pi?aspettare a lungo tempo la promessa riforma agraria, che Kerensky rinvia ogni giorno. Hanno preso le armi e hanno invaso le terre dei loro signori, per di condividerli tra i contadini. I soldati, che spesso provengono dalla campagna, lasciano i loro reggimenti per essere in grado di ottenere la loro parte.;;;;;;Крестьяне больше не хо??ждат?решения земельного вопрос??аграрной реформ? проведение которо?Керенски?каждый ра?откладывае? Он?взялись за оружие ?начали захват помещичьих имений, чтоб?самост?тельно разделит?земл?межд?собо? Солдат? которы??основной масс?являют? выходцам?из сельской местност? начинают покидать свои полк? чтоб?имет?возможност?получить свою долю.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
