EVT1914_2104525_DESC;In what became known as the July Days, approximately half a million came out onto the streets of Petrograd in protest, including soldiers and sailors. Lenin proved incapable of directing them into an organised coup. The demonstrators, lacking leadership, disbanded and the government survived.;Dans ce qui deviendra plus connu sous le nom de Journйes de Juillet 1917, environ 500 000 personnes ont protestйs dans les rues de Petrograd. Parmi eux se trouvaient des soldats et des marins. Lйnine s'est trouv?incapable de les diriger pour rйalis?en coup d'йtat organis? Les manifestants, manquant de leadership, se sont dissolus et le gouvernement survйcut.;In den sogenannten 'Julitagen' gingen circa 500.000  Menschen in Petrograd auf die Strassen und protestierten gegen die Regierung. Lenin gelang es nicht, die Demonstranten zu einigen und auf ein gemeinsames Ziel einzuschwцren. Auf diese Art ohne Fьhrung lцsten sich die Protestmдrsche bald auf und die Regierung ьberlebte.;W wydarzeniu, ktуre bкdzie znane jako Dni Lipcowe, blisko pуі miliona osуb wyszіo na ulice Piotrogrodu w proteњcie, w tym їoіnierze i marynarze. Lenin okaza?si?jednak niezdolny, by ruch ten przeksztaіci?w zorganizowany zamach stanu. Demonstranci z powodu braku przywуdcy rozeszli si? a rz№d przetrwa?ten kryzys.;En los 'Dнas de Julio', mбs de medio millуn de ciudadanos rusos salieron a las calles de Petrogrado a protestar, ejercito incluido. Lenin fue incapaz de dirigirlos para lograr un golpe de estado organizado lo que concluyo en la disoluciуn de las protestas. El gobierno a duras penas sobrevivi?;In quelle che furono chiamate le Giornate di Luglio, all'incirca mezzo milione di uomini uscirono sulle strate di Pietrogrado per protestare, compresi soldati e marinai. Lenin si dimostr?icapace di dirigerli in maniera organizzata. I dimostranti senza una guida si dispersero e il governo sopravvisse.;;;;;;?июльские дн?1917 года, окол?полумиллиона челове?вышл?на улиц?Петрограда ?знак протеста,