EVT1914_2104527_DESC;Kornilov's first act in his new position was to issue a list of demands to the Provisional Government, including the request that he be removed from the control of the government so that he was essentially only accountable to himself. These requests were denied and, fearing a revolution, Kornilov ordered his troops to advance to a position closer to Petrograd. This order was given without either the knowledge or consent of the Provisional Government.;La premiиre dйcision de Kornilov dans sa nouvelle fonction a йt?d'йtablir une liste de demande au gouvernement provisoire. Parmi celles-ci se trouvait la demande que Kornilov ne soit pas sous le contrфle du gouvernement, et qu'il ne doive rendre de compte dйsormais qu'?lui mкme. Ces requкtes ont йt?rejetйes et, craignant une rйvolution, Kornilov a ordonn??ses troupes d'avancer ?une position plus proche de Petrograd. Cet ordre a йt?donn?sans que le gouvernement provisoire ne le sache.;Kornilovs erste Massnahme war, einen Antrag an die provisorische Regierung zu stellen, da?er nur sich selbst, nicht aber der Regierung verantwortlich sei. Dieser Antrag wurde natьrlich abgelehnt und Kornilov fьhrte seine Truppen daraufhin eigenmдchtig nach Petrograd, um einer Revolte vorzubeugen. ;Pierwszym posuniкciem Korniіowa w jego nowej roli byіo wystosowanie listy ї№da?wobec rz№du tymczasowego, w tym ї№dania usuniкcia go spod kontroli rz№du i uczynienia odpowiedzialnym przed sob?samym. Zostaіo to odrzucone i Korniіow rozkaza?swym wojskom maszerowa?na Piotrogrуd. Rozkaz ten zosta?wydany bez zgody i wiedzy rz№du.;El primer acto de Kornilov en su nuevo cargo fue tratar el asunto de demandas del gobierno provisional, incluida la orden de removerle del cargo. Todas las demandas fueron rechazadas por lo que los asuntos militares del imperio serбn llevados solo por йl, con esto, Kornilov desplazo al ejйrcito a una posiciуn mбs cercana a Petrogrado, sin la autorizaciуn del gobierno provisional.;Il primo atto di Kornilov nella sua nuova posizione fu di mandare una lista di richieste al Governo Provvisorio, compresa la richiesta di essere rimosso dal controllo del governo in modo da diventare l'unico responsabile di s?stesso. Queste richieste furono respinte e, temendo una rivoluzione, Kornilov ordin?alle sue truppe di avanzare in una posizione pi?vicina a Pietrogrado. Quest'ordine fu dato senza la conoscenza o il consenso del governo Provvisorio.;;;;;;Первым действие?Корнилов?на пост?Верховного Главнокомандующего стал?выдвижение Временному правительств?перечня требований, одни?из которы?было предоставление Главковерх?полной автономи?во всех военны?вопросах, таки?ка?решени?оперативны?зада? назначение ?смещение командного состав? Посл?отказа Керенского принять эт?требован?, Корнилов, опас?сь дальнейшег?развит? анархи??ново?революци? отда?приказ войска?начать движение на Петрогра?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
