EVT1914_2104528_DESC;On August 27 Kornilov ordered his troops to advance on Petrograd. Kerensky appealed to the Petrograd Soviet to help put down this attempted seizure of power. The Soviet called upon the workers and soldiers of the capital to help defend the revolution and they responded. As the Soviet was successful in persuading the troops to disobey Kornilov's orders the coup was avoided and no blood was shed. Kornilov was arrested and replaced by Mikhail Alekseyev;Le 27 Aoыt, Kornilov a ordonn??ses troupes d'avancer vers Petrograd. Kerensky appela ?l'aide le Soviet de Petrograd pour l'aider ?faire йchouer sa tentative de pouvoir. Les Soviet ont appelйs les ouvriers et les soldats ?aider ?dйfendre la rйvolution, appel auquel ils ont rйpondu. Comme les Soviet ont persuadйs avec succиs les troupes de dйsobйir aux ordres de Kornilov, le coup d'Йtat a йt?йvit?et il n'y a pas eu d'effusion de sang. Kornilov a йt?arrкt?et remplac?par Mickail Alekseyev.;Am 27. August nдherten sich Kornilovs Truppen den Aussenbezirken von Petrograd. Kerensky bat daraufhin den Sowjet um Mithilfe beim niederschlagen dieses Putschversuches, der seinerseits die Arbeiter und Soladten dazu aufrief, die Stadt und die Revolution zu verteidigen. Dadurch das der Sowjet Kornilovs Truppen zur Meuterei aufrief, konnte dieser versuchte Staatstrech unblutig beendet werden. Kornilov wurde verhaftet und durch Mikhail Alekseyev ersetzt.;27 sierpnia Korniіow rozkaza?swym wojskom maszerowa?na Piotrogrуd. Kiereсski odwoіa?si?do sowietu piotrogrodzkiego, aby powstrzyma?on ten zamach na prawowit?wіadz? Sowiet odwoіa?si?do robotnikуw i їoіnierzy, by bronili stolicy w imi?rewolucji i udaіo si?wywoіa?masowy odzew. Sowietom udaіo si?przekona?їoіnierzy Korniіowa, by nie sіuchali rozkazуw swego dowуdcy, co pozwoliіo zaїegna?groџb?puczu. Korniіow zosta?aresztowany i zast№piony przez Michaіa Aleksiejewa.;El 27 de agosto Kornilov ordeno a sus tropas avanzar hacia Petrogrado. Kerensky recurrio al Soviet de Petrogrado para buscar ayuda en contra el intento de golpe de estado. El Soviet llamo a los trabajadores y soldados de la capital para defender la revoluciуn y estos respondieron. Como el Soviet tuvo йxito al convencer a los soldados de desobedecer a Kornilov, el golpe fue neutralizado y no hubieron vнctimas. Kornilov fue arrestado y reemplazado por Mikhail Alekseyev.;Il 27 Agosto Kornilov ordin?alle sue truppe di avanzare verso Pietrogrado. Kerensky si appell?al Soviet di Pietrogrado per ricevere aiuto nell'impedire questo colpo di stato. Il Soviet chiese ai lavoratori e ai soldati della capitale di aiutare a difendere la rivoluzione e loro risposero. Il Soviet riusc?a persuadere le truppe a disobbedire gli ordini di Kornilov e quindi il colpo di stato fu evitato senza spargimenti di sangue. Kornilov fu arrestato e rimpiazzato da Mikhail Alekseyev;;;;;;27 август?1917 года Корнилов отда?свои?войска?приказ наступат?на Петрогра? Пытаясь удержать? ?власти, Керенски?обратился ?Петроградскому совету за помоўў??подавлении этой попытк?установлен? военно?диктатур? Большевики призвали рабочи??солдат столиц?встать на защиту завоеваний революци? Посл?того, ка?агитаторам Петросовет?удалос?распропагандироват?наступающи?войска ?убедит?их не подчинять? приказам Корнилов? стал?ясн? чт?попытк?переворота провалилас? Корнилов бы?арестова??замене?на Михаил?Алексеев?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
