EVT1914_2104529_DESC;Many Bolsheviks were arrested after the July Days, but after the Petrograd Soviet decisive help in defeating Kornilov's coup, the Provisional Government was asked to release them.;Plusieurs Bolcheviques ont йt?arrкtйs aprиs les Journйes de Juillet, mais aprиs l'aide dйcisive du Soviet de Petrograd ?empкcher le coup d'Йtat de Kornilov, le gouvernement provision a reзu la demande de les relвcher.;Wдhrend der 'Julitage' befanden sich viele Bolschewiken in Haft, aber wegen der entscheidenden Hilfe, die der Petrograder Sowjet der provisorischen Regierung gegen Kornilov leistete, wurden die meisten freigelassen.;Wielu bolszewikуw aresztowanych po wydarzeniach Dni Lipcowych zostaіo, w wyniku wsparcia jakiego udzieli?sowiet piotrogrodzki podczas puczu Korniіowa, uwolnionych.;Muchos Bolcheviques fueron arrestados en los sucesos de julio, pero luego de la ayuda decisiva del Soviet de Petrogrado para derrotar a Kornilov, el gobierno provisional ha decidido liberarlos.;Molti Bolscevichi furono arrestati durante le Giornate di Luglio, ma dopo l'aiuto decisivo del Soviet di Pietrogrado  nello sconfiggere il colpo di stato di Kornilov, al Governo Provvisorio ?stato chiesto di liberarli.;;;;;;Мног?большевико?было арестовано посл?июльских событи? однако посл?того, ка?Петроградски?Сове?оказал решающую помоўў ?подавлении корниловског?переворота, Временному Правительств?было предложено освободить их.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
