EVT1914_2104542_DESC;Even though Serbia bowed to Austro-Hungarian demands, people and the Intelligentsia reject the Austro-Hungarian influence over their country. We can finance and equip small partisan groups to hamper Austria-Hungary in their assimilation of Serbia, as well as pinning some of their forces down for the Operation Belgrade.;Bien que la Serbie se soit inclinйe face aux demandes austro-hongroises, le peuple et l'Intelligentsia rejette la domination de leur voisin germanique. Nous pouvons financer de petits groupes de partisans pour retarder l'assimilation de la Serbie ainsi que pour fixer des troupes ennemies lors de l'Opйration Belgrade.;Auch wenn die Regierung Serbiens sich dem Ultimatum Цsterreich-Ungarns beugte, lehnen weite Teile der Bevцlkerung die Besetzung durch Цsterreich-Ungarn ab. Wir kцnnten kleine Partisanengruppen finanzieren und ausrьsten, um Цsterreich-Ungarn bei der Eingliederung Serbiens zu behindern. Mцglicherweise zwingen diese Partisanengruppen bei ausreichender Unterstьtzung die Besatzer, Truppen zu ihrer Bekдmpfung abzustellen, was uns wiederum die Durchfьhrung der 'Operation Belgrad' erleichtern wьrde.;Pomimo, їe Serbowie ugiкli si?przed ї№daniami Austro-Wкgier, zwykіy lud i inteligencja nie zgadzaj?si?z wpіywem austro-wкgierskim, pod ktуrym znalaz?si?ich kraj. Moїemy finansowa?i wyposaїa?maіe grupy partyzantуw, aby utrudnia?Austro-Wкgrom asymiliacj?Serbуw, jak rуwnie?wi№ї№c cz??ich si?w przededniu Operacji Belgrad.;Aun cuando el gobierno Serbio cedi?ante la presiуn Austro-Hъngara, su pueblo rechaza tajantemente la influencia germбnica en su paнs. Podemos financiar pequeсos grupos de partisanos para sabotear las operaciones Austro-Hъngaras en Serbia y para debilitar un poco sus tropas, de cara a la Operaciуn Belgrado.;Anche se la Serbia si inchin?alle richieste austro-ungarico, la gente e gli intellettuali respinsero l'influenza austro-ungarica nel loro paese. Siamo in grado di finanziare e di equipaggiare piccoli gruppi di partigianperad ostacolare l'Austria-Ungheria nella loro assimilazione della Serbia, cos?come occupare alcune delle loro forze in vista dell'operazione Belgrado.;;;;;;Несмот? на то, чт?сербское правительств?согласилос?принять австро-венгерский ультиматум, просты?люди ?интеллигенция не желают мирить? ?австрийски?вл?нием на их страну. Мы може?вооружит?от?ды сербских партизан, которы?буду?противостоять Австро-Венгри??ее попытках ассимилировать Сербию, ?такж?смогут от?нуть на се? част?австрийски?си? облегчив те?самы?проведение 'операции Белгра?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
