EVT1914_2104544_DESC;We've signed an armistice with Germany after we defeated their armies. Peace negotiations will soon begin and France, as leader of the alliance, will decide how high a price they'll have to pay.;Nous avons signйs un armistice avec l'Allemagne aprиs que nous ayons dйfaits leurs armйes. Les Nйgociations de paix dйbuteront bientфt et la France, en tant que leader de l'Alliance, dйcidera ensuite quel prix ils devront payer.;Wir haben ein Waffenstillstandsabkommen mit dem deutschen Kaiserreich abgeschlossen, nachdem wir seine Truppen geschlagen haben. Bald werden wir in Friedensverhandlungen eintreten und Frankreich, als Fьhrer der Entente, wird entscheiden, wie hoch die Reparationszahlungen ausfallen werden.;Podpisaliњmy rozejm z Niemcami po tym, jak pokonaliњmy ich armie. Negocjacje pokojowe wkrуtce si?rozpoczn?i Francja, jako lider sojuszu, zadecyduje jak wysok?cen?przyjdzie im zapіaci?;Hemos firmado el armisticio con Alemania, luego de la rendiciуn de sus ejйrcitos. Las negociaciones de paz comenzaran pronto, tan pronto como Francia, como lнder de la alianza, decida qu?tan alto ser? el precio que deberбn pagar.;Abbiamo firmato un armistizio con la Germania dopo aver sconfitto il loro esercito. Le trattative di pace inizieranno presto e la Francia, in quanto leader dell'alleanza, decider?che prezzo saranno costretti a pagare.;;;;;;Мы подписал?временно?перемири??Германие?посл?того, ка?их войска были разгромлен? Переговоры ?мире начнут? чере?нескольк?ме?це? ?Франция, ка?лиде?Антант? буде?решать судьбу побежденного противника со всей подобающей строгостью.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
