EVT1914_2104547_DESC;We've been defeated by the Central Powers who imposed their conditions. We have to release Finland, Georgia and Azerbaijan as independent states and secede Poland, the Baltic State, Ukraine and part of Belarus and Caucasus.;Nous avons йt?dйfaits par les puissances Centrales, qui ont imposйs leurs conditions. Nous devrons relвcher la Finlande, la Georgie et l'Azerbaidjan en tant qu'Etats indйpendance et cйder la Pologne, les Etats Baltes, l'Ukraine et une partie du Caucase et du Belarus.;Wir haben den Krieg gegen die Mittelmдchte verloren und mьssen ihre Forderungen akzeptieren. Wir werden Finnland, Georgien und Aserbeidschan als unabhдngige Nationen freilassen und Polen, das Baltikum, die Ukraine und Teile Weisrusslands sowie des Kaukasus abtreten.;Zostaliњmy pokonani przez paсstwa centralne, ktуre narzuciіy swe warunki. Musimy przyzna?niepodlegіoњж Finlandii, Gruzji i Azerbejdїanowi, a takїe zrzec si?Polski, paсstw baіtyckich, Ukrainy, a takїe cz?ci Biaіorusi i regionu Kaukazu.;Las Potencias Centrales, como vencedoras de la reciente guerra, anuncian al gobierno del Imperio Ruso, las siguientes condiciones de paz: La liberaciуn de Finlandia y los estados caucбsicos de  Georgia y Azerbaiyбn mas la cesiуn de Polonia, los estados bбlticos y la Rusia Blanca al Kaiserreich Alemбn.;Siamo stati sconfitti dagli Imperi Centrali che hanno imposto le loro condizioni. Dobbiamo rilasciare la Finlandia, la Georgia e l'Azerbaiajn come stati indipendenti e secedere Polonia, gli Stati Baltici, Ucraina e parte di Bielorussia e Caucaso.;;;;;;Мы побежден?Центральными державам? которы?выставил?на?свои условия. На?придёт? предоставить независимост?Финляндии, Грузии ?Азербайджану ?отдать Польшу, Прибалтику, Украин? част?Белоруссии ?Кавказ?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
