EVT1914_2104552_DESC;Historically, it was the partition plans of the Entente which let the Ottoman Empire fall into the hands of the Central Powers. The Russian Empire was strived to gain control over Bosporus and Constantinople to expand the dominance in the Black Sea. Also, territorial expansion was planned in eastern Anatolia.\nSince the Ottoman Empire is now isolated diplomatically, the Russian conquest plans could be materialized now.;Historiquement, ce furent les plans de partition de l'Entente qui firent tomber l'Empire ottoman dans les mains des Puissances Centrales. L'Empire russe cherchait ?prendre le contrфle du Bosphore et de Constantinople pour йtendre sa domination de la mer Noire. Aussi, une expansion territoriale йtait planifiйe en Anatolie orientale.\nMaintenant que l'Empire ottoman est dйsormais isol?diplomatiquement, les plans de conquкte russes pourraient se concrйtiser dиs aujourd'hui.;Historisch waren es die Teilungsplдne der Entente, die das Osmanische Reich zur Seite der Mittelmдchte zog. So war Russland bestrebt die Meerenge des Bosporus und Konstantinopel zu kontrollieren, um somit die Dominanz im Schwarzen Meer auszubauen. Auch waren Gebietserweiterungen im Osten Anatoliens geplant.\nDa das Osmanische Reich nun diplomatisch isoliert ist, sind den Eroberungsplдnen Russlands keine Hindernisse mehr gesetzt.;Historycznie, to plany rozbiorуw autorstwa Ententy doprowadziіy Imperium Ottomaсskie do sojuszu z paсstwami centralnymi. Imperium Rosyjskie d№їyіo do osi№gniкcia kontroli nad Bosforem i Konstantynopolem w celu rozszerzenia dominacji w obszare Morza Czarnego. Planowaіo rуwnie?ekspansj?terytorialn?we wschodniej Anatolii.\nJako їe Imperium Ottomaсskie byіy izolowane dyplomatycznie, rosyjskie plany podboju mogіy si?teraz zmaterializowa?;Histуricamente, fueron los planes de particiуn de la Entente los que dejaron al Imperio Otomano caer en manos de las Potencias Centrales. El Imperio Ruso se esforz?para ganar el control sobre el Bуsforo y Constantinopla y expandir la dominaciуn en el Mar Negro. Tambiйn, la expansiуn territorial fue planeada en la Anatolia del este.\nYa que el Imperio Otomano est?ahora aislado diplomбticamente, los planes rusos de conquista ya podrбn ser materializados.;Storicamente, furono i piani di spartizione dell'Intesa a spingere l'Impero Ottomano nelle mani degli Imperi Centrali. L'Impero Russo bramava di controllare il Bosforo e Costantinopoli per espandere il proprio dominio nel Mar Nero. Inoltre, un'espansione territoriale era prevista anche nell'Anatolia Orientale. Dato che l'Impero Ottomano ?ora isolato diplomaticamente, i piani di conquista russi possono materializzarsi.;;;;;;Историческ?эт?были план?стра?Антант? которы?толкал?Османску?Импери???ды центральны?держав. Русская Империя стремилась получить контроль на?Босфором ?Константинополем, чтоб?расширит?господство ?Черном море. Кром?того, территориальная экспансия была запланирован???Восточно?Анатолии. \nТа?ка?Османская Империя ?наст?ще?время находилась ?дипломатическо?изоляци? русски?план?завоеван? могл?стат?реальным?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
