EVT1914_2145502_DESC;The Entente managed to conquer Constantinople. The heavily centralized Ottoman Empire is now shattering.;L'Entente est parvenue ?conquйrir Constantinople. L'Empire Ottoman, extrкmement centralis? se dйsagrиge dйj?;Der Entente gelang es, Konstantinopel zu erobern. Das stark zentralistisch organisierte osmanische Reich ist in seinen Grundfesten erschьttert.;Entencie udaіo si?podbi?Konstantynopol. Silnie scentralizowane paсstwo Ottomanуw drїy w posadach.;Las fuerzas de la entente marchan ahora por Constantinopla, nuestra capital Imperial desde que la conquistamos a los Bizantinos en 1453, debido a casi todas las instituciones de nuestro gobierno estбn en la ciudad, hemos perdido la capacidad de gobernar el Imperio.;L'Intesa ?riuscita a conquistare Costantinopoli. Il pesantemente centralizzato Impero Ottomano si sta ora sfaldando;;;;;;Войска?'Антант? удалос?захватит?Константинопол?! Османско?импери?нанесено сокрушительное поражени?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
