EVT1914_2145514_DESC;Already during the Balkan Wars the European powers considered the partition of the Ottoman Empire. To save their Empire the Ottomans attempted to get into an alliance with any major power, but none of them was interested in an alliance with the sick Empire. Most members of the CUP (Committee of Union and Progress, the ruling party) favoured an alliance with France or Britain. Only a minority around Enver Pasha wanted to ally with the German Empire. Only the July Crisis prompted the German Empire to approach the Ottomans. In the end of July secret negotiations were held in Constantinople with respect to a defensive alliance against Russia. After Enver had offered the battleship Sultan Osman I (which was seized a day later by the British) the Germans agreed on 1st August to sign the offer of the Ottoman Empire and sealed the alliance on 2nd August. The two parties committed themselves to military assistance in case one of their countries being declared war by Russia. Since a day before the signing the German Empire declared war on Russia, the Ottomans were not obliged to assist. Although on the next day general mobilization was announced, the Ottoman Empire declared neutrality. The German military mission, headed by Otto Liman von Sanders, was scheduled to leave on August 1st, but it was agreed that the mission would remain in the Empire and that in times of war some posts in the highest military command level of Ottoman army should be assigned to German officers.\n§RNote: The signing of the defensive alliance is a prerequisite to make §Rthe Ottomans join the Central Powers. Should the defensive pact §Rnot be signed there would be no support from the German Empire §Rand §Rthere is the danger of a Russian declaration of war.;Dйj?durant les guerres balkaniques, les puissances europйennes considйrиrent la partition de l'Empire ottoman. Pour sauver leur empire, les Ottomans tentиrent de s'allier avec une grande puissance, mais aucune d'elles ne se montrait intйress?pour s'allier avec l'Empire malade. La plupart des membres du CUP (Comit?Union et Progrиs du parti au pouvoir) penchaient pour une alliance avec la France ou la Grande-Bretagne. Seule une minorit?autour Enver Pacha voulait s'allier avec l'Empire allemand. Seule la Crise de Juillet poussa l'Empire allemand ?approcher les Ottomans. A la fin de Juillet, des nйgociations secrиtes eurent lieu ?Constantinople , concernant une alliance dйfensive contre la Russie. Aprиs qu'Enver eu offert le cuirass?Sultan Osman Ier (qui fut saisi un jour plus tard par les Britanniques), les Allemands convinrent le 1er aoыt de signer l'offre de l'Empire ottoman, et scellиrent l'alliance le 2 aoыt. Les deux parties s'engagиrent ?une assistance militaire au cas o?l'un des deux pays se verraient dйclar?la guerre par la Russie. L'Empire allemand ayant dйclar?la guerre ?la Russie depuis la veille de la signature, les Ottomans ne se virent pas obligйs de les aider. Bien que la mobilisation gйnйrale ait йt?annoncйe, l'Empire ottoman dйclara sa neutralit?le lendemain. Il йtait prйvu que la mission militaire allemande dirigйe par Otto Liman von Sanders devait quitter le pays le 1er aoыt, mais il fut convenu que la mission reste dans l'Empire, et que certains des postes au plus haut niveau du commandement militaire ottoman soit attribuйs ?des officiers allemands en temps de guerre, \n§Remarque : La signature de l'alliance dйfensive est une condition sine qua non pour que §Rles Ottomans rejoignent les Puissances Centrales. Si le pacte dйfensif §Rn'est pas sign? il n'y aura pas de soutien de l'Empire allemand §Ret §Ril y aura danger d'une dйclaration de guerre russe.;Schon wдhrend der Balkankriege wдgten die europдischen Mдchte eine Zerschlagung und Aufteilung des osmanischen Reiches ab. Um das Reich zu bewahren, bemьhten sich die Osmanen mehrmals vergeblich um eine Allianz mit einer beliebigen GroЯmacht, doch niemand war an einer Allianz mit dem 'kranken Mann vom Bosporus' interessiert. Die meisten Mitglieder des Komitees fьr Einheit und Fortschritt (KEF, die herrschende Partei) bevorzugten eine Allianz mit Frankreich und GroЯbritannien. Lediglich eine Minderheit um Enver Pasha befьrwortete eine Allianz mit dem Deutschen Kaiserreich. Erst die Ermordung des цsterreichischen Thronfolgers Franz Ferdinand und die darauf folgende Julikrise, welche schlieЯlich im Ersten Weltkrieg mьnden sollte, bewegten das Deutsche Reich dazu, auf das osmanische Reich zuzugehen. Gegen Ende Juli wurden geheime Verhandlungen in Konstantinopel bezьglich eines Defensivabkommens gegen das Russische Zarenreich abgehalten.  Enver bot den Deutschen das Schlachtschiff 'Sultan Osman I' an (welches einen Tag spдter von den Briten beschlagnahmt wurde) und die Deutschen stimmten am 1. August einer Unterzeichnung des Geschenks und am 2. August einer Unterzeichnung des Defensivabkommens zu.  Beide Seiten verpflichteten sich zur gegenseitigen Hilfe im Falle einer Kriegserklдrung durch Russland. Da die Deutschen einen Tag zuvor dem Russischen Zarenreich den Krieg erklдrt hatten, waren die Osmanen vertragsrechtlich nicht zu einem Eintritt in den Krieg verpflichtet. Obwohl das Osmanische Reich seine Neutralitдt beteuerte, wurde am folgenden Tag die Generalmobilmachung angeordnet. Die deutsche Militдrmission unter Generalleutnant Otto Liman von Sanders, die eigentlich am 1. August das Land verlassen sollte, verblieb daraufhin im Reich und es wurde sich darauf verstдndigt, dass hohe Militдrpositionen in der osmanischen Armee an deutsche Offiziere vergeben weden sollten. \n§RHinweis: Die Unterzeichnung des Defensivabkommens ist eine Voraussetzung zum Beitritt des osmanischen Reiches zu den Mittelmдchten. Sollte das Defensivabkommen nicht unterzeichnet werden, so wьrde es keine Unterstьtzung durch das Deutsche Reich geben und die Gefahr einer russischen Kriegserklдrung wдre gro?  ;Ju?podczas Wojen Baіkaсskich mocarstwa europejskie rozwaїaіy podzia?Imperium Ottomaсskiego. Chc№c chroni?swoje imperium, Ottomanie d№їyli do sojuszu z jak№kolwiek potкga europejsk? ale їadna nie chciaіa si?wi№za?ukіadami z 'chorym czіowiekiem Europy'. Wiкkszoњж czіonkуw rz№dz№cej partii, CUP (Komitetu Unii i Postкpu), chciaіo sojuszu z Francj?lub Wielk?Brytani? Tylko nieliczni, zgromadzeni wokуі Enwera Paszy, pragnкli sojuszu z Cesarstwem Niemieckim. Dopiero Kryzys Lipcowy skіoni?Niemcуw do rozpoczкcia negocjacji z Ottomanami. Tajne rozmowy toczyіy si?w Konstantynopolu i dotyczyіy sojuszu defensywnego przeciwko Rosji. Po tym jak Enwer zaoferowa?pancernik Suіtan Osman I (ktуry dzie?p?niej zarekwirowali Brytyjczycy) Niemcom, zgodzili si?oni, 1 sierpnia, podpisa?sojusz, ostatecznie zawarty 2 sierpnia 1914 r. Oba paсstwa zobowi№zaіy si?do wsparcia wojskowego w przypadku deklaracji wojny ze strony Rosji. Jakkolwiek nastкpnego dnia ogіoszono powszechn?mobilizacj? Imperium Ottomaсskie zadeklarowaіo neutralnoњж. Niemiecka misja wojskowa, prowadzona przez Otto Limana von Sandersa, miaіa opuњci?Turcj?1 sierpnia, ale zdecydowano o jej przedіuїenia oraz przyznania Niemcom podczas wojny rуїnych kluczowych stanowisk w krкgach kierowniczych armii tureckiej.\n§RUwaga: Podpisanie defensywnego sojuszu jest warunkiem wstкpnym, aby §ROttomanowie doі№czyli do paсstw centralnych. Jeњli sojusz defensywny §Rnie zostanie zawarty, Cesarstwo Niemieckie nie udzieli pomocy §R, a §RRosja moїe wypowiedzie?Turcji wojn?;Ya durante las Guerra de los Balcanes las potencias europeas consideraban la particiуn del Imperio Otomano. Para salvar su Imperio los otomanos intentaron una alianza con una gran potencia, pero ninguna de ellas estaba interesada en una alianza con el Imperio. La mayorнa de los miembros del CUP (Comit?de Uniуn y Progreso, el partido gobernante) querнan una alianza con Francia o Gran Bretaсa. Solo una minorнa querнa aliarse con el Imperio Alemбn. Solo la Crisis de Julio estimul?al Imperio Alemбn a acercarse a los otomanos. A finales de julio negociaciones secretas fueron mantenidas en Constantinopla con respecto a una alianza defensiva contra Rusia. Enver habнa ofrecido el acorazado Sultбn Osman I (que fue incautado un dнa despuйs por los britбnicos) los alemanes aceptaron el 1 de agosto a firmar la oferta del Imperio Otomano y cerraron la alianza el 2 de agosto. Las dos partes se comprometieron a asistencia militar en caso de que a uno de los paнses se le fuese declarada la guerra por Rusia. Un dнa antes de la firma, el Imperio Alemбn declar?la guerra a Rusia, los otomanos no fueron obligados a asistir. Aunque el dнa siguiente una movilizaciуn general fue anunciada, el Imperio Otomano declar?la neutralidad. La comisiуn militar alemana, liderada por Otto Liman von Sanders, fue programado su salida el 1 de agosto, pero se acept?que la comisiуn permaneciese en el Imperio y que en tiempos de guerra algunos puestos en el comando militar superior deberнan ser asignados a oficiales alemanes.\n§RNota: La firma de la alianza defensiva es un prerrequisito para hacer §Ra los otomanos unirse a las Potencias Centrales. Si el pacto defensivo §Rno es firmado no habrнa apoyo del Imperio Alemбn §Ry §Rhay peligro de la declaraciуn de guerra rusa.;Gi?durante le Guerre Balcaniche le potenze Europee avevano considerato la spartizione dell'Impero Ottomano. Per salvare l'Impero, gli Ottomani cercarono di allearsi con una qualunque potenza, ma nessuna di loro era interessata ad allearsi con l'Impero Malato. Molti membri del CUP (Comitato per Unione e Progresso, il partito regnante) preferivano un'alleanza con Francia o Regno Unito. Solo una minoranza intorno a Enver Pasha voleva allearsi con l'Impero Tedesco. Solo la Crisi di Luglio spinse l'Impero Tedesco ad approcciare gli Ottomani. Alla fine di luglio, negoziati segreti furono tenuti a Costantinopoli a riguardo di un'alleanza difensiva contro la Russia. Dopo che Enver offr?la corazzata Sultan Osman I (requisita il giorno dopo dai Britannici) i Tedeschi accettarono la proposta degli Ottomani il 1 Agosto e firmarono l'allenza il 2 Agosto. I due paesi si impegnarono ad assistersi militarmente se la Russia avesse dichiarato guerra a uno dei due. Dato che il giorno prima della firma l'Impero Tedesco aveva dichiarato guerra alla Russia, gli Ottomani non erano obbligati a partecipare. Sebbene il giorno dopo fu proclamata la mobilitazione generale, l'Impero Ottomano si dichiar?neutrale. La missione militare tedesca, guidata da Otto Liman von Sanders, avrebbe dovuto lasciare il paese il 1 Agosto, ma fu deciso di continuarla e che in tempo di guerra agli ufficiali tedeschi sarebbero stati affidati incarichi nelle pi?alte sfere militari dell'esercito Ottomano.\n§RNota: la firma di un'alleanza difensiva ?un prerequisito per far §Rentrare gli Ottomani negli Imperi Centrali. Se l'allenza difensiva §Rnon §Rsar?firmata, non ci sar?supporto da parte dei tedeschi e ci §Rsarebbe §Ril §Rrischio di una dichiarazione di guerra russa.;;;;;;Уж?во время Балканских войн европейски?держав?подумывали на?разделом Османско?импери? Чтоб?сохранит?свою Импери?Османы пытались вступить ?союз ?любо?крупно?державой, но ни одна из ни?не бы?заинтересована ?союз?со слабой империей. Большинств?членов CUP (Комите?Единение ?прогресс, правящая парт?) выступал?за союз ?Францией ил?Великобритание? Лишь меньшинств?сосредоточенно?вокруг Энве?пашы хотело вступить ?союз ?Германской империей. Только июльский кризис побуди?Германскую Импери?обратить? ?Османско?Импери? ?конц?ию? секретны?переговоры были проведен??Константинопол??отношени?оборонительног?союз?против России. Посл?этог?Энве?предложи?линкор Султан Осма?I (которы?бы?захвачен чере?день британцами), 1 август?немц?согласилис?подписат?предложени?Османско?импери??заключил?ал?нс на 2 август? Об?сторон?взяли на се? обязательство военно?помощи ?случае, если одно?из стра?об?ви?войн?Росс?. Та?ка? за день до подписан? Германск? империя об?вила войн?России, турк?не были обязаны помогать. Хо? на следующи?день была об?вленна генеральная мобилизация, Османская империя об?вила нейтралите? Немецк? военная мисс? во глав??Отто Лима?фо?Сандер? должна была отбыть 1 август? но было решено, чт?мисс? останется ?Импери? ?чт?во время войн?на некоторы?должност??высшем военно?командно?уровне османско?арми?должны быть назначен?немецкие офицер?\n §RПримечание:. подписание оборонительног?союз?являет? необходимы?условием, чтоб?сделат?§Rосмано?союзниками Центральны?держав. ?случае, если оборонительный догово?§Rне буде?подписан, не буде?поддержк?со сторон?Германской импери?§R?§Rесть возможност?об?влен? Россие?войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2145514_NAME;Propose a defensive alliance to Germany?;Proposer une alliance dйfensive ?l'Allemagne ?;Dem Deutschen Reich ein Defensivbьndnis vorschlagen?;Propozycja sojuszu obronnego z Niemcami?;їProponer una alianza defensiva a Alemania?;Proponi un'alleanza difensiva alla Germania?;;;;;;Предложить оборонительный союз Германии?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2145515_DESC;Already during the Balkan Wars the European powers considered the partition of the Ottoman Empire. To save their Empire the Ottomans attempted to get into an alliance with any major power, but none of them was interested in an alliance with the sick Empire. Most members of the CUP (Committee of Union and Progress, the ruling party) favoured an alliance with France or Britain. Only a minority around Enver Pasha wanted to ally with the German Empire. Only the July Crisis prompted the German Empire to approach the Ottomans. In the end of July secret negotiations were held in Constantinople with respect to a defensive alliance against Russia. After Enver had offered the battleship Sultan Osman I (which was seized a day later by the British) the Germans agreed on 1st August to sign the offer of the Ottoman Empire and sealed the alliance on 2nd August. The two parties committed themselves to military assistance in case one of their countries being declared war by Russia. Since a day before the signing the German Empire declared war on Russia, the Ottomans were not obliged to assist. Although on the next day general mobilization was announced, the Ottoman Empire declared neutrality. The German military mission, headed by Otto Liman von Sanders, was scheduled to leave on August 1st, but it was agreed that the mission would remain in the Empire and that in times of war some posts in the highest military command level of Ottoman army should be assigned to German officers.;Dйj?durant les guerres balkaniques, les puissances europйennes considйrиrent la partition de l'Empire ottoman. Pour sauver leur empire, les Ottomans tentиrent de s'allier avec une grande puissance, mais aucune d'elles ne se montrait intйress?pour s'allier avec l'Empire malade. La plupart des membres du CUP (Comit?Union et Progrиs du parti au pouvoir) penchaient pour une alliance avec la France ou la Grande-Bretagne. Seule une minorit?autour Enver Pacha voulait s'allier avec l'Empire allemand. Seule la Crise de Juillet poussa l'Empire allemand ?approcher les Ottomans. A la fin de Juillet, des nйgociations secrиtes eurent lieu ?Constantinople , concernant une alliance dйfensive contre la Russie. Aprиs qu'Enver eu offert le cuirass?Sultan Osman Ier (qui fut saisi un jour plus tard par les Britanniques), les Allemands convinrent le 1er aoыt de signer l'offre de l'Empire ottoman, et scellиrent l'alliance le 2 aoыt. Les deux parties s'engagиrent ?une assistance militaire au cas o?l'un des deux pays se verraient dйclar?la guerre par la Russie. L'Empire allemand ayant dйclar?la guerre ?la Russie depuis la veille de la signature, les Ottomans ne se virent pas obligйs de les aider. Bien que la mobilisation gйnйrale ait йt?annoncйe, l'Empire ottoman dйclara sa neutralit?le lendemain. Il йtait prйvu que la mission militaire allemande dirigйe par Otto Liman von Sanders devait quitter le pays le 1er aoыt, mais il fut convenu que la mission reste dans l'Empire, et que certains des postes au plus haut niveau du commandement militaire ottoman soit attribuйs ?des officiers allemands en temps de guerre, \n§Remarque : La signature de l'alliance dйfensive est une condition sine qua non pour que §Rles Ottomans rejoignent les Puissances Centrales. Si le pacte dйfensif §Rn'est pas sign? il n'y aura pas de soutien de l'Empire allemand §Ret §Ril y aura danger d'une dйclaration de guerre russe.;Schon wдhrend der Balkankriege wдgten die europдischen Mдchte eine Zerschlagung und Aufteilung des osmanischen Reiches ab. Um das Reich zu bewahren, bemьhten sich die Osmanen mehrmals vergeblich um eine Allianz mit einer beliebigen GroЯmacht, doch niemand war an einer Allianz mit dem 'Kranken Mann vom Bosporus' interessiert. Die meisten Mitglieder des Komitees fьr Einheit und Fortschritt (KEF, die herrschende Partei) bevorzugten eine Allianz mit Frankreich und GroЯbritannien. Lediglich eine Minderheit um Enver Pasha befьrwortete eine Allianz mit dem Deutschen Kaiserreich. Erst die Ermordung des цsterreichischen Thronfolgers Franz Ferdinand und die darauf folgende Julikrise, welche schlieЯlich im Ersten Weltkrieg mьnden sollte, bewegten das Deutsche Reich dazu, auf das osmanische Reich zuzugehen. Gegen Ende Juli wurden geheime Verhandlungen in Konstantinopel bezьglich eines Defensivabkommens gegen das Russische Zarenreich abgehalten.  Enver bot den Deutschen das Schlachtschiff 'Sultan Osman I' an (welches einen Tag spдter von den Briten beschlagnahmt wurde) und die Deutschen stimmten am 1. August einer Unterzeichnung des Geschenks und am 2. August einer Unterzeichnung des Defensivabkommens zu.  Beide Seiten verpflichteten sich zur gegenseitigen Hilfe im Falle einer Kriegserklдrung durch Russland. Da die Deutschen einen Tag zuvor dem Russischen Zarenreich den Krieg erklдrt hatten, waren die Osmanen vertragsrechtlich nicht zu einem Eintritt in den Krieg verpflichtet. Obwohl das osmanische Reich seine Neutralitдt beteuerte, wurde am folgenden Tag die Generalmobilmachung angeordnet. Die deutsche Militдrmission unter Generalleutnant Otto Liman von Sanders, die eigentlich am 1. August das Land verlassen sollte, verblieb daraufhin im Reich und es wurde sich darauf verstдndigt, dass hohe Militдrpositionen in der osmanischen Armee an deutsche Offiziere vergeben weden sollten. ;Ju?podczas Wojen Baіkaсskich mocarstwa europejskie rozwaїaіy podzia?Imperium Ottomaсskiego. Chc№c chroni?swoje imperium, Ottomanie d№їyli do sojuszu z jak№kolwiek potкga europejsk? ale їadna nie chciaіa si?wi№za?ukіadami z 'chorym czіowiekiem Europy'. Wiкkszoњж czіonkуw rz№dz№cej partii, CUP (Komitetu Unii i Postкpu), chciaіo sojuszu z Francj?lub Wielk?Brytani? Tylko nieliczni, zgromadzeni wokуі Enwera Paszy, pragnкli sojuszu z Cesarstwem Niemieckim. Dopiero Kryzys Lipcowy skіoni?Niemcуw do rozpoczкcia negocjacji z Ottomanami. Tajne rozmowy toczyіy si?w Konstantynopolu i dotyczyіy sojuszu defensywnego przeciwko Rosji. Po tym jak Enwer zaoferowa?pancernik Suіtan Osman I (ktуry dzie?p?niej zarekwirowali Brytyjczycy) Niemcom, zgodzili si?oni, 1 sierpnia, podpisa?sojusz, ostatecznie zawarty 2 sierpnia 1914 r. Oba paсstwa zobowi№zaіy si?do wsparcia wojskowego w przypadku deklaracji wojny ze strony Rosji. Jakkolwiek nastкpnego dnia ogіoszono powszechn?mobilizacj? Imperium Ottomaсskie zadeklarowaіo neutralnoњж. Niemiecka misja wojskowa, prowadzona przez Otto Limana von Sandersa, miaіa opuњci?Turcj?1 sierpnia, ale zdecydowano o jej przedіuїenia oraz przyznania Niemcom podczas wojny rуїnych kluczowych stanowisk w krкgach kierowniczych armii tureckiej.\n;Ya durante las Guerra de los Balcanes las potencias europeas consideraban la particiуn del Imperio Otomano. Para salvar su Imperio los otomanos intentaron una alianza con una gran potencia, pero ninguna de ellas estaba interesada en una alianza con el Imperio. La mayorнa de los miembros del CUP (Comit?de Uniуn y Progreso, el partido gobernante) querнan una alianza con Francia o Gran Bretaсa. Solo una minorнa querнa aliarse con el Imperio Alemбn. Solo la Crisis de Julio estimul?al Imperio Alemбn a acercarse a los otomanos. A final de julio negociaciones secretas fueron mantenidas en Constantinopla con respecto a una alianza defensiva contra Rusia. Enver habнa ofrecido el acorazado Sultбn Osman I (que fue incautado un dнa despuйs por los britбnicos) los alemanes aceptaron el 1 de agosto a firmar la oferta del Imperio Otomano y cerraron la alianza el 2 de agosto. Las dos partes se comprometieron a asistencia militar en caso de que a uno de los paнses se le fuese declarada la guerra por Rusia. Un dнa antes de la firma, el Imperio Alemбn declar?la guerra a Rusia, los otomanos no fueron obligados a asistir. Aunque el dнa siguiente una movilizaciуn general fue anunciada, el Imperio Otomano declar?la neutralidad. La comisiуn militar alemana, liderada por Otto Liman von Sanders, fue programada su salida el 1 de agosto, pero se acept?que la comisiуn permaneciese en el Imperio y que en tiempos de guerra algunos puestos en el comando militar superior deberнan ser asignados a oficiales alemanes.\n;Gi?durante le Guerre Balcaniche le potenze Europee avevano considerato la spartizione dell'Impero Ottomano. Per salvare l'Impero, gli Ottomani cercarono di allearsi con una qualunque potenza, ma nessuna di loro era interessata ad allearsi con l'Impero Malato. Molti membri del CUP (Comitato per Unione e Progresso, il partito regnante) preferivano un'alleanza con Francia o Regno Unito. Solo una minoranza intorno a Enver Pasha voleva allearsi con l'Impero Tedesco. Solo la Crisi di Luglio spinse l'Impero Tedesco ad approcciare gli Ottomani. Alla fine di luglio, negoziati segreti furono tenuti a Costantinopoli a riguardo di un'alleanza difensiva contro la Russia. Dopo che Enver offr?la corazzata Sultan Osman I (requisita il giorno dopo dai Britannici) i Tedeschi accettarono la proposta degli Ottomani il 1 Agosto e firmarono l'allenza il 2 Agosto. I due paesi si impegnarono ad assistersi militarmente se la Russia avesse dichiarato guerra a uno dei due. Dato che il giorno prima della firma l'Impero Tedesco aveva dichiarato guerra alla Russia, gli Ottomani non erano obbligati a partecipare. Sebbene il giorno dopo fu proclamata la mobilitazione generale, l'Impero Ottomano si dichiar?neutrale. La missione militare tedesca, guidata da Otto Liman von Sanders, avrebbe dovuto lasciare il paese il 1 Agosto, ma fu deciso di continuarla e che in tempo di guerra agli ufficiali tedeschi sarebbero stati affidati incarichi nelle pi?alte sfere militari dell'esercito Ottomano.;;;;;;Уж?во время Балканских войн европейски?держав?подумывали на?разделом Османско?импери? Чтоб?сохранит?свою Импери?Османы пытались вступить ?союз ?любо?крупно?державой, но ни одна из ни?не бы?заинтересована ?союз?со слабой империей. Большинств?членов CUP (Комите?Единение ?прогресс, правящая парт?) выступал?за союз ?Францией ил?Великобритание? Лишь меньшинств?сосредоточенно?вокруг Энве?пашы хотело вступить ?союз ?Германской империей. Только июльский кризис побуди?Германскую Импери?обратить? ?Османско?импери? ?конц?ию? секретны?переговоры были проведен??Константинопол??отношени?оборонительног?союз?против России. Посл?этог?Энве?предложи?линкор Султан Осма?I (которы?бы?захвачен чере?день британцами), 1 август?немц?согласилис?подписат?предложени?Османско?импери??заключил?ал?нс на 2 август? Об?сторон?взяли на се? обязательство военно?помощи ?случае, если одно?из стра?об?ви?войн?Росс?. Та?ка? за день до подписан? Германск? империя об?вила войн?России, турк?не были обязаны помогать. Хо? на следующи?день была об?вленна генеральная мобилизация, Османская империя об?вила нейтралите? Немецк? военная мисс? во глав??Отто Лима?фо?Сандер? должна была отбыть 1 август? но было решено, чт?мисс? останется ?Импери? ?чт?во время войн?на некоторы?должност??высшем военно?командно?уровне османско?арми?должны быть назначен?немецкие офицер?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
