EVT1914_2145516_DESC;To maintain the superiority over the Argentine fleet the Brazilian government had ordered a battleship from the British shipyard 'Armstrong' in 1910. The ship was launched in 1913, but due to economic reasons Brazil decided to sell the semi-finished ship to the Ottoman Empire. The ship was named after the founder of the Ottoman Empire: 'Sultan Osman I'. At the same time there was already another battleship for the Ottoman Empire under construction: the 'Reshadiye'. Both ships were supposed to be transferred to the Ottoman navy on 2nd August 1914. However, because of the July Crisis, on 31st July the British government agreed with the proposal of the First Lord of the Admiralty Winston Churchill to confiscate the warships for the Royal Navy, since they were considered useful for the impending war. Soon the battleships were incorporated into the Royal Navy and renamed resp. to 'Agincourt' and to 'Erin'. The Ottoman Empire never got back their payments. The negotiations for the secret alliance between Germany and the Ottoman Empire were close the abandonment in late July. The German ambassador Wangenheim demanded a significant contribution and on 1st August the Ottoman minister of war Enver Pasha offered the battleship Sultan Osman I. Wangenheim agreed and accepted the alliance. It must be noted that the Ottoman government was informed of the British plans of confiscation since the 31st July.\n§RNote: If the British don't seize the ships and the Sultan Osman I will §Rnot be transferred to the German Empire, you would risk the German §REmpire breaking all relations with the Ottomans. Therefore, §Ran §Ralliance with the Central Powers would be no longer possible.;Afin de maintenir la supйriorit?sur la flotte argentine, le gouvernement brйsilien commanda un navire de guerre au chantier naval britannique Armstrong en 1910. Le navire, qui devait кtre baptis?'Rio de Janeiro', fut lanc?en 1913. Pour des raisons йconomiques, le Brйsil dйcida de vendre le navire ?moiti?fini ?l'Empire ottoman. Le navire fut baptis?d'aprиs le fondateur de l'Empire ottoman, le 'Sultan Osman I '. Dans le mкme temps, il y avait dйj?un autre cuirass?de l'Empire ottoman en construction, le 'Reshadiye'. Les deux navires йtaient censйs кtre transfйrйs ?la marine ottomane le 2 aoыt 1914.\nCependant, en raison du dйveloppement de la Crise de Juillet, le 31 Juillet, le gouvernement britannique accepta la proposition du Premier Lord de l'Amiraut? Winston Churchill, et confisqua les navires de guerre au profit de la Royal Navy, au prйtexte qu'ils йtaient jugйs utiles pour la guerre imminente contre l'Empire allemand. Bientфt, les cuirassйs furent incorporйs dans la Royal Navy, et rebaptisйs respectivement 'Azincourt'et 'Erin'. L'Empire ottoman ne reзut jamais les paiements en retour. Les nйgociations en vue d'une alliance secrиte entre l'Allemagne et l'Empire ottoman furent proches de l'abandon ?la fin juillet. L'ambassadeur allemand, Wangenheim, demandait une contribution significative, ?la suite de quoi le ministre ottoman de la guerre Enver Pacha offrit le cuirass?Sultan Osman I le 1er aoыt. Wangenheim accepta l'alliance. Il faut noter que le gouvernement ottoman avait йt?inform?des plans britanniques de confiscation dиs le 31 juillet\n§RRemarque : Si les Britanniques ne saisissent pas les navires et si le Sultan Osman I n'est §Rpas transfйr??l'Empire allemand, vous risquez que §Rl'Empire allemand brise toutes les relations avec les Ottomans. Par consйquent §Rune §R alliance avec les Puissances Centrales ne serait plus possible.;Um der argentinischen Flotte weiterhin ьberlegen zu sein, bestellte die brasilianische Regierung im Jahre 1910 ein Kriegsschiff bei der britischen Armstrong-Werft. Der Bau des Schlachtschiffs wurde 1913 begonnen. Aufgrund wirtschaftlicher Schwierigkeiten verkaufte Brasilien das halbfertige Schiff jedoch an das osmanische Reich, wo es nach dem Grьnder des Reiches 'Sultan Osman I.' benannt wurde. Zur selben Zeit war bereits ein weiteres Kriegsschiff fьr das osmanische Reich im Bau: die 'Reshadiye'. Beide Schiffe sollten am 2. August 1914 dem osmanischen Reich ьberstellt werden. Die Julikrise verleitete die britische Regierung am 31. Juli jedoch dazu, dem Rat von Marineminister Churchill zu folgen und beide Schiffe fьr die Royal Navy zu konfiszieren, da sie fьr den herannahenden Krieg als nьtzlich angesehen wurden. Die Kriegsschiffe wurden kurz darauf unter den Namen 'Agincourt' und 'Erin' in die Royal Navy integriert. Das osmanische Reich bekam seine Zahlungen fьr die beiden Schiffe nie zurьck.  Die Verhandlungen um eine geheime Allianz zwischen dem Deutschen Kaiserreich und dem osmanischen Reich waren Ende Juli fast abgeschlossen. Der deutsche Botschafter Wangenheim verlangte von den Osmanen eine signifikante Unterstьtzung fьr die Kriegsanstrengungen und der osmanische Kriegsminister Enver Pascha bot den Deutschen die 'Sultan Osman I' als Geschenk an. Wangenheim stimmte zu und akzeptierte das Allianzangebot. Es ist hierbei festzuhalten, dass die osmanische Regierung bereits am 31. Juli von den Plдnen der Briten zur Beschlagnahmung der 'Sultan Osman I' wusste. \n§RHinweis: Wenn die Briten die beiden Schiffe nicht beschlagnahmen und die 'Sultan Osman I' Deutschland nicht versprochen wird, so riskieren Sie einen Abbruch der Beziehungen zwischen Deutschland und dem osmanischen Reich. Eine Allianz mit den Mittelmдchten wдre nicht lдnger mцglich.;Aby utrzyma?przewag?nad flot?argentyсsk? rz№d Brazylii zamуwi?w 1910 r. z brytyjskiej stoczni 'Armstrong' pancernik. Okrкt, ktуry nazwano 'Rio de Janeiro', zaczкto budowa?w 1913 r. Z uwagi na czynniki ekonomiczne, Brazylia zdecydowaіa si?sprzeda?nieukoсczony okrкt Imperium Ottomaсskiemu. Tam nazwano go na czeњж zaіoїyciela Imperium: 'Suіtan Osman I' . W tym czasie konstruowano dla Imperium Ottomaсskiego drugi pancernik: 'Reshadiye'. Oba okrкty miaіy by?przekazane marynarce ottomaсskiej 2 sierpnia 1914 r.\nZ uwagi na rozwуj wypadkуw w czasie Kryzysu Lipcowego, 31 lipca rz№d brytyjski przysta?na propozycj?Pierwszego Lorda Admiralicji, Winstona Churchilla, aby skonfiskowa?okrкty na rzecz brytyjskiej Marynarki Krуlewskiej, poniewa?mogіy by?przydatne w nadchodz№cej wojnie z Niemcami. 2 sierpnia, na pуі godziny przed rozpoczкciem ceremonii przekazania, poinformowano wizytuj№cy stoczni?zespуі ottomaсski pod kierownictwem kapitana Raufa Beja, їe okrкty bкd?skonfiskowane. Wkrуtce pancerniki staіy si?rzeczywiњcie cz?ci?marynarki brytyjskiej pod nazwami 'Agincourt' i 'Erin'. Imperium Ottomaсskie nigdy nie odzyskaіo swoich pіatnoњci. Negocjacje dotycz№ce tajnego sojuszu miкdzy Niemcami i Imperium Ottomaсskim byіy bliskie zerwania w koсcu lipca. Niemiecki ambasador Wangenheim domaga?si?pokaџnej kontrybucji i 1 sierpnia ottomaсski minister wojny, Enwer Pasza, zaoferowa?pancernik Suіtan Osman I. Wangenheim przysta?na propozycj?i sojusz zawarto. Trzeba zauwaїy? їe rz№d ottomaсski wiedzia?ju?o brytyjskich planach konfiskaty okrкtu od 31 lipca.\n§RUwaga: Jeњli Brytyjczycy nie skonfiskuj?okrкtуw, a Suіtan Osman I §Rnie bкdzie przekazany Cesarstwu Niemieckiemu, istnieje ryzyko, їe Cesarstwo §RNiemieckie zerwie wszelkie kontakty dyplomatyczne z Ottomanami. Tym §Rsamym, §Rsojusz z paсstwami centralnymi nie bкdzie ju?moїliwy.;Para mantener la superioridad sobre la flota argentina, el gobierno brasileсo ha ordenado un acorazado al astillero britбnico 'Armstrong' en 1910. El barco fue fletado en 1913, pero debido a razones econуmicas, Brasil decidi?vender el casi terminado barco al Imperio Otomano. El barco fue llamado como el fundador del Imperio Otoman: 'Sultбn Osman I'. Al mismo tiempo, habнa otro acorazado para el Imperio Otomano que estaba bajo construcciуn: el 'Reshadiye'. Ambos barcos serнan transferidos a la armada otomana el 2 de agosto de 1914. Sin embargo, debido al desarrollo de la Crisis de Julio el 31 de julio, el gobierno britбnico acept?la propuesta del Primer Lord del Almirantazgo Winston Churchill de confiscar los buques de guerra para la Armada Real, porque eran considerados ъtiles para la inminente guerra contra el Imperio Alemбn. El 2 de agosto, media hora antes de la ceremonia de traspaso, la tripulaciуn otomana, liderada por el capitбn Rauf Bey, fue informada de que los buques eran requisados. Pronto los acorazados fueron incorporados en la Armada Real y renombrados respectivamente 'Agincourt' y 'Erin'. Al Imperio Otomano no se le devolvieron nunca los pagos. Las negociaciones para una alianza secreta entre Alemania y el Imperio Otomano estaban cerca de ser abandonadas a finales de julio. El embajador alemбn Wangenheim demand?una gran contribuciуn y el 1 de agosto el ministro de guerra otomano Enver Pasha ofreci?el acorazado Sultбn Osman I. Wangenheim acept?el barco y la alianza. Hay que seсalar que el gobierno otomano estaba informado de los planes de confiscaciуn britбnicos desde el 31 de julio.\n§RNota: Si los britбnicos no los incautan, los barcos §Rno serбn transferidos al Imperio Alemбn, arriesgarнas que el §RImperio Alemбn rompiese todas las relaciones con los otomanos. Por lo tanto, §Runa §Ralianza con las Potencias Centrales no ser?posible.;Per mantenere la superiorit?sulla flotta Argentina, il governo Brasiliano ordin?una corazzata dal cantiere navale Britannico 'Armstrong' nel 1910. La nave, che avrebbe dovuto essere chiamata 'Rio de Janeiro', fu lanciata nel 1913. A causa di ragioni economiche, il Brasile decise di vendere la nave semi-completa all'Impero Ottomano. La nave fu ribattezzata col nome del fondatore dell'Impero: 'Sultano Osman I'. Nello stesso periodo un'altra corazzata era in fase di costruzione per l'Impero Ottomano, la 'Reshadiye'. Entrambe le navi dovevano essere trasferite alla marina Ottomana il 2 agosot 1914.\nTuttavia, a causa della Crisi di Luglio, il 31 Luglio il governo Britannico accett?la proposta del Primo Lord dell'Ammiragliato Winston Churchill di confiscare le navi da guerra per la Marina Reale, dato che erano considerate utili per l'incombente guerra con la Germania. Subito le corazzate furono incorporate nella Marina Reale e rinominate rispettivamente 'Agincourt' e 'Erin'. L'Impero Ottomano non fu mai rimborsato. I negoziati per l'alleanza segreta tra Tedeschi e Ottomani erano vicine all'abbandono alla fine di Luglio. L'ambasciatore tedesco Wangenheim chiese un contributo significativo e il 1 Agosto il Ministro Ottomano per la Guerra Enver Pasha offr?la corazzata Sultano Osman I. Wangenheim accett?la proposta e l'alleanza. In realt?il governo Ottomano sapeva dei propositi britannici di confisca della navi sin dal 31 Luglio.\n§RNota: se i Britannici non requisiscono le navi e la Sultano Osman §RI §Rnon §Rviene trasferita ai tedeschi, ?possibile che i tedeschi rompano §Rtutte le relazioni con l'Impero Ottomano e perci?un'allenza §Rcon §Rgli §RImperi §RCentrali non sarebbe pi?possibile.;;;;;;Для поддержания превосходств?на?аргентинским флотом бразильско?правительств?заказало линкор ?британской верф?'Армстрон? ?1910 году. Корабл? которы?должен быть назван 'Ри?де-Жанейр? бы?заложе??1913 году. ?связи ?экономическими причинам?Бразил? решила продат?на половину готовы?корабл?Османско?импери? Корабл?бы?назван ?чест?основате? Османско?импери? 'Султан Осма?I '. ?то же время уж?строил? другой линкор для Османско?импери?: 'Reshadiye'. Об?судн?должны были быть переданы ?Османско?флот?на 2 август?1914 года. \nТа?ил?инач? ?связи ?развитие?июльског?кризис? 31 ию? британское правительств?согласилос??предложением Первог?лорд?Адмиралтейства Уинстона Черчил? ?конфискаци?кораблей для военно-морского флот? та?ка?он?считаются полезным?для предст?ще?войн?против Германской Импери? Вскоре корабл?были включены ?состав военно-морского флот??переименован соот? на 'Agincourt' ?'Erin'. Османская империя никогд?не получила обратн?свои платеж? Переговоры ?тайном союз?межд?Германие??Османско?импери?были близки ?провал??конц?ию?. Немецкий посо?Вангенхайм требовал значительных средст??на 1 август?Османско?военны?минист?Энве?паша предложи?линкор Султан Осма?I. Вангенхайм согласил? ?заключил ал?нс. Следуе?отметить, чт?Османско?правительств?было проинформировано ?британских планах конфискаци??31 ию? \n §RПримечание:. Если англичан?не захватя?корабл??Султан Осма?не §Rбуде?переда?Германской Импери? вы рискуете разрывом §Rдипломатически?относшений османо??Германие? Таки?образо? §Rсоюз§R ?Центральными державам?буде?невозможны?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
