EVT1914_2145517_DESC;To maintain the superiority over the Argentine fleet the Brazilian government had ordered a battleship from the British shipyard 'Armstrong' in 1910. The ship was launched in 1913, but due to economic reasons Brazil decided to sell the semi-finished ship to the Ottoman Empire. The ship was named after the founder of the Ottoman Empire: 'Sultan Osman I'. At the same time there was already another battleship for the Ottoman Empire under construction: the 'Reshadiye'. Both ships were supposed to be transferred to the Ottoman navy on 2nd August 1914.\nHowever, because of the development of the July Crisis, on 31st July the British government agreed with the proposal of the First Lord of the Admiralty Winston Churchill to confiscate the warships for the Royal Navy, since they were considered useful for the impending war. Soon the battleships were incorporated into the Royal Navy and renamed resp. to 'Agincourt' and to 'Erin'. The Ottoman Empire never got back their payments.;Afin de maintenir la supйriorit?sur la flotte argentine, le gouvernement brйsilien commanda un navire de guerre au chantier naval britannique Armstrong en 1910. Le navire fut lanc?en 1913. Pour des raisons йconomiques, le Brйsil dйcida de vendre le navire ?moiti?fini ?l'Empire ottoman. Le navire fut baptis?d'aprиs le fondateur de l'Empire ottoman, le 'Sultan Osman I '. Dans le mкme temps, il y avait dйj?un autre cuirass?de l'Empire ottoman en construction, le 'Reshadiye'. Les deux navires йtaient censйs кtre transfйrйs ?la marine ottomane le 2 aoыt 1914.\nCependant, en raison du dйveloppement de la Crise de Juillet, le 31 Juillet, le gouvernement britannique accepta la proposition du Premier Lord de l'Amiraut? Winston Churchill, et confisqua les navires de guerre au profit de la Royal Navy, au prйtexte qu'ils йtaient jugйs utiles pour la guerre imminente contre l'Empire allemand. Bientфt, les cuirassйs furent incorporйs dans la Royal Navy, et rebaptisйs respectivement 'Azincourt'et 'Erin'. L'Empire ottoman ne reзut jamais les paiements en retour. Le dernier avait йt?vers?fin juillet.;Um der argentinischen Flotte weiterhin ьberlegen zu sein, bestellte die brasilianische Regierung im Jahre 1910 ein Kriegsschiff bei der britischen Armstrong-Werft. Der Bau des Schlachtschiffs wurde 1913 begonnen. Aufgrund wirtschaftlicher Schwierigkeiten verkaufte Brasilien das halbfertige Schiff jedoch an das osmanische Reich, wo es nach dem Grьnder des Reiches 'Sultan Osman I' benannt wurde. Zur selben Zeit war bereits ein weiteres Kriegsschiff fьr das osmanische Reich im Bau: die 'Reshadiye'. Beide Schiffe sollten am 2. August 1914 dem osmanischen Reich ьberstellt werden. Die Julikrise verleitete die britische Regierung am 31. Juli jedoch dazu, dem Rat von Marineminister Churchill zu folgen und beide Schiffe fьr die Royal Navy zu konfiszieren, da sie fьr den herannahenden Krieg als nьtzlich angesehen wurden. Die Kriegsschiffe wurden kurz darauf unter den Namen 'Agincourt' und 'Erin' in die Royal Navy integriert. Das osmanische Reich bekam seine Zahlungen fьr die beiden Schiffe nie zurьck.  ;Aby utrzyma?przewag?nad flot?argentyсsk? rz№d Brazylii zamуwi?w 1910 r. z brytyjskiej stoczni 'Armstrong' pancernik. Okrкt, ktуry nazwano 'Rio de Janeiro', zaczкto budowa?w 1913 r. Z uwagi na czynniki ekonomiczne, Brazylia zdecydowaіa si?sprzeda?nieukoсczony okrкt Imperium Ottomaсskiemu. Tam nazwano go na czeњж zaіoїyciela Imperium: 'Suіtan Osman I' . W tym czasie konstruowano dla Imperium Ottomaсskiego drugi pancernik: 'Reshadiye'. Oba okrкty miaіy by?przekazane marynarce ottomaсskiej 2 sierpnia 1914 r.\nZ uwagi na rozwуj wypadkуw w czasie Kryzysu Lipcowego, 31 lipca rz№d brytyjski przysta?na propozycj?Pierwszego Lorda Admiralicji, Winstona Churchilla, aby skonfiskowa?okrкty na rzecz brytyjskiej Marynarki Krуlewskiej, poniewa?mogіy by?przydatne w nadchodz№cej wojnie z Niemcami. 2 sierpnia, na pуі godziny przed rozpoczкciem ceremonii przekazania, poinformowano wizytuj№cy 