EVT1914_2145520_NAME;SMS Goeben and SMS Breslau join the Ottomans' Navy;Les SMS Gњben et SMS Breslau rejoignent la marine ottomane.;Die Mittelmeerdivision schlieЯt sich der Osmanischen Flotte an;SMS Goeben i SMS Breslau doі№czaj?do marynarki ottomaсskiej;SMS Goeben y SMS Breslause se unen a la Armada Otomana;SMS Goeben e SMS Breslau incorporate nella Marina Ottomana;;;;;;Гебе? ?'Бресла? присоеди?ют? ?османскому флот?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2145521_DESC;Aware of his own weakness, the Ottoman Empire refused to comply the request of the German Empire to participate on the war on side of the Central Powers. Just one day after the signing of the secret pact with the German Empire on 2nd August 1914, the Ottoman Empire was mobilizing, although it was not obliged by this treaty to take part on war. For mobilization 21 days were estimated, but due to the poor transport system it wasn't yet completed in September.\nFirst the Ottoman Empire wanted to be ensured in the West. On 19th August a defensive alliance was concluded with Bulgaria. The same was attempted with Romania and Greece but the negotiations failed.\nThe Ottoman Empire made demands to the German Empire: they asked for money, equipment and personnel over and over again, declaring that they were necessary to go to war. The German Empire, near the end of its patience, considered to threaten with the withdrawal of the military mission, but the bombardment of Russian ports in the Black Sea by admiral Wilhelm Souchon, who acted officially as Ottoman commander, brought the events into action, whereby the Ottoman Empire was inevitably involved in the war.;Conscient de sa propre faiblesse, l'Empire ottoman refusa d'obtempйrer aux demandes de l'Empire allemand de participer ?la guerre aux cфtйs des Puissances Centrales. Juste un jour aprиs la signature du pacte secret avec l'Empire allemand le 2 Aoыt 1914, l'Empire ottoman mobilisa, mкme si il n'йtait pas tenu par ce trait?de prendre part ?la guerre. Pour mobiliser, 21 jours semblaient nйcessaires, mais d??un systиme de transport mйdiocre, la mobilisation n'йtait toujours pas achevйe en Septembre.\nAvant toute chose, l'Empire ottoman voulait кtre sыr du cфt?Ouest. Le 19 aoыt, une alliance dйfensive fut conclue avec la Bulgarie. La mкme chose fut tentйe avec la Roumanie et la Grиce, mais les nйgociations йchouиrent.\nL'Empire ottoman fit des demandes ?l'Empire allemand : Il demanda maintes et maintes fois de l'argent, de l'йquipement et du personnel, dйclarant que cel?йtait nйcessaire pour entrer en guerre. L'Empire allemand, ?bout de patience, pensa ?faire une menace par le biais du retrait de la mission militaire, mais le bombardement des ports russes de la mer Noire par l'Amiral Wilhelm Souchon, agissant officiellement en tant que commandant ottoman, dйclencha une cascade d'йvйnements qui impliqua inйvitablement l'Empire ottoman dans la guerre.;Im Bewusstsein seiner eigenen Schwдche verweigerte sich das Osmanische Reich den Bitten des Deutsches Reiches nachzukommen an der Seite der Mittelmдchte an dem Krieg teilzunehmen. Bereits einen Tag nach der Unterzeichnung des geheimen Paktes mit dem Deutschen Reich am 2. August 1914, begann das Osmanische Reich mit der Mobilisierung, obwohl es durch diesen nicht zur Kriegsteilnahme verpflichtet war. Veranschlagt waren dafьr 21 Tage, doch aufgrund des schlechten Transportsystems war die Mobilisierung noch im September nicht abgeschlossen.\nAuch wollten man sich im Westen erst abgesichert wissen. Mit Bulgarien wurde am 19. August ein defensives Bьndnis geschlossen. Mit Rumдnien und Griechenland wurde dasselbe versucht. Die Verhandlungen scheiterten aber.\nDas Osmanische Reich stellte immer wieder neue Forderungen an das Deutsche Reich nach Geld, Equipment und Personal, die es fьr den Kriegseintritt als notwendig deklarierte. Das Deutsche Reich, mit seiner Geduld am Ende, erwдgte mit dem Abzug der Militдrmission zu drohen, doch das Bombardement russischer Hдfen im Schwarzen Meer durch Admiral Wilhelm Souchon, der offiziell als osmanischer Kommandeur agierte, sollte die Ereignisse ins Rollen bringen, wodurch das Osmanische Reich unausweichlich in den Krieg hineingezogen werden musste.;Bкd№c њwiadom swoich sіaboњci, Imperium Ottomaсskie odmуwiіo podporz№dkowania si?planom Cesarstwa Niemieckiego, ktуre oczekiwaіo uczestnictwa w wojnie po stronie paсstw centralnych. Ju?nastкpnego dnia po podpisaniu tajnego paktu z Cesarstwem Niemieckim 2 sierpnia 1914 r., Imperium Ottomaсskie rozpoczкіo mobilizacj? chocia?nie byіo zobowi№zane tym traktatem do przyst№pienia do wojny. Na mobilizacj?przeznaczono 21 dni, ale z uwagi na sіab?infrastruktur?transportow? we wrzeњniu ci№gle jeszcze nie byіa zakoсczona.\nImperium Ottomaсskie, po pierwsze, chciaіo zabezpieczy?si?na zachodzie. 19 sierpnia zawarіo ukіad obronny z Buіgari? Podobne kroki podjкto w przypadku Rumunii i Grecji, ale w tych przypadkach negocjacje zawiodіy.\nW miкdzyczasie Imperium Ottomaсskie wystкpowaіo z ї№daniami wobec Cesarstwa Niemieckiego: chciaіo pieniкdzy, sprzкtu i personelu, twierdz№c wci№ї їe s?one niezbкdnym warunkiem przyst№pienia do wojny. Cesarstwo Niemieckie zbliїaіo si?ju?do kresu cierpliwoњci, planuj№c wycofa?swoj?misj?wojskow? ale zbombardowanie rosyjskich portуw przez admiraіa Wilhelma Souchona, wystкpuj№cego oficjalnie jako dowуdca ottomaсski, zmieniіo zupeіnie sytuacj? angaїuj№c Imperium Ottomaсskie bezpoњrednio w dziaіania wojenne.;Conociendo su propia debilidad, el Imperio Otomano rechaz?cumplir la peticiуn del Imperio Alemбn de participar en la guerra al lado de las Potencias Centrales. Un dнa despuйs de la firma del pacto secreto con el Imperio Alemбn el 2 de agosto de 1914, el Imperio Otomano se moviliz? aunque no estaba obligado a participar en la guerra. Se estimaron 21 dнas de movilizaciones, pero debido al pobre sistema de transporte no se complet?en septiembre.\nPrimero el Imperio Otomano querнa asegurarse en el Occidente. El 19 de agosto fue concluнda una alianza defensiva con Bulgarнa. Lo mismo fue intentado con Rumanнa y Grecia pero las negociaciones fallaron.\nEl Imperio Otomano hizo demandas al Imperio Alemбn: pidieron dinero, equipamiento y personal muchas veces, declarando que eran necesarios para ir a la guerra. El Imperio Alemбn, casi con la paciencia terminada, amenaz?con la retirada de la comisiуn militar, pero el bombardeo de puertos rusos en el Mar Negro por el almirante Wilhelm Souchon, que actu?como comandante otomano, llev?los eventos en acciуn, por lo cual el Imperio Otomano estaba inevitablemente envuelto en la guerra.;Cosciente della propria debolezza, l'Impero Ottomano si rifiut?di piegarsi alle richieste dell'Impero Tedesco di partecipare alla guerra insieme agli Imperi Centrali. Tuttavia, gi?il giorno seguente alla firma della patto segreto con la Germania del 2 Agosto 1914 l'Impero Ottomano dichiar?la mobilitazione generale, sebbene non obbligato dal trattato ad entrare in guerra. Per la mobilizatione furono stimati 21 giorni, ma a causa del pessimo sistema di trasporti questo non era stato ancora completato a Settembre.\nPer prima cosa gli Ottomani cercarono di migliorare la propria posizione in Occidente. Il 19 Agosto un'alleanza difensiva fu siglata con la Bulgaria. La stessa cosa su tentata con Romania e Grecia, ma i negoziati fallirono.\nL'Impero Ottomano fece delle richieste all'Impero Tedesco: chiese ripetutamente soldi, equipaggiamento e personale, dichiarando che erano necessari per l'entrata in guerra. L'Impero Tedesco, vicino a perdere la pazienza, decise di minacciare il ritiro della missione militare, ma il bombardamento dei porti Russi nel Mar Nero da parte dell'Ammiraglio Wilhelm Souchon, che ag?ufficialmente come comandante Ottomano, diede moto agli eventi, per cui l'Impero Ottomano fu trascinato inevitabilmente in guerra.;;;;;;Сознав? свою слабость, Османская империя отказалась выполнит?просьб?Германской импери?принять участи??войн?на сторон?Центральны?держав. Только один день посл?подписан? тайног?договора ?Германской империей на 2 август?1914 года ?Османско?импери?была об?влен?мобилизация, хо? османы не были обязаны по договору принять участи??войн? Мобилизаци?планировал?провести за 21 день, однако из-за плохой транспортной систем?он?ещ?не была завершен??сентябр? \nДля начала Османская империя хотела обезапасит?западное направлени? 19 август?оборонительный союз бы?заключен ?Болгарие? То же само?пытались заключит??Румынией ?Грецие? но переговоры не увенчались успехо?\nОсманская Империя требовал?от Германской импери?деньги, оборудование ?персонал, снов??снов? заяви? чт?эт?было необходимо, чтоб?начать войн? Германск? Империя, терпение которо?приходил??конц? жотела пригрозить отзыво?военно?миссии, но бомбардировк?портов России ?Черном море адмирало?Вильгельмо?Сушоно? которы?действовал официально ка?Османски?командир, подтолкнул?события, по которы?Османская империя неизбежн?была вовлечен??войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
