EVT1914_2145523_DESC;On 25nd October, after Enver's efforts had failed to persuade the Ottoman government to enter the war, he and Djemal Pasha (minister of the Navy) gave admiral Souchon ?who was under Ottoman supreme command ?the secret order to navigate his fleet into the Black Sea and to attack Russian ships. With this action an incident should be faked, so that the Russian Empire should be seem as the aggressor. Souchon disobeyed the orders as he wanted to force the Ottoman Empire to enter the war against its will and began to bombard Russian ports on 29th October. As planned Enver pretended the Ottoman Government that Souchon's fleet had only defended and had been attacked by the Russians. Over the next two days, there have been numerous meetings between the Ottoman government and the 'Committee of Union and Progress' to discuss the next step. The anti-war faction was still in the majority, and so it was decided to send an appeasement note to the Russian Empire. The Russian government ignored this note and declared war on the Ottoman Empire on the 2nd November.;Le 25 octobre, aprиs que les efforts d'Enver n'aient pas rйussi ?convaincre le gouvernement ottoman d'entrer en guerre, lui ainsi que Djemal Pacha (Ministre de la Marine) ordonna ?l'Amiral Souchon - qui йtait sous le commandement suprкme ottoman- l'ordre secret de mener sa flotte dans la mer Noire pour y attaquer les navires russes. Un incident devait кtre mont?de toutes piиces de telle sorte que l'Empire russe apparaisse comme йtant l'agresseur. Souchon dйsobйit aux ordres car il voulait forcer l'Empire ottoman ?entrer en guerre contre sa volont? et commenзa ?bombarder les ports russes le 29 octobre. Comme prйvu, Enver prйtendit vis-?vis du gouvernement ottoman que la flotte de Souchon n'avait fait que se dйfendre, et qu'elle avait йt?attaquйe par les Russes. Au cours des deux jours suivants, il y eut de nombreuses rйunions entre le gouvernement ottoman et le 'Comit?Union et Progrиs' pour discuter de la suite. La faction anti-guerre йtait encore majoritaire, et il fut donc dйcid?d'envoyer une note d'apaisement ?l'Empire russe. Le gouvernement russe ignora cette note, et dйclara la guerre ?l'Empire ottoman le 2 novembre.;Nachdem Envers Bemьhungen gescheitert waren die osmanische Regierung zum Kriegseintritt zu bewegen, gaben er und Djemal Pascha (Marineminister) am 25. Oktober dem unter osmanischen Oberbefehl stehenden Souchon den geheimen Befehl mit seiner Flotte das Schwarze Meer zu befahren und russische Schiffe anzugreifen. Es sollte damit ein Zwischenfall fingiert werden, wodurch das Russische Reich als Aggressor auftreten sollte. Souchon missachtete die Befehle um das Osmanische Reich auch gegen dessen Willen zum Kriegseintritt zu zwingen und begann am 29. Oktober russische Hдfen zu bombardieren. Enver gab der osmanischen Regierung wie geplant vor, die Flotte hдtte sich nur verteidigt und sei von den Russen angegriffen worden. In den nдchsten zwei Tagen gab es zahlreiche Treffen zwischen der osmanische Regierung und dem 'Komitee fьr Einheit und Fortschritt' um ьber den nдchsten Schritt zu beraten. Die Antikriegsfraktion war immer noch in der Mehrheit und so wurde beschlossen eine Beschwichtigungsnote an das Russische Reich zu senden. Die russische Regierung ignorierte diese Note  und erklдrte dem Osmanischen Reich am 2. November den Krieg.;25 paџdziernika, po tym jak wysiіki Enwera w celu przekonania ottomaсskiego rz№du do przyst№pienia do wojny speіzіy na niczym, da?on wraz z Dїemalem Pasz?(ministrem marynarki) tajny rozkaz admiraіowi Souchonowi - ktуry podlega?najwyїszemu dowуdztwu otomaсskiemu - aby wypіyn№і na Morze Czarne i zaatakowa?okrкty rosyjskie. Zaleci? by ta sytuacja wygl№daіa na incydent, ktуry bкdzie moїna zinterpretowa?jako agresj?Imperium Rosyjskiego. Souchon zignorowa?ten rozkaz, gdy?chcia?za wszelk?cen?zmusi?Imperium Ottomaсskie do przyst№pienia do wojny i rozpocz№і bombardowanie rosyjskich portуw 29 paџdziernika. Zgodnie z planem Enwer ogіosi? їe flota Souchona jedynie odpowiedziaіa zbrojnie na atak rosyjski. W ci№gu nastкpnych dwуch dni, odbyіy si?liczne spotkania miкdzy rz№dem ottomaсskim i 'Komitetem Unii i Postкpu' w celu okreњlenia nastкpnych krokуw. Frakcja antywojenna byіa wci№ї gуr? wiкc zdecydowano si?wysіa?not?іagodz№c?do Cesarstwa Rosyjskiego. Ale rz№d rosyjski zignorowa?t?not?i 2 listopada zadecydowa?o wypowiedzeniu wojny Imperium Ottomaсskiemu.;El 25 de octubre, despuйs que los esfuerzos de Enver hayan fallado en persuadir al gobierno otomano para entrar en la guerra, йl y Djemal Pasha (ministro de la Armada) dieron al almirante Souchon, que estaba bajo el comando supremo otomano, la orden secreta de llevar su flota al Mar Negro y atacar barcos rusos. Con esta acciуn un incidente debнa ser falseado, para que el Imperio Ruso pareciese el agresor. Souchon desobedeci?las ordenes porque querнa forzar al Imperio Otomano a entrar en la guerra contra su voluntad y empez?a bombardear puertos rusos el 29 de octubre. Como plane?Enver pretendi?que el gobierno otomano se creyese que la flota de Souchon solo se habнa defendido y que habнa sido atacada por los rusos. Durante los siguientes dos dнas, hubo numerosas reuniones entre el gobierno otomano y el Comit?de Uniуn y Progreso para discutir el siguiente paso. La facciуn anti-guerra era aъn mayoritarнa, y se decidi?en enviar una nota de apaciguamiento al Imperio Ruso. El gobierno ruso ignor?esta nota y declar?la guerra al Imperio Otomano el 2 de noviembre.;Il 25 ottobre, dopo il fallimento degli sforzi di Enver nel persuadere il governo Ottomano all'entrata in guerra, lui e Djemal Pasha (ministro della Marina) diedero all'Ammiraglio Souchon (che era sotto il comando Ottomano) l'ordine segreto di portare la sua flotta nel Mar Nero e attaccare navi russe. Inoltre si sarebbe dovuto simulare un incidente, in modo da far sembrare l'Impero Russo l'aggressore. Souchon disobbed?gli ordini dato che voleva forzare l'entrata in guerra dell'Impero Ottomano contro la sua volont?e inizi?a bombardare porti russi il 29 ottobre. Come pianificato Enver disse al governo Ottomano che Souchon si era solo difeso ed era stato attaccato dai russi. Nel corso dei seguenti due giorni, ci furono numerosi incontri tra il governo Ottomano e il 'Comitato di Unione e Progresso' per discutere i passi successivi. La fazione opposta alla guerra aveva ancora la maggioranza e cos?si decise di mandare una nota di scusa all'Impero Russo. Il governo russo ignor?la nota e dichiar?guerra all'Impero Ottomano il 2 Novembre.;;;;;;25 ок?бря, посл?неудач?Энвера убедит?правительств?Османско?Импери?вступить ?войн? он ?Джемал?паша (минист?военно-морского флот? да?адмиралу Сушону - кт?бы?по?верховны?Османски?командование?- тайное задани?направит?свой ??флот ?Черное море ?атаковат?на российские корабл? Эт?должно было послужит?инцидентом, ?Росс? выглядеть агрессором. Сушо?подчинил? приказ? та?ка?он тоже хоте?заставит?Османску?Импери?вступить ?войн?против свое?воли ?нача?обстреливать порт?России 29 ок?бря. Ка??планировалос?Энве?сделал ви? чт?Османски?флот бы?атакован русскими ?всег?лишь защищался. ?течени?следующи?двух дней, проходил?многочисленные встреч?межд?османски?правительством ?'Комитето?Единение ?прогресс', чтоб?обсудить следующи?ша? Антивоенная фракция была ещ??большинств? ?поэтом?было решено отправит?предложени??примирении ?Россию. Правительств?России проигнорировал?эт?предложени??об?вило войн?Османско?импери?2 ноября 1914 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
