EVT1914_2145527_DESC;During the reign of Abdul Hamid II from 1876 to 1909, the Ottoman navy was hardly supported. This changed when the Young Turks came to power. The majority of the Young Turks was pro-British, so much that in 1909 not German but British experts were invited to expand and modernize the fleet. The head of the mission was also commander of the entire Ottoman fleet. The heads were admiral Douglas Gamble (1909-1910), followed by admiral Hugh Pigot Williams (1910-1911) and then by admiral Arthur Limpus (1912-1914).\nAs the transfer of the German ships 'Goeben' and 'Breslau' was almost completed, admiral Limpus was withdrawn from the supreme command of the fleet and shifted to the Ottoman ministry of navy. A month later on 9th September 1914, the German Admiral Souchon was appointed commander of the Ottoman navy and the British naval mission left the Ottoman Empire.;Pendant le rиgne d'Abdul Hamid II de 1876 ?1909, la marine ottomane ne reзut que guиre d'attentions. Cel?changea lorsque les Jeunes-Turcs arrivиrent au pouvoir. La majorit?des Jeunes Turcs йtait pro-britannique, ?tel point que, en 1909, ce ne furent pas des experts allemands mais britanniques qui furent invitйs ?dйvelopper et moderniser la flotte. Le chef de la mission йtait йgalement commandant de toute la flotte ottomane. Les responsables furent l'Amiral Douglas Gamble (1909-1910), suivi par l'Amiral Pigot Hugh Williams (1910-1911), puis par l'Amiral Limpus Arthur (1912-1914).\nAvec le transfert des navires allemands 'Gњben' et 'Breslau' quasiment achev? l'Amiral Limpus fut retir?du commandement suprкme de la flotte, et envoy?au ministиre ottoman de la marine. Un mois plus tard, le 9 septembre 1914, l'amiral allemand Souchon fut nomm?commandant de la marine ottomane, et la mission de la marine britannique quitta l'Empire ottoman.;Wдhrend der Regierungszeit von Abdьlhamid II. von 1876 bis 1909 wurde die osmanische Marine kaum unterstьtzt. Dies дnderte sich als die Jungtьrken an die Macht kamen. Die Mehrheit der Jungtьrken war pro-britisch eingestellt, so dass 1909 nicht deutsche sondern britische Experten eingeladen wurden die Flotte auszubauen und zu modernisieren. Der Leiter der Mission war zugleich Oberbefehlshaber der gesamten Osmanischen Flotte. Die Leiter waren Admiral Douglas Gamble (1909-1910), Admiral Hugh Pigot Williams (1910-1911) und Admiral Arthur Limpus (1912-1914).\nAls die Ьbergabe der deutschen Schiffe  'Goeben' und 'Breslau' nahezu vollendet war, wurde Admiral Limpus der Oberbefehl der Flotte entzogen und in das osmanische Marineministerium versetzt. Nachdem einen Monat spдter am 9. September 1914 der deutsche Admiral Souchon zum Oberbefehlshaber der osmanischen Seestreitkrдfte ernannt wurde, verlie?die britische Mission das Osmanische Reich.;W czasie panowania Abdula Hamida II w latach 1876-1909, marynarka ottomaсska byіa bardzo zaniedbywana. Ulegіo to zmianie, gdy Mіodzi Turcy doszli do wіadzy. Wiкkszoњж z nich byіa probrytyjska, na tyle їe w 1909 r. to brytyjscy, nie niemieccy, eksperci zostali zaproszeni by rozbudowa?i zmodernizowa?flot? Szef misji wojskowej sta?si?jednoczeњnie dowуdc?caіej floty ottomaсskiej. Kolejnymi szefami misji wojskowej byli admira?Douglas Gamble (1909-1910), admira?Hugh Pigot Williams (1910-1911) i nastкpnie admira?Arthur Limpus (1912-1914).\nJako їe transfer niemieckich okrкtуw 'Goeben' i 'Breslau' by?niemal ukoсczony, odwoіano admiraіa Limpusa ze sztabu gіуwnego floty i przekazano kontrol?ottomaсskiemu ministerstwu marynarki wojennej. Miesi№c p?niej, 9 wrzeњnia 1914 r., niemiecki admira?Souchon zosta?mianowany dowуdc?ottomaсskiej marynarki wojennej, a brytyjska misja wojskowa opuњciіa Imperium Ottomaсskie.;Durante el reinado de Abdul Hamid II desde 1876 a 1909, la armada otomana fue muy apoyada. Esto cambi?cuando los Jуvenes Turcos llegaron al poder. La mayorнa de los Jуvenes Turcos eran pro-britбnicos, tanto que en 1909 fueron invitados britбnicos y no alemanes para expandir y modernizar la flota. El jefe de la comisiуn era tambiйn el comandante de toda la flota otomana. Los jefes fueron el almirante Douglas Gamble (1909-1910), seguido del almirante Hugh Pigot Williams (1910-1911) y por el almirante Arthur Limpus (1912-1914).\nCuando la transferencia de los barcos 'Goeben' y 'Breslau' estaba casi completada, el almirante Limpus fue retirado del comando supremo de la flota y cambi?al ministro de la armada otomano. Un mes mбs tarde, el 9 de septiembre de 1914, el almirante alemбn Souchon fue nombrado comandante supremo de la armada otomana y la comisiуn naval britбnica dej?el Imperio Otomano.;Durante il regno di Abdul Hamid II dal 1876 al 1909, la Marina Ottomana non ricevette molti finanziamenti. Questo cambi?quando i Giovani Turchi presero il potere. La maggioranza dei Giovani Turchi favoriva i Britannici, tanto che nel 1909 furono invitati esperti britannini, e non tedeschi, per espandere e modernizzare la flotta. Il capo della missione era anche il comandante dell'intera flotta ottomana. I comandanti furono Douglas Gamble (1909-1910), seguito dall'ammiraglio Hugh Pigot Williams (1910-1911) e poi dall'ammiraglio Arthur Limpus (1912-1914).\nQuando il trasferimento delle navi tedesche 'Goeben' e 'Breslau' era quasi completo, l'ammiraglio Limpus fu rimosso dal supremo comando della flotta e trasferito al ministero della Marina. Un mese dopo, il 9 settembre 1914, l'ammiraglio tedesco Souchon fu nominato comandante della marina ottomana e la missione navale britannica lasci?l'Impero Ottomano.;;;;;;Во время правления Абду?Гамида II ?1876 по 1909 ? Османски?флот практическ?не поддерживался. Вс?изменилось, когд?младотурки пришли ?власти. Большинств?младотурок было пр?британским? настольк?чт??1909 году не немецкие, но британские специалист?были приглашены для расширен? ?модернизации флот? Глав?миссии бы?такж?командующи?всем флотом Османско?импери? Миссие?руководили: адмира?Дуглас Гэмб?(1909-1910), посл?него адмира?Хь?Пиго?Уильямс (1910-1911), ?зате?адмирала Арту?Лимпус (1912-1914).\nКогд?передача немецких кораблей 'Гебе? ?'Бресла? была практическ?завершен? адмира?Лимпус бы?сня??верховного командован? флот??переше??Османскому министерству военно-морского флот? Чере?ме?? 9 сентября 1914 года, командующи?Османско?флотом бы?назначен немецкий адмира?Сушо??Британск? морская мисс? покинула Османску?импери?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
