EVT1914_2147508_DESC;The Basmachi movement rose in 1916 against the Tsarist rule. Some leaders allied with the Reds while others, considering Bolsheviks as enemies, fought them. Mohammed Alim Khan is one of them. He recruited nearly 30.000 troops to fight the soviets.;Le mouvement Basmachi se dйveloppe au cours de l'annйe 1916, d'abord contre l'autorit?tsariste. Certains de ses chefs ce sont alliйs aux Bolchйviques tandis que d'autres les conidиrent comme d'autres ennemis. Mohammed Alim Khan est l'un d'entre eux. Il a recrut?environs 30.000 hommes pour combattre les rouges.;Die Basmachi Bewegung wurde 1916 gegrьndet und richtete sich ursprьnglich gegen die zaristische Herrschaft. Einige der Basmachi Anдnger schlossen sie den Bolschewiken an, wдhrend andere gegen sie kдmpften. Einer der Gegner der Bolschewiken war Mohammed Alim Khan, der 30.000 Mann gegen den Bolschewismus mobilierte.;Ruch basmacki powsta?w 1916 r. przeciwko panowaniu carskiemu. Cz??przywуdcуw sprzymierzyіa si?z bolszewikami, pozostali uznali ich za wrogow. Mohammed Alim Chan by?jednym z nich. Zrekrutowa?blisko 30 000 їoіnierzy do walki z sowietami.;El movimiento Basmachi se alz?en 1916 contra las autoridades zaristas. Algunos de sus lнderes se aliaron con los rojos, cuando otros considerando a los Bolcheviques sus enemigos, les combatieron. Mohammed Alim Khan es uno de ellos, con cerca de 30,000 hombres listos para enfrentar a los soviйticos.;Il movimento Basmachi si rivolt?nel 1916 contro il dominio zarista. Alcuni leader si allearono con i rossi, mentre altri, considerando i bolscevichi come nemici, li combatterono. Mohammed Alim Khan ?uno di loro. Ha reclutato quasi 30,000 truppe per combattere i sovietici.;;;;;;Басмаческо?движение возникло ?Средне?Азии посл?Ок?брьско?революци?1917 года. Некоторы?лидеры басмачей присоединились ?красны? однако большая част?рассматривал?большевико??качестве врагов ?боролась ?ними. Сейи?Алим Ха?бы?одни?из ни? Для борьбы ?Советами он собрал 30.000 от??;x;;,,,,,,,,,,,