EVT1914_2147509_DESC;Ismail Enver, Ottoman Empire's former War Minister, came in Central Asia as a mediator between the Bolsheviks and the Basmachi rebels. He finally joined the rebellion and fielded an efficient army, strong enough to create an independent Muslim and Turkish state.;Ismail Enver, ancien ministre de la guerre de l'Empire Ottoman, est venu dans la rйgion comme mйdiateur entre les Bolchйviques et les Basmachi. Il rejoint finalement le second camp et organise une armйe efficace pour rйaliser l'idйal des Basmachi : un Etat musulman et Turque indйpendant.;Ismail Enver, der frьhere Kriegsminister des osmanischen Reiches, kam als Vermittler zwischen den Basmachi Rebellen und den Bolschewiken nach Zentral-Asien. Im Laufe der Zeit entschied er sich allerdings fьr die Sache der Basmachi Bewegung und stellte eine Armee auf, die stark genug war, einen unabhдngigen tьrkisch-muslimischen Staat zu grьnden und zu verteidigen.;Ismail Enver, byіy minister wojny Imperium Ottomaсskiego, przyby?do centralnej Azji jako mediator pomiкdzy bolszewikami, a basmackimi rebeliantami. W koсcu jednak przyі№czy?si?do rebelii i wystawi?skuteczn?i karn?armi? wystarczaj№co siln?by utworzy?niepodlegіe islamskie paсstwo tureckie.;Ismail Enver, El ex-ministro de Guerra del Imperio Otomano, ha venido a Asia Central como mediador entre los Bolcheviques y los Basmachi. Finalmente, debido quiz?a sus ideas pan-turquicas ha decidido unirse a la rebeliуn, entrenando a un ejйrcito eficiente y poderoso, lo suficiente como para crear un estado Turco-Musulmбn independiente.;Ismail Enver, l'ex ministro della guerra dell'Impero Ottomano, arriv?nell'Asia centrale come mediatore tra i bolscevichi ed i ribelli Basmachi. Egli ha infine aderito alla ribellione e messo in campo un esercito efficiente, forte abbastanza per creare uno Stato indipendente turco e musulmano.;;;;;;Исмаил Энве?(Энве?паша), бывший военны?минист?Османско?импери? прибыл вместе ?советскими представителями ?Центральну?Азию ?качестве посредника межд?большевиками ?басмачам? Однако, вскоре, он приня?решени?противодействовать большевика??поднять панисламское движение за освобождение Средне?Азии от красны? для чего взя?на се? задачу объединения от?до?басмачей ?борьбе ?советско?власть? чтоб?создат?независимо?па?тюркское государств?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
