EVT1914_2168500_DESC;The Volunteers' Army started as a bunch of troops, mainly officers, which rebelled against the bolchevik rule in Russia, around white officers like Denikine or Drosdovsky in southern Russia. They made profit from the mayhem in late '18 to gather enough troops and become a real threat for the Bolshevik power.;L'Armйe des Volontaires n'est au dйpart qu'un petite petite troupe composйe principalement d'officiers rassemblйs autour des gйnйraux blancs Denikine et Drosdovsky. L'armйe profita du dйsordre ?la fin de l'annйe 1918 pour se renforcer et devenir une vйritable menace pour le pouvoir bolchйvique.;Die Freiwilligenarmee bestand zunдchst ьberwiegend aus Offizieren rund um Denikine und Drosdovsky, die gegen die bolschewistische Herrschaft in Russland rebellierten. Bei ihren Rekrutierungen profitierten sie stark von dem Chaos und dem Zusammenbruch der цffentlichen Ordnung am Ende des Jahres 1918 und wurden zu einer Bedrohung der bolschewistischen Machthaber. ;Armia Ochotnicza zaczynaіa jako zbieranina їoіnierzy, gіуwnie oficerуw, ktуrzy zbuntowali si?przeciw wіadzy bolszewickiej w Rosji, skupiaj№c si?wokуі biaіych oficerуw jak Denikin, czy Drozdowski, w poіudniowej Rosji. Korzystali z zamieszania p?nego roku 1918 i udaіo im si?zebra?wystarczaj№c?liczb?їoіnierzy, by stanowi?realne zagroїenie dla wіadzy bolszewickiej.;Ejйrcito de Voluntarios comenz?como un grupo de tropas, principalmente oficiales, que se rebelaron contra el gobierno bolchevique en Rusia, en torno a los oficiales blancos como Denikine o Drosdovsky en el sur de Rusia. Aprovecharon el caos de finales del '18 para reunir suficientes tropas y convertirse en una amenaza real para el poder bolchevique;L'esercito volontario ha iniziato come un gruppo di soldati, soprattutto ufficiali, che si ribellarono contro il governo bolscevico in Russia, insieme ad ufficiali bianchi come Denikine o Drosdovsky nella Russia meridionale. Hanno approfittato dal caos verso la fine del '18 per raccogliere abbastanza truppe e diventare una vera minaccia per il potere bolscevico. ;;;;;;Добровольческая армия возникла ?качестве добровольног?воинског?объединения, сост?вшег?преимущественн?из офицеров, юнкеро??гардемарин, отказавших? принять власть большевико??России ?объединивших? на юг?России вокруг белы?генерало? таки?ка?Деники? Алексеев ил?Корнилов. Он?прибыл??Новочеркасск из красного хаос??конц?1918-го года, чтоб?создат?боеспособную арми??стат?реальной угрозо?для большевистской власти.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
