EVT1914_2173501_DESC;A meeting is planned at Omsk, where all states which rose against the Bolsheviks must decide actions to be taken against the Reds. An alliance can be sealed.;Une entrevue est prйvue ?Omsk, rйunissant les Etats se rebellant contre le pouboir Bolshйvique. Il doit кtre dйcid?des actions ?prendre contre les Rouge. Une alliance peut кtre scellйe.;Es ist geplant, da?sich Abgesandte aller Staaten, die sich gegen die Bolschewiken erhoben haben, in Omsk treffen, um gemeinsame Aktionen gegen die 'Roten' zu beschliessen. Hieraus kцnnte durchaus eine Allianz entstehen.;W Omsku planowane jest spotkanie, podczas ktуre wszystkie kraje, ktуre powstaіy przeciw Bolszewikom, musz?zadecydowa? jakie kroki podejm?przeciwko Czerwonym. Moїe to doprowadzi?do podpisania sojuszu.;Una reuniуn se llevara a cabo en la ciudad rusa de Omsk, donde los estados involucrados en la lucha contra los Bolcheviques decidirбn las acciones a tomar durante lo que reste de la lucha contra ellos, podrнa ser el preludio de una alianza.;?previsto un incontro a Omsk, dove tutti gli Stati che si sollevarono contro i bolscevichi devono decidere le azioni da intraprendere contro i rossi. Un'alleanza pu?essere sigillata.;;;;;;?Омск?планируется проведение конференци? ?ходе которо?вс?антибольшевистские силы должны принять скоординированны?план по борьбе ?красно?чумо? Вполне вероятн? чт?буде?принято решени?вступить ?союз.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
