EVT1914_2173502_DESC;Once at Omsk, Koltchak realized that his new allies are far from being ready for war. They barely have any troops, their administration is incompetent and worse, corruption in these governments seems an incurable disease. The only solution is a coup d'Etat.;Au cours de l'entrevue d'Omsk, Koltchak rйalise que ses alliйs ne sont pas prкts ?la guerre. Ils n'ont pas de troupes, leur administration est inefficace et pire que tout, la corruption semble кtre un mal incurable dans ces gouvernements. La seule solution est le coup d'Etat.;In Omsk angekommen erkennt Admiral Koltchak schnell, da?seine neuen Verbьndeten in keinster Weise auf einen Krieg gegen den Bolschewismus vorbereitet sind. Sie haben kaum Truppen, die Regierung ist inkompetent, Korruption ist ein unausrottbares Geschwьr. Ein Staatsstreich scheint ihm die sinnvollste Lцsung zu sein.;Bкd№c w Omsku, Koіczak zauwaїy?їe jego nowi sojusznicy s?w stanie dalekim od gotowoњci wojennej. Nie maj?prawie wojska, ich administracja jest niekompetentna, a co gorsza, korupcja wydaje si?nieuleczaln?chorob? Jedynym rozwi№zaniem jest zamach stanu.;Una vez en Omsk, Kolchak seсalo que sus nuevos aliados estan lejos de estar preparados para la guerra. Apenas tienen soldados, su administraciуn es muy incompetente y peor aъn, la corrupciуn de sus funcionarios parece ser un cancer incurable que amenaza la seguridad de futuras operaciones. Parece ser que solo hay una soluciуn.;Una volta a Omsk, Koltchak si rese conto che i suoi nuovi alleati erano ben lungi dall'essere pronti per la guerra. Non avevano truppe, la loro amministrazione era incompetente e, ancora peggio, la corruzione in questi governi sembra una malattia incurabile. L'unica soluzione ?un colpo di Stato.;;;;;;Прибыв ?Омск, Колчак сраз?же по?? чт?ег?новы?союзники совершенно не готовы ?войн? Он?практическ?не имею?боеспособных войс? их администрация совершенно некомпетентн? но хуже всег?то, чт?коррупция ?этих правительствах приобрел?поистине чудовищные 