EVT1914_2173503_DESC;The White Army is created by Alexeyev, leader of the Volunteers Army. This army gathers any troops opposed to the Bolshevik and has no other agenda that crushing the Revolution. At least Alexeyev says so. Joining this army means an alliance with him.;L'Armйe Blanche est une crйation d'Alexeyev, chef suprкme de l'Armйe des Volontaires. Elle regroupe toute troupe opposйe aux Bolchйviques, et ne dispose en thйorie d'aucun agenda en dehors de l'йcrasement de cette Rйvolution. D'aprиs Alexeyev en tous cas. Rejoindre cette armйe signifie conclure une alliance avec lui.;Die 'Weisse Armee' wurde von General Alexeiev aus Freiwilligen aufgestellt. Zusдtzlich ist diese Armee das Sammelbecken aller anit-bolschewistischen Krдfte in Russland und hat nur den einen Zweck, die Revolution zu zerschlagen. Sich dieser Organisation anzuschliessen bedeutet, ein Bьndnis mit General Alexeiev einzugehen.;Biaіa Armia jest tworzona przez Aleksiejewa, przywуdc?Armii Ochotniczej. Ta armia zbiera wszystkie siіy przeciwne bolszewikom i nie ma innego celu jak zgniecenie rewolucji. Przynajmniej tak twiedzi Aleksiejew. Przyі№czenie si?do jego armii oznacza nasz wspуlny sojusz.;El Ejercito Blanco fue creado por Mijail Alexeiev, lнder del Ejйrcito de Voluntarios. Esta milicia estaba formada por cualquier tropa que se opusiera contra los Bolcheviques y que no tuviera otro objetivo que aplastar la revoluciуn. Al final Alexeiev dijo. Unirse a este ejercito significa aliarse con йl.;L'Armata Bianca ?stato creato da Alexeiev, leader dell'Armata Volontaria. Questo esercito raccoglie le truppe contro i bolscevichi e non ha altro ordine che lo schiacciamento della Rivoluzione. Almeno cos?dice Alexeiev. Aderendo a questo esercito, ci si alleer?con lui.;;;;;;Родоначальнико?Белого движен? являет? генера?Aлексее? командующи?Добровольческо?армией. Он?включает ?се? вс?антибольшевистские вооруженны?формирован? ?правительств??не преследует никаки?иных целе? кром?борьбы ?красными. По крайне?мере и