EVT1914_2173506_DESC;Janin's behavior is hampering our efforts to crush the Reds. The only solution is to replace him, but this decision must be taken by the French. Our report may also displease them, as we are openly criticizing one of their officers.;Le comportement de Janin nous empкche d'agir au mieux contre les Rouges. La seule solution viable est son йviction, mais seuls les Franзais peuvent prendre une telle dйcision. Notre rapport sur Janin pourrait aussi fortement leur dйplaire, vu qu'il critique ouvertement un de leurs officiers.;Janins Verhalten behindert unsere Anstrengungen, die Revolution niederzuschlagen. Der einzige Weg ist seine Abberufung, aber diese Entscheidung muss in Frankreich fallen. Uns ist klar, da?unser Bericht in Frankreich nicht nur positive Reaktionen hervorrufen wird, da wir einen ihrer Offiziere kritisieren.;Zachowanie Janina utrudnia nasze wysiіki w celu rozbicia Czerwonych. Jedynym rozwi№zaniem jest zast№pienie go, ale ta decyzja musi by?podjкta przez Francuzуw. Nasze raporty moga rуwnie?ich nastawi?przeciwko nam, gdy?krytykujemy jednego z ich oficerуw.;El comportamiento de Janin est?obstaculizando nuestros esfuerzos para aplastar a los Rojos. La ъnica soluciуn sustituirlo, pero esta decisiуn la deben tomar los franceses. Nuestro informe tambiйn les desagrada, ya que estamos criticando abiertamente a uno de sus oficiales.;Il comportamento di Janin ostacola i nostri sforzi per schiacciare i rossi. L'unica soluzione ?sostituirlo, ma questa decisione deve essere presa dai Francesi. La nostra relazione potrebbe anche dispiacerli, dato che stiamo apertamente criticando uno dei loro ufficiali.;;;;;;Поведени?генерала Жанена являет? неприемлемым, поскольк?мешает на?раздавит?красны? Похоже, единственным варианто?буде?требование ег?отзыва во Франци? однако эт?решени?должно быть принято французски?командование? Вместе ?те? не стои?забывать ?то? чт?на?доклад може?вызват??французо?недовольство из-за того, чт?мы открыт?критикуе?одного из их гене