EVT1914_2173510_DESC;General Janin finally led his troop to treason. Without any order from his hierarchy, the French general decided to cease any cooperation with us. Rumors said he's negotiating with the Reds to obtain a safe route towards central Europe.;Le Gйnйral Janin a finalement men?ses troupes ?la trahison. Sans avoir reзu aucun ordre de sa hiйrarchie, Janin refuse dйsormais toute coopйration. Une rumeur persistante affirme qu'il nйgocie avec les Bolchйviques un sauf-conduit vers l'Europe centrale.;General Janin hat mit seinen Truppen Hochverrat begangen. Ohne Befehl aus Frankreich hat er entschieden, jegliche Zusammenarbeit mit uns einzustellen. Gerьchte besagen, da?er mit der 'Roten Armee' ьber freies Geleit nach Zentraleuropa verhandelt.;Genera?Janin w koсcu doprowadzi?swych їoіnierzy do zdrady. Bez konsultacji ze swoj?hierarchi? francuski genera?zadecydowa?o zakoсczeniu wspуіpracy z nami. Plotki gіosz? їe potajemnie negocjuje z Czerwonymi przemarsz bezpieczn?tras?do њrodkowej Europy.; El general Janin al final lidero a sus hombres a una deshonrosa traiciуn. Sin ningъn respeto por su grado militar, el general decidi?cesar su cooperaciуn con nosotros y se rumorea que est?negociando con los rojos, una ruta segura de vuelta a Europa. Tambiйn se nos reporta que se ha perdido un tren con ocho vagones repletos de oro del Tesoro Imperial. Quiйn sabe por qu?motivo no hay seсales de su ubicaciуn?Il Generale Janin ha infine condotto la sua truppa al tradimento. Senza alcun ordine dai suoi superiori, il generale francese ha deciso di cessare ogni collaborazione con noi. Voci di corridoio dicono che sta negoziando con i rossi per ottenere una rotta sicura verso l'Europa centrale.;;;;;;Ка??следовал?ожидат? Жане?нане?на?подлый удар ?спин? Бе?какого-либо приказ?свыш? французски?генера?реши?отказать на??поддержк? По слухам, он тайн?договорился ?красными, которы?предоставили ем??ег?войска?безопасный маршру?для эвакуаци??Европу.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,