EVT1914_2173511_DESC;Some soldiers of the Czechoslovak Legion put Admiral Koltchak under arrest. Janin negotiated with the reds, exchanging their freedom against Koltchak. As soon as he fell into Bolsheviks' hands, he was executed.;Quelques soldats de la Lйgio Tchиque ont arrкt?l'Amiral Koltchak. Janin a nйgoci?avec les Rouges, obtenant leur libert?contre Koltchak. Sitфt celui-ci dans les mains des Bolchйviques, il fut exйcut?;Soldaten der tschechischen Legion nahmen Admiral Koltchak gefangen. General Janin verhandelte mit der 'Roten Armee' und bot den Admiral im Gegenzug fьr den freien Abzug seiner Truppen an. Kurz nach der Auslieferung Admirtal Koltchaks wurde dieser von den Bolschewiken hingerichtet.;Cz??їoіnierzy Legionu Czechosіowackiego zatrzymaіa admiraіa Koіczaka w areszcie. Janin wynegocjowa?z bolszewikami swobod?przejњcia w zamian za wydanie Koіczaka. Gdy tylko trafi?on w rкce bolszewikуw, zosta?rozstrzelany.d.;Algunos miembros de la Legiуn Checa han arrestado al almirante Kolchak. Janin le ha intercambiado, junto con una considerable cantidad de oro que dice se encontro, por de la libertad de el y sus hombres. Tan pronto como el almirante cayo en manos de los Bolcheviques, fue ejecutado.;Alcuni soldati della Legione ceca hanno arrestato l'ammiraglio Koltchak. Janin ha negoziato con i rossi, scambiando la loro libert?contro Koltchak. Questi fu giustiziato subito dopo essere caduto nelle mani dei bolscevichi.;;;;;;Командование Чехословацкого Легион?поместил?адмирала Колчак?по?арес? Вскоре, генера?Жане?договорился ?красными, ??обме?на гарантии безопасной эвакуаци?частей Легион?чере?Владивосто??Европу, выда?Колчак?большевика? Адмира?бы?расстреля?на берегу реки Ушаковка бе?суда ?следствия, по постановлени?Иркутского военно-революционного комитета.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
