EVT1914_2173517_DESC;Mass Terror is a necessary weapon against the Proletarian Dictatorship. Used by generals, local populations or the Okhrana (Secret Services), the Terror targets Red activists or partisan. In fact, entire villages were targeted, even if a single person was guilty or accused of being a red partisan. Such policies, which aimed at scaring populations, had often the opposite effect.;La Terreur de masse est une arme contre la Dictature du Prolйtariat. Utilisйe par les Gйnйraux, les populations locales ou l'Okhrana (Services Secrets), elle cible particuliиrement les rouges et leurs sympathisants. Dans les faits, des villages entiers йtaient touchйs dиs lors qu'une seule personne йtait coupable ou simplement soupзonnйe. Ces politiques, destinйes ?effayer la population, avaient souvent l'effet inverse.;Massenterror ist ein notwendiges Instrument gegen die Diktatur des Proletariats. Dieses Vorgehen wurde von Armee, Geheimdienst ( Okhrana ) und der Bevцlkerung selbst gegen 'rote' Aktivisten und Partisanen eingesetzt. In der Tat wurde mehr als nur ein Dorf zum Ziel dieses Terrors, wenn auch nur der Hauch eines Verdachtes der Zusammenarbeit mit den 'roten' bestand. Solche Instrumente, die auf der Einschьchterung der Bevцlkerung hinarbeiteten, erreichten natьrlich oftmals das Gegenteil.;Masowy terror jest militarnym narzкdziem przeciwko dyktaturze proletariatu. Realizowany przez generaіуw, lokaln?ludnoњж i Ochran?(tajne sіuїby), terror skierowany jest przeciw czerwonym aktywistom i bojownikom. Faktycznie, celem byіy caіe wioski, jeњli nawet tylko jeden z mieszkaсcуw by?podejrzany o sprzyjanie bolszewikom. Takie porz№dki, nakierowane na przeraїenie spoіeczeсstwa, miaіy czкsto obrуt przeciwny do zamierzonego.;El terror en masa es un arma necesaria para luchar contra la dictadura del proletariado. Usada por los generales, milicias locales o la Ojrana (Ojrбnnoyie Otdelйniye), el terror est?dirigido a activistas Pro-Rojos o a partisanos. De hecho, poblaciones enteras eran victimas de йl, aun si solo una persona era encontrada culpable de ser un 'agente provocador' o un 'traidor al Zar'. Algunas veces en vez de asustar a la poblaciуn, lograban el efecto contrario. ;Terrore di massa ?un'arma contro la dittatura del proletariato. Usato dai generali, dalle popolazioni locali o dal'Okhrana (Servizi segreti), il terrore ha come obbiettivo attivisti o partigiani rossi. In realt? interi villaggi sono stati distrutti, anche se una sola persona era colpevole od accusato di essere un partigiano rosso. Tali politiche, che miravano a terrorizzare le popolazioni, avevano spesso l'effetto opposto.;;;;;;Массовый террор по отношени??врагам революци?являлся хороши?средство?борьбы против диктатур?пролетариата. Применявший? белыми генералами, местными органами власти ?сотрудниками Государственно?охраны, красны?террор служил средство?устрашен? ка?большевистских си?та??мирног?населения. Фактически, целы?деревн?уничтожались только за то, чт?один из жителе?бы?заподозрен ?пособничеств?красны? однако такая политика, направленн? на запугивани?местного населения, част?имел?прямо противоположны?эффект...;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
