EVT1914_2173518_DESC;We control enough provinces to recreate Russia. From its shattered pieces, Russia rises once again!;Nous contrфlons assez de provinces pour reformer la Russie. De ses dйcombres, la Russie se relиve encore une fois !;Wir kontrollieren jetzt eine ausreichende Anzahl von Provinzen, um Russland neu zu grьnden. Aus seinen Trьmmern entsteht Russlands aufs neue.;Kontrolujemy wystarczaj№c?liczb?prowincji, by odtworzy?paсstwo rosyjskie. Ze swych rozrzuconych szcz№tkуw Rosja powstaje raz jeszcze do їycia!;Controlamos provincias suficientes para recrear Rusia. Desde sus piezas destrozadas, Rusia se levanta de nuevo!;Controlliamo un numero sufficiente di province per ricreare la Russia. Dai suoi pezzi in frantumi, la Russia rinasce ancora una volta! ;;;;;;Мы контролируем достаточно провинци? чтоб?воссоздать Россию. Расколот? Империя внов?возрождает? !;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
