EVT1914_2185006_DESC;After end of the World War, the Russian- and British-occupied territories were returned to Persia gradually. After the signing of the Treaty of Brest-Litovsk in 1918 between the Russian Soviet Republic and the Central Powers Persia should regain sovereignty over its northern territories. However, these were still occupied by White Russian troops. In 1919 Britain tried to make Persia a protectorate by a bilateral treaty, but it did not materialize.;Aprиs la fin de la Premiиre Guerre mondiale, les territoires occupйs par les russes et par les Britanniques furent progressivement retournйs ?la Perse. Aprиs la signature du trait?de Brest-Litovsk en 1918 entre la Russie Soviйtique et les Puissances Centrales, la Perse devait retrouver sa souverainet?sur les territoires du Nord. Toutefois, ceux-ci йtaient encore occupйs par les troupes Russes Blancs. En 1919, la Grande-Bretagne essaya de faire de la Perse un protectorat via un trait?bilatйral, mais cela ne se concrйtisa pas.;Nach dem Weltkrieg wurden die von Russen und Briten besetzten Gebiete Persiens allmдhlich zurьckgegeben. Nach der Unterzeichnung des Vertrages von Brest-Litowsk 1918 zwischen der Russischen Sowjetrepublik und den Mittelmдchten sollte Persien wieder die Souverдnitдt ьber seine nцrdlichen Gebiete erhalten. Allerdings blieben diese noch von weiЯrussischen Truppen besetzt. GroЯbritannien versuchte 1919 Persien durch einen bilateralen Vertrag zu einem Protektorat zu machen, welcher aber nicht zustande kam.;Po zakoсczeniu wojny, terytoria okupowane przez Rosjan i Brytyjczykуw stopniowo wracaіy pod kontrol?Persji. Po podpisaniu traktatu w Brzeњciu Litewskim w 1918 r. pomiкdzy paсstwami centralnymi, a Rosyjsk?Republik?Sowieck? Persja miaіa odzyska?peіn?kontrol?nad terytoriami pуіnocnymi. Obszary te byіy jednak wci№ї okupowane przez rosyjskie wojska Biaіych. W 1919 r. Wielka Brytania usiіowaіa uczyni?z Persji swуj protektorat poprzez ukіad dwustronny, ale plan ten ostatecznie nie uleg?realizacji.;Despuйs del final de la Gran Guerra, los territorios ocupados por rusos y britбnicos fueron gradualmente devueltos a Persia. Despuйs de la firma del Tratado de Brest-Litovsk en 1918 entre la Uniуn Soviйtica y las Potencias Centrales, Persia debнa recuperar soberanнa sobre sus territorios del norte. Sin embargo, estos todavнa estaban ocupados por tropas de la Guardia Blanca. En 1919 Gran Bretaсa intent?hacer a Persia un protectorado con un tratado bilateral, pero no se materializ?;Dopo la fine della Guerra Mondiale, i territori occupati da Russi e Britannici tornarono gradualmente in mano persiana. Dopo la forma del trattato di Brest-Litovsk nel 1918 tra la Repubblica Sovietica Russia e gli Imperi Centrali, la Persia avrebbe dovuto riguadagnare la propria sovranit?sui territori del nord. Tuttavia questi furono occupati dalle truppe della Russia Bianca. Nel 1919 il Regno Unito cerc?di rendere la Persia un protettorato tramite un accordo bilaterale, ma la cosa non si materializz?;;;;;;Посл?окончания Первой мирово?войн? территории оккупированные русскими ?англичанам?были постепенно возвращены Персии. Посл?подписан? Брес?Литовского мирног?договора  ?1918 ? межд?русско?советско?республико??Центральными державам?Перс? должна восстановить суверените?на?своими северным?территор?ми. Однако, он?вс?ещ?были за?ты русскими войсками 'белы?. ?1919 году Британ? пытались сделат?Персию протекторато??помоўў?заключен? двустороннег?договора, но эт?закончилос?неудачей.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
