EVT1914_2191511_DESC;Vladimir Illitch Oulianov (Lenin), in exile in Switzerland, has expressed his desire to go back to Russia. To do so, we must allow him to cross Germany. He may be a key element to destabilize the Russian provisional government, thus weakening our enemy.;Vladimir Illitch Oulianov (Lenine), en exil en Suisse, exprime son dйsir de retourner en Russie. Pour cela, nous devons lui permettre de traverser notre territoire. Cet agitateur pourrait destabiliser le rйgime provisoire en Russie, affaiblissant ainsi notre ennemi.;Vladimir Illitch Oulianov, auch Lenin genannt, fragt von seinem Schweizer Exil aus an, ob wir ihn zurьck nach Russland reisen lassen wьrden. Fьr uns Kцnnte dieser Lenin ein Schlьsselelement sein, das russische Reich weiter zu destabilisieren und es endgьltig zu schlagen.;Wіadimir Ilijcz Uljanow (Lenin), dotychczas їyj№cy na wygnaniu w Szwajcarii, wyrazi?chкж powrotu do Rosji. W tym celu, musimy pozwoli?mu na przejazd przez Niemcy. Moїe by?on kluczowym elementem destabilizuj№cym rosyjski rz№d tymczasowy, a tym samym osіabiaj№cym naszego wroga.;Vladimir Ilyich Ulyanov (Lenin), exiliado en Suiza, ha expresado su deseo de volver a Rusia. Para hacerlo debe atravesar Alemania. Puede ser un elemento clave para darle la estocada final al gobierno provisional ruso, debilitando aъn mбs a nuestros enemigos?Vladimir Illitch Oulianov (Lenin), in esilio in Svizzera, ha espresso il suo desiderio di tornare in Russia. Per fare ci? dobbiamo permettergli di attraversare la Germania. Egli pu?essere un elemento chiave per destabilizzare il governo provvisorio russo, indebolendo cos?il nostro nemico.;;;;;;Лиде?большевико?Владимир Ильи?Ул?но?(Лени?, нахо?щийся ?эмиграци??Швейцари? вырази?желани?вернуться ?Россию. Для этог?мы должны позволит?ем?пересечь Германию. Эт??наши?интереса? поскольк?он може?стат?ключевым элементо?дестабилизации Временного правительств?России ?поспособствовать ослаблению нашего враг?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,