EVT1914_2191512_DESC;France has been defeated and agreed to negotiate peace without conditions. Once again, German troops parade in Versailles, where the belligerents agreed to meet. The Central Powers have the upper hand and can impose their conditions, which include financial reparations as well as military disarmament. Soft conditions impose only a removal of French claims over Alsace-Moselle, mild conditions add French colonies in Equatorial Africa and harsh conditions include territorial gains in Lorraine.;La France est vaincue et souhaite nйgocier une paix, sans conditions. Les troupes allemandes paradent de nouveau ?Versailles o?les belligйrents se rencontrent. Les Puissances Centrales ont l'initiative, et peuvent imposer leurs conditions, incluant de toutes faзons des rйparations financiиres et un dйsarmement militaire. Des conditions de paix acceptables ajoutent la fin des revendications franзaises en Alsace-Moselle, des conditions modйrйes incluent les colonies franзaises d'Afrique Equatoriale, tandis que les conditions les plus dures ajoutent des gains territoriaux en Lorraine.;Frankreich wurde geschlagen und hat bedingungslos kapituliert. Wieder einmal halten deutsche Truppen eine Parade in Versailles ab, wo sich die Abgesandten der kriegfьhrenden Mдchte zu Friedensverhandlungen getroffen haben. Die siegreichen Mittelmдchte kцnnen die Bedingungen diktieren, die wohl auf jeden Fall aus Reparationszahlungen und der Entwaffnung bestehen werden. Milde Bedingungen sehen vor, da?Frankreich seine Ansprьche auf das Elsa?und die Moselregion zurьcknimmt und moderate Bedingungen wьrden zusдtzlich die Abgabe der Kolonialgebiete in Дquatorial-Afrika bedeuten. Wirklich hart wдre es jedoch, wenn die Mittelmдchte territoriale Zugestдndnnisse in Lothringen fordern wьrden.;Francja zostaіa pokonana i przystaіa na bezwarunkowy pokуj. Raz jeszcze niemieckie wojska paraduj?w Wersalu, gdzie strony konfliktu zgodziіy si?na przeprowadzenie konferencji pokojowej. Paсstwa centralne maj?moїliwoњж narzucenia swoich ї№da? w ramach ktуrych mog?znaleџж si?reparacje wojenne, jak rуwnie?rozbrojenie. Јagodne warunki oznacza?bкd?rуwnie?zrzekniкcie si?przez Francj?pretensji do Alzacji i Lotaryngii, њrednio ciкїkie warunki dodadz?do listy ї№da?kolonie w Afryce Rуwnikowej, a surowe warunki bкd?obejmowa?rуwnie?dalsze zdobycze terytorialne w Lotaryngii.;Francia ha sido derrotada, de nuevo, y nos ha pedido la paz. Despuйs del ya tradicional desfile del ejйrcito alemбn en Paris, la Triple Alianza ha comenzado a estudiar las exigencias que se le harбn a los franceses, que incluyen, si son suaves, la renuncia de Francia a la Alsacia-Lorena, si son medias, ademбs de la renuncia, algunas colonias francesas en Бfrica, y si son fuertes, lo anterior mбs el resto de la regiуn de Lorena, las tres opciones van de la mano con compensaciones monetarias y el desarme obligatorio.;La Francia ?stata sconfitta ed ha accettato di negoziare una pace senza condizioni. Ancora una volta, le truppe tedesche sfilano a Versailles, dove i belligeranti hanno concordato di incontrarsi. I poteri centrali hanno il sopravvento e possono imporre le proprie condizioni, che includono risarcimenti finanziari, nonch?il disarmo militare. Condizioni accettabili sarebbero solo di imporre la fine delle rivendicazioni francesi sull'Alsazia-Mosella, condizioni accettabili aggiungerebbero l'annessione delle colonie francesi in Africa Equatoriale e quelle dure includono vantaggi territoriali in Lorena.;;;;;;Франция потерпел?поражени??была вынужден?согласиться на предложени??безоговорочной капиту?ци? Сегодня немецкие войска прошли парадным маршем пере?Версальски?дворцо? ?которо?встретятся руководители Франци??Центральны?Держав, чтоб?обсудить условия мира. Центральны?держав?вышл?победите?ми ?имею?полное прав?на?зать свои условия, ?которы?непременно войдут требован? разоружения арми??выплат?репараци? ?гкие условия подразумеваю?признани?Эльзас?Мозе? ?качестве немецких территорий, умеренны?условия прибав?