EVT1914_2191514_DESC;The Entente finally managed to breach our defense and invade Germany. We have no choice but to admit our defeat and ask for peace.;L'Entente est finalement parvenue ?percer nos dйfenses et envahir le territoire allemand. Nous n'avons d'autre choix que d'admettre notre dйfaite et nйgocier la paix.;Letzten Endes gelang den Truppen der Entente der Durchbruch durch unsere Verteidigung und der Einfall ins deutsche Reich. Uns bleibt nur noch, unsere Niederlage einzugestehen und um Frieden zu bitten.;Ententa ostatecznie pokonaіa nasze linie obronne i napadіa na Niemcy. Nie mamy wyboru i musimy uzna?poraїk?i prosi?o pokуj.;La Entente finalmente ha desbordado nuestras defensas y ha tomado posiciones en el corazуn de Alemania. No hay mбs opciуn que aceptar?la derrota?y pedir la paz?L'intesa ?finalmente riuscita a scardinare la nostra difesa ed invadere la Germania. Non abbiamo altra scelta che ammettere la nostra sconfitta e chiedere la pace.;;;;;;Войска?'Антант? удалос?прорвать нашу оборон??вторгнуться на территорию Германии. ?на?не?иног?выбора, кром?ка?признать свое поражени??просит?мира.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
