EVT1914_2191515_DESC;The sailors of the German Imperial Navy were ordered to prepare for a last final battle against the Royal Navy, but they decided to rebel against the orders. This unprecedented event demonstrated that not even the soldiers believed in an honorable exit of Germany from the war. This mutiny sparked the fuse that led to the explosion of the Empire;Les marins de la marine impйriale allemande ont reзu l'ordre de se prйparer pour une derniиre bataille contre la Royal Navy, mais ils ont dйcidйs de se rebeller contre les ordres. Ces йvйnements sans prйcйdent ont montrйs que mкme les soldats ne croient plus en une sortie honorable de la guerre pour l'Allemagne. Cette mutinerie enclencha la bombe qui allait mener ?l'explosion de l'Empire Allemand.;Die Seeleute der kaiserlich deutschen Marine erhielten den Befehl, sich auf die letzte, alles entscheidende Schacht gegen die Royal Navy vorzubereiten. Stattdessen verweigerten sie diesen Befehl und zeigten durch dieses unerhцrte Verhalten, da?selbst die Soldaten des Kaiserreiches nicht mehr an einen ehrenvollen Ausgang des Krieges glaubten. Diese Meuterei erschьtterte das Reich bis ins Mark.;Marynarze Niemieckiej Marynarki Cesarskiej otrzymali rozkaz przygotowania do ostatecznej walki przeciw Marynarce Krуlweskiej, ale postanowili przeciwstawi?si?rozkazom. Ten bezprecedensowy akt pokaza? їe nawet їoіnierze stracili wiar?w moїliwoњж honorowego wyjњcia Niemiec z wojny. Bunt ten by?iskr? ktуra wywoіaіa eksplozj?Cesarstwa.;Los marinos de la Kaiserliche Marine se rehusan a partir a una batalla final contra la Royal Navy y han preferido rebelarse. Este acontecimiento inedito muestra que ya ni los mismos soldados confian en una salida honrosa de la guerra para el Imperio Alemбn. este motнn ha encendido la mecha que hara expolotar al Kaiserreich.;Ai marinai della Marina Imperiale tedesca ?stato ordinato di prepararsi ad una battaglia finale contro la Marina Reale britannica, ma hanno preferito ribellarsi. Questo evento senza precedenti dimostr?che nemmeno i soldati credevano ad una uscita onorevole dell'Impero tedesco dalla guerra. Questo ammutinamento accese la miccia che fece esplodere l'impero.;;;;;;Мо?ка?Германског?Императорского флот?было приказан?подготовиться ?'последне?решающей битв? против британског?Гран?Флит? однако он?отказались идти на смерть, выполняя бессмысленны?приказ. Эт?беспрецедентно?событи?ясн?продемонстрировало то, чт?даже матрос?уж?не ве???благоприятный для Германии исхо?войн? Именно эт?восстани?привел??революци??Германии ?падени?монархии.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
