EVT1914_2191517_DESC;On 9 November 1918, a German Republic was proclaimed by Philipp Scheidemann at the Reichstag building in Berlin, to the fury of Friedrich Ebert, who thought that the choice between monarchy and republic belonged to a national assembly. Two hours later, a Free Socialist Republic was proclaimed at the Berliner Stadtschloss. The proclamation was issued by Karl Liebknecht, leader (with Rosa Luxemburg) of the communist Spartacus League.;Le 9 Novembre 1918, le Rйpublique Allemande a йt?proclamйe par Philipp Scheidermann au bвtiment du Reichstag ?Berlin, ?la fureur de Friedrich Elbert, qui pensait que le choix entre la monarchie et la rйpublique incombe ?une assemblйe nationale. Deux heures plus tard, une rйpublique socialiste libre a йt?proclamйe au Palais de la ville de Berlin. La proclamation a йt?faite par Karl Liebknecht, le dirigeant (avec Rosa Luxemburg) de la communiste Ligue Spartakiste.;Am 9. November 1918 rief Philipp Scheidemann am Reichstag die deutsche Republik aus, sehr zum Дrger von Friedrich Ebert, der der Meinung war, die Entscheidung zwischen Monarchie und Republik stьnde nur der Nationalversammlung zu. Nur zwei Stunden spдter rief der Anfьhrer des Spartakusbundes, Karl Liebknecht, die freie sozialistische Republik am Berliner Stadtschloss aus.;9 listopada 1918 r. Republika Niemiecka zostaіa powoіana do їycia przez Philippa Scheidemanna w berliсskim Reichstagu. Wywoіaіo to wњciekіoњж Friedricha Eberta, ktуry uwaїa?їe wybуr miкdzy monarchi?i republik?naleїa?do zgromadzenia narodowego. Dwie godziny p?niej Wolna Republika Socjalistyczna zostaіa powoіana w berliсskim Stadtschloss. Proklamacja zostaіa wygіoszona przez Karla Liebknechta, ktуry wraz z Rуї?Luksemburg kierowa?komunistyczn?Lig?Spartakusa.;El 9 de noviembre de 1918, dнas antes de la abdicaciуn del Kбiser, la Repъblica fue proclamada por Philipp Scheidemann en el Reichstag de Berlнn, para enojo de Friedrich Ebert, que deseaba que los alemanes decidieran entre monarquнa y Repъblica por medio de una asamblea nacional. Dos horas despuйs, una Repъblica Socialista fue proclamada en el Berliner Stadtschloss (Palacio Real) por Karl Liebknecht, lнder (junto con Rosa Luxemburgo) de la Comunista Liga Espartaquista.;Il 9 Novembre 1918 una Repubblica Tedesca fu proclamata da Philipp Scheidemann al Reichstag di Berlino, provocando la furia di Friedrich Ebert, che pensava che la scelta tra monarchia o repubblica spettasse ad un'assemblea nazionale. Due ore dopo, una Libera Repubblica Socialista fu proclamata allo Stadtschloss di Berlino. La proclamazione fu effettuata da Karl Liebknecht, leader (insieme a Rosa Luxemburg) della comunista Lega Spartachista.;;;;;;9 ноября 1918 ?, ?здании Рейхстаг??Берлин? Филипп Шейдеман об?ви??падени?монархии ?провозгласил Германию республико? Этот ша?вызвал ярост??Фридриха Эберта, считавшего, чт?выбо?межд?монархие??республико?принадлежи?Национальном?собранию. Двумя часами позж? 'свободная социалистическ? республика Герман?' была провозглашен??Берлинском городско?дворце Карлом Либкнехтом из коммунистическог?'Союз?Спартака'.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
