EVT1914_2191518_DESC;On 10 November 1918, a coalition government called Council of the People's Deputies was established, consisting of three MSPD and three USPD members. Led by Friedrich Ebert for the MSPD and Hugo Haase for the USPD it sought to act as collective head of state. Although the new government was confirmed by the Berlin worker and soldier council, it was opposed by the Spartacist League.;Le 10 Novembre 1918, un gouvernement de coalition appel?conseil des dйputйs du peuple a йt?йtablit, consistant en 3 membres du MSPD et 3 du USPD. Menйs par Friedrich Elbert pour le MSPD et Huho Haase pour le UPSD, ils avaient l'intention de diriger collectivement en tant que chef d'Etat. Et mкme si le nouveau gouvernement a йt?approuv?par les travailleurs et soldats de Berlin. La Ligue Spartakiste s'opposa nйanmoins ?ce gouvernement.;Am 10. November 1918 grьndete sich der Rat der Volksdeputierten, bestehend aus je drei Mitgliedern der MSPD und der USPD. Friedrich Ebert ( MSPD ) und Hugo Haase ( USPD ) gedachten, sich die Position des Staatsoberhauptes zu teilen. Auch wenn diese Regierung von den Berliner Arbeiter- und Soldatenrдten unterstьtzt wurde, distanzierte sich der Spartakusbund von ihr.;10 listopada 1918 r. powoіany zosta?rz№d koalicyjny zwany Rad?Przedstawicieli Ludowych. Pod przewodnictwem Friedricha Eberta i Hugona Haasego prуbowa?dziaіa?jako zbiorowa gіowa paсstwa. Jakkowiek nowy rz№d zosta?uznany przez berliсsk?rad?robotnikуw i їoіnierzy, przeciw niemu wystкpowaіa Liga Spartakusa.;El 10 de noviembre, una coaliciуn de gobierno, llamada 'Consejo de los Diputados del Pueblo) fue formada por miembros del MSPD y del USPD. Liderados por Friedrich Ebert del primer partido y por Hugo Haase los otros, en una especie de jefatura de estado compartida. Aunque el nuevo gobierno tenнa el apoyo de los obreros y soldados de Berlнn, estaban enfrentados a la Liga Espartaquista.;Il 10 Novembre 1918, fu formato un governo di coalizione chiamato Concilio dei Deputati del Popolo, composto da tre membri del MSPD e tre membri dell'USPD. Guidati da Friedrich Ebert per il MSPD e Hugo Haase per il USPD, doveva agire come capo di stato della Germania. Sebbene il nuovo governo fosse confermato dal concilio dei lavoratori e dei soldati di Berlino, esso fu opposto dalla Lega Spartachista.;;;;;;10 ноября 1918 ?, ?Германии было сформировано коалиционное временно?правительств? получившее название Совета народных уполномоченных. ?Сове?входил?тр?представителя СДПГ (Фридри?Эбер? Филипп Шейдеман, Отто Ландсбер? ?тр?представителя НСДП?(Гуго Гааз? Вильгель?Дитман, Эмил?Барт). Хо? ново?правительств??было подтверждено вл?ни?Берлинског?Совета Рабочи??Солдатских депутато? он?выступил?против коммунистическог?'Союз?Спартака'.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
