EVT1914_2191519_DESC;Kaiser Wilhelm II was surprised by the uprisings in Berlin and other centres in late 1918. Mutiny among the ranks of his beloved Kaiserliche Marine, the imperial navy, profoundly shocked him. For the sake of preserving some form of government in the face of anarchy, Wilhelm's abdicated both as German Emperor and King of Prussia on 9 November 1918.;Le Kaiser Wilhelm II a йt?surpris par les йmeutes ?Berlin et dans d'autres centres en fin 1918. La mutinerie parmi les rangs de sa bien-aimйe marine, l'ont profondйment choqu? Dans le but de prйserver une forme de gouvernement devant l'anarchie actuelle, Wilhelm abdiqua en tant que Empereur Allemand et Roi de Prusse le 9 Novembre 1918.;Kaiser Wilhelm II wurde von diesen Aufstдnden in Berlin und anderen GroЯstдdten vцllig ьberrascht. Vor allem die Meuterei seiner ьber alles geliebten kaiserlichen Marine traf ihn tief. Um eine weitere Zerrьtung des Reiches abzuwenden, dankte er am 9. November als Kaiser des deutschen Reiches und Kцnig von Preussen ab. ;Cesarz Wilhelm II by?zaskoczony powstaniem w Berlinie i innych miastach niemieckich w koсcu 1918 r. Zamieszki w szeregach jego ukochanej Marynarki Cesarskiej dogікbnie nim wstrz№snкіy. W celu utrzymania w istnieniu jakiej?formy rz№du w obliczu caіkowitej anarchii, Wilhelm abdykowa?zarуwno jako Cesarz Niemiecki, jak i Krуl Prus 9 listopada 1918 r.;El Kбiser Wilhelm II se vio sorprendido por los disturbios en Berlнn y otras ciudades luego del armisticio de 1918. Motines en todos los estamentos de su amada Kaiserliche Marine, la armada imperial, lo impresionaron profundamente. Para dejar en pie alguna forma de gobierno que le pudiera hacer frente a la anarquнa imperante, el Kбiser abdico a los tronos de Prusia y Alemania en un comunicado emitido por el Reichskanzler Maximillian von Baden el 9 de noviembre de 1918, asumiendo el poder un consejo de regencia, dirigido por Friedrich Ebert.;Il Kaiser Wilhelm II fu sorpreso dalle ribellioni a Berlino e altri centri alla fine del 1918. L'ammutinamento della sua amata Marina Imperiale lo sconvolse profondamente. Con la speranza di preservare una qualche forma di governo di fronte all'anarchia, Wilhelm abdic?come Imperatore della Germania e Re della Prussia il 9 Novembre 1918.;;;;;;Революция ?Берлин??других города?Германии, начавш?? ?конц?1918 ?, застал?кайзер?Вильгельма II врасплох. Однако наиболее сильно ег?потря??те???да?го?чо любимого императорского флот?- Кайзермарине. Ради сохранен? хоть како?нибудь власти ?условия?анархи? Вильгель?отрекся от обои?престоло?(прусског??имперского) 9 ноября 1918 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
