EVT1914_2191520_DESC;On 11 November, an armistice was signed at Compiиgne by German representatives. It effectively ended military operations between the Entente and Germany. It amounted to German demilitarization, without any concessions by the Entente. The naval blockade would continue until complete peace terms were agreed.;Le 11 Novembre, l'armistice a йt?sign??Compiиgne par les reprйsentants de l'Allemagne. Ils ont sign?la fin des opйrations militaires entre l'Entente et l'Allemagne. La dйmilitarisation de l'Allemagne a йt?actйe sans concessions par l'Entente. Le blocus naval continuera jusqu'?ce que les termes complets de la paix seraient signйs.;Am 11. November wurde von Abgesandten des deutschen Reiches bei Compiegne ein Waffenstillstandsabkommen unterzeichnet. Es beendete die Kampfhandlungen zwischen der Entente und dem deutschen Reich und erlegte ihm eine allgemeine Entwaffnung auf. Die Blockade sollte solange aufrecht erhalten werden, bis ein formeller Friedensschluss zustande gekommen wдre.  ;11 listopada w Compiиgne niemieccy przedstawiciele podpisali zawieszenie broni. Oznaczaіo ono faktyczny koniec operacji wojskowej pomiкdzy Entent? a Niemcami. Ostatecznie doprowadziіo do demilitaryzacji Niemiec, przy braku ustкpstw ze strony Ententy. Blokada morska trwaіa a?do ustalenia ostatecznych warunkуw pokojowych.;El 11 de noviembre, fue firmado el armisticio en Compiиgne por representantes alemanes. Esto termino de manera efectiva los enfrentamientos entre la Entente y el Imperio Alemбn. Significo la rendiciуn incondicional de Alemania a la Entente. El bloqueo naval seria mantenido hasta el acuerdo de paz fuera aceptado. ;L'11 Novembre, un armistizio fu firmato a Compiиgne dai rappresentanti della Germania. Esso pose fine alle manovre militari tra l'Intesa e la Germania e prevedeva la demilitarizzazione delal Germania, senza alcuna concessione all'Intesa. Il blocco navale sarebbe continuato fino al raggiungimento di un completo accordo di pace;;;;;;11 ноября 