 Klбipeda a Lituania y liberar el Sarre para Francia por 15 aсos?Es la hora mбs oscura del pueblo alemбn, que ve hipotecado su futuro?La Francia ci impone le sue condizioni di pace. Dobbiamo concedegli l'Alsazia e la Mosella, pagare riparazioni di guerra e disarmare l'esercito. Le nostre colonie saranno divise tra i paesi belligeranti, la Danimarca riprender?il controllo dei suoi territori a sud, la Polonia occuper?gran parte delle nostre terre orientali e dovremo cedere Klaipeda alla Lituania.;;;;;;Держав?Антант?на?зали на?свои условия мира. Мы обязаны возвратить Эльзас-Мозель Франци? выплатит?значительные военны?репараци??разоружить арми? Кром?того, наши колони?де?тся межд?державам?победительницами, Дания получает обратн?част?свои?южны?территорий, ?Польше отходи?большая част?наше?Западной Прусси? ?Клайпеда передает? Литв?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
