EVT1914_2191533_DESC;Our diplomats warned us that the Tzar's Winter Palace has been stormed by Russian revolutionaries. The government has been dismantled and Bolshevik Russia proclaimed. Their leader states they are 'neither at war, neither at peace' with Tsarist Russia's enemies. We must keep an eye on them.;Nos diplomates nous ont avertis que le Palais d'Hiver du Tsar a йt?pris d'assaut par des rйvolutionnaires russes. Le gouvernement a йt?dissout et la Russie Bolchйvique proclamйe. Ses dirigeants affirment n'кtre 'ni en paix, ni en guerre' contre les ennemis de la Russie tsariste. Nous devons garder un oeil sur eux.;Unsere Diplomaten setzten uns in Kenntnis, das der Winterpalast des Zaren von Aufrьhren gestьrmt wurde. Die rechtmдssige Regierung wurde abgesetzt und ein 'bolschewistisches Russland' ausgerufen. Die 'Bolschewiken' sagen selber, da?sie sich weder im Krieg noch im Frieden mit dem zaristischen Russland befдnden. Wir mьssen diese Situation im Auge behalten.;Nasi dyplomaci ostrzegli nas, їe carski Paіac Zimowy zosta?przejкty przez rosyjskich rewolucjonistуw. Rz№d zosta?rozproszony i ogіoszono powstanie republiki bolszewickiej. Ich przywуdca gіosi, їe bolszewicy nie s?'ani w stanie wojny, ani w stanie pokoju' z carskimi przeciwnikami. Musimy mie?na nich oko.;Nuestros diplomбticos nos advierten que Palacio de invierno del Zar ha sido asaltado por los revolucionarios rusos. El gobierno ha sido desmantelado y la Rusia bolchevique ha sido proclamada. Sus nuevos lнderes afirman que no estan 'ni en guerra, ni en la paz' con los enemigos de la Rusia zarista. Debemos mantenerlos vigilados. ;Our diplomats warned us that the Tsar's Winter Palace has been stormed by Russian revolutionnaries. The government has been dismantled and Bolshevik Russia proclaimed. Their leader state they are 'neither at war, neither at peace' with Tsarist Russia's ennemies. We must keep an eye on them.;;;;;;Наши дипломат?уведомил??то? чт?Зимний Дворец бы?взя?штурмо?революционерам? Временн