EVT1914_2191542_DESC;As a retaliation to the British blockade, we have the means to blockade them using submarines. This may upset some nations.;En rйponde au blocus britannique, nous avons les moyens d'йtablir un blocus contre eux ?l'aide de sous-marins. Cela dйrangera certainement quelques pays.;Als Vergeltung fьr die britische Blockade unserer Handelswege werden wir jetzt unsere U-Boote einsetzen, um die Ьbersseverbindungen GroЯbritanniens zu unterbrechen. Das kцnnte einige Nationen gegen uns aufbringen.;W odpowiedzi na blokad?brytyjsk? sami ustanowiliњmy blokad?ich kraju, wykorzystuj№c okrкty podwodne. To moїe nie podoba?si?niektуrym krajom.;Como represalia al bloqueo Britбnico, podemos bloquear las islas Britбnicas con nuestra extensa flota submarina, como es el corazуn de su Imperio Global, puede afectar a algunas naciones.;Come ritorsione per il blocco britannico, abbiamo i mezzi per bloccarli usando sottomarini. Questo potrebbe, per? turbare alcune nazioni.;;;;;;?отве?на британскую морску?блокад? мы такж?може?начать блокад? используя подводны?лодк? Однако подобный ша?може?вызват?недовольство нейтральны?государств.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
