EVT1914_2191543_DESC;Unlimited warfare means all convoys, including neutral ships, may be fired upon. As United Kingdom's major trade partner, the United States will certainly condemn this decision.;En rйponde au blocus britannique, nous avons les moyens d'йtablir un blocus contre eux ?l'aide de sous-marins. La guerre illimitйe signifie que tout convoi, y compris neutre, peut кtre attaqu? En tant que partenaire privilйgi?des britanniques, les Etats-Unis condamnerons certainement une telle dйcision.;Uneingeschrдnkter U-Bootkrieg heisst, da?alle Handelsschiffe, auch die neutraler Staaten, angegriffen werden dьrfen. Der Haupthandelspartner GroЯbritanniens sind die Vereinigten Staaten, die uns fьr diese Entscheidung nicht gerade lieben werden.;Nieograniczona wojna podwodna oznacza, їe atakujemy wszystkie konwoje, takїe neutralne statki. Jako partner handlowy Wielkiej Brytanii, Stany Zjednoczone z pewnoњci?potкpi?nasz?decyzj?;La guerra naval ilimitada (o total) significa que todos los convoyes, incluidas naves neutrales, son blancos legнtimos a los que debemos hundir. Como principal socio comercial del Imperio Britбnico, los Estados Unidos seguramente condenaran esta decisiуn.;Guerra senza limiti: tutti i convogli, comprese le navi neutrali, possono essere colpiti. Gli Stati Uniti, come principale partner commerciale del Regno Unito, condanneranno certamente questa decisione.;;;;;;Неограниченн? подводная войн?означает, чт?вс?граждански?торговые суда, ?то?числ??принадлежащи?нейтральны?страна? могу?быть потоплен?бе?предупрежден?. Эт?решени?безусловно вызове?недовольство ?САСШ, основног?торговог?партнера Великобритании.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
