EVT1914_2191544_DESC;As a result of our blockade, the Lusitania has been sunk this morning. United Kingdom claims it's a civilian ship, and that our attack resulted in hundreds of innocent deaths, among then 123 American passengers.;Consйquence de notre blocus, le Lusitania a йt?coul?ce matin. Les britanniques affirment que c'est un navire civil, et que l'attaque a provoqu?la mort de centaines d'innocents, dont 123 passagers amйricains.;Heute Morgen wurde infolge unseres U-Boot Krieges das Passagierschiff Lusitania versenkt. GroЯbritannien behauptet, es seien nur Zivilisten, unter ihnen 123 US Bьrger, an Bord gewesen.;Jedna z ofiar naszej blokady, statek Luzytania, zosta?zatopiony tego ranka. Wielka Brytania utrzymuje, їe by?to statek cywilny i їe w wyniku naszego ataku setki ludzi poniosіy њmier? Wњrуd nich byіo 123 amerykaсskich pasaїerуw.;Como resultado de la Guerra submarina total que hemos lanzado, el Navнo de pasajeros Britбnico, Lusitania, fue hundido frente a las costas de Irlanda, hoy por la tarde, causando la muerte de 1,198 pasajeros incluidos 234 ciudadanos estadounidenses. Esto ha enfurecido mucho la opiniуn pъblica de los Estados Unidos.;Come risultato del nostro blocco, il Lusitania ?stato affondato questa mattina. Il Regno Unito afferma che era una nave civile, e che il nostro attacco ha provocato centinaia di morti innocenti, tra i quali 123 passeggeri americani.;;;;;;?результате наше?блокад?сегодня утро?бы?потоплен британский пассажирский лайнер 'Лузитания'. Судн?затонуло за 18 мину??13 км. от берего?Ирландии. Великобритан? утверждает, чт?эт?было гражданско?судн? ?чт?наше нападени?привел??гибели соте?невинных люде? сред?которы?было 123 гражданина САСШ.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
