EVT1914_2191545_DESC;To the Mexican president : 'We intend to begin on the first of February unrestricted submarine warfare. We shall endeavor in spite of this to keep the United States of America neutral. In the event of this not succeeding, we make Mexico a proposal of alliance on the following basis: make war together, make peace together, generous financial support and an understanding on our part that Mexico is to reconquer the lost territory in Texas, New Mexico, and Arizona.';Au prйsident mexicain : 'Nous avons l'intention d'inaugurer la guerre sous-marine ?outrance. En dйpit de cela, nous dйsirons que les Йtats-Unis restent neutres, et si nous n'y rйussissons pas, nous proposons une alliance au Mexique.Nous ferons la guerre ensemble et nous ferons la paix ensemble. Nous accorderons notre appui financier au Mexique, qui aura ?reconquйrir les territoires du Nouveau Mexique, du Texas et de l'Arizona.';An den mexikanischen Prдsidenten: 'Wir beabsichtigen, ab dem 1. Februar einen uneingeschrдnkten U-Bootkrieg zu fьhren. Trotzdem bemьhen wir uns, die Vereinigten Staaten neutral zu halten. Sollten die Vereinigten Staaten an der Seite unserer Gegner in den Krieg eintreten, schlagen wir Mexiko folgendes Bьndnis vor: Wir kдmpfen gemeinsam, wir schliessen gemeinsam Frieden, das deutsche Reich leistet finanzielle Hilfe und unterstьtzt Mexiko in seinem Bestreben, verlorene Gebiete in Texas, Neu Mexiko und Arizona von den Vereinigten Staaten zurьckzubekommen.';Do prezydenta Meksyku: 'Planujemy wraz z 1 lutego rozpocz№ж nieograniczon?wojn?podwodn? Bкdziemy pomimo tego d№їy?do utrzymania Stanуw Zjednoczonych Ameryki Pуіnocnej w stanie neutralnoњci. Jeїeli jednakїe okazaіoby si?to niemoїliwe, proponujemy Meksykowi sojusz na nastкpuj№cych warunkach: razem pуjdziemy na wojn? razem zawrzemy pokуj, zaoferujemy hojne wsparcie finansowe i przyjmujemy, їe celem Meksyku jest odzyskanie utraconego terytorium Teksasu, Nowego Meksyku i Arizony.';Del Kбiser Wilhelm II al Gobierno de Mйxico: Nos proponemos comenzar el primero de febrero la guerra submarina, sin restricciуn. No obstante, nos esforzaremos para mantener la neutralidad de los Estados Unidos de Amйrica. En caso de no tener йxito, proponemos a Mйxico una alianza sobre las siguientes bases: hacer juntos la guerra, declarar juntos la paz;Per il presidente messicano: 'Abbiamo intenzione di iniziare il primo di febbraio una guerra sottomarina illimitata. Ci sforzeremo, nonostante questo, di mantenere gli Stati Uniti d'America neutrali. In caso di insuccesso, facciamo al Messico una proposta di alleanza sulle seguenti basi: fare la guerra insieme, fare insieme la pace, un generoso sostegno finanziario e la nostra affermazione che il Messico ha il diritto di riconquistare i territori perduti in Texas, Nuovo Messico ed Arizona.';;;;;;От кайзер?Вильгельма II мексиканском?президенту Венустиано Каррансе: 'Мы намерены начать ?1 февраля беспощадну?подводну?войн? Несмот? ни на чт? мы попытаем? удержать СШ??сост?ни?нейтралитета. Однако ?случае неуспеха мы предложи?Мексик? вместе вест?войн??сообща заключит?ми? ?наше?сторон?мы окажем Мексик?финансовую помоўў ?завери? чт?по окончани?войн?он?получи?обратн?утраченные ею территории Техаса, Ново?Мексик??Аризон?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
