EVT1914_2191546_DESC;Born in Burg Belchau near Graudenz in the Province of Prussia, Falkenhayn became a career soldier. Between 1896 and 1903 he served in Qing China, and saw action during the Boxer Rebellion. Afterward, the Army posted him to Brunswick, Metz, and Magdeburg, with ever-increasing rank. In 1913, he became Prussian Minister of War, in which capacity he acted as one of the key players in the genesis of World War I when the assassination of Archduke Franz Ferdinand in Sarajevo took place. Like most German military, he did not then count on an overall war, but he very soon embraced the idea and belonged to those pushing Kaiser Wilhelm II to declare war. Falkenhayn succeeded Moltke as Chief of the General Staff of the German Army after the Battle of the Marne on 14 September 1914. Confronted with the failure of the Schlieffen Plan due to Moltke's interference, he attempted to outflank the British and French in the 'Race to the Sea', a series of engagements throughout northern France and Belgium in which each side tried to turn the others flank until they reached the coastline. The British and French eventually stopped the Germans at the First Battle of Ypres (October-November 1914).;Durant la Premiиre Guerre mondiale, le haut йtat-major allemand est devenu un nid d'intrigues dиs l'instant o?von Falkenhayn a succйd??von Moltke ?la tкte de l'йtat-major gйnйral du front de l'Ouest. Hautain et tranchant, celui-ci dйpend entiиrement de la faveur du Kaiser, car son caractиre et ses propos acerbes lui valent l'hostilit?de la plupart de ses pairs. Falkenhayn a conзu l'offensive de Verdun en sachant pertinemment que la 'clique' du front de l'Est complotait contre lui. Son йchec permettra d'ailleurs ?Hindenburg et Ludendorff de le supplanter et de devenir les maоtres de l'Allemagne en guerre, qu'ils conduiront ?la dйfaite en 1918.;Erich von Falkenhayn erblickte am 11. September 1861 in Burg Belchau bei Graudenz in Westpreussen das Licht der Welt. Im Laufe seiner Karriere als Berufssoldat diente er zwischen 1896 und 1903 aus finanziellen und Karrieregrьnden als Mitilitдrberater in China und war an der Zerschlagung des 'Boxeraufstandes' beteiligt. Nach seiner Rьckkehr wurde er von der Armee nach Braunschweig, Metz und Magdeburg versetzt, was jedemals mit einer Befцrderung einherging. 1913 wurde er preussischer Kriegsminister und wurde zu einer der Schlьsselpersonen fьr den Ausbruch des Weltkrieges. Wie die meisten deutschen Militдrs rechnete er nicht mit einem allumfassenden Krieg, aber schon bald gehцrte er zu denjenigen, die Kaiser Wilhelm II zu einer Kriegserklдrung rieten. Als nach der verlorenen gegangenen Schlacht an der Marne Generalstabschef Moltke entlassen wurde, trat Flakenhayn seine Nachfolge an. Mit dem scheitern des Schlieffenplans durch die Einmischung Moltkes konfrontiert, versuchte er die nцrdliche Flanke der Entente Streitkrдfte zu ьberflьgeln und lieferte sich mit den Ententetruppen den 'Wettlauf zum Meer', der mit der verloren gegangenen Schlacht um Ypern in Belgien endete.;Urodzony w Burg Belchau koіo Grudzi№dza w prowincji pruskiej, Falkenhayn zwi№za?swoj?karier?z wojskiem. Pomiкdzy 1896 i 1903 r. sіuїy?w Chinach, gdzie uczestniczy?w dziaіaniach podczas powstania bokserуw. Nastкpnie armia wysіaіa go kolejno do Brunszwiku, Metz i Magdeburga, gdzie zdobywa?kolejne stopnie. W 1913 r. zosta?pruskim minister wojny, w ramach ktуrej funkcji by?kluczowym graczem podczas wybuchu I Wojny Њwiatowej po zabуjstwie arcyksiкcia Franciszka Ferdynanda. Jak wiкkszoњж sztabowcуw, nie zakіada?prowadzenia wojny caіkowitej, ale wkrуtce zaakceptowa?ten pomys?i przyі№czy?si?do њrodowisk naciskaj№cych na cesarza Wilhelma II, aby ten wypowiedzia?wojn? Falkenhayn zast№pi?Moltkego jako szefa sztabu generalnego niemieckiej armii po bitwie nad Marn?14 wrzeњnia 1914 r. Po poraїce Planu Schlieffena z powodu decyzji Moltkego, prуbowa?okr№їy?Brytyjczykуw i Francuzуw w ramach 'Wyњcigu do Morza' - serii walk w pуіnocnej Francji i Belgii, w ktуrej obie strony konfliktu manewrowaіy wokуі swoich linii tak dіugo, a?nie dotarіy do wybrzeїa. Brytyjczycy i Francuzi ostatecznie zatrzymali Niemcуw w pierwszej bitwie pod Ypres (paџdziernik-listopad 1914 r.).;Nacido en Burg Belchau cerca de Graudenz en el Reino de Prusia, von Falkenhayn se ha convertido en un oficial de carrera. Entre 1896 y 1903 ha servido en el Imperio Qing, y ha visto acciуn durante la rebeliуn Boxer. Despuйs de eso el Reichsheer le ha destinado en Brunswick, Metz y Magdeburgo, donde fue ascendiendo de rango. En 1913, se convirti?en ministro de guerra del Reino de Prusia, donde tomo un rol clave durante el inicio de la Gran Guerra, cuando sucedi?el asesinato del Archiduque Franz Ferdinand en Sarajevo. Como todo militar alemбn, no contaba con una guerra total contra la Entente, pero poco a poco fue convencido de la necesidad de empujar a su majestad imperial, el Kaiser Wilhelm II, a declarar la Guerra. Von Falkenhayn sucedi?a von Moltke como jefe del Generalstab der Kaiserreich, luego de la primera batalla del Marne el 14 de septiembre de 1914. Confrontado con el fracaso del Plan von Schlieffen debido a las interferencias de von Moltke, el intento flanquear a las fuerzas enemigas en la 'carrera al mar', una serie de enfrentamientos con el fin de enterrar las fuerzas enemigas en la costa. La coaliciуn Anglo-francesa, eventualmente le detuvo en la primera batalla de Ypres, a finales de octubre de 1914.;Nato a Burg Belchau vicino Graudenz nella provincia di Prussia, Falkenhayn ?diventato un soldato di carriera. Tra il 1896 e il 1903 ha prestato servizio nella Cina dei Qing, ed ha visto l'azione durante la rivolta dei Boxer. In seguito, l'esercito lo ha distaccato a Brunswick, Metz, e Magdeburgo, con gradi sempre crescenti. Nel 1913, divenne ministro della guerra prussiano, nella cui veste ha agito come uno degli attori chiave nella genesi della guerra mondiale, quando l'assassinio dell'arciduca Francesco Ferdinando a Sarajevo ha avuto luogo. Come la maggior parte dei militari tedeschi, non si aspettava una guerra globale, ma ben presto ha abbracciato l'idea ed ha spinto il Kaiser Guglielmo II a dichiarare guerra. Falkenhayn successe a Moltke come capo di stato maggiore generale dell'esercito tedesco dopo la battaglia della Marna, il 14 settembre 1914. Di fronte al fallimento del piano Schlieffen a causa dell'interferenza di Moltke, ha tentato di aggirare gli inglesi ed i francesi nella 'Corsa al mare', una serie di combattimenti in tutto il nord della Francia e del Belgio, in cui ciascuna parte ha cercato di fiancheggiare l'altro fino a quando hanno raggiunto la costa. Gli inglesi ed i francesi alla fine fermarono i tedeschi nella prima battaglia di Ypres (ottobre-novembre 1914).;;;;;;Родивший? ?замк?Бург-Бельха? расположенно?неподалеку от городк?Грауденц ?Прусси? Эрих фо?Фалькенхай?избрал военну?карьер? ?период ?1896 по1903 года он служил ?Цинско?Кита? участвовал ?подавлении восстания боксёров. Впоследствии служил ?Брауншвейг? Меце ?Магдебурге, на вс?боле?возраставших должностя? ?1913 году Фалькенхай?стал военны?министро?Прусси? ?этом качестве он выступал ?качестве одно?из ключевых фигу? способствовавших возникновени?мирово?войн? посл?убийства эрцгерцога Франца Фердинанда ?Сараев? Ка??большинств?немецких военны? он не являлся стороннико?общеевропейско?войн? однако вскоре измени?свои взгляды ?стал одни?из те? кт?склони?кайзер?Вильгельма II ?об?влению войн? 14 сентября 1914 года, посл?сражен? на Марн? Фалькенхай?сменил Мольтк?на пост?начальника генерального штаб? Столкнувшись ?провалом план?Шлиффена из-за самовольства Мольтк? он попытался обойти англичан ?французо??'Беге ?морю', маневренно?операции ?Северной Франци??Бельги? имевше?цель?охватить фланги противника ?окончившей? достижение?побережья Северног?мо? ?удлинением фронта на 170 - 180 км. ?конц?концов, британцы ?французы сумели остановить продвижени?немцев ?ходе первой битв?на Ипре (ок?бр?ноябр?1914 ?).;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,