EVT1914_2191547_DESC;Already during the secret negotiations for the defensive alliance the German ambassador Wangenheim and the Ottoman minister of war Enver Pasha agreed that the German 'Mittelmeerdivision' (Mediterranean Division), consisting of the SMS Goeben and SMS Breslau, would be sent to Constantinople to support the Ottoman fleet. However Enver Pasha had made the agreement without the consent of his government, which seeked to preserve its neutrality. Admiral Souchon misinterpreted the situation and moved towards Constantinople anyway, while a British fleet was already hunting for his ships. The 'Mittelmeerdivision' reached the Dardanelles on 10th August. There the Ottomans demanded the abolition of German trade privileges ('Capitulations') to let the fleet cruise into Ottoman waters and Wangenheim agreed. By granting the German fleet such permission the Ottomans transgressed the rules of neutrality, so the Grand Vizier Said Halim pretended the acquisition of these ships. The Germans rejected this proposal and demanded entry into the war from the Ottoman Empire. The Ottomans ignored this and announced the purchase of the two vessels. The Germans were forced to agree. Since the Ottomans did not have the appropriate personnel, the German crew was kept on board. One month later Souchon was appointed commander of the Ottoman Black Sea Fleet.;Dйj?durant les nйgociations secrиtes pour une alliance dйfensive, l'ambassadeur allemand Wangenheim et le ministre ottoman de la guerre Enver Pacha convinrent que 'Mittelmeerdivision' allemande (Division de la Mйditerranйe) comprenant le Gњben SMS et SMS Breslau serait envoy??Constantinople pour soutenir la flotte ottomane. Cependant, Enver Pacha conclu cet accord sans le consentement de son gouvernement, qui cherchait lui ?prйserver sa neutralit? L'Amiral Souchon interprйta incorrectement la situation, et se dirigea de toute faзon vers Constantinople, tandis qu'une flotte britannique avait dйj?commenc??chasser ses navires. La 'Mittelmeerdivision' atteignit les Dardanelles le 10 aoыt. L? les Ottomans exigиrent l'abolition des privilиges commerciaux allemands ('LesCapitulations') en prйambule pour autoriser la flotte allemande ?naviguer dans les eaux ottomanes. Wangenheim accepta. En accordant ?la flotte allemande une telle autorisation, les Ottomans transgressиrent les rиgles de la neutralit? c'est pourquoi le Grand Vizir Said Halim prйtendit avoir fait l'acquisition de ces navires. Les Allemands rejettиrent cette proposition, et demandиrent l'entrйe en guerre de l'Empire ottoman. Les Ottomans ignorиrent cette demande, et annoncиrent l'achat des deux navires. Les Allemands furent obligйs d'accepter. Les Ottomans n'ayant pas le personnel appropri? l'йquipage allemand fut conserv??bord. Un mois plus tard, Souchon fut nomm?commandant de la Flotte ottomane de la Mer Noire.;Schon wдhrend der geheimen Verhandlungen ьber ein Defensivabkommen gegen Russland verstдndigten sich der deutsche Botschafter Wangenheim und der osmanische Kriegsminister Enver Pasha darauf, die deutsche 'Mittelmeerdivision' bestehend aus der SMS Goeben und der SMS Breslau nach Konstantinopel zu schicken, wo sie die osmanische Schwarzmeerflotte unterstьtzen sollten. Enver Pasha hatte diese Ьbereinkunft allerdings ohne die Zustimmung seiner Regierung getroffen, welche die Neutralitдt des osmanischen Reiches wahren wollte. Vizeadmiral Souchon, Anfьhrer der Mittelmeerdivision, missinterpretierte die Situation allerdings und bewegte seine Schiffe verfrьht in Richtung Konstantinopel, wдhrend eine britische Flotte bereits Jagd auf die beiden Schiffe machte. Die Mittelmeerdivision erreichte die Dardanellen am 10. August. Um die osmanischen Gewдsser passieren zu dьrfen, verlangten die Osmanen die Abschaffung deutscher Handelsprivilegien ('Kapitulationen') und Botschafter Wangenheim stimmte zu. Diese Erlaubnis wдre eine Verletzung der osmanischen Neutralitдt gewesen, also gab der osmanische GroЯwesir Said Halim den Kauf der beiden Schiffe vor. Die Deutschen lehnten das Angebot ab und verlangten einen Kriegsbeitritt des osmanischen Reiches - diese jedoch ignorierten die Deutschen und kьndigten den Abschluss des Handels an. Den Deutschen blieb keine andere Wahl als zuzustimmen. Da die Osmanen jedoch nicht ьber das nцtige Personal zur Bedienung der Schiffe verfьgten, verblieben die deutschen Besatzungen einsatzbereit an Bord. Einen Monat spдter wurde Vizeadmiral Souchon zum Kommandanten der osmanischen Schwarzmeerflotte ernannt. ;Ju?podczas tajnych negocjacji w kwestii sojuszu obronnego, niemiecki ambasador Wangenheim i ottomaсski minister wojny Enwer Pasza zgodzili si?na to, by niemiecka 'Mittelmeerdivision' (Dywizja Њrуdziemnomorska), skіadaj№ca si?z SMS Goeben i SMS Breslau, bкd?wysіane do Konstantynopola, aby wesprze?flot?ottomaсsk? Enwer Pasza podejmowa?jednak decyzje bez zgody swojego rz№du, ktуry szuka?sposobu na zachowanie neutralnoњci. Admira?Souchon bікdnie zinterpretowa?sytuacj?i pomimo tego skierowa?si?na Konstantynopol, podczas gdy brytyjska flota szukaіa jego okrкtуw. 'Mittelmeerdivision' osi№gnкіa Dardanele 10 sierpnia. Ottomanowie zaї№dali anulowania niemieckich przywilejуw handlowych ('kapitulacji') w zamian za przepuszczenie floty i Wangenheim przysta?na to. Danie Niemcom takiej moїliwoњci byіo zіamaniem przez Ottomanуw zasad neutralnoњci, tak wiкc Wielki Wezyr Said Halim stworzy?pozory kupna okrкtуw. Niemcy nie zgodzili si?na to i wezwali Imperium Ottomaсskie do otwartego przyі№czenia si?do wojny. Spotkaіo si?to z obojкtnoњci?Ottomanуw, ktуrzy pomimo tego kupili oba okrкty, a Niemcy zmuszeni byli przysta?na taki ukіad. Poniewa?Ottomanowie nie mieli odpowiedniej zaіogi, na okrкtach pozostali Niemcy. Po miesi№cu Souchon zosta?mianowany dowуdc?ottomaсskiej Floty Czarnomorskiej.;Ya durante las negociaciones secretas para la alianza defensiva el embajador alemбn Wangenheim y el ministro de guerra otomano Enver Pasha aceptaron que la 'Mittelmeerdivision' alemana (Divisiуn Mediterrбnea), que consistнa en el SMS Goeben y el SMS Breslau, serнa enviada a Constantinopla para apoyar a la flota otomana. Sin embargo Enver Pasha habнa hecho un acuerdo sin el consentimiento de su gobierno, que querнa preservar su neutralidad. El almirante Souchon malinterpret?la situaciуn y se movi?hacia Constantinopla, mientras que la flota britбnica perseguнa a sus barcos. La Mittelmeerdivision lleg?a los Dardanelos el 10 de agosto. All?los otomanos demandaron la aboliciуn de los privilegios de comercio alemanes (Capitulaciones) para dejar a la flota en aguas otomanas y Wangenheim acept? Dando a la flota alemana esos permisos los otomanos transgedieron las reglas de la neutralidad, por lo tanto el Gran Visir Said Halim pretendi?adquirir esos barcos. Los alemanes rechazaron la propuesta y demandaron entrar en la guerra desde el Imperio Otomano. Los otomanos ignoraron esto y anunciaron la compra de los dos buques. Los alemanes fueron forzados a aceptar. Dado que los otomanos no tenнan el personal apropiado, la tripulaciуn alemana fue mantenida a bordo. Un mes despuйs, Souchon fue nombrado comandante de la flota otomana en el Mar Negro.;Gi?durante i negoziati segreti per l'alleanza difensiva, l'ambasciatore tedesco Wangenheim e il ministro Ottomano alla guerra Enver Pasha erano d'accordo sul fatto che la 'Mittelmeerdivision' tedesca (Divisione Mediterranea), comprendente la SMS Goeben e la SMS Breslau, sarebbe stata mandata a Costantinopoli per aiutare la flotta ottomana. Tuttavia Enver Pasha aveva siglato l'accordo senza il consenso del suo governo, che voleva preservare la propria neutralit? L'Ammiraglio Souchon interpret?male la situazione e si diresse comunque verso Costantinopoli, mentre una flotta Britannica cercava le sue navi. La 'Mittelmeerdivision' raggiunse i Dardanelli il 10 Agosto. L?gli Ottomani chiesero l'abolizione dei diritti di commercio tedeschi ('Capitolazioni') per far entrare le navi in acque Ottomane e Wangenheim acconsent? Dando tale permesso alla flotta tedesca, gli Ottomani trasgredirono alle regole delle neutralit? pertanto il Gran Visir Said Halim pretese di acquistare queste navi. I tedeschi rifiutarono la proposta e chiesero l'entrata in guerra dell'Impero Ottomano. Gli Ottomani li ignorarono e annunciarono l'acquisto delle due navi. I tedeschi furono costretti ad accettare la situazione. Dato che gli Ottomani non avevano il personale adatto, l'equipaggio tedesco rimase a bordo. Un mese dopo Souchon fu nominato Comandante della Flotta Ottomana del Mar Nero.;;;;;;Уж?во время тайных переговоро?по оборонительном?союз?немецкий посо?Вангенхайм ?Османско?военны?минист?Энве?паша договорились, чт?немецкий 'Mittelmeerdivision '(средиземноморски?девизион), сост?щи?из SMS Гебе??SMS  Бресла? буде?отправле??Константинопол? поддерживать флот Османско?импери? Однако Энве?паша сделал соглашен? бе?соглас? ег?правительств? которо?добивалось сохранен? нейтралитета. Адмира?Сушо?неправильн?оценил ситуацию ?выдвинул? ?сторон?Константинополя, ?то время ка?Британский флот уж?нача?охот?за ег?кораблями. Средиземноморски?девизион достиг Дарданел?10 август? Та?турк?потребовал?отмены немецких торговых привилегий, чтоб?допустит?корабл??османски?воды ?Вангенхайм согласил?. Пр?предоставлении германском?флот?такого разрешен? турк?нарушили правил?нейтралитета, та?чт?велики?визирь Саид Хали?стал претендовать на приобритение этих судо?Немц?отвергли эт?предложени??потребовал?от Османско?импери?вступленя ?войн? Османы проигнорировал?эт??об?вили ?покупк?двух судо?Немц?были вынужден?согласиться. Поскольк??туро?не было подходящего персонал? немецкий экипаж находился на борт? Чере?ме??Сушо?бы?назначен командиром Османского Черноморског?флот?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
