EVT1914_2191548_DESC;We managed to defeat Italy and force Italian leaders to surrender unconditionally. Italy loses its African colonies and must demobilize its army. Austria-Hungary also insists on gaining some provinces.;Nous sommes parvenus ?battre l'Italie et forcer ses dirigeants ?s'assoir ?la table des nйgociations. L'Italie doit cйder ses colonies et dйmobiliser son armйe. L'Autriche-Hongrie insiste йgalement pour obtenir quelques provinces.;Wir haben es geschafft, Italien zu besiegen und die Regierung zu einer bedingslosen Kapitulation zu zwingen. Italien muss seine afrikanischen Kolonien abtreten und seine Armee auflцsen. Auch Цsterreich-Ungarn besteht auf territorialen Zugestдndnissen.;Udaіo nam si?pokona?Wіochy i zmusi?ich przywуdcуw do bezwarunkowej kapitulacji. Wіosi trac?swe kolonie w Afryce i musz?zdemobilizowa?swoje wojsko. Austro-Wкgry naciskaj?rуwnie?na pozyskanie pewnych terytoriуw.;Hemos conseguido derrotar a Italia y obligar a los responsables italianos a la rendiciуn incondicional. Italia pierde sus colonias africanas y deben desmovilizar su ejйrcito. Austria-Hungria tambien considera que les deben ceder alguna de sus provincias.;Siamo riusciti a sconfiggere l'Italia ed a costringere i responsabili italiani ad arrendersi senza condizioni. L'Italia perde le sue colonie africane e deve smobilitare il proprio esercito. Austria-Ungheria insiste anche sul raggiungimento di alcune province.;;;;;;На?удалос?нанест?Италии поражени??принудит?итал?нско?руководств??безоговорочной капиту?ци? По ее условия?Итал? те?ет свои африкански?колони??обязует? демобилизовать свою арми? Австро-Венгрия такж?настаивает на получени?некоторы?территорий.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
