EVT1914_2191550_DESC;Now that peace have been signed with France, it's time to settle the Netherlands case.;Maintenant que la paix a йt?signйe avec la France, il est temps d'en finir avec le cas Nйerlandais.;Nach dem Friedensschluss mit Frankreich ist es an der Zeit, ьber die Zukunft der Niederlande zu entscheiden.;Teraz, kiedy podpisaliњmy pokуj z Francj? przyszed?czas na uregulowanie warunkуw pokoju z Holandi?;Ahora que hemos firmado la paz con Francia, es hora de encargarse de Holanda;Ora che la pace ?stata firmata con la Francia, ?il momento di passare al caso dei Paesi Bassi.;;;;;;Теперь, когд?подписан ми??Францией, настал?время уладит?дело ?Голландией.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
