EVT1914_2191551_DESC;We have won our war against the United Kingdom, which agreed to an armistice with us. The United Kingdom and the Central Powers' leaders meet today in Balmoral Castle, Scotland, to discuss the conditions of peace. We have the upper hand, so we can impose our choice.;Nous avons gagnйs la guerre contre le Royaume-Unis, qui a accept?un armistice avec nous. Le Royaume-Uni et les puissances Cnetrales se sont rencontrйs aujourd'hui dans le Chвteau de Balmoral en Ecosse, pour discuter des conditions de la paix. Nous avons l'avantage, nous pouvoir donc imposer notre choix.;Wir haben den Krieg gegen das vereinte Kцnigreich gewonnen und einem Waffenstillstand zugestimmt. Abgesandte des Kцnigreiches und des deutschen Kaiserreiches treffen sich heute auf Balmoral Castle in Schottland, um einen Friedensvertrag auszuhandeln. Als Sieger kцnnen wir die Bedingungen diktieren.;Wygraliњmy nasz?wojn?przeciwko Wielkiej Brytanii, ktуra zgodziіa si?na zawieszenie broni. Przywуdcy Zjednoczonego Krуlestwa i paсstw centralnych spotykaj?si?dzisiaj na Zamku Balmoral w Szkocji, aby przedyskutowa?warunki pokoju. Mamy przewag?w tej wojnie, wiкc moїemy narzuci?nasze warunki.;La Pйrfida Albiуn ha sido por fin vencida, corean extasiados los ciudadanos de Berlнn y Viena mientras los representantes de las Potencias Centrales y el Reino Unido se reъnen este dнa en el castillo escoces de Balmoral, para discutir las condiciones de paz que el Imperio Britбnico deber?pagar a cambio de la paz. Como vencedores de la guerra aceptaran lo que sea que pidamos?Abbiamo vinto la guerra con il Regno Unito, che ha accettato il nostro armistizio. I leader del Regno Unito e degli Imperi Centrali si sono incontrati oggi al Castello di Balmoral, in Scozia, per discutere le condizioni di pace. Abbiamo la possibilit?di imporre le nostre scelte.;;;;;;Мы выиграли нашу войн?против Соединенного Королевств? он?согласны на ми? Переговоры межд?представителями Соединенного Королевств??Центральны?держав пройде?сегодня ?замк?Балморал, Шотландия. Мы може?диктоват?наши условия.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
