EVT1914_2191552_DESC;We've signed an armistice with France after we defeated their armies. Peace negotiations will soon begin and then we'll decide how high a price they'll have to pay.;Nous avons signйs un armistice avec la France aprиs que nous ayons dйfaits leurs armйes. Les Nйgociations de paix dйbuteront bientфt et nous dйcideront ensuite quel prix ils devront payer.;Nachdem wir seine Truppen zerschlagen haben, haben wir einen Waffenstillstand mit Frankreich geschlossen. Die Friedensgesprдche werden bald beginnen und wir werden entscheiden, wie hoch die Reparationszahlungen ausfallen werden.;Podpisaliњmy rozejm z Francj?po tym, jak pokonaliњmy ich armie. Negocjacje pokojowe wkrуtce si?rozpoczn?i wtedy zadecydujemy, jak wysok?cen?przyjdzie im zapіaci?;Hemos firmado un Armisticio con Francia luego de la derrota total de sus ejйrcitos. Las negociaciones de paz comenzaran tan pronto como decidamos el castigo que merece la fъtil afrenta a nuestro poder que represent?esta absurda guerra?Abbiamo firmato un armistizio con la Francia dopo aver sconfitto il loro esercito. Le trattative di pace inizieranno presto e allora decideremo che prezzo saranno costretti a pagare.;;;;;;Мы подписал?временно?перемири??Францией посл?того, ка?их войска были разгромлен? Переговоры ?мире начнут? чере?нескольк?ме?це? ?Герман?, ка?лиде?Тройственног?союз? буде?решать судьбу побежденного противника со всей подобающей строгостью.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
