EVT1914_2191554_DESC;We've signed an armistice with Russia after we defeated their armies. Peace negotiations will soon begin and then we'll decide how high a price they'll have to pay.;Nous avons signйs un armistice avec la Russie aprиs que nous ayons dйfaits leurs armйes. Les Nйgociations de paix dйbuteront bientфt et nous dйcideront ensuite quel prix ils devront payer.;Nachdem wir seine Truppen zerschlagen haben, haben wir einen Waffenstillstand mit dem russischen Reich geschlossen. Die Friedensgesprдche werden bald beginnen und wir werden entscheiden, wie hoch die Reparationszahlungen ausfallen werden.;Podpisaliњmy rozejm z Rosj?po tym, jak pokonaliњmy ich armie. Negocjacje pokojowe wkrуtce si?rozpoczn?i wtedy zadecydujemy jak wysok?cen?przyjdzie im zapіaci?;Armisticio con el Imperio Ruso;Abbiamo firmato un armistizio con la Russia dopo aver sconfitto il loro esercito. Le trattative di pace inizieranno presto e allora decideremo che prezzo saranno costretti a pagare.;;;;;;Мы подписал?перемири??Россие?посл?победы на?их армиями. Переговоры ?мире скор?начнут?, ?мы сможем решить, каку?цену он?заплатя?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
