EVT1914_2191555_DESC;We have won our war against Russia which agreed to an armistice with us. The Russian Empire and the Central Powers' leaders meet today at Alexander Palace, near Petrograd, to discuss the conditions of peace. We have the upper hand, so we can impose our choice.;Nous avons gagnйs la guerre contre la Russie, qui a acceptйe un armistice avec nous. L'Empire Russe et les puissances Centrales se sont rencontrйes aujourd'hui au Palais d'Alexandre, ?cфt?de Petrograd, pour discuter des conditions de paix. Nous avons l'avantage, nous pouvons donc imposer notre choix.;Wir haben den Krieg gegen das russische Reich gewonnen und einem Waffenstillstand zugestimmt. Abgesandte des russischen Reiches und des deutschen Kaiserreiches treffen sich heute im Alexanderpalast bei Petrograd, um einen Friedensvertrag auszuhandeln. Als Sieger kцnnen wir die Bedingungen diktieren.;Wygraliњmy nasz?wojn?przeciwko Rosji, ktуra zgodziіa si?na zawieszenie broni. Przywуdcy Cesarstwa Rosyjskiego i przywуdcy paсstw centralnych spotykaj?si?dzisiaj w Paіacu Aleksandrowskim niedaleko Piotrogrodu, aby przedyskutowa?warunki pokoju. Mamy przewag?wystarczaj№c? by narzuci?swoje warunki.;El Tratado de Tsarskoye Selo;Abbiamo vinto la guerra con la Russia, che ha accettato il nostro armistizio. I leader del Regno Unito e degli Imperi Centrali si sono incontrati oggi al Palazzo di Alessandro, vicino a  Pietrogrado, per discutere le condizioni di pace. Abbiamo la possibilit?di imporre le nostre scelte.;;;;;;Мы выиграли войн?против России, ?сегодня было заключен?перемири? Дипломат?Российской импери??Тройственног?союз?встретятся сегодня ?Александровско?дворце ?Петрограде, чтоб?обсудить условия капиту?ци? Мы може?расчитыват?на самы?жестки?требоания.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
