EVT1914_2191560_DESC;The Baghdad Railway was the only effective route to the southern parts of the Ottoman Empire. The Anatolian Railway (Istanbul - Konya) had already been built and was operated by a consortium of German companies. In 1903 the same consortium got the concession for a route from Konya to Basra for 99 years. The construction - estimated for 10 years - was stopped by political issues in Ottoman Empire from 1904 until 1910. To obtain the consent of the British Empire to continue the construction, Baghdad was set as the endpoint. During the Great War the construction went on, but due the defeat of the German Empire it wasn't completed until 1940. However, if you do complete the construction, you will get free oil from Mosul.;Le chemin de fer de Bagdad йtait la seule voie efficace vers les parties mйridionales de l'Empire ottoman. Le chemin de fer d'Anatolie (Istanbul - Konya) avait dйj?йt?construit et йtait exploit?par un consortium d'entreprises allemandes. En 1903, le mкme consortium obtint la concession pour une route de Konya ?Bassorah, pour 99 ans. La construction - estimйe ?10 ans - fut arrкt?par des raisons politiques de 1904 jusqu'en 1910. Pour obtenir le consentement de l'Empire britannique ?poursuivre la construction, Bagdad fut dйfini comme la fin de la ligne. Pendant la Grande Guerre, la construction continua, mais ne fut complйtйe qu'en 1940 en raison de la dйfaite. Toutefois, si vous achevez la construction, vous obtiendrez gratuitement du pйtrole de Mossoul.;Die Bagdadbahn war die einzige effektive Verbindung zu den sьdlichen Teilen des osmanischen Reiches. Die anatolische Eisenbahn von Istanbul nach Konya war bereits fertiggestellt und wurde von einem Konsortium deutscher Firmen betrieben. Im Jahre 1903 bekam dasselbe Konsortium die Konzession zum Bau und Betrieb einer Bahnlinie von Konya nach Basra. Der Bau sollte 10 Jahre dauern, wurde aber aufgrund politischer Grьnde im osmanischen Reich von 1904 bis 1910 ausgesetzt. Um die Zustimmung des britischen Empires zum Bau der Bahn zu bekommen, wurde allerdings als neuer Endpunkt Bagdad festgesetzt. Wдhrend des Weltkrieges wurde zwar der Bau fortgesetzt, wegen der Niederlage des deutschen Kaiserreiches aber erst 1940 beendet. Wenn Sie den Bau der Bagdadbahn vollenden, werden sie kostenloses Цl aus der Region Mosul bekommen. ;Kolej Bagdadzka byіa jedyn?skuteczn?tras?prowadz№c?do poіudniowych terytoriуw Imperium Ottomaсskiego. Kolej Anatolijska (Stambu?- Konya) byіa ju?zbudowana wczeњniej i obsіugiwaіo j?konsorcjum niemieckich spуіek. W 1903 r. to samo konsorcjum uzyskaіo na 99 lat koncesj?na tras?od Konyi do Basry. Budowa, ktуra miaіa trwa?10 lat, zatrzymywana byіa przez niepokoje polityczne w Imperium Ottomaсskim dwukrotnie, w 1904 i 1910 r. Aby zapobiec oporowi Wielkiej Brytanii wobec planуw budowy tras?skrуcono do Bagdadu. Budowy nie przerwaіa natomiast I Wojna Њwiatowa, chocia?poraїka paсstw centralnych op?niіa ukoсczenie konstrukcji do 1940 r. W przypadku ukoсczenia konstrukcji gracz otrzyma natomiast darmow?rop?naftow?z Mosulu.;El Ferrocarril de Baghdad era la ъnica ruta efectiva a las partes meridionales del Imperio Otomano. El Ferrocarril Anatolio (Istambul - Konya) ya habнa sido construнdo y era operado por un consorcio de compaснas alemanas. En 1903 el mismo consorcio obtuvo la concesiуn de una ruta desde Konya hasta Basra por 99 aсos. La construcciуn, estimada en 10 aсos, fue detenida por razones polнticas en el Imperio Otomano desde 1904 a 1910. Para obtener el consentimiento del Imperio Britбnico y continuar la construcciуn, Baghdad fue fijada como el punto final. Durante la Gran Guerra la construcciуn continu? pero debido a la derrota del Imperio Alemбn no fue completada hasta 1940. Sin embargo, si completamos la construcciуn obtendremos petrуleo gratis de Mosul.;La ferrovia di Baghdad era l'unica via efficace per andare verso la parte meridionale dell'Impero Ottomano. La Ferrovia Anatolica (Istanbul - Konya) era gi?stata costruita ed era gestita da un consorzio di aziende tedesche. Nel 1903 lo stesso consorzio ha ottenuto la concessione, per 99 anni, per un itinerario da Konya a Bassora. La costruzione - stimato in 10 anni - fu fermata per i problemi politici dell'impero ottomano dal 1904 fino al 1910. Per ottenere il consenso dell'Impero Britannico al proseguimento della costruzione, Baghdad venne scelta come destinazione finale. Durante la Grande Guerra la costruzione continu? ma a causa della sconfitta dell'Impero tedesco, non fu completata fino al 1940. Tuttavia, completando la costruzione, si ottiene il petrolio di Mosul.;;;;;;Багдадск? железн? дорога была единственной эффективно?дорого??южно?част?Османско?импери? Анатолийск? железн? дорога (Стамбу?- Конья) уж?была построен??эксплуатировалас?консорциумом немецких компаний. ?1903 году то?же консорциум получи?концесси?на маршру?из Конья ?Баср?на 99 ле?Строительств?- приблизительно ?течени?10 ле?- бы?остановлен?из-за политических вопросов ?Османско?импери??1904 до 1910 года. Для получения соглас? Британской импери?продолжить строительств? Багдад бы?установлен ?качестве конечной точк? Во время Мирово?войн?строительств?продолжалось, но из-за поражения Германской импери?он?не было завершен?до 1940 года. Однако, если вы завершит?строительств? вы получите бесплатную нефт?из Мосула.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
