EVT1914_2191561_DESC;The presence of oil deposits around Mosul had been well known for a long time. At the beginning of the 20th century, oil was becoming more and more important with each day, but at that time the German Empire was completely dependent on oil imports from USA. For this reason the German consortium asked and manages to obtain the concession to extract all raw materials near the railway. Historically the Germans didn't complete the railway section to Mosul.;La prйsence de gisements de pйtrole autour de Mossoul йtait bien connu depuis longtemps. Au dйbut du 20иme siиcle, le pйtrole devint de jour en jour plus important, mais ?cette йpoque-l? l'Empire allemand йtait complиtement dйpendant des importations de pйtrole en provenance des USA. Pour cette raison, le consortium allemand demanda et parvint ?obtenir la concession pour l'extraction de toutes les matiиres premiиres ?proximit?du chemin de fer. Historiquement, les Allemands n'ont pas termin?le tronзon de chemin de fer vers Mossoul.;Seit langer Zeit war bekannt, da?es in der Gegend von Mosul Цl gibt. Mit Beginn des 20. Jahrhunderts wurde Цl von Tag zu Tag wichtiger, aber das deutsche Kaiserreich war abhдngig von Цlimporten aus den vereingten Staaten. Aus diesem Grund verhandelte das deutsche Konsortium nicht nur den Bau und Betrieb der Bagdadbahn, sondern erhielt auch die Schьrfrechte entlang der Bahnlinie. Der Ausbruch des Weltkrieges verhinderte allerdings, da?die Bahnlinie Mosul erreichte.;Obecnoњж bogatych zіу?w okolicach Mosulu byіa wiadoma od dіugiego czasu. W pocz№tkach XX wieku, ropa naftowa stawaіa si?z kaїdym dniem coraz waїniejszym surowcem, a Cesarstwo Niemieckie kompletnie polegaіo na imporcie ropy. Z tego wzglкdu niemieckie konsorcjum ubiegaіo si?na koncesj?na wydobycie wszystkich zasobуw naturalnych w okolicach budowanej kolei, i koncesj?tak?uzyskaіo. W rzeczywistoњci Niemcom nie udaіo si?ukoсczy?odcinka kolei w okolicach Mosulu.;La presencia de depуsitos de petrуleo en las cercanнas de Mosul ha sido bien conocida por largo tiempo. Al inicio del siglo 20, el petrуleo se iba volviendo mбs y mбs importante cada dнa que pasaba, pero en esos tiempos el Imperio Alemбn era completamente dependiente de la importaciуn de petrуleo desde EEUU. Por esta razуn, el consorcio alemбn solicit?y logr?obtener la concesiуn para extraer todas las materias primas cercanas al ferrocarril. Histуricamente los alemanes no completaron la secciуn de ferrocarril hasta Mosul.;La presenza di depositi di petrolio vicino Mosul era nota da tempo. All'inizio del XX secolo, il petrolio stava diventando sempre pi?importante, ma a quel tempo l'impero tedesco era completamente dipendente dalle importazioni di petrolio dagli Stati Uniti. Per questo motivo il consorzio tedesco chiese, riuscendoci, ad ottenere la concessione per estrarre tutte le materie prime nei pressi della ferrovia. Storicamente i tedeschi non completarono la sezione della ferrovia fino a Mosul.;;;;;;?наличи?нефтяны?месторождени?вокруг Мосула было известно давн? ?начале XX-го века, нефт?становит? вс?боле??боле?важной ?каждым днем??, но ?то время Германск? империя была полность?зависима от импорт?нефт?из СШ? По этой причин?немецкий консорциум запросил, ?ем?удалос?получить концесси? чтоб?извлеч?вс?сырь? ?до??железной дорого? Историческ?сложилос? чт?немц?не завершил?участо?железной дороги ?Мосу?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
