EVT1914_2191562_DESC;Financial, technical and political issues prevented the construction of a tunnel through the Taurus Mountains before the beginning of the Great War. Historically this section was completed on 9th October 1918. It was 37 km long and connected the stations Karapinar and Dorak.;Des problиmes financiers, techniques et politiques, empкchиrent la construction d'un tunnel ?travers les montagnes du Taurus avant le dйbut de la Grande Guerre. Historiquement, ce tronзon fut complйtйe le 9 octobre 1918. Elle йtait longue de 37 km de long, et reliait les gares de Karapinar et de Dorak.;Finanzielle, politische und technische Grьnde verhinderten die Fertigstellung eines Tunnels durch das Taurusgebirge vor Kriegsbeginn. Das 37 Kilometer lange Teilstьck von Karapinar bis Dorak wurde erst am 9. Oktober 1918 fertiggestellt. ;Przeszkody finansowe, techniczne i polityczne stanкіy na drodze budowy tunelu przez Gуry Taurus zaraz przed rozpoczкciem Wielkiej Wojny. Historycznie, sekcja ta zostaіa ukoсczona 9 paџdziernika 1918 r. Miaіa 37 km dіugoњci i і№czyіa stacje Karapinar i Dorak.;Cuestiones financieras, tйcnicas y polнticas evitaron la construcciуn de un tъnel a travйs de las Montaсas Taurus antes del inicio de la Gran Guerra. Histуricamente esta secciуn fue completada el 9 de octubre de 1918. Tenнa 37 km de largo y conectaba las estaciones de Karapinar y Dorak.;Questioni finanziarie, tecniche e politiche impedirono la costruzione di un tunnel attraverso le montagne del Taurus prima dell'inizio della Grande Guerra. Storicamente questa sezione venne conclusa il 9 ottobre 1918. Era lunga 37 km e collegava le stazioni di Karapinar e Dorak.;;;;;;Финансовые, технически??политические вопросов?предотвратил?строительств?тоннеля чере?горы Таурус до начала Первой Мирово? Историческ?этот раздел бы?завершен 9 ок?бря 1918 года. Этот участо?бы?37 км ?длин??подключи?станци?Карапина??Дора?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,