EVT1914_2191567_DESC;Mosul wasn't connected with the Baghdad Railway until 1939. The Taurus Express rode only until Nusaybin and beyond that haulage services were established which transported passengers with carriages (and later with cars) to the cities of Kirkurk, Mosul and Baghdad.;Mossoul ne fut pas connect?avec le Chemin de fer de Bagdad jusqu'en 1939. L'Express du Taurus roulait seulement jusqu'?Nusaybin, et, au-del?  des services de transport ont йt?mis en place, transportant les passagers par charriots (et plus tard par voitures) pour les villes de Mossoul et de Kirkurk.;Mosul wurde erst im Jahre 1939 an die Bagdadbahn angeschlossen. Bis dahin fuhr der Taurus Express nur bis Nusaybin und die Passagiere mit Ziel Bagdad, Mosul und Kirkurk wurden mit Wagen weitertransportiert. ;Mosul nie by?poі№czony do systemu kolei bagdadzkiej a?do 1939 r. Tauruski Ekspres koсczy?swуj bieg ju?w Nusaybinie, a dalej transport wozami (w p?niejszym czasie samochodami) zapewnia?moїliwoњж dotarcia do Kirkuku, Mosulu i Bagdadu.;Mosul no fue conectada con el Ferrocarril de Baghdad hasta 1939. El Expreso Taurus circul?solo hasta Nusaybin, y mбs all?se establecieron servicios de transporte que llevaban pasajeros con carruajes (y luego con automуviles) a las ciudades de Kirkuk, Mosul y Baghdad.;Mosul non fu collegata con la ferrovia di Baghdad fino al 1939. Il Taurus Express andava solo fino Nusaybin e, per proseguire, i servizi di trasporto erano rappresentati da carrozze (e pi?tardi da auto) verso le citt?di Kirkurk, Mosul e Baghdad.;;;;;;Мосу?не бы?связа??Багдадской железной дороги до 1939 года.Таурус экспресс ше?только до Нусайбин? ?за ег?пределам? были создан?услуги перевозк? которы?перевозили пассажиров ко?скам?(?зате??автомоби?ми) ?города Киркур? Мосу??Багдад.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
