EVT1914_2191569_DESC;The section Tall Kutschak ?Samarra is 384 km long. It was completed on 15th july 1940. With the inauguration of this section the Baghdad Railway was finally finished.;Le tronзon Tall Kutschak - Samarra йtait long de 384 km. Il fut achev?le 15 juillet 1940. Avec l'inauguration de ce tronзon, le chemin de fer de Bagdad йtait finalement termin?;Der Streckenabschnitt von Kutschak bis Samarra ist 384 Kilometer lang. Er wurde am 15. Juli 1940 fertiggestellt und vollendete mit seiner Einweihung die Bagdadbahn. ;Odcinek od Tall Kutschak do Samarry mia?384 km. Zosta?ukoсczony 15 lipca 1940 r. Wraz z inauguracj?tego odcinka Kolej Bagdadzka zostaіa wreszcie ukoсczona.;La secciуn Tall Kutschak - Samarra es de 384 km de largo. Fue completada el 15 de julio de 1940. Con la inauguraciуn de esta secciуn el Ferrocarril de Baghdad finalmente fue terminado.;La tratta Tall Kutschak - Samarra ?lunga 384 km. Venne completata il 15 luglio 1940. Con l'inaugurazione di questa sezione, la ferrovia di Baghdad venne finalmente finita.;;;;;;Участо?Та?Кутчак - Самарр?состав?ет 384 км. Он бы?завершен 15 ию? 1940 года. ?открытие?данног?раздел?Багдадск? железн? дорога была окончательно закончен?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
