EVT1914_2191571_DESC;The missing section between the stations Rasulain and Nusaybin was 110 km long. The first part (Rasulain ?Darbiziyya) was completed in february 1917, the second (Darbiziyya ?Nusaybin) on 30th june 1918.;Le tronзon manquant entre les gares de Rasulain et de Nusaybin йtait long de 110 km. La premiиre partie (Rasulain - Darbiziyya) fut achevйe en fйvrier 1917, la seconde (Darbiziyya - Nusaybin) le 30 juin 1918.;Der Streckenabschnitt von Rasulain bis Nusaybin ist 110 Kilometer lang. Der erste Teil von Rasulain bis Darbiziyya wurde im Februatr 1917, der zweite von Darbiziyya bis Nusaybin am 30. Juni 1918 fertigestellt.;Brakuj№cy odcinek od Rasulainu do Nusaybinu mia?110 km dіugoњci. Pierwsza jego cz??(Rasulain ?Darbiziyya) zostaіa ukoсczona w lutym 1917 r., reszt?trasy (Darbiziyya ?Nusaybin) oddano do uїytku 30 czerwca 1918 r.;La secciуn faltante entre las estaciones Rasulain y Nsaybin era de 110 km de largo. La primera parte (Rasulain ?Darbiziyya) fue completada en febrero de 1917, la segunda (Darbiziyya ?Nusaybin) el 30 de junio de 1918.;La sezione mancante tra le stazioni di Rasulain e Nusaybin era di 110 km. La prima parte (Rasulain - Darbiziyya) venne completata nel febbraio 1917, la seconda (Darbiziyya - Nusaybin) il 30 giugno 1918.;;;;;;Отсутствующи?участо?межд?станциями Расулейн ?Нусайбин состав??110 км. Перв? част?(Расулейн - Дарбизийя) была завершен??феврал?1917 года, втор? (Дарбизийя - Нусайбин) 30 ию? 1918 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
