EVT1914_2191573_DESC;Already during the Balkan Wars the European powers considered the partition of the Ottoman Empire. To save their Empire the Ottomans attempted to get into an alliance with any major power, but none of them was interested in an alliance with the sick Empire. Most members of the CUP (Committee of Union and Progress, the ruling party) favoured an alliance with France or Britain. Only a minority around Enver Pasha wanted to ally with the German Empire. Only the July Crisis prompted the German Empire to approach the Ottomans.\nIn the end of July secret negotiations were held in Constantinople with respect to a defensive alliance against Russia. After Enver had offered the battleship Sultan Osman I (which was seized a day later by the British) the Germans agreed on 1st August to sign the offer of the Ottoman Empire and sealed the alliance on 2nd August. The two parties committed themselves to military assistance in case one of their countries being declared war by Russia. Since a day before the signing the German Empire declared war on Russia, the Ottomans were not obliged to assist. Although on the next day general mobilization was announced, the Ottoman Empire declared neutrality.\nThe German military mission, headed by Otto Liman von Sanders, was scheduled to leave on August 1st, but it was agreed that the mission would remain in the Empire and that in times of war some posts in the highest military command level of Ottoman army should be assigned to German officers.\n§RNote: The signing of the defensive alliance is a prerequisite to make §Rthe Ottomans join the Central Powers.;Dйj?durant les guerres balkaniques, les puissances europйennes considйrиrent la partition de l'Empire ottoman. Pour sauver leur empire, les Ottomans tentиrent de s'allier avec une grande puissance, mais aucune d'elles ne se montrait intйress?pour s'allier avec l'Empire malade. La plupart des membres du CUP (Comit?Union et Progrиs du parti au pouvoir) penchaient pour une alliance avec la France ou la Grande-Bretagne. Seule une minorit?autour Enver Pacha voulait s'allier avec l'Empire allemand. Seule la Crise de Juillet poussa l'Empire allemand ?approcher les Ottomans.\n\n A la fin de Juillet, des nйgociations secrиtes eurent lieu ?Constantinople , concernant une alliance dйfensive contre la Russie. Aprиs qu'Enver eu offert le cuirass?Sultan Osman Ier (qui fut saisi un jour plus tard par les Britanniques), les Allemands convinrent le 1er aoыt de signer l'offre de l'Empire ottoman, et scellиrent l'alliance le 2 aoыt. Les deux parties s'engagиrent ?une assistance militaire au cas o?l'un des deux pays se verraient dйclar?la guerre par la Russie. L'Empire allemand ayant dйclar?la guerre ?la Russie depuis la veille de la signature, les Ottomans ne se virent pas obligйs de les aider. Bien que la mobilisation gйnйrale ait йt?annoncйe, l'Empire ottoman dйclara sa neutralit?le lendemain.\nIl йtait prйvu que la mission militaire allemande dirigйe par Otto Liman von Sanders devait quitter le pays le 1er aoыt, mais il fut convenu que la mission reste dans l'Empire, et que certains des postes au plus haut niveau du commandement militaire ottoman soit attribuйs ?des officiers allemands en temps de guerre, \n§Remarque : La signature de l'alliance dйfensive est une condition sine qua non pour que §Rles Ottomans rejoignent les Puissances Centrales.;Schon wдhrend der Balkankriege wдgten die europдischen Mдchte eine Zerschlagung und Aufteilung des osmanischen Reiches ab. Um das Reich zu bewahren, bemьhten sich die Osmanen mehrmals vergeblich um eine Allianz mit einer beliebigen GroЯmacht, doch niemand war an einer Allianz mit dem 'kranken Mann vom Bosporus' interessiert. Die meisten Mitglieder des Komitees fьr Einheit und Fortschritt (KEF, die herrschende Partei) bevorzugten eine Allianz mit Frankreich und GroЯbritannien. Lediglich eine Minderheit um Enver Pasha befьrwortete eine Allianz mit dem Deutschen Kaiserreich. Erst die Ermordung des цsterreichischen Thronfolgers Franz Ferdinand und die darauf folgende Julikrise, welche schlieЯlich im Ersten Weltkrieg mьnden sollte, bewegten das deutsche Reich dazu, auf das osmanische Reich zuzugehen. \nGegen Ende Juli wurden geheime Verhandlungen in Konstantinopel bezьglich eines Defensivabkommens gegen das russische Zarenreich abgehalten.  Enver bot den Deutschen das Schlachtschiff 'Sultan Osman I' an (welches einen Tag spдter von den Briten beschlagnahmt wurde) und die Deutschen stimmten am 1. August einer Unterzeichnung des Geschenks und am 2. August einer Unterzeichnung des Defensivabkommens zu.  Beide Seiten verpflichteten sich zur gegenseitigen Hilfe im Falle einer Kriegserklдrung durch Russland. Da die Deutschen einen Tag zuvor dem russischen Zarenreich den Krieg erklдrt hatten, waren die Osmanen vertragsrechtlich nicht zu einem Eintritt in den Krieg verpflichtet. Obwohl das osmanische Reich seine Neutralitдt beteuerte, wurde am folgenden Tag die Generalmobilmachung angeordnet. \nDie deutsche Militдrmission unter Generalleutnant Otto Liman von Sanders, die eigentlich am 1. August das Land verlassen sollte, verblieb daraufhin im Reich und es wurde sich darauf verstдndigt, dass hohe Militдrpositionen in der osmanischen Armee an deutsche Offiziere vergeben weden sollten. \n§RHinweis: Die Unterzeichnung des Defensivabkommens ist eine Voraussetzung zum Beitritt des osmanischen Reiches zu den Mittelmдchten.;Ju?podczas Wojen Baіkaсskich mocarstwa europejskie rozwaїaіy podzia?Imperium Ottomaсskiego. Chc№c chroni?swoje imperium, Ottomanie d№їyli do sojuszu z jak№kolwiek potкga europejsk? ale їadna nie chciaіa si?wi№za?ukіadami z 'chorym czіowiekiem Europy'. Wiкkszoњж czіonkуw rz№dz№cej partii, CUP (Komitetu Unii i Postкpu), chciaіo sojuszu z Francj?lub Wielk?Brytani? Tylko nieliczni, zgromadzeni wokуі Enwera Paszy, pragnкli sojuszu z Cesarstwem Niemieckim. Dopiero Kryzys Lipcowy skіoni?Niemcуw do rozpoczкcia negocjacji z Ottomanami. Tajne rozmowy toczyіy si?w Konstantynopolu i dotyczyіy sojuszu defensywnego przeciwko Rosji. Po tym jak Enwer zaoferowa?pancernik Suіtan Osman I (ktуry dzie?p?niej zarekwirowali Brytyjczycy) Niemcom, zgodzili si?oni, 1 sierpnia, podpisa?sojusz, ostatecznie zawarty 2 sierpnia 1914 r. Oba paсstwa zobowi№zaіy si?do wsparcia wojskowego w przypadku deklaracji wojny ze strony Rosji. Jakkolwiek nastкpnego dnia ogіoszono powszechn?mobilizacj? Imperium Ottomaсskie zadeklarowaіo neutralnoњж. Niemiecka misja wojskowa, prowadzona przez Otto Limana von Sandersa, miaіa opuњci?Turcj?1 sierpnia, ale zdecydowano o jej przedіuїenia oraz przyznania Niemcom podczas wojny rуїnych kluczowych stanowisk w krкgach kierowniczych armii tureckiej.\n§RUwaga: Podpisanie sojuszu obronnego jest warunkiem wstкpnym, aby §ROttomanowi doі№czyli do paсstw centralnych.;Ya durante las Guerra de los Balcanes las potencias europeas consideraban la particiуn del Imperio Otomano. Para salvar su Imperio los otomanos intentaron una alianza con una gran potencia, pero ninguna de ellas estaba interesada en una alianza con el Imperio. La mayorнa de los miembros del CUP (Comit?de Uniуn y Progreso, el partido gobernante) querнan una alianza con Francia o Gran Bretaсa. Solo una minorнa querнa aliarse con el Imperio Alemбn. Solo la Crisis de Julio estimul?al Imperio Alemбn a acercarse a los otomanos. A final de julio negociaciones secretas fueron mantenidas en Constantinopla con respecto a una alianza defensiva contra Rusia. Enver habнa ofrecido el acorazado Sultбn Osman I (que fue incautado un dнa despuйs por los britбnicos) los alemanes aceptaron el 1 de agosto a firmar la oferta del Imperio Otomano y cerraron la alianza el 2 de agosto. Las dos partes se comprometieron a asistencia militar en caso de que a uno de los paнses se le fuese declarada la guerra por Rusia. Un dнa antes de la firma, el Imperio Alemбn declar?la guerra a Rusia, los otomanos no fueron obligados a asistir. Aunque el dнa siguiente una movilizaciуn general fue anunciada, el Imperio Otomano declar?la neutralidad. La comisiуn militar alemana, liderada por Otto Liman von Sanders, program?su salida el 1 de agosto, pero se acept?que la comisiуn permaneciese en el Imperio y que en tiempos de guerra algunos puestos en el comando militar superior deberнan ser asignados a oficiales alemanes.\n§RNota: La firma de una alianza defensiva es un prerrequisito para que los §Rotomanos se unan a las Potencias Centrales.;Gi?durante le Guerre Balcaniche le potenze Europee avevano considerato la spartizione dell'Impero Ottomano. Per salvare l'Impero, gli Ottomani cercarono di allearsi con una qualunque potenza, ma nessuna di loro era interessata ad allearsi con l'Impero Malato. Molti membri del CUP (Comitato per Unione e Progresso, il partito regnante) preferivano un'alleanza con Francia o Regno Unito. Solo una minoranza intorno a Enver Pasha voleva allearsi con l'Impero Tedesco. Solo la Crisi di Luglio spinse l'Impero Tedesco ad approcciare gli Ottomani. Alla fine di luglio, negoziati segreti furono tenuti a Costantinopoli a riguardo di un'alleanza difensiva contro la Russia. Dopo che Enver offr?la corazzata Sultan Osman I (requisita il giorno dopo dai Britannici) i Tedeschi accettarono la proposta degli Ottomani il 1 Agosto e firmarono l'allenza il 2 Agosto. I due paesi si impegnarono ad assistersi militarmente se la Russia avesse dichiarato guerra a uno dei due. Dato che il giorno prima della firma l'Impero Tedesco aveva dichiarato guerra alla Russia, gli Ottomani non erano obbligati a partecipare. Sebbene il giorno dopo fu proclamata la mobilitazione generale, l'Impero Ottomano si dichiar?neutrale. La missione militare tedesca, guidata da Otto Liman von Sanders, avrebbe dovuto lasciare il paese il 1 Agosto, ma fu deciso di continuarla e che in tempo di guerra agli ufficiali tedeschi sarebbero stati affidati incarichi nelle pi?alte sfere militari dell'esercito Ottomano.\n§RNota: la firma di un'alleanza difensiva ?un prerequisito per far §Rentrare gli Ottomani negli Imperi Centrali.;;;;;;Уж?во время Балканских войн европейски?держав?задумывались ?раздел?Османско?импери? Чтоб?сохранит?свою импери?Османы пытались попаст??союз ?любо?крупно?державой, но ни одна из ни?не бы?заинтересова??союз??'больно? империей. Большинств?членов КЕ?(Комите?Единение ?прогресс, правящая парт?) выступал?за союз ?Францией ил?Великобритание? Лишь меньшинств?вокруг Энве?паши хотело вступить ?союз ?Германской империей. Только июльский кризис побудило Германскую импери?сблизится ?Османско?империей.\n?конц?ию? тайные переговоры были проведен??Константинопол??рассчёто?на оборонительный союз против России. Посл?того ка?Энве?предложи?линкор 'Султан Осма?I'(которы?бы?конфискова?англичанам?на следуюши?день), немц?согласилис?подписат?предложени?Османско?импери?1 август??заключил?ал?нс 2 август? Об?сторон?взяли на се? обязательство военно?помощи ?случае, если Росс? об?ви?войн?одно?из ни? Та? за день до подписан? Германск? империя об?вила войн?России, турк?не были обязаны помогать. Хо? на следующи?день была об?влен?всеобщ? мобилизация, Османская империя об?вила нейтралите?\nГерманск? военная мисс? во глав??Отто Лима?фо?Сандерсо? должен была покинуть Османску?импери?1 август? но было решено, чт?мисс? останется, ?чт?во время войн?некоторы?должност??высшем военно?командно?уровне османско?арми?должны быть предоставлен?немецким офицерам \n§RПримечание: Заключение договора услови?для §Rвступлен? Османско?Импери??союз ?Центральными Державам?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191573_NAME;The Ottomans propose a defensive pact;Les Ottomans proposent un pacte dйfensif.;Das osmanische Reich schlдgt ein Defensivbьndnis vor;Ottomanowie proponuj?sojusz obronny;Los otomanos proponen una pacto defensivo;Gli Ottomani propongono un patto difensivo;;;;;;Османы предлагают оборонительный пакт;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191574_DESC;To maintain the superiority over the Argentine fleet the Brazilian government had ordered a battleship from the British shipyard 'Armstrong' in 1910. The ship was launched in 1913, but due to economic reasons Brazil decided to sell the semi-finished ship to the Ottoman Empire. The ship was named after the founder of the Ottoman Empire: 'Sultan Osman I'. At the same time there was already another battleship for the Ottoman Empire under construction: the 'Reshadiye'. Both ships were supposed to be transferred to the Ottoman navy on 2nd August 1914. However, because of the July Crisis, on 31st July the British government agreed with the proposal of the First Lord of the Admiralty Winston Churchill to confiscate the warships for the Royal Navy, since they were considered useful for the impending war. Soon the battleships were incorporated into the Royal Navy and renamed resp. to 'Agincourt' and to 'Erin'. The Ottoman Empire never got back their payments. The negotiations for the secret alliance between Germany and the Ottoman Empire were close the abandonment in late July. The German ambassador Wangenheim demanded a significant contribution and on 1st August the Ottoman minister of war Enver Pasha offered the battleship Sultan Osman I. Wangenheim agreed and accepted the alliance. It must be noted that the Ottoman government was informed of the British plans of confiscation since the 31st July.;Afin de maintenir la supйriorit?sur la flotte argentine, le gouvernement brйsilien commanda un navire de guerre au chantier naval britannique Armstrong en 1910. Le navire fut lanc?en 1913. Pour des raisons йconomiques, le Brйsil dйcida de vendre le navire ?moiti?fini ?l'Empire ottoman. Le navire fut baptis?d'aprиs le fondateur de l'Empire ottoman, le 'Sultan Osman I '. Dans le mкme temps, il y avait dйj?un autre cuirass?de l'Empire ottoman en construction, le 'Reshadiye'. Les deux navires йtaient censйs кtre transfйrйs ?la marine ottomane le 2 aoыt 1914.\nCependant, en raison du dйveloppement de la Crise de Juillet, le 31 Juillet, le gouvernement britannique accepta la proposition du Premier Lord de l'Amiraut? Winston Churchill, et confisqua les navires de guerre au profit de la Royal Navy, au prйtexte qu'ils йtaient jugйs utiles pour la guerre imminente contre l'Empire allemand. Bientфt, les cuirassйs furent incorporйs dans la Royal Navy, et rebaptisйs respectivement 'Azincourt'et 'Erin'. L'Empire ottoman ne reзut jamais les paiements en retour. Les nйgociations en vue d'une alliance secrиte entre l'Allemagne et l'Empire ottoman furent proches de l'abandon ?la fin juillet. L'ambassadeur allemand Wangenheim demanda une contribution significative et, le 1er aoыt, le ministre ottoman de la guerre Enver Pacha offrit le cuirass?Sultan Osman I. Wangenheim accepta l'alliance. Il faut noter que le gouvernement ottoman avait йt?inform?des plans britanniques de confiscation dиs le 31 Juillet.;Um der argentinischen Flotte weiterhin ьberlegen zu sein, bestellte die brasilianische Regierung im Jahre 1910 ein Kriegsschiff bei der britischen Armstrong-Werft. Der Bau des Schlachtschiffs wurde 1913 begonnen. Aufgrund wirtschaftlicher Schwierigkeiten verkaufte Brasilien das halbfertige Schiff jedoch an das osmanische Reich, wo es nach dem Grьnder des Reiches 'Sultan Osman .' benannt wurde. Zur selben Zeit war bereits ein weiteres Kriegsschiff fьr das osmanische Reich im Bau: die 'Reshadiye'. Beide Schiffe sollten am 2. August 1914 dem osmanischen Reich ьberstellt werden. Die Julikrise verleitete die britische Regierung am 31. Juli jedoch dazu, dem Rat von Marineminister Churchill zu folgen und beide Schiffe fьr die Royal Navy zu konfiszieren, da sie fьr den herannahenden Krieg als nьtzlich angesehen wurden. Die Kriegsschiffe wurden kurz darauf unter den Namen 'Agincourt' und 'Erin' in die Royal Navy integriert. Das osmanische Reich bekam seine Zahlungen fьr die beiden Schiffe nie zurьck.  Die Verhandlungen um eine geheime Allianz zwischen dem deutschen Kaiserreich und dem osmanischen Reich waren Ende Juli fast abgeschlossen. Der deutsche Botschafter Wangenheim verlangte von den Osmanen eine signifikante Unterstьtzung fьr die Kriegsanstrengungen und der osmanische Kriegsminister Enver Pascha bot den Deutschen die 'Sultan Osman I' als Geschenk an. Wangenheim stimmte zu und akzeptierte das Allianzangebot. Es ist hierbei festzuhalten, dass die osmanische Regierung bereits am 31. Juli von den Plдnen der Briten zur Beschlagnahmung der 'Sultan Osman I' wusste. ;Aby utrzyma?przewag?nad flot?argentyсsk? rz№d Brazylii zamуwi?w 1910 r. z brytyjskiej stoczni 'Armstrong' pancernik. Okrкt, ktуry nazwano 'Rio de Janeiro', zaczкto budowa?w 1913 r. Z uwagi na czynniki ekonomiczne, Brazylia zdecydowaіa si?sprzeda?nieukoсczony okrкt Imperium Ottomaсskiemu. Tam nazwano go na czeњж zaіoїyciela Imperium: 'Suіtan Osman I' . W tym czasie konstruowano dla Imperium Ottomaсskiego drugi pancernik: 'Reshadiye'. Oba okrкty miaіy by?przekazane marynarce ottomaсskiej 2 sierpnia 1914 r.\nZ uwagi na rozwуj wypadkуw w czasie Kryzysu Lipcowego, 31 lipca rz№d brytyjski przysta?na propozycj?Pierwszego Lorda Admiralicji, Winstona Churchilla, aby skonfiskowa?okrкty na rzecz brytyjskiej Marynarki Krуlewskiej, poniewa?mogіy by?przydatne w nadchodz№cej wojnie z Niemcami. 2 sierpnia, na pуі godziny przed rozpoczкciem ceremonii przekazania, poinformowano wizytuj№cy stoczni?zespуі ottomaсski pod kierownictwem kapitana Raufa Beja, їe okrкty bкd?skonfiskowane. Wkrуtce pancerniki staіy si?rzeczywiњcie cz?ci?marynarki brytyjskiej pod nazwami 'Agincourt' i 'Erin'. Imperium Ottomaсskie nigdy nie odzyskaіo swoich pіatnoњci. Negocjacje dotycz№ce tajnego sojuszu miкdzy Niemcami i Imperium Ottomaсskim byіy bliskie zerwania w koсcu lipca. Niemiecki ambasador Wangenheim domaga?si?pokaџnej kontrybucji i 1 sierpnia ottomaсski minister wojny, Enwer Pasza, zaoferowa?pancernik Suіtan Osman I. Wangenheim przysta?na propozycj?i sojusz zawarto. Trzeba zauwaїy? їe rz№d ottomaсski wiedzia?ju?o brytyjskich planach konfiskaty okrкtu od 31 lipca.;Para mantener la superioridad sobre la flota argentina, el gobierno brasileсo ha ordenado un acorazado al astillero britбnico 'Armstrong' en 1910. El barco fue fletado en 1913, pero debido a razones econуmicas, Brasil decidi?vender el casi terminado barco al Imperio Otomano. El barco fue llamado como el fundador del Imperio Otoman: 'Sultбn Osman I'. Al mismo tiempo, habнa otro acorazado para el Imperio Otomano que estaba bajo construcciуn: el 'Reshadiye'. Ambos barcos serнan transferidos a la armada otomana el 2 de agosto de 1914.\nSin embargo, debido al desarrollo de la Crisis de Julio el 31 de julio, el gobierno britбnico acept?la propuesta del Primer Lord del Almirantazgo Winston Churchill de confiscar los buques de guerra para la Armada Real, porque eran considerados ъtiles para la inminente guerra contra el Imperio Alemбn. Pronto los acorazados fueron incorporados en la Armada Real y renombrados respectivamente 'Agincourt' y 'Erin'. Al Imperio Otomano no se le devolvieron nunca los pagos. Las negociaciones para la alianza secreta entre Alemania y el Imperio Otomano estaban cerca ser abandonadas a finales de julio. El embajador alemбn Wangenheim demand?una gran contribuciуn y el 1 de agosto el ministro de guerra otomano Enver Pasha ofreci?el acorazado Sultбn Osman I. Wangenheim acept?el barco y la alianza. Hay que seсalar que el gobierno otomano estaba informado de los planes de confiscaciуn britбnicos desde el 31 de julio;Per mantenere la superiorit?sulla flotta Argentina, il governo Brasiliano ordin?una corazzata dal cantiere navale Britannico 'Armstrong' nel 1910. La nave, che avrebbe dovuto essere chiamata 'Rio de Janeiro', fu lanciata nel 1913. A causa di ragioni economiche, il Brasile decise di vendere la nave semi-completa all'Impero Ottomano. La nave fu ribattezzata col nome del fondatore dell'Impero: 'Sultano Osman I'. Nello stesso periodo un'altra corazzata era in fase di costruzione per l'Impero Ottomano, la 'Reshadiye'. Entrambe le navi dovevano essere trasferite alla marina Ottomana il 2 agosot 1914.\nTuttavia, a causa della Crisi di Luglio, il 31 Luglio il governo Britannico accett?la proposta del Primo Lord dell'Ammiragliato Winston Churchill di confiscare le navi da guerra per la Marina Reale, dato che erano considerate utili per l'incombente guerra con la Germania. Subito le corazzate furono incorporate nella Marina Reale e rinominate rispettivamente 'Agincourt' e 'Erin'. L'Impero Ottomano non fu mai rimborsato. I negoziati per l'alleanza segreta tra Tedeschi e Ottomani erano vicine all'abbandono alla fine di Luglio. L'ambasciatore tedesco Wangenheim chiese un contributo significativo e il 1 Agosto il Ministro Ottomano per la Guerra Enver Pasha offr?la corazzata Sultano Osman I. Wangenheim accett?la proposta e l'alleanza. In realt?il governo Ottomano sapeva dei propositi britannici di confisca della navi sin dal 31 Luglio.;;;;;;Для поддержания превосходств?на?аргентинским флотом бразильско?правительств?заказало линкор на британской верф?'Армстрон? ?1910 году. Корабл?бы?запуще??1913 году, но из-за экономически?трудностей ?Бразилии наполовину достроенны?корабл?решили продат?Османско?импери? Корабл?бы?назван ?чест?основате? Османско?импери? 'Султан Осма?I'. ?то же время для Османско?импери?уж?строил? другой линкор 'Решадь?. Об?судн?должны были быть переданы Османскому флот?2 август?1914 года. Те?не мене? из-за июльског?кризис? 31 ию? британское правительств?согласилос??предложением Первог?лорд?Адмиралтейства Уинстона Черчил?, конфисковать корабл?для военно-морского флот? та?ка?он?считалис?полезным?для предст?ще?войн? Вскоре корабл?были включены ?состав военно-морского флот??переименован??соот? на 'Агинкурт' ?'Эрин'.Османская империя никогд?не получила обратн?свои платеж? Переговоры ?тайном союз?межд?Германие??Османско?импери?были близки ?отмене ?конц?ию?.Немецкий посо?Вангенхайм потребовал существенног?вклада ?1 август?османски?военны?минист?Энве?паша предложи?линкор 'султан Осма?I'. Вангенхайм?эт?устроило ?он согласил? на ал?нс. Следуе?отметить, чт?Османско?правительств?было проинформировано ?британских планах конфискаци??31 ию?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191574_NAME;The Sultan Osman I joins our fleet;Le Sultan Osman Ier rejoint notre flotte.;Die Sultan Osman I. schlieЯt sich unserer Flotte an;Suіtan Osman I doі№cza do naszej floty;El Sultбn Osman I se une a nuestra flota;La Sultano Osman I entra nella nostra flotta;;;;;;Султан Осма?I' введен ?на?флот;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191576_DESC;Already during the secret negotiations for the defensive alliance the German ambassador Wangenheim and the Ottoman minister of war Enver Pasha agreed that the German 'Mittelmeerdivision' (Mediterranean Division), consisting of the SMS Goeben and SMS Breslau, would be sent to Constantinople to support the Ottoman fleet. However Enver Pasha had made the agreement without the consent of his government, which seeked to preserve its neutrality. Admiral Souchon misinterpreted the situation and moved towards Constantinople anyway, while a British fleet was already hunting for his ships. The 'Mittelmeerdivision' reached the Dardanelles on 10th August. There the Ottomans demanded the abolition of German trade privileges ('Capitulations') to let the fleet cruise into Ottoman waters and Wangenheim agreed. By granting the German fleet such permission the Ottomans transgressed the rules of neutrality, so the Grand Vizier Said Halim pretended the acquisition of these ships. The Germans rejected this proposal and demanded entry into the war from the Ottoman Empire. The Ottomanst ignored this and announced the purchase of the two vessels. The Germans were forced to agree. Since the Ottomans did not have the appropriate personnel, the German crew was kept on board. One month later Souchon was appointed commander of the Ottoman Black Sea Fleet.;Dйj?durant les nйgociations secrиtes pour une alliance dйfensive, l'ambassadeur allemand Wangenheim et le ministre ottoman de la guerre Enver Pacha convinrent que 'Mittelmeerdivision' allemande (Division de la Mйditerranйe) comprenant le Gњben SMS et SMS Breslau serait envoy??Constantinople pour soutenir la flotte ottomane. Cependant, Enver Pacha conclu cet accord sans le consentement de son gouvernement, qui cherchait lui ?prйserver sa neutralit? L'Amiral Souchon interprйta incorrectement la situation, et se dirigea de toute faзon vers Constantinople, tandis qu'une flotte britannique avait dйj?commenc??chasser ses navires. La 'Mittelmeerdivision' atteignit les Dardanelles le 10 aoыt. L? les Ottomans exigиrent l'abolition des privilиges commerciaux allemands ('LesCapitulations') en prйambule pour autoriser la flotte allemande ?naviguer dans les eaux ottomanes. Wangenheim accepta. En accordant ?la flotte allemande une telle autorisation, les Ottomans transgressиrent les rиgles de la neutralit? c'est pourquoi le Grand Vizir Said Halim prйtendit avoir fait l'acquisition de ces navires. Les Allemands rejettиrent cette proposition, et demandиrent l'entrйe en guerre de l'Empire ottoman. Les Ottomans ignorиrent cette demande, et annoncиrent l'achat des deux navires. Les Allemands furent obligйs d'accepter. Les Ottomans n'ayant pas le personnel appropri? l'йquipage allemand fut conserv??bord. Un mois plus tard, Souchon fut nomm?commandant de la Flotte ottomane de la Mer Noire.;Schon wдhrend der geheimen Verhandlungen ьber ein Defensivabkommen gegen Russland verstдndigten sich der deutsche Botschafter Wangenheim und der osmanische Kriegsminister Enver Pasha darauf, die deutsche 'Mittelmeerdivision' bestehend aus der SMS Goeben und der SMS Breslau nach Konstantinopel zu schicken, wo sie die osmanische Schwarzmeerflotte unterstьtzen sollten. Enver Pasha hatte diese Ьbereinkunft allerdings ohne die Zustimmung seiner Regierung getroffen, welche die Neutralitдt des osmanischen Reiches wahren wollte. Vizeadmiral Souchon, Anfьhrer der Mittelmeerdivision, missinterpretierte die Situation allerdings und bewegte seine Schiffe verfrьht in Richtung Konstantinopel, wдhrend eine britische Flotte bereits Jagd auf die beiden Schiffe machte. Die Mittelmeerdivision erreichte die Dardanellen am 10. August. Um die osmanischen Gewдsser passieren zu dьrfen, verlangten die Osmanen die Abschaffung deutscher Handelsprivilegien ('Kapitulationen') und Botschafter Wangenheim stimmte zu. Diese Erlaubnis wдre eine Verletzung der osmanischen Neutralitдt gewesen, also gab der osmanische GroЯwesir Said Halim den Kauf der beiden Schiffe vor. Die Deutschen lehnten das Angebot ab und verlangten einen Kriegsbeitritt des osmanischen Reiches - diese jedoch ignorierten die Deutschen und kьndigten den Abschluss des Handels an. Den Deutschen blieb keine andere Wahl als zuzustimmen. Da die Osmanen jedoch nicht ьber das nцtige Personal zur Bedienung der Schiffe verfьgten, verblieben die deutschen Besatzungen einsatzbereit an Bord. Einen Monat spдter wurde Vizeadmiral Souchon zum Kommandanten der osmanischen Schwarzmeerflotte ernannt. ;Ju?podczas tajnych negocjacji w kwestii sojuszu obronnego, niemiecki ambasador Wangenheim i ottomaсski minister wojny Enwer Pasza zgodzili si?na to, by niemiecka 'Mittelmeerdivision' (Dywizja Њrуdziemnomorska), skіadaj№ca si?z SMS Goeben i SMS Breslau, bкd?wysіane do Konstantynopola, aby wesprze?flot?ottomaсsk? Enwer Pasza podejmowa?jednak decyzje bez zgody swojego rz№du, ktуry szuka?sposobu na zachowanie neutralnoњci. Admira?Souchon bікdnie zinterpretowa?sytuacj?i pomimo tego skierowa?si?na Konstantynopol, podczas gdy brytyjska flota szukaіa jego okrкtуw. 'Mittelmeerdivision' osi№gnкіa Dardanele 10 sierpnia. Ottomanowie zaї№dali anulowania niemieckich przywilejуw handlowych ('kapitulacji') w zamian za przepuszczenie floty i Wangenheim przysta?na to. Danie Niemcom takiej moїliwoњci byіo zіamaniem przez Ottomanуw zasad neutralnoњci, tak wiкc Wielki Wezyr Said Halim stworzy?pozory kupna okrкtуw. Niemcy nie zgodzili si?na to i wezwali Imperium Ottomaсskie do otwartego przyі№czenia si?do wojny. Spotkaіo si?to z obojкtnoњci?Ottomanуw, ktуrzy pomimo tego kupili oba okrкty, a Niemcy zmuszeni byli przysta?na taki ukіad. Poniewa?Ottomanowie nie mieli odpowiedniej zaіogi, na okrкtach pozostali Niemcy. Po miesi№cu Souchon zosta?mianowany dowуdc?ottomaсskiej Floty Czarnomorskiej.;Ya durante las negociaciones secretas para la alianza defensiva el embajador alemбn Wangenheim y el ministro de guerra otomano Enver Pasha aceptaron que la 'Mittelmeerdivision' alemana (Divisiуn Mediterrбnea), que consistнa en el SMS Goeben y el SMS Breslau, serнa enviada a Constantinopla para apoyar a la flota otomana. Sin embargo Enver Pasha habнa hecho un acuerdo sin el consentimiento de su gobierno, que querнa preservar su neutralidad. El almirante Souchon malinterpret?la situaciуn y se movi?hacia Constantinopla, mientras que la flota britбnica perseguнa a sus barcos. La Mittelmeerdivision lleg?a los Dardanelos el 10 de agosto. All?los otomanos demandaron la aboliciуn de los privilegios de comercio alemanes (Capitulaciones) para dejar a la flota en aguas otomanas y Wangenheim acept? Dando a la flota alemana esos permisos los otomanos transgedieron las reglas de la neutralidad, por lo tanto el Gran Visir Said Halim pretendi?adquirir esos barcos. Los alemanes rechazaron la propuesta y demandaron entrar en la guerra desde el Imperio Otomano. Los otomanos ignoraron esto y anunciaron la compra de los dos buques. Los alemanes fueron forzados a aceptar. Dado que los otomanos no tenнan el personal apropiado, la tripulaciуn alemana fue mantenida a bordo. Un mes despuйs, Souchon fue nombrado comandante de la flota otomana en el Mar Negro.;Gi?durante i negoziati segreti per l'alleanza difensiva, l'ambasciatore tedesco Wangenheim e il ministro Ottomano alla guerra Enver Pasha erano d'accordo sul fatto che la 'Mittelmeerdivision' tedesca (Divisione Mediterranea), comprendente la SMS Goeben e la SMS Breslau, sarebbe stata mandata a Costantinopoli per aiutare la flotta ottomana. Tuttavia Enver Pasha aveva siglato l'accordo senza il consenso del suo governo, che voleva preservare la propria neutralit? L'Ammiraglio Souchon interpret?male la situazione e si diresse comunque verso Costantinopoli, mentre una flotta Britannica cercava le sue navi. La 'Mittelmeerdivision' raggiunse i Dardanelli il 10 Agosto. L?gli Ottomani chiesero l'abolizione dei diritti di commercio tedeschi ('Capitolazioni') per far entrare le navi in acque Ottomane e Wangenheim acconsent? Dando tale permesso alla flotta tedesca, gli Ottomani trasgredirono alle regole delle neutralit? pertanto il Gran Visir Said Halim pretese di acquistare queste navi. I tedeschi rifiutarono la proposta e chiesero l'entrata in guerra dell'Impero Ottomano. Gli Ottomani li ignorarono e annunciarono l'acquisto delle due navi. I tedeschi furono costretti ad accettare la situazione. Dato che gli Ottomani non avevano il personale adatto, l'equipaggio tedesco rimase a bordo. Un mese dopo Souchon fu nominato Comandante della Flotta Ottomana del Mar Nero.;;;;;;Уж?во время тайных переговоро?по оборонительном?союз?немецкий посо?Вангенхайм ?Османско?военны?минист?Энве?паша договорились, чт?немецкий 'Mittelmeerdivision '(средиземноморски?девизион), сост?щи?из SMS Гебе??SMS  Бресла? буде?отправле??Константинопол? поддерживать флот Османско?импери? Однако Энве?паша сделал соглашен? бе?соглас? ег?правительств? которо?добивалось сохранен? нейтралитета. Адмира?Сушо?неправильн?оценил ситуацию ?выдвинул? ?сторон?Константинополя, ?то время ка?Британский флот уж?нача?охот?за ег?кораблями. Средиземноморски?девизион достиг Дарданел?10 август? Та?турк?потребовал?отмены немецких торговых привилегий, чтоб?допустит?корабл??османски?воды ?Вангенхайм согласил?. Пр?предоставлении германском?флот?такого разрешен? турк?нарушили правил?нейтралитета, та?чт?велики?визирь Саид Хали?стал претендовать на приобритение этих судо?Немц?отвергли эт?предложени??потребовал?от Османско?импери?вступленя ?войн? Османы проигнорировал?эт??об?вили ?покупк?двух судо?Немц?были вынужден?согласиться. Поскольк??туро?не было подходящего персонал? немецкий экипаж находился на борт? Чере?ме??Сушо?бы?назначен командиром Османского Черноморског?флот?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
