EVT1914_2191579_DESC;Only a small group in the leadership of the 'Committee of Union and Progress' was in favour of entry into the war on side of the Central Powers. The Ottoman minister of war Enver Pasha was the leader of this group. There had been numerous unsuccessful attempts to persuade the Ottoman government to enter the war by the German Empire. Finally at beginning of October 1914 Enver promised to obtain an entry into the war until mid-month. In fact, he achieved to convert the minister Talaat Bey (minister of the interior), Djemal Pasha (minister of the Navy) and Halil Pasha (speaker of parliament) to his faction. To be able to convince the government Enver demanded gold worth two million Turkish pounds for the Ottoman army from the German Empire. The last rate of the payment reached Constantinople on 21st October. But Enver overestimated his influence. Talaat and Halil changed their minds. The gold payment was accepted but the promised entry into the war failed to materialize. From that date Enver ended his efforts to convince the Ottoman government.;Seul un petit groupe ?la direction du 'Comit?Union et Progrиs' йtait en faveur de l'entrйe en guerre aux cфtйs des Puissances Centrales. Le ministre ottoman de la guerre, Enver Pacha, йtait le chef de ce groupe. Il y eut de nombreuses tentatives infructueuses de la part de l'Empire allemand en vue de convaincre le gouvernement ottoman d'entrer en guerre. Enfin, au dйbut d'octobre 1914, Enver promis d'obtenir une entrйe en guerre au plus tard au milieu du mois. En fait, il parvint ?convertir les ministres Talaat Bey (Ministre de l'Intйrieur), Djemal Pacha (Ministre de la Marine) et Halil Pasha (Prйsident du parlement) ?sa faction. Pour кtre en mesure de convaincre le gouvernement, Enver exigea de l'Empire allemand un montant de deux millions de livres turques en or, pour l'armйe ottomane. Le dernier paiement atteignit Constantinople le 21 octobre. Mais Enver avait surestim?son influence. Talaat et Halil changиrent d'avis. Le paiement en or avait йt?accept? mais l'entrйe en guerre ne s'йtait pas concrйtis?ainsi que promis. ?partir de cette date, Enver arrкta ses efforts pour convaincre le gouvernement ottoman.;Lediglich eine kleine Gruppe in der Fьhrungsriege des 'Komitees fьr Einheit und Fortschritt' war fьr einen Kriegseintritt auf Seiten der Mittelmдchte.  Der osmanische Kriegsminister Enver Pascha war der Anfьhrer dieser Gruppe. Es gab zahlreiche vergebliche Versuche Deutschlands die osmanische Regierung zu einem Kriegseintritt zu bewegen. Letztendlich versprach Enver Anfang Oktober 1914 einen Kriegseintritt bis zur Monatsmitte erwirken zu kцnnen. Tatsдchlich erreichte er die Minister Talaat Bey (Innenminister), Djemal Pascha (Marineminister) und Halil Pascha (Parlamentsprдsident) auf seine Seite zu ziehen. Um die Regierung letztendlich ьberzeugen zu kцnnen forderte Enver vom Deutschen Reich Gold im Wert von zwei Millionen tьrkische Pfund fьr die osmanische Armee. Die letzte Rate der Zahlung erreichte Konstantinopel am 21. Oktober. Doch Enver ьberschдtzte seinen Einfluss. Talaat und Halil дnderten ihre Meinung. Die Goldzahlung wurde zwar angenommen, aber der versprochene Kriegseintritt blieb aus. Enver beendete damit seine Bemьhungen seine Regierung zu ьberzeugen.;Tylko maіa grupa w przywуdztwie 'Komitetu Unii i Postкpu' opowiadaіa si?za przyst№pieniem do wojny po stronie paсstw centralnych. Ottomaсski minister wojny, Enwer Pasza, by?liderem tej grupy. Podjкto wiele zakoсczonych niepowodzeniem prуb skіonienia rz№du ottomaсskiego, by przyst№pi?do wojny wraz z Cesarstwem Niemieckim. W koсcu w pocz№tku paџdziernika 1914 r. Enwer obieca?uzyskanie wypowiedzenia wojny do poіowy miesi№ca. W rzeczywistoњci udaіo mi si?przekona?ministra Talaata Beja (ministra spraw wewnкtrznych), Dїemala Pasz?(ministra marynarki wojennej) i Halila Pasz?(przewodnicz№cego parlamentu) do swoich racji. Enwer zaї№da?od Cesarstwa Niemieckiego dla ottomaсskiej armii 2 milionуw tureckich funtуw w zіocie, aby mуc przekona?rz№d. Ostatnia rata pіatnoњci trafiіa do Konstantynopola 21 paџdziernika. Ale Enwer przeceni?swoje wpіywy. Talaat i Halil zmienili swe plany. Zaakceptowali pіatnoњж w zіocie, ale obiecywane przyst№pienie do wojny nie zostaіo dokonane. Od tego momentu Enwer zakoсczy?swe prуby przekonania ottomaсskiego rz№du.;Solo un pequeсo grupo en el liderazgo del Comit?de Uniуn y Progreso estaba a favor de la entrada en la guerra al lado de las Potencias Centrales. El ministro de guerra otomano Enver Pasha fue el lнder de este grupo. Han habido numerosos intentos sin йxito de persuadir al gobierno otomano de entrar en la guerra junto al Imperio Alemбn. Finalmente a principios de octubre de 1914 Enver prometi?obtener la entrada en la guerra antes de mediados de mes. Consigui?persuadir al ministro del interior Talaat Bey, al ministro de la Armada Djemal Pasha y al portavoz del parlamento Halil Pasha. Para ser capaz de convencer al gobierno, Enver demand?al Imperio Alemбn oro valorado en dos millones de libras turcas para el ejйrcito otomano. El ъltimo tipo de pago lleg?a Constantinopla el 21 de octubre. Pero Enver sobreestim?su influencia. Talaat y Halil cambiaron su opiniуn. El pago de oro fue aceptado pero la promesa de entrar en la guerra no se materializ? Desde esa fecha Enver termin?sus esfuerzos para convencer al gobierno otomano.;Solo un piccolo gruppo nella leadership del 'Comitato di Unione  Progresso' era favorevole all'entrata in guerra insieme agli Imperi Centrali. Il ministro Ottomano della guerra Enver Pasha era il leader di questo gruppo. Ci furono numerosi falliti tentativi di persuadere il governo Ottomano da parte dell'Impero Tedesco. Finalmente all'inizio di Ottobre 1914 Enver promise di ottenere l'entrata in guerra entro met?mese. In effetti, riusc?a convertire il ministro Talaat Bey (ministro degli interni), Djemal Pasha (ministro della marina) e Halil Pasha (Presidente del Parlamento) alla sua fazione. Per riuscire a convincere il governo Enver chiese oro di valore pari a 2 milioni di lire ottomane per l'esercito ottomano da parte dell'Impero Ottomano. L'ultima rata del pagamento raggiunse Costantinopoli il 21 Ottobre. Ma Enver sovrastim?la propria influenza. Talaat e Halil cambiarono idea. Il pagamento dell'oro fu accettato ma la promessa dell'entrata in guerra non si materializz? Da quella data Enver ferm?i propri sforzi per convinvere il governo ottomano.;;;;;;Только небольшая группа ?руководств?'Комитета за Единение ?прогресс' выступал?за вступление ?войн?на сторон?Центральны?держав.Османски?военны?минист?Энве?паша бы?лидеро?этой группы. Он?предпринимал?многочисленные неудачны?попытк?убедит?правительств?вступить ?войн?на сторон?Немецкой Импери? Наконе? ?начале ок?бря 1914 Энве?обещал получить разрешение на вступление ?войн?до середины ме?ца. На само?деле, он смог убедит?министра Талаат-бея (минист?внутренних де?, Джемал?пашу (минист?военно-морского флот? ?Хали?пашу (спикер парламента) присоединится ?свое?фракци? Для того, чтоб?убедит?правительств?Энве?требовал золота ценность??дв?миллиона турецких фунтов для османско?арми?от Германской импери? Послед?я порц? плат?достигла Константинополя 21 ок?бря. Но Энве?переоценил свое вл?ни? Талаат-бе??Хали?паша изменили свое мнение.Платеж золото?бы?приня? но обещанного вступлен? ?войн?не оправдалис? ?этой даты Энве?закончил свои усил?, по убеждени?правительств?Османско?импери?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191579_NAME;Try to persuade the Ottomans to intervene;Essayer de convaincre les Ottomans ?intervenir.;Versuchen die Osmanen zum Kriegseintritt zu ьberreden;Sprуbuj przekona?Ottomanуw do interwencji;Intentar persuadir a los otomanos para que intervengan;Cerca di persuadere gli Ottomani a intervenire;;;;;;Принудит?Османску?импери??вмешательств?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191580_DESC;The German military had already operated in the Ottoman Empire for decades. The first German military mission was active from 1882 to 1895 to reorganize the Ottoman army. After that a military attach?office was established, but its influence was much less than that of the mission. Only the disastrous defeat in the First Balkan War in 1913 motivated the Ottoman army to request again German help for reforming the army. After months of negotiations, the second German military mission arrived in Constantinople in December 1913 under the leadership of Otto Liman von Sanders. Actually it was scheduled that the military mission would withdraw in case of war. With signing of the secret treaty between the German and the Ottoman Empire on 2nd August 1914 it was agreed that the mission should stay in Constantinople. It was promised that the mission would get a vast influence on the conduct of war of the Ottoman army. Many German officers would hold leadership positions. Numerous officers, specialists and troops were deployed during the war. It is estimated that approximately 25,000 men were in use for the military mission. The Ottoman army was supplied with weapons and aircrafts. Since the sea was locked, material and human support could only be sent overland to the Ottoman Empire. Since the German Empire was at war with Serbia, the supply could only be sent through neutral Romania, but this was not enough. However in mid-September 1914 Romania refused the transit permit and so the Ottoman Empire was cut off from support from the German Empire. Only with the occupation of Serbia, the Ottoman Empire was able to be supplied with war material again.;L'armйe allemande avait dйj?opйr?dans l'Empire ottoman pendant des dйcennies. La premiиre mission militaire allemande fut active de 1882 ?1895 pour rйorganiser l'armйe ottomane. Aprиs cela, un bureau d'attach?militaire fut crйй, mais son influence fut bien moindre que celle de la mission. Seule la dйfaite dйsastreuse durant la deuxiиme guerre balkanique, en 1913, motiva l'armйe ottomane ?demander de nouveau l'aide allemande pour la rйformer. Aprиs des mois de nйgociations, la deuxiиme mission militaire allemande arriva ?Constantinople en dйcembre 1913, sous la direction d'Otto Liman von Sanders.\nInitialement, il йtait prйvu que la mission militaire se retire en cas de guerre. Avec la signature du trait?secret entre l'Allemagne et l'Empire ottoman le 2 aoыt 1914, il fut convenu que la mission devrait rester ?Constantinople. Il fut promis que la mission obtiendrait une grande influence sur l'armйe ottomane pour la conduite de la guerre. De nombreux officiers allemands occupиrent des postes de direction.\n De nombreux spйcialistes, officiers et soldats, furent dйployйs pendant la guerre. On estime ?environ 25000 hommes la taille de la mission militaire. L'armйe ottomane reзut des armes et des avions. Avec l'accиs par la mer verrouill? le soutien matйriel et humain ne pouvait pas кtre envoy?par voie terrestre vers l'Empire ottoman. L'Empire allemand йtant en guerre avec la Serbie, l'aide ne pouvait кtre envoy?que via par la Roumanie neutre, mais ce n'йtait pas suffisant. Toutefois, ?partir de la mi-septembre 1914, la roumanie refusa le permis de transit, et l'Empire ottoman fut ainsi coup?de l'appui de l'Empire allemand. C'est seulement avec l'occupation de la Serbie que l'Empire ottoman put de nouveau кtre ravitaill?en matйriel.;Das deutsche Militдr war bereits seit Jahrzehnten im Osmanschen Reich tдtig. Die erste deutsche Militдrmission zur Reorganisierung der Osmanischen Armee war von 1882 bis 1895 aktiv. Danach wurde eine Militдrattachйstelle eingerichtet, deren Einfluss allerdings wesentlich geringer als der der Mission war. Erst die desastrцse Niederlage im Zweiten Balkankrieg 1913 veranlasste die Osmanische Armee zu ihrer Reformierung erneut deutsche Hilfe anzufragen. Nach monatelanger Verhandlungen traf die zweite deutsche Militдrmission unter der Leitung Otto Liman von Sanders im Dezember 1913 in Konstantinopel ein.\nEigentlich war vorgesehen die Militдrmission im Kriegsfall abzuziehen. Mit dem Geheimvertrag zwischen dem Deutschen und Osmanischen Reich vom 2. August 1914 wurde aber der Verbleib vereinbart. Der Mission wurde ein erheblicher Einfluss auf die Kriegsfьhrung der Osmanischen Armee versprochen. Zahlreiche deutsche Offiziere sollten Fьhrungspositionen besetzen.\nZahlreiche Offizieren, Spezialisten und Truppen wurden im Laufe des Krieges entsandt. Es wird geschдtzt, dass ca. 25.000 Mann fьr die Militдrmission im Einsatz waren. Auch wurde die Osmanische Armee mit Waffen und Flugzeugen beliefert. Da die Seewege versperrt waren, konnte nur ьber den Landweg materielle und personelle Unterstьtzung an das Osmanische Reich gesendet werden. Da man sich mit Serbien im Kriegszustand befand, konnten diese Lieferung nur unzureichend ьber das neutrale Rumдnien erfolgen. Doch Mitte September 1914 verweigerte Rumдnien die Transiterlaubnis, so dass das Osmanische Reich von jeglicher Unterstьtzung seitens des Deutschen Reichs abgeschnitten war. Erst mit der Besetzung Serbiens konnte das Osmanische Reich wieder mit Kriegsmaterial beliefert werden.  ;Przedstawiciele niemieckiej armii dziaіali w armii Imperium Ottomaсskiego od dziesiкcioleci. Pierwsza niemiecka misja wojskowa dziaіaіa w latach 1882-1895 w celu reorganizacji armii ottomaсskiej. Potem powoіano urz№d wojskowego attach? ale jego znaczenie byіo znacznie mniejsze ni?istniej№cej wczeњniej misji wojskowej. Jedynie katastrofalna poraїka w Drugiej Wojnie Baіkaсskiej 1913 r. zmotywowaіa armi?ottomaсsk?do poproszenia Niemcуw o ponown?pomoc w reformowaniu armii. Po miesi№cach negocjacji druga niemiecka misja wojskowa przybyіa do Konstantynopola pod przywуdztwem Otto Limana von Sandersa.\nW przypadku wojny misja wojskowa miaіa ulec wycofaniu. Jednak przy okazji podpisywania tajnego traktatu pomiкdzy Niemcami, a Imperium Ottomaсskim 2 sierpnia 1914 r. ustalono, їe misja powinna pozosta?w Konstantynopolu. Obiecano, їe misja bкdzie miaіa kluczowy wpіyw na prowadzenie wojny przez armi?ottomaсsk? a wielu niemieckich oficerуw obejmie stanowiska dowуdcze.\nW czasie wojny w ramach misji przydzielono wielu oficerуw, specjalistуw i liczne oddziaіy wojskowe. Ocenia si? їe misja wykorzystywaіa okoіo 25 000 osуb. Armia ottomaсska byіa dziкki temu wsparciu zaopatrzona w bro?i samoloty. Poniewa?dostкp morski by?zablokowany, zapasy i rekrutуw transportowano drog?l№dow? Poniewa?Cesarstwo Niemieckie byіo w stanie wojny z Serbi? dostawy mogіy przechodzi?jedynie przez neutraln?Rumuni? ale to nie wystarczyіo. W poіowie wrzeњnia 1914 r. Rumunia zamknкіa granic?dla tych transportуw i Imperium Ottomaсskie zostaіo odciкte od Cesarstwa Niemieckiego. Dopiero po okupacji Serbii przez paсstwa centralne, Imperium Ottomaсskie mogіo by?ponownie zaopatrywane.;La comisiуn militar alemana habнa estado operando en el Imperio Otomano durante dйcadas. La primera estuvo activa desde 1882 a 1895 para reorganizar al ejйrcito otomano. Despuйs de que una oficina militar fuese establecida, su influencia fue mucho menor que la de la comisiуn. Solo la desastrosa derrota en la Segunda Guerra Balcбnica en 1913 motiv?al ejйrcito otomano a pedir otra vez ayuda alemana para reformar su ejйrcito. Despuйs de meses de negociaciones, la segunda comisiуn militar alemana lleg?a Constantinopla en diciembre de 1913 bajo el liderazgo de Otto Liman von Sanders.\nEn verdad, estaba programado que la comisiуn militar se retirarнa en caso de guerra. Con la firma de un tratado secreto entre el Imperio Alemбn y el Otomano el 2 de agosto de 1914 se acept?que la comisiуn deberнa quedarse en Constantinopla. Fue prometido que la comisiуn tendrнa una gran influencia en el manejo del ejйrcito otomano en la guerra. Muchos oficiales alemanes mantendrнan sus cargos en el liderazgo.\nNumerosos oficiales, especialistas y tropas fueron desplegados durante la guerra. Se estima que aproximadamente 25.000 hombres fueron usados por la comisiуn militar. El ejйrcito otomano fue suministrado con armas y aviones. Debido a que el mar estaba cerrado, el apoyo material y humano solo podнa ser enviado por tierra al Imperio Otomano. Debido a que el Imperio Alemбn estaba en guerra con Serbia, los suministros solo podнan ser enviados a travйs de Rumanнa, pero esto no era suficiente. Sin embargo, a mediados de septiembre de 1914, Rumanнa rechaz?permitir el trбnsito y as? al Imperio Otomano se le fue cortado todo tipo de suministros desde Alemania. Solo con la ocupaciуn de Serbia, el Imperio Otomano fue capaz de ser suministrado con materiales de guerra.;L'esercito tedesco aveva gi?operato da decadi nell'Impero Ottomano. La prima missione militare tedesca fu attiva dal 1882 al 1895 per riorganizzare l'esercito Ottomano. Dopo quel periodo fu nominato un addetto militare, ma la sua influenza era molto inferiore rispetto alla precedente missione. Solo la disastrosa sconfitta nella Prima Guerra Balcanica del 1913 spinsero l'esercito Ottomano a chiedere ancora l'aiuto tedesco per riformare l'esercito. Dopo mesi di negoziati, la seconda missione militare tedesca arriv?a Costantinopoli nel Dicembre 1913 sotto la guida di Otto Liman von Sanders. Era stato deciso che la missione si sarebbe ritirata in caso di guerra. Con la firma del trattato segreto di alleanza tra Imperi Tedesco e Ottomano il 2 Agosto 1914, si decise che la missione sarebbe rimasta a Costantinopoli. Fu promesso inoltre che la missione avrebbe avuto una grande influenza nella condotta di guerrra dell'esercito Ottomano. Molti ufficiali tedeschi avrebbero ottenuto posti di rilievo. Numerosi ufficiali, specialisti e truppe furono schierati durante la guerrra. Si stima che circa 25 000 uomini furono impiegati in posizioni militari. L'esercito Ottomano fu rifornito di armi e aeroplani. Dato che la via del mare era bloccata, materiali e uomini dovevano essere mandati via mare. Dato che la Germania era in guerra con la Serbia, i rifornimenti furono inviati tramite la Romania neutrale, ma questo non era abbastanza. Tuttavia a met?del Settembre del 1914 la Romania rifiut?il permesso di transito e cos?l'Impero Ottomano non pot?pi?ricevere il supporto dell'Impero Tedesco. Solo con l'occupazione della Serbia fu possibile rifornire nuovamente l'Impero Ottomani di materiale di guerrra.;;;;;;Немецкие военны?уж?работали ?Османско?импери?на протяжени?де?тилети? Перв? немецк? военная мисс? была активн??1882 по 1895 для реорганизаци?арми?Османско?импери? Посл?этог?бы?создан офис военного атташе, но ег?вл?ни?было горазд?меньше, че??миссии. Только катастрофическое поражени??Первой Балканской войн??1913 году мотивировало османску?арми?снов?просит?немецкой помощи ?реформировании арми? Посл?нескольких ме?це?переговоро? втор? немецк? военная мисс? прибыл??Константинопол??декабр?1913 года по?руководством Отто Лимана фо?Сандерса. На само?деле было запланирован? чт?военная мисс? буде?отозвана ?случае войн? Пр?подписании секретного договора межд?Германской ?Османско?империями 2 август?1914 ? было решено, чт?мисс? должна остать? ?Константинопол? Было обещан? чт?мисс? буде?получить огромное вл?ни?на ведени?войн?Османско?армией. Многие немецкие офицер?за?ли руково?щи?пост? Многочисленные сотрудники, специалист??войска были развернуты во время войн? Подсчитано, чт?окол?25000 мужчин были ?использовани?для военны?зада?Османская армия была снабжена оружие??самолетами. Поскольк?море было заперт? материальн? ?людская поддержк?могл?быть осуществлена только по суше. Поскольк?Германск? империя находилась ?сост?ни?войн??Сербие? поставки могл?быть послан?только чере?нейтральну?Румыни? но этог?было недостаточно. Однако ?середине сентября 1914 Румыния отказалась от разрешен? на транзи??Османская импери?была полность?отрезана от поддержк?со сторон?Германской импери? Снабжени?было восстановлен?только ?оккупацией Сербии.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191580_NAME;Extend military mission in the Ottoman Empire;Prolonger la mission militaire dans l'Empire ottoman.;Die Militдrmission im Osmanischen Reich erweitern;Przedіu?misj?wojskow?w Imperium Ottomaсskim;Extender la comisiуn militar en el Imperio Otomano;Estendere la missione militare nell'Impero Ottomano;;;;;;Расширит?военну?миссию ?Османско?импери?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2191581_DESC;The 'Asienkorps' (Asia Corps) was a German expeditionary force in the Ottoman Empire. The first groups were stationed under the code name 'Pascha' on the Sinai front, where they arrived in March 1916. First commander was general Friedrich Kre?von Kressenstein.\nThe capture of Baghdad by the British on 11th March 1917 induced the German Empire to strengthen the 'Asienkorps'. The new groups (named 'Pascha II') reached the Ottoman Empire in August 1917. Colonel Werner von Frankenberg und Proschlitz was made commander of the 'Asienkorps'. In addition, in June 1917, the staff of the Ottoman Army Group F was completely replaced by German officers and renamed to 'Heeresgruppe Yildirim' (Army Group Thunderbolt). General Erich von Falkenhayn was made commander. To this army group there were assigned three Ottoman armies and the 'Asienkorps'.\nThe initial goal was the reconquest of Baghdad, which was abandoned in October 1917. The 'Asienkorps' was moved to Palestine to stabilize the front. In 1918, the 'Asienkorps' was strengthened again and achieved a strength of 16,000 men.\nTo the 'Asienkorps' also belonged 6 Fliegerabteilungen (flier detachements) and 1 Jagdstaffel (hunting squadron) with a total of about 70 aircrafts. Austria-Hungary was also involved with several artillery batteries.\nAfter the surrender of the Ottoman Empire in late October 1918, the troops of the 'Asienkorps' were interned in Constantinople and shipped home in January 1919.;L''Asienkorps'(Corps d'Asie) йtait le nom d'une force expйditionnaire allemande dans l'Empire ottoman. Les premiers groupes furent stationnйs sous le nom de code 'Pascha' sur le front du Sina?o?ils arrivиrent en mars 1916. Leur premier commandant fut le Gйnйral Friedrich von Kre?Kressenstein.\nLa prise de Bagdad par les Britanniques le 11 mars 1917 poussa l'Empire allemand ?renforcer l''Asienkorps'. Les nouveaux groupes (nomm?'Pascha II') atteignirent l'Empire ottoman en aoыt 1917. Le Colonel Werner von Frankenberg und Proschlitz fut nomm?commandant des 'Asienkorps'. En outre, en juin 1917, le personnel du Groupe F de l'armйe ottomane fut complиtement remplac?par des officiers allemands, et renomm?'Heeresgruppe Yildirim' (Groupe d'armйes Foudre). Le Gйnйral Erich von Falkenhayn en fut nomm?commandant. Pour ce groupe armйe, il fut assign?trois armйes ottomanes ainsi que l''Asienkorps'.\nLe but initial йtait la reconquкte de Bagdad, qui fut abandonn?en octobre 1917. Les 'Asienkorps' furent dйplacйs vers la Palestine afin de stabiliser le front. En 1918, les 'Asienkorps' furent de nouveau renforcйs, pour atteindre 16000 hommes.\n?l''Asienkorps' йtait йgalement rattachйs les 6 Fliegerabteilungen (detachement volant) et 1 Jagdstaffel (escadron de chasse), pour un total d'environ 70 avions. L'Autriche-Hongrie participa йgalement avec plusieurs batteries d'artillerie.\nAprиs la capitulation de l'Empire ottoman fin octobre 1918, les troupes des 'Asienkorps' furent internйs ?Constantinople et renvoyйes chez elle en janvier 1919.;Das 'Asienkorps' war eine deutsche Expeditionstruppe im Osmanischen Reich. Die ersten Verbдnden wurden unter der Tarnbezeichnung 'Pascha' an der Sinaifront stationiert, wo sie im Mдrz 1916 ankamen. Erster Kommandeur war General Friedrich Kre?von Kressenstein.\nDie Einnahme Bagdads am 11. Mдrz 1917 durch die Briten veranlasste das Deutsch Reich das 'Asienkorps' zu verstдrken. Die neuen Verbдnde ('Pascha II') erreichten August 1917 ihr Ziel. Kommandeur des 'Asienkorps' wurde Oberst Werner von Frankenberg und Proschlitz. AuЯerdem wurde im Juni 1917 der Stab der osmanische Heeresgruppe F komplett durch deutsche Offiziere ersetzt und in 'Heeresgruppe Yildirim' (Blitz) umbenannt. Oberbefehlshaber wurde General Erich von Falkenhayn. Dieser Heeresgruppe waren 3 osmanische Armeen und das 'Asienkorps' zugewiesen.\nDas eigentliche Ziel war die Rьckeroberung Bagdads, welches aber in Oktober 1917 aufgegeben wurde. Das 'Asienkorps' wurde zur Frontstabilisierung nach Palдstina verlegt. 1918 wurde das 'Asienkorps' abermals verstдrkt und erreichte ein Stдrke von 16.000 Mann.\nDem 'Asienkorps' gehцrten zudem 6 Fliegerabteilungen und 1 Jagdstaffel mit insgesamt ca. 70 Flugzeugen an. Auch Цsterreich-Ungarn war mit einigen Artilleriebatterien am 'Asienkorps' beteiligt.\nNach der Kapitulation des Osmanischen Reiches Ende Oktober 1918 wurden die Truppen des 'Asienkorps' in Konstantinopel interniert und im Januar 1919 in ihre Heimat verschifft.;Asienkorps' (Korpus Azjatycki) by?niemieck?siі№ ekspedycyjn?w Imperium Ottomaсskim. Pierwsze grupy stacjonowaіy pod nazw?kodow?'Pasza' na froncie na Synaju, gdzie przybyіy w marcu 1916 r. Pierwszym dowуdc?by?genera?Friedrich Kre?von Kressenstein.\nZajкcie Bagdadu przez Brytyjczykуw 11 marca 1917 r. skіoniіo Cesarstwo Niemieckie do dodatkowego zasilenia Asienkorpsu. Nowe grupy їoіnierzy (nazwane 'Pasza II') dotarіy do Imperium Ottomaсskiego w sierpniu 1917 r. Puіkownik Werner von Frankenberg und Proschlitz zosta?nowym dowуdc?Asienkorpsu. Dodatkowo, w czerwcu 1917 r., sztab ottomaсskiej armii Grupy F zosta?caіkowicie zast№piony przez dowуdcуw niemieckich i przemianowany na 'Heeresgruppe Yildirim' (Grupa Armii Bіyskawica). Dowуdc?zosta?genera?Erich von Falkenhayn. Do tej grupy armii przyporz№dkowano trzy ottomaсskie armie i wіaњnie Asienkorps.\nPodstawowym celem byіo odbicie Bagdadu, ale cel ten porzucono w paџdzierniku 1917 r. Asienkorps przesuniкto do Palestyny, aby ustabilizowa?front. W 1918 r. Asienkorps zasilono ponownie, tak їe osi№gn№і liczebnoњж 16 000 їoіnierzy.\nDo Asienkorpsu przynaleїaіo rуwnie?6 Fliegerabteilungen (oddziaіy lotnicze) i 1 Jagdstaffel (szwadron poњcigowy), w sumie okoіo 70 samolotуw. Austro-Wкgry byіy rуwnie?zaangaїowane wysyіaj№c wiele baterii artyleryjskich.\nPo kapitulacji Imperium Ottomaсskiego w p?nym paџdzierniku 1918 r. siіy Asienkorpsu zostaіy internowane w Konstantynopolu i wysіane do domu w styczniu 1919 r.;Los Asienkorps (Cuerpos de Asia) fueron una fuerza expedicionaria alemana en el Imperio Otomano. Los primeros grupos estaban estacionados bajo el nombre en clave 'Pascha' en el frente Sinai, donde llegaron en marzo de 1916. El primer comandante fue el general Friedrich Kre?von Kressenstein.\nLa captura de Bagdad por los britбnicos el 11 de marzo de 1917 induci?al Imperio Alemбn a fortalecer los Asienkorps. Los nuevos grupos (llamados Pascha II) llegaron al Imperio Otomano en agosto de 1917. El coronel Werner von Frankenberg und Proschlitz fue hecho comandante de los Asienkorps. Ademбs, en junio de 1917, el Estado Mayor del Grupo F del ejйrcito otomano fue reemplazado completamente por oficiales alemanes y renombrado a 'Heeresgruppe Yildirim' (Grupo Armado Rayo). El general Erich von Falkenhayn fue hecho comandante. A este grupo armado se le fue asignado tres ejйrcitos otomanos y los Asienkorps.\nEl objetivo principal fue la reconquista de Bagdad, que habнa sido abandonada en octubre de 1917. A los Asienkorps tambiйn le pertenecнan 6 Fliegerabteilungen (destacamentos voladores) y 1 Jagdstaffel (escuadrуn de caza) con un total de 70 aviones. Austria-Hungrнa estaba tambiйn involucrada con varias baterias de artillerнa.\nDespuйs de la rendiciуn del Imperio Otomano a finales de octubre de 1918, las tropas de los Asienkorps fueron internadas en Constantinopla y mandadas a casa en enero de 1919.;Gli 'Asienkorps' (Corpi Asiatici) furono una forza di spedizione tedesca nell'Impero Ottomano. I primi gruppi furono mandati sotto il nome in codice 'Pascha' sul fronte del Sinai, dove arrivarono nel Marzo 1916. Il primo comandante fu il generale Friedrich Kre?von Kressenstein.\nLa cattura di Bagdad da parte Britannica l'11 Marzo 1917 indusse l'Impero Tedesco a rafforzare gli 'Asienkorps'. I nuovi gruppi (chiamati 'Pascha II') raggiunsero l'Impero Ottomano nell'Agosto 1917. Il Colonnello Werner von Frankenberg und Proschlitz fu nominato comandante degli 'Asienkorps'. Inoltre nel Giugno 1917, il personale del Gruppo F dell'esercito Ottomano fu sostituito da ufficiali tedeschi e rinominato 'Heeresgruppe Yildirim' (Gruppo d'Armata Fulmine). Il Generale Erich von Falkenhayn ne divenne il comandante. A questo gruppo d'armate furono assegnate tre armate Ottomane e gli 'Asienkorps'.\nL'obiettivo iniziale era la riconquista di Bagdad, ma fu abbandonato nell'Ottobre 1917. Gli 'Asienkorps' furono quindi spostati in Palestina per stabilizzare il fronte. Nel 1918, gli 'Asienkorps' furono rafforzati ancora fino a raggiungere i 16 000 uomini.\nAgli 'Asienkorps' appartenevano anche 6 Fliegerabteilungen (distaccamenti di piloti) e 1 Jagdstaffel (squadrone di caccia) per un totale di 70 aeroplani. L'Austria-Ungheria mand?a sua volta parecchie batterie di artiglieria.\nDopo la resa dell'Impero Ottomano alla fine dell'Ottobre 1918, le truppe degli 'Asienkorps' furono internate a Costantinopoli e mandate a casa nel Gennaio 1919.;;;;;;Asienkorps' (Корпус Аз?) бы?название?немецког?экспедиционног?корпус??Османско?импери?Первые группы были размещен?по?кодовы?название?'Паша' на Синайско?фронте, куда он?прибыл ?март?1916 года. Первым командиром бы?генера?Фридри?фо?Крес Крессенштейн.\nЗахват Багдад?англичанам?11 март?1917 вынуди?Германскую импери?усилит?'Asienkorps'. Новы?группы (по?название?'Паша II ') достигли Османско?импери??август?1917 года. Полковника Вернер фо?Франкенбер?ун?Прошли?бы?назначен командиром корпус? Кром?того, ?июне 1917 года, командование османско?арми?Группы F было полность?заменено на немецких офицеров ?переименован??'Heeresgruppe Yildirim' (группа арми?молн?), ?генера?Эрих фо?Фалькенхай?бы?назначен командиром. ?этой группе арми?были придан?тр?османски?арми??'Корпус Аз?'.\nПервоначальной цель?было возвращени?Багдад? от которо?отказались ?ок?бр?1917 года. 'Корпус Аз?' бы?отправле??Палестин? чтоб?стабилизироват?фрон? ?1918 году 'Корпус Аз?' бы?усилен ещ?ра??достиг 16000 челове?\n?корпус?такж?принадлежали 6 отделени?лётчиков ?1 отдельны?'охотничи? эскадрон, ?обще?сложност?окол?70 самолето? Австро-Венгрия такж?приняла участи??нескольких артиллерийских батаре?\nПосл?капиту?ци?Османско?импери??конц?ок?бря 1918 года войска корпус?были интернирован??Константинопол??отправлены домо??январ?1919 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
