EVT1914_2191582_DESC;On 16th August 1914 Enver Pasha demanded German support for the reorganization and the overhaul of coastal fortifications at the Dardanelles Strait. For this task, the retired vice-admiral Guido von Usedom was reactivated as 'Generalinspekteur der Kьstenverteidigung an den Dardanellen' (Inspector General of the coastal defenses at the Dardanelles) on 25th August. Under his leadership, a dedicated team of 26 officers and 520 men, was sent to Constantinople. This team (known as Sonderkommando der Kaiserlichen Marine in der Tьrkei ['Special Detachment of the Imperial Navy in Turkey']) should also compensate the shortage of specialists caused by the discontinuation of the British naval mission. The repairs to the fortifications began in early September.;Le 16 aoыt 1914, Enver Pacha demanda le soutien allemand pour la rйorganisation et la rйnovation des fortifications cфtiиres du dйtroit des Dardanelles. Pour cette tвche, le Vice-Amiral ?la retraite Guido von Usedom fut rйactiv?au rang de 'Generalinspekteur der Kьstenverteidigung un Dardanellen den' (Inspecteur Gйnйral des dйfenses cфtiиres des Dardanelles) le 25 aoыt. Sous sa direction, une йquipe de 26 officiers et de 520 hommes fut envoy??Constantinople. Cette йquipe (connu sous le nom de 'Sonderkommando der Marine Kaiserlichen in der Tьrkei' (Dйtachement spйcial de la marine impйriale en Turquie) devait йgalement compenser la pйnurie en spйcialistes causйe par l'interruption de la mission navale britannique. Les rйparations des fortifications commencиrent dйbut septembre.;Am 16. August 1914 forderte Enver Pascha deutsche Unterstьtzung zur Reorganisierung und zum Aufbau der Kьstenbefestigungen fьr die Dardanellen-Meerenge an. Fьr diese Aufgabe wurde der pensionierte Vizeadmiral Guido von Usedom am 25. August als 'Generalinspekteur der Kьstenverteidigung an den Dardanellen' reaktiviert. Unter seiner Fьhrung wurde ein Spezialistenteam von 26 Offizieren und 520 Mann nach Konstantinopel  geschickt. Auch sollte dieses Team (bekannt als 'Sonderkommando der Kaiserlichen Marine in der Tьrkei') jene Lьcken kompensieren, die durch den Wegfall der britischen Marinemission entstanden sind. Die Reparaturen an den Befestigungen begannen Anfang September.;16 sierpnia 1914 r. Enwer Pasza zaї№da?niemieckiego wsparcia dla reorganizacji i przebudowy fortyfikacji brzegowych w Cieњninach Dardanelskich. Dla realizacji tego celu, emerytowany wiceadmira?Guido von Usedom zosta?przywrуcony jako 'Generalinspekteur der Kьstenverteidigung an den Dardanellen' (Inspektor Generalny Instalacji Obronnych w Dardanelach) 25 sierpnia tego roku. Pod jego kierownictwem, specjalny zespуі 26 oficerуw i 520 robotnikуw zosta?wysіany do Konstantynopola. Zespуі ten znany jako Sonderkommando der Kaiserlichen Marine in der Tьrkei ('Specjalny Oddzia?Marynarki Cesarskiej w Turcji') powinien skompensowa?braki specjalistуw, ktуre staіy si?widoczne gdy kraj opuњciіa brytyjska misja wojskowa. Reparacje fortyfikacji rozpoczкto we wczesnym wrzeњniu.;El 16 de agosto de 1914 Enver Pasha demand?el apoyo alemбn para la reorganizaciуn y la revisiуn de las fortificaciones costeras del Estrecho de los Dardanelos. Para esta tarea, fue reactivado el vicealmirante retirado Guido von Usedom como 'Generalinspekteur der Kьstenverteidigung an den Dardanellen' (Inspector general de la defensa costera de los Dardanelos) el 25 de agosto. Bajo su mando, un dedicado equipo de 26 oficiales y 520 hombres, fue enviado a Constantinopla. Este equipo (conocido como Sonderkommando der Kaiserlichen Marine in der Tьrkei [Destacamento especial de la Armada Imperial en Turquнa]) deberнa tambiйn compensar la escasez de especialistas causada por la suspensiуn de la comisiуn naval britбnica. Las reparaciones de las fortificaciones empezaron a principios de septiembre.;Il 16 Agosto 1914 Enver Pasha chiese l'aiuto tedesco per riorganizzare e sovrintendere le fortificazioni costiere presso lo stretto dei Dardanelli. Per questo compito, l'ormai ritirato vice ammiraglio Guido von Usedom fu richiamato in servizio in 25 Agosto e nominato 'Generalinspekteur der Kьstenverteidigung an den Dardanellen' (Ispettore Generale delle difese costiere dei Dardanelli). Sotto la sua guida, un team dedicato di 26 ufficiali e 520 uomini fu mandato a Costantinopoli. Questo team, noto come 'Sonderkommando der Kaiserlichen Marine in der Tьrkei' (Distaccamento Speciale della Marina Imperiale in Turchia), avrebbe dovuto rimediare alla mancanza di specialisti causata dall'interruzione della missione navale Britannica. Le riparazioni delle fortificazioni cominciarono all'inizio di Settembre;;;;;;16 август?1914 Энве?паша потребовал немецкой поддержк??реорганизаци??капитально?ремонт?береговы?укреплений ?пролив?Дарданеллы. Для решения этой задачи, отставно?вице-адмира?Гвид?фо?Узедом бы?восстановлен ?качестве 'Generalinspekteur der Kustenverteidigung де?Dardanellen' (генеральны?инспекто?берегово?оборон??Дарданелла? на 25 август? По?ег?руководством специальная группа из 26 офицеров ?520 мужчин, была отправле??Константинопол? Эт?команд?(известная ка?Sonderkommando der Kaiserlichen Marine in der Turkei ('Специальны?от??Императорского военно-морского флот??Турции')) такж?должна , была компенсировать нехватку специалистов, вызванну?прекращением британской военно-морско?миссии. Ремонт укреплений начался ?начале сентября.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
