EVT1914_2192500_DESC;On 28 June 1914, Archduke Franz Ferdinand of Austria, heir apparent to the Austria-Hungarian throne, and his wife, Sophie, Duchess of Hohenberg, were shot dead in Sarajevo, by Gavrilo Princip, a member of the Young Bosnia movement. The political objective of the assassination was to break Austria-Hungary's South-Slav provinces off so they could be combined into a Greater Serbia or a Yugoslavia. Serbian military officers stood behind the attack.;Le 28 juin 1914, ?Sarajevo, Gavrilo Princip, Serbe de Bosnie, nationaliste yougoslave1, membre du groupe Jeune Bosnie (Mlada Bosna), tue l'archiduc Franзois-Ferdinand, hйritier de l'empire austro-hongrois, et son йpouse la duchesse de Hohenberg, au moment o?leur accession au trфne semblait imminente. L'objectif de cet assassinat est de permettre le dйtachement des provinces slaves de l'Empire Austrohongrois et de former ainsi la Grande Serbie, ou Yougoslavie. Des officiers serbes sont derriиre cette attaque.;Am 28. Juni 1914 wurde der цsterreichische Thronfolger, Erzherzog Franz Ferdinand von Цsterreich und seine Frau Sophie, Herzogin von Hohenberg, von einem jungen Bosnier namens Gavrilo Princip in Sarajevo erschossen. Das politische Ziel deses Anschlags war es, die sьdslawischen Provinzen Цsterreich-Ungarns aus dem Reich zu lцsen, um sie zu einem 'Kцnigreich GroЯerbien' oder Yugoslawien zu vereinen.;28 czerwca 1914 r. austriacki arcyksi№їe Franciszek Ferdynand, dziedzic austro-wкgierskiego tronu, i jego їona Zofia, ksiкїna Hohenberg, zostali zastrzeleni w Sarajewie przez Gawriіo Principa, czіonku ruchu Mіodej Boњni. Politycznym celem zabуjstwa byіo oderwanie tamtejszych terenуw i przyі№czenie ich do ewentualnej Wielkiej Serbii lub nawet Jugosіawii. Za atakiem stali serbscy dowуdcy wojskowi.;El 28 de junio de 1914, el Archiduque Francisco Fernando de Austria, heredero del trono Austro-hъngaro, y su esposa, Sofнa, Duquesa de Hohenberg, fueron hallados muertos a tiros en Sarajevo, por Gavrilo Princip, miembro del movimiento de la Joven Bosnia. El principal objetivo polнtico del asesinato era romper las provincias Sur-eslavas de Austria-Hungrнa para que se puedan combinar en una Gran Serbia o Yugoslavia. Los oficiales Serbios militares estaban detrбs del ataque.;Il 28 giugno 1914 l'Arciduca Francesco Ferdinando d'Austria, erede al trono Austro-Ungarico, e sua moglie Sofia, Duchessa di Hohenberg, furono assassinati a Sarajevo da Gavrilo Princip, un membro del movimento Giovane Bosnia. L'obiettivo politico dell'assassinio era separare le province Slave dall'Austria-Ungheria per unirle in una Grande Serbia o una Jugoslavia. Ufficiali militari serbi erano i responsabili dell'attacco.;;;;;;28 ию? 1914 года, эрцгерцо?Фран?Фердинан? наследни?австро-венгерског?престола, ?ег?жена герцогиня София Гогенбер?были убит??Сараев?сербским гимназисто?Гаврилой Принципо? членом сербской террористической организаци?'Млад?Босн?, которо?ставил?свое?задаче?объединени?южны?славя??создание 'Велико?Сербии'. За нападением наверняка ст??сербские военны?..;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
