EVT1914_2192502_DESC;Diplomacy has its ends. Since Serbia hasn't fulfilled our conditions through peaceful negotiations, it'll accept them by force.;La diplomatie a ses limites. La Serbie n'ayant pas accept?nos conditions par le dialogue, elle les acceptera par la force.;Unsere diplomatischen Mцglichkeiten sind erschцpft. Da Serbien sich weigert, unsere berechtigten Forderungen zu erfьllen, werden die Waffen sprechen.;Dyplomacja ma swoje granice. Poniewa?Serbia nie wypeіniіa warunkуw pokojowej negocjacji, zaakceptuje je pod przymusem.;El tiempo de la diplomacia se ha acabado desde que Serbia no ha satisfecho todas nuestras demandas. Es tiempo de hacerlas cumplir por la fuerza!;La diplomazia ?finita. Siccome la Serbia non ha accettato le nostre condizioni tramite pacifiche negoziazioni, le accetter?con la forza.;;;;;;?дипломатие?покончен?! Поскольк?Серб? отказывает? выполнит?наши условия мирным путе? он?буде?вынужден?принять их сило?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
