EVT1914_2192503_DESC;Italy is upset with our foreign policy. They now may well join our enemies. However, we can make concessions to them, promising Italia irredenta lands in exchange of their loyalty. Of course, such a proposal has its cost.;L'Italie, dйзue de notre politique йtrangиre, pourrait bien passer dans le camp ennemi. Il nous est toutefois loisible de lui promettre de cйder les terres irrйdentes et йventuellement le Trentin en йchange de leur loyaut? Bien sыr, une telle proposition a un coыt...;Italien ist erbost ьber unsere Aussenpolitik und es besteht die Gefahr, da?es sich unseren Feinden anschliesst. Wir kцnnen ihnen aber auf jeden Fall Konzessionen wie die Rьckfьhrung italienisch bewohnter Gebiete anbieten, um uns ihre Loyalitдt zu erkaufen. Die Region ьm Trient kдme dafьr in Frage, aber natьrlich hat ein solcher Vorschlag auch seinen Preis.;Wіosi s?rozdraїnieni naszym ultimatum. Jeњli wojna wybuchnie, mog?oni opuњci?nasz sojusz lub co gorsza, przyі№czy?si?po stronie wroga. Italy is upset with our ultimatum. Moїemy zaproponowa?im ustкpstwa, proponuj№c przygraniczne tereny i by?moїe region Trydentu w zamian za ich lojalnoњж. Oczywiњcie, taka propozycja bкdzie miaіa swoje koszty.;Italia est?molesta por nuestra polнtica exterior y probablemente se unirбn a nuestros enemigos. Pero podemos hacer algunas condiciones prometiйndoles la 'Italia Irredenta' a cambio de su lealtad. Por supuesto esto enfurecer?un poco a nuestro pueblo?L'Italia ?turbata a causa del nostro ultimatum. Se la guerra dovesse scoppiare, potrebbero rompere la nostra alleanza o, peggio ancora, allearsi con i nostri nemici. Potremmo fare delle concessioni, promettere le terre irredente e, forse, anche la regione di Trento in cambio della loro lealt? Ovviamente, una simile proposta ?molto costosa per noi.;;;;;;Итал? недовольна наше?внешне?политико? Теперь он?даже  може?присоединить? ?наши?врагам. Однако, мы може?пойт?на уступк?им, пообещав передачу земель 'неосвобожденно?Италии' ('Italia ir