EVT1914_2192506_DESC;Karl I issued a proclamation, the Imperial Manifesto of 16 October 1918, which significantly altered the structure of the Austrian half of the monarchy. The regions of Galicia and Lodomeria were granted independence and permission to form a Polish state. The rest of the Austrian half was transformed into a federal union composed of four parts (German, Czech, South Slav and Ukrainian), while Trieste was to receive a special status.;Charles I publia une proclamation, qui s'apelle le Manifeste Impйrial du 16 Octobre 1918, qui a considйrablement modifi?la structure de la moiti?autrichienne de la monarchie. Les rйgions de la Galice-Lodomйrie accйdиrent ?l'indйpendance et le document donna l'autorisation de former un Etat polonais. Le reste de la moiti?autrichienne a йt?transformйe en une union fйdйrale composйe de quatre parties (Allemande, Tchиque, des Slaves du Sud et de l'Ukraine), tandis que Trieste reзut un statut spйcial.;Karl I erliess eine Proklamation, das kaiserliche Manifest vom 16. Oktober 1918, das die Struktur der цsterreichischen Hдlfte der Monarchie stark verдnderte. Den Regionen Galizien und Lodomeria wurde die Unabhдngigkeit zugesprochen und die Erlaubnis, einen polnischen Staat zu begrьnden. Der Rest des Reiches wurde in eine fцderale Republik umgewandelt, die aus den vier Teilen Deutschland, Tschechien, Sьd-Slowakei und Ukraine bestand, wдhrend Triest einen Sonderstatus zugesprochen bekam.;Karol I wyda?odezw? Manifest Imperialny, 16 paџdziernika 1918 r., w ramach ktуrej znacz№co zmieni?struktur?austriackiej poіowy monarchii. Regiony Galicji i Lodomerii otrzymaіy niepodlegіoњж i zezwolenie na stworzenie polskiego paсstwa. Reszta austriackiej cz?ci paсstwa zostaіa przeksztaіcona w federaln?uni?zіoїon?z czterech cz?ci (niemieckiej, czeskiej, poіudniowosіowiaсskiej i ukraiсskiej), podczas gdy Triest mia?otrzyma?specjalny status.;El Kбiser Karl I emiti?una proclamaciуn, el Manifiesto Imperial del 16 de Octubre de 1918, que altero significativamente la estructura de la parte Austriaca de la monarquнa dual. Los Reinos de Galicia y Lodomeria fueron liberados y autorizados a formar un estado polaco. El resto del territorio austriaco se transform?en una Uniуn Federal compuesta por cuatro estados (uno alemбn, uno checo, uno eslavo y otro ucraniano) con Trieste como ciudad estado especial.;Karl I emise una proclamazione, il Manifesto Imperiale del 16 Ottobre 1918, che alterava significativamente la struttura della met?austriaca della monarchia. Alle regioni della Galizia e della Lodomeria fu concessa l'indipendenza e il permesso di create uno stato Polacco. Il resto della met?austrica sarebbe stato trasformato in un'unione federale composta da quattro parti (Tedesca, Ceca, Slava e Ucraina) mentre Trieste avrebbe ricevuto uno statuto speciale.;;;;;;Карл I изда?прокламаци?- Императорски?манифест от 16 ок?бря 1918 года, которы?существенн?изменивший структур?австрийско?половины монархии. Област?Галиция ?Лодомерия получает независимост??разрешение на создание польског?государств? Остальны?част?Австри преобразовываются ?Федеральны?союз сост?щи?из четыре?частей (немецкой, чешско? южны?славя??украинской), ?Триест получает особый статус.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
