EVT1914_2192507_DESC;On October 18, USA Secretary of State Robert Lansing replied that the Allies were now committed to the causes of the Czechs, Slovaks and South Slavs. Therefore, Lansing said, simple autonomy for the nationalities was no longer enough and they had to receive complete independence.;Le 18 Octobre, le Secrйtaire d'Etat des Йtats-Unis Robert Lansing a rйpondu que les Alliйs йtaient dйsormais engagйs dans la cause des Tchиques, des Slovaques et des Slaves du Sud. Par consйquent, Lansing a rйpondu ?l'Autriche que l'autonomie simple pour les nationalitйs ne suffisait pas, et que ces pays doivent accйder ?l'indйpendance.;Am 18. Oktober antwortete der Aussenminister der Vereinigten Staaten, Robert Lansing, da?die Alliierten sich fьr die Sache der Tschechen, Slowaken und Sьd-Slawen einsetzen wollen. Deshalb, so Lansing, sei einfache Autonomie nicht ausreichend, sondern den;18 paџdziernika sekretarz stanu USA, Robert Lansing, wyda?oњwiadczenie, їe Alianci s?zdeterminowani by wesprze?Czechуw, Sіowakуw i poіudniowych Sіowian w ich d№їeniu do niezawisіoњci. Tym samym staіo si?jasne, їe zwykіa autonomia nie jest ju?wystarczaj№ca i narody te maj?osi№gn№ж niepodlegіoњж w ramach swoich paсstw.;El 18 de octubre de 1918, el Secretario de Estado de los Estados Unidos, Robert Lansing, respondi?a la Entente que la naciуn estaba comprometida con las causas independentistas de los Checos, Eslovacos y Eslavos. Luego, Lansing dijo que una simple autonomнa no era suficiente, que Austria-Hungrнa debнa otorgarles la independencia completa.;Il 18 Ottobre, il Segretario di Stato USA Robert Lansing rispose che gli Alleati erano ormai impegnati alla causa dei Cechi, Slovacchi e Slavi. Pertanti, disse Lansing, semplice autonomia per queste nazionalit?non era pi?abbastanza e avrebbero dovuto ricevere completa indipendenza.;;;;;;18 ок?бря 1918 года, Госсекретарь СШ?Роберт Лансин?заяви? чт?держав?'Антант? озабочен?дальнейшей судьбо?чехо? словаков ?южны?славя? Поэтом?Лансин?вырази?мне