EVT1914_2192530b_DESC;With results of the investigation clearly showing direct intervention of the Serbian state into the assassination of Archduke Franz Ferdinand as an attempt to destabilize our Empire, it is now time to show Serbia that Austria-Hungary will respond to all attempts aimed against our territorial integrity with overwhelming force. But in order to satisfy the public and bring blame of the starting war upon Serbia, we have compiled a series of unacceptable demands to the Serbian government, which will be surely rejected, serving as a good pretext for war.;Le rйsultat de notre enquкte a clairement dйmontr?l'implication directe de l'Etat Serbe dans l'assassinat de l'Archiduke Franz Ferdinand comme une tentative de destabiliser notre Empire. Il est maintenant temps de montrer ?la Serbie que l'Autriche-Hongrie rйpondre ?toutes les atteintes ?notre intйgrit?territoriale avec des forces йcrasantes ! Mais pour satisfaire l'opinion publique et amener la faute du dйbut de la guerre ?le Serbie, nous avons compilйs une sйrie de demandes inacceptables au gouvernement Serbe, qui les rejettera sыrement, nous offrant ainsi un bon prйtexte pour les envahir.;Die Ergebnisse unserer Nachforschungen haben eindeutige Beweise erbracht, da?die serbische Regierung in die Ermordung von Erzherzog Franz Ferdinand verwickelt ist, um unser Reich zu destabilisieren. Wir mьssen ein fьr allemal klarstellen, da?wir auf Angriffe auf unsere territoriale Souvдrenitдt mit aller Hдrte reagieren werden. In diesem speziellen Fall werden wir Serbien die Schuld fьr den Ausbruch der Feindseligkeiten zuschieben, indem wir ihnen ein unerfьllbares Ultimatum stellen. Eine gute Einleitung fьr einen Krieg.;Wraz z doniesieniami њledczych o bezpoњrednim wpіywie paсstwa serbskiego na przeprowadzenie zabуjstwa arcyksiкcia Franciszka Ferdynanda, jako sposobu na destabilizacj?Imperium, jesteњmy gotowi pokaza?jak Austro-Wкgry reaguj?na prуby ingerencji w ich integralnoњж. Jednakїe, aby zadowoli?opini?publiczn?i jednoznacznie zrzuci?odpowiedzialnoњж za wojn?na Serbуw, przygotowaliњmy zestaw niemoїliwych do zaakceptowania ї№da? ktуre odrzucone, bкd?stanowiіy њwietny pretekst do wojny.;Con los resultados de la investigaciуn mostrando una intervenciуn directa del Reino de Serbia en el asesinato del Archiduque Franz Ferdinand, nuestro querido heredero al trono, como parte de un plan para desestabilizar nuestro Imperio, es tiempo de mostrarles que Austria-Hungrнa responder?contra todo intento de perjudicar nuestra unidad territorial con una fuerza implacable. Para satisfacer el clamor popular de una declaraciуn de guerra total contra Serbia, hemos compilado una serie de demandas inaceptables para el gobierno serbio, que seguramente serбn rechazadas, lo que ser?un buen pretexto para dejar fluir nuestra inestimable ira.;I risultati dell'indagine mostrano chiaramente l'intervento diretto dello stato serbo nell'assassinio dell'arciduca Francesco Ferdinando, come tentativo di destabilizzare il nostro Impero, ?giunto quindi il momento di mostrare alla Serbia che l'Austria-Ungheria risponder?a tutti i tentativi di rivolta contro la nostra integrit?territoriale con la forza. Ma al fine di soddisfare il pubblico e far pesare la colpa della guerra contro la Serbia, abbiamo compilato una serie di richieste inaccettabili per il governo serbo, che saranno sicuramente respinte, e questo servir?come un buon pretesto per la guerra.;;;;;;Итог?расследования ясн?показали прямо?участи?сербов ?подготовке убийства эрцгерцога Франца Фердинанда, ка?попытк?дестабилизироват?нашу Импери? Теперь настал?время показать Сербии, чт?Австро-Венгрия жестко ответи?на всяческие действ?, направленные против наше?территориально?целостност? Для того, чтоб?успокоит?общество ?выставит?Сербию виновницей начала войн? мы подготовил?список неприемлемых для сербског?правительств?требований, которы?он?обязательно отвергне? Этот отка?послужит отличным поводо?для нашего вторжения...;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,