EVT1914_9000038_DESC;L'union sacrйe (French for Sacred Union) was a political truce in France in which the left-wing agreed, during World War I, not to oppose the government nor to call any strike. Made in the name of patriotism, it opposed the French Section of the Workers' International's (SFIO) internationalism and its late former leader Jean Jaurиs' pledge not to enter any 'bourgeois war'. Although an important part of the socialist movement joined the Union sacrйe, some trade unionists such as Pierre Monatte opposed it. Similar events took place in Germany, England and Russia.;L'Union sacrйe est le nom donn?au mouvement de rapprochement politique qui a soud?les Franзais de toutes tendances (politiques ou religieuses) lors du dйclenchement de la Premiиre Guerre mondiale. Le terme fut utilis?pour la premiиre fois ?la Chambre des dйputйs le 4 aoыt 1914, par le Prйsident de la Rйpublique, Raymond Poincar? dans son message aux Assemblйes. Cela fut le cas immйdiatement car l'ensemble des organisations syndicales et politiques de gauches, essentiellement la CGT et la SFIO, se ralliиrent au gouvernement. Cette unanimit?nationale persista, mis ?part quelques dissidences de gauche, jusqu'?la fin du conflit. Un mouvement analogue se produisit chez l'ensemble des belligйrants comme en Angleterre, en Russie ou en Allemagne, lorsque le Parti socialiste d'Allemagne, le SPD, votera l'entrйe en guerre en aoыt 1914, lanзant le mouvement qui prit le nom de Burgfrieden.;Die 'heilige Union' war eine Art Waffenstillstand, in dem die politische Linke zusagte, in Kriegszeiten mit der Regierung zusammenzuarbeiten und keine Streiks auszurufen. Im Namen des Patriotismus gegrьndet, stand sie im Gegensatz zur franzцsischen Sektion der international agierenden Arbeiterverinigung SFIO, die unter ihrem frьheren Anfьhrer Jean Jaures dafьr stand, sich in keinen 'bьrgerlichen Krieg' verwickeln zu lassen. Дhnliches geschah auch im deutschen Reich, im vereinten Kцnigreich und im russischen Reich.;L'union sacrйe (fr. њwiкta unia) byіa politycznym zawieszeniem broni we Francji, w ramach ktуrego siіy lewicy obiecaіy tak dіugo jak bкdzie trwaіa I Wojna Њwiatowa, nie sprzeciwia?si?rz№dowi i nie wywoіywa?їadnego strajku. Powoіana w imi?patriotyzmu, pozostawaіa ona w sprzecznoњci wobec stanowiska Francuskiej Sekcji Miкdzynarodуwki Robotczej (SFIO), ktуrej zmarіy lider Jean Jaures opiera?si?przeciw angaїowaniu si?w jak№kolwiek 'burїuazyjn?wojn?. Jakkolwiek znaczna cz??ruchu socjalistycznego stanowiіa cz??њwiкtej unii, niektуrzy zwi№zkowcy, jak Pierre Monatte, byli przeciw niej. Podobne wydarzenia miaіy miejsce w Niemczech, Anglii i Rosji.;L'union sacrйe (La Uniуn Sacra de los Franceses) fue una tregua polнtica pactada por todos los partidos polнticos, principalmente la izquierda) de la Tercera Repъblica Francesa al estallar la Primera Guerra Mundial, el principal compromiso fue el evitar llamar a huelgas contra el gobierno. Hecho en nombre de la patria, se oponнa directamente a la Seccion Francesa de la Internacional (SFIO) cuyo ex-lider Jean Jaurиs prometi?'jamбs entrar en ninguna guerra burguesa'. Aun as?la gran mayorнa del movimiento socialista aprob?la L'union sacrйe aunque algunos sindicalistas como Pierre Monatte tuvieron el valor de oponerse. Similares hechos ocurrieron en las demбs naciones europeas durante el llamado 'Espнritu de 1914'.;L'Union sacrйe (L'Unione Sacra, in francese) ?stata una tregua politica in Francia, in cui la sinistra ha accettato, durante la prima guerra mondiale, di non opporsi al governo, n?di incitare allo sciopero. In nome del patriottismo, si opponeva la sezione francese dell'Internazionale dei Lavoratori (SFIO) in nome dell'internazionalismo ed il suo leader Jean Jaurиs impegno a non entrare in qualsiasi 'guerra borghese'. Anche se una parte importante del movimento socialista ha aderito all'Unione sacrйe, alcuni sindacalisti come Pierre Monatte si sono opposti. Eventi simili si sono svolta in Germania, Inghilterra e Russia.;;;;;; L'union sacree (Священный союз) представ??собо?политическое перемири?во Франци? ?которо?левы?согласилис?на время Первой мирово?войн?не создават?оппозици?правительств??не предпринимат?каки?либо политических акци? могущи?нанест?ущер?обороноспособности страны. Созданны?по?лозунгом патриотизм? Союз выступал против Французско?секции Рабочего интернационала (СФИО) ?ее бывшег?лидера, покойног? Жана Жореса, боровшегося против 'буржуазной войн?. Хо? большая част?социалистическог?движен? ?присоединилась ?Священном?союз? некоторы?профсоюзны?лидеры, таки?ка?Пьер Монатт выступил?против него. Аналогичны?события имел?мест??Германии, Англии ?России.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
