EVT1914_2038601_DESC;The reaction to Victoriano Huerta's harsh military dictatorship was Venustiano Carranza's Plan of Guadalupe, which called for the creation of a Constitutional Army, for Huerta's ouster, and for the restoration of constitutional government. Supporters of the plan included Emiliano Zapata, Francisco Pancho Villa and Бlvaro Obregуn. After repeated field defeats of Huerta's Federal Army by Obregуn and Villa, climaxing in the Battle of Zacatecas, Huerta bowed to pressure and resigned the presidency on July 15, 1914.;La rйaction ?la brutale dictature militaire de Victoriano Huerta fut le Plan de Guadalupe de Venustiano Carranza, qui appelait ?la crйation d'une Armйe Constitutionnelle pour йvincer Huerta, et pour restaurer un gouvernement constitutionnel. Les partisans du plan incluaient Emiliano Zapata, Francisco Pancho Villa et Бlvaro Obregуn. Suite aux nombreuses dйfaites sur le terrain subies par l'Armйe Fйdйrale de Huerta des mains d'Obregуn et de Villa, culminant avec la Bataille de Zacatecas, Huerta s'inclina et dйmissionna de la prйsidence le 15 juillet 1914.;Die Reaktion auf Victoriano Huerta's Militдrdiktatur war Venustanio Carranza's Plan von Guadalupe, der die Grьndung einer verfassungskonformen Armee, die Absetzung Huerta's und die Wiederherstellung einer verfassungsmдssigen Regierung vorsah. Zu den Unterstьtzern dieses Plans gehцrten Emiliano Zapata, Francisco Pancho Villa and Бlvaro Obregуn. Nach mehreren verlorenen Schlachten gegen Obregуn und Villa beugte sich Huerta dem Druck und legte sein Amt am 15. July 1914 nieder.;Reakcj?na brutaln?dyktatur?wojenn?Victoriano Huerty by?Plan z Gwadelupy autorstwa Venustiano Carranzy, ktуry postulowa?powstanie Armii Konstytucyjnej, odsuniкcie Huerty of wіadzy i przywrуcenie prawowitego rz№du. Plan ten by?wspierany przez Zapat? Francisco Pancho Vill?i Бlvaro Obregуna. Po kolejnych poraїkach Armii Federalnej Huerty z r№k Obregуna i Villi, ktуrych punktem kulminacyjnym byіa bitwa pod Zacatecas, Huerta ugi№і si?pod naciskiem i zrezygnowa?z urzкdu prezydenckiego 15 lipca 1914 r.;La reaccion a la dictadura militar sufriente de Victoriano Huerta fue el Plan de Guadalupe de Venustiano Carranza, el cual llamo por la creacion de un Ejercito Constitucional, para el sacamiento de Huerta, y para la restauracion de un govierno constitucional. Soportadores del plan incluyeron a Emiliano Zapata, Francisco Pancho Villa y Бlvaro Obregуn. Despues de repetidas derrotas del Ejercito Federal de Huerta por Obregуn y Villa, culminando en la Batalla de Zacatecas, Huerta se arrebato a la presion y renuncio a la presidencia el 15 de Julio de 1914.;La reazione alla dura dittatura militare di Victoriano Huerta fu il Piano di Guadalupe di Venustiano Carranza, che invoc?la creazione di un esercito Costituzionalista per rimuovere Huerta e restaurare il governo costituzionale. Tra i sostenitori del piano ci furono Emiliano Zapata, Francisco Pancho Villa e Бlvaro Obregуn. Dopo ripetute sconfitte sul campo dell'Esercito Federale di Huerta da parte di Obregуn e di Villa, culminate nella battaglia di Zacatecas, Huerta si arrese alla presione e si dimise dalla presidenza il 15 Luglio 1914.;;;;;;Реакцией на военну?диктатур?Викториано Уэрт?бы?Гваделупский план Венустиано Каррансы, призвавшег??созданию Конституциалистско?арми? для того, чтоб?покончит??Уэртой ?создат?конституционно?правительств? План поддерживали Эмилиано Сапата, Панч?Вилья ?Альвар?Обрего? Посл?поражени?Федерально?Арми?Уэрт?от Обрегона ?Виль? Уэрт?поддал? давлению ?остави?президенстки?пост 15 ию? 1914.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
