EVT1914_2038604_DESC;The Convention of Aguascalientes was issued on 1 October 1914 by Venustiano Carranza, head of the Constitutional Army, who described it as the Great Convention of Commanding Military Chiefs and State Governors. Its first sessions were held in the Chamber of Deputies in Mexico City, but were later transferred to the city of Aguascalientes, whence its name, where it met from 10 October to 9 November 1914. The convention was intended to little the differences between the big four warlords who played the biggest roles in overthrowing Huerta: Pancho Villa, Emiliano Zapata, Venustiano Carranza and Alvaro Obregon. From the onset, however, the Convention was dominated by the Villistas, who imposed their points of view on the other delegates. The Convention declared itself sovereign, elected General Eulalio Gutiйrrez Ortiz as President of Republic, and appointed Villa commander of the Conventionalist Army, which then took up arms against Carranza's Constitutionalists together with Emilano Zapata.;La Convention d'Aguascalientes fut dйcidйe le 1er octobre 1914 par Venustiano Carranza, le chef de l'Armйe Constitutionnelle, qui la dйcrivait comme la Grande Convention des chefs militaires et des Gouverneurs d'Йtats. Les premiиres sйances se tinrent dans la Chambre des Dйputйs ?Mexico City, mais furent ultйrieurement transfйrйes dans la ville d'Aguascalientes (d'o?le nom) o?elles eurent lieu du 10 octobre au 9 novembre 1914. Le but de la convention йtait de diminuer les diffйrences entre les quatre chefs de guerre ayant jou?le plus grand rфle lors du renversement de Huerta: Pancho Villa, Emiliano Zapata, Venustiano Carranza, et Alvaro Obregon. Dиs le dйbut, la Convention fut nйanmoins dominйe par les partisans de Villa qui imposиrent leurs vues aux autres dйlйguйs. La Convention se dйclara d'elle-mкme souveraine, et йlit comme Prйsident de la Rйpublique le Gйnйral Eulalio Gutiйrrez Ortiz, et nomma Villa comme commandant de l'Armйe de la Convention, qui prit alors les armes contre les Constitutionnalistes de Carranza, ainsi que contre Emilano Zapata.;Der Kongress von Aguascalientes wurde am 1. Oktober 1914 von Venustiano Carranza, dem Anfьhrer der konstitutionellen Armee, einberufen, der ihn als 'grosse Konferenz der Armeefьhrer und Gouverneure' bezeichnete. Die ersten Sitzungen wurden im Abgeordnetenhaus in Mexico City abgehalten, aber spдter wurde die gesamte Veranstaltung nach Aguascalientes verlegte, wo zwischen dem 10. Oktober und 9. November 1914 getagt wurde. ;Konwencja Aguascalientes zostaіa zwoіana 1 paџdziernika 1914 r. przez Venustiano Carranz? przywуdc?Armii Konstytucyjnej, ktуry opisa?j?jako Wielk?Konwencj?Dowуdcуw Si?Zbrojnych i Gubernatorуw Stanуw. Jej pierwsze sesje odbywaіy si?w Izbie Deputowanych w Mexico City, ale p?niej przeniosіy si?do miasta Aguascalientes, od ktуrego przyjкіy nazw? Spotkania trwaіy w dniach od 10 paџdziernika do 9 listopada 1914 r. Konwencja miaіa zmniejszy?rуїnice pomiкdzy czterema dowуdcami, ktуrzy odegrali najwiкksz?rol?w pokonaniu Huerty: Pancho Vill? Emiliano Zapat? Venustiano Carranz?i Alvaro Obregonem. Od pocz№tku jednak konwencja zdominowana byіa przez Villistуw, ktуrzy narzucili swуj punkt widzenia innym delegatom. Konwencja obwoіaіa si?suwerennym przedstawicielem narodu, wybraіa generaіa Eulalio Gutiйrreza Ortiza jako prezydenta republiki i mianowaіa Vill?jako dowуdc?Armii Konwencjonalistуw, ktуra skierowaіa si?przeciwko Konstytucjonalistom Carranzy i Emiliano Zapacie.;La Convenciуn de Aguascalientes fue creada 1 Octubre 1914 por Venustiano Carranza, jefe del Ejercito Constitucional, quien la describio como la Gran Convencion de Jefes Militares y Governantes de Estado. Sus primeras sesiones fueron hechas en la Camara de Deputados en Mexico D.F peru fueron transferidas a la ciudad de Aguascalientes, donde se encontro desde el 10 de Octobubre hasta el 9 de Noviembre de 1914. La convencion fue creada para eliminar las diferencias entre los 4 Lideres quienes jugaron the los papeles en sacar a Huerta: Pancho Villa, Emiliano Zapata, Venustiano Carranza y Alvaro Obregon. Desde el comienzo, sin embargo, la Convencion fue dominada por los Villistas, quienes impusieron sus puntos de vista en los otros delegados. la Convencion se declaro a si misma soverana, eligio al General Eulalio Gutiйrrez Ortiz como President de la Republica, y apunto a Villa como comandante del Ejercito Convencionalista, el cual luego surgio contra los constitucionalistas de carranza junto a Emilano Zapata.;L'Assemblea di Aguascalientes fu convocata il 1 Ottobre 1914 da Venustiano Carranza, capo dell'esercito Costituzionalista, che la descrisse come la Grande Assemble del Comandanti Militari e dei Governatori degli Stati. La sua prima sessione fu tenuta nella Camera dei Deputati di Citt?del Messico, ma fu in seguito trasferita nella citt?di Aguascalientes, da cui prese il nome, dove fu convocata dal 10 Ottobre al 9 Novembre 1914. L'assemblea era intesa per spianare le divergenze tra i quattro grandi conduttori che avevano avuto il merito di rovesciare Huerta: Pancho Villa, Emiliano Zapata, Venustiano Carranza e Alvaro Obregon. Dall'inizio tuttavia l'assemblea fu dominata dai Villisti che imposero il proprio punto di vista sugli altri delegati. La Convenzione si dichiar?sovrana, elesse il generale Eulalio Gutiйrrez Ortiz come Presidente della Repubblica e nomin?Villa come comandante dell'esercito Convenzionalista, che insieme ad Emiliano Zapata impugn?le armi contro l'esercito Costituzionalista di Carranza.;;;;;;Агуаскальентесск? конвенция была предложена 1 ок?бря 1914 года Венустиано Каррансо?ка?создание союз?межд?руководите?ми арми??губернаторам?штатов. Перв? сесс? прошла ?Палате депутато??Мехико, но зате?участник?переехал??Агуаскальентес (?чест?которого назван?конвенция), гд?он?проходил??10 ок?бря по 9 ноября 1914 года. Конвенция была призвана сгладить разногласия межд?4 главными варлордами, которы?участвовал??перевороте против Уэрт? Эмилиано Сапато?Венустиано Каррансо? Панч?Вильей ?Альвар?Обрегоно? На заседания?доминировали Вильисты, которы?оказывал?вл?ни?на других участников. Согласно конвенци? главой страны бы?избран Эулали?Гутьерре?Орти? ?Вилья стал главой Конвенциалистско?арми?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
