EVT1914_2038617_DESC;In early 1919 disagreements arose between our officers Gonzбlez and Guajardo, and after learning of these, Emiliano Zapata wrote a letter to Guajardo, asking him to join the Zapatistas. Luckily for us, the letter was intercepted by Gonzбlez who blackmailed Guajardo and saw it as an opportunity to set up an ambush for Zapata. Guajardo would gain the trust of Zapataby killing Zapatistas turn-coats, and then kill Zapata during a meeting. Do we support this assassination plan?;Au dйbut de 1919, des dйsaccords apparurent entre les officiers Gonzбlez et Guajardo, et aprиs en avoir pris connaissance, Emiliano Zapata йcrivit une lettre ?Guajardo lui demandant de rejoindre les Zapatistes. Par chance pour nous, la lettre ?йt?interceptйe par Gonzбlez, qui a fait chant?Guajardo, et a vu en elle une opportunit?de mettre en place une embuscade contre Zapata. Guajardo gagnerait la confiance de Zapata en tuant des traоtres Zapatistes, puis assassinerait Zapata durant une rйunion. Supportons nous ce plan d'assassinat?;Zu Beginn des Jahres 1919 kam es zu Unstimmigkeiten zwischen unseren Generдlen Gonzбles und Guajardo, die auch Emiliano Zapata bekannt wurden. In einem Brief an Guajardo forderte er diesen auf, sich den Zapatistas anzuschliessen. Glьcklicherweise fing Gonzбles diesen Brief ab und erpresste Guajardo damit, um einen Hinterhalt fьr Zapata vorzubereiten. Guajardo sollte Zapatas Vertrauen gewinnen, indem er einige abtrьnnige Zapatistas tцtet, um dann wдhrend einer Besprechung Zapata selbst zu ermorden. Sollen wir diesen Plan unterstьtzen ?;We wczesnym 1919 r. nieporozumienia narosіy pomiкdzy naszymi oficerami Gonzбlezem and Guajardo. Emiliano Zapata, gdy dowiedzia?si?o tej sytuacji, napisa?list do Guajardo, zapraszaj№c go do przyі№czenia si?do Zapatistуw. Szcz?liwie dla nas, list przechwyci?Gonzбlez, ktуry zaszantaїowa?Guajardo i zauwaїy?w tej sytuacji okazj?do organizacji zasadzki na Zapat? Guajardo zyskaіby zaufanie Zapaty zabijaj№c zapatistowskich zdrajcуw, a wtedy zabiіby samego Zapat?podczas spotkania. Czy wesprzemy ten plan?;A comienzos de 1919 desacuerdos ocurieron entre entre nuestros oficiales Gonzбlez and Guajardo, y despues de aprender de estos, Emiliano Zapata le escribio una letra a Guajardo, preguntandole si queria entrar a los Zapatistas. Suertemente para nosotros, la carta fue interceptada por Gonzбlez quien chantajeo a Guajardo y vio esta como una oportunidad a emboscar a Zapata. Guajardo ganaria la confianza de Zapata matando a Zapatistas traidores, y luego mataria a Zapata durante una reuniуn. Vamos a soportar este plan de asesinato?;All'inizio del 1919 nacquero delle divergenze tra gli ufficiali Gonzбlez and Guajardo e dopo esserne giunto a conoscenza, Emiliano Zapata scrisse una lettera a Guajardo, chiedendogli di entrare a far parte degli Zapatisti. Fortunatamente per noi, la lettera ?stata intercettata da Gonzбlez che ha ricattato Guajardo e l'ha vista come un'opportunit?per preparare un'imboscata contro Zapata. Guajardo dovrebbe guadagnare la fiducia di Zapata uccidendo dei voltagabbana Zapatisti per poi uccidere Zapata durante un incontro. Vogliamo sostenere questo piano di assassinio?;;;;;;?начале 1919 появились разногласия межд?нашими офицерам?Гонсалезом ?Гу?рд? ?когд?Сапата узна?об этом, он написа?письмо ?которо?пригласи?Гу?рд??себе на службу. ?счасть?для на? эт?письмо было перехвачен?Гонсалесом, которо?стал шантажироват?Гу?рд??заставил ег?придти на собрание Сапатистов ?та?убит?Сапату. Следуе?ли на?утвердит?план убийства?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
