EVT1914_2038618_DESC;In early 1919 disagreements arose between Gonzбlez and Guajardo, and after learning of these, Zapata wrote a letter to Guajardo, asking him to join the Zapatistas. The letter was intercepted by Gonzбlez who blackmailed Guajardo and used it as an opportunity to set up an ambush for Zapata. Guajardo, after making a show of loyalty to Zapata by executing a turn coat Zapatista chief, Victoriano Barcena, arranged a meeting with Zapata at Chinameca Hacienda at which he was supposed to deliver badly needed ammunitions. After Zapata arrived, on April 10 1919, a guard of honor presented arms to him, but on the third signal of the bugle they opened up fire at point blank range, killing Zapata. They then took his body to Cuautla to claim the bounty, where they are reputed to have been given only half of what was promised. Following Zapata's death, the Liberation Army of the South slowly fell apart, although Zapata's heir apparent Gildardo Magaсa and many other Zapata adherents went on to political careers as representatives of Zapatista causes and positions in the Mexican army and government. It is now necessary to decide who will lead the Zapatistas now. Gildardo Magaсa Cerda and Jesъs Capistrбn are the two leading choices: both are capable, whom will the Junta elect?;Au dйbut de 1919, des dйsaccords apparurent entre les officiers Gonzбlez et Guajardo, et aprиs en avoir pris connaissance, Emiliano Zapata йcrivit une lettre ?Guajardo lui demandant de rejoindre les Zapatistes Par chance pour nous, la lettre ?йt?interceptйe par Gonzбlez, qui a fait chant?Guajardo, et a vu en elle une opportunit?de mettre en place une embuscade contre Zapata. Guajardo, aprиs avoir fait preuve de sa loyaut?envers Zapata en exйcutant un traоtre Zapatiste, organisa une rencontre avec Zapata ?l'Hacienda Chinameca, o?il йtait suppos?livrer des munitions grandement attendues. Aprиs l'arrivйe de Zapata le 10 avril 1919, une garde d'honneur lui prйsenta les armes, mais au troisiиme appel du clairon, elle fit feu sur Zapata, le tuant ?bout portant. Les tueurs emmenиrent son corps ?Cuautla pour rйclamer la prime, o?il est dit qu'ils ne reзurent que la moiti?de ce qui avait йt?promis. Suite ?la mort de Zapata, l'Armйe de Libйration du Sud se dйlita lentement, bien que l'hйritier de Zapata, Gildardo Magaсa, ainsi que de nombreux adhйrents ?la cause Zapatiste, prirent des carriиres politiques en dйfense des causes Zapatistes, ainsi que des postes dans l'armйe et le gouvernement mexicain. Il est dйsormais nйcessaire de choisir qui dirigera les Zapatistes Gildardo Magaсa Cerda et Jesъs Capistrбn sont les deux choix possibles. Les deux sont capables. Qui la junte йlira t-elle?;Zu Beginn des Jahres 1919 kam es zu Unstimmigkeiten zwischen unseren Generдlen Gonzбles und Guajardo, die auch Emiliano Zapata bekannt wurden. In einem Brief an Guajardo forderte er diesen auf, sich den Zapatistas anzuschliessen. Gonzбles fing diesen Brief ab und erpresste Guajardo damit, um einen Hinterhalt fьr Zapata vorzubereiten. Als Zeichen der Loyalitдt richtete Guajardo einen abtrьnnigen Zapatista Fьhrer, Victoriano Barcena, hin und arrangierte ein Treffen mit Zapata auf der Hazienda San Juan bei Chinameca, vorgeblich um dringend benцtigte Munition zu liefern. Nachdem Zapata am 10. April 1919 die Hazienda erreichte und die Ehrenwache inspizierte, erцffnete diese aus nдchster Nдhe das Feuer auf ihn. Zapatas Leiche wurde nach Cuautla gebracht, wo die Verschwцrer aber nur die Hдlfte des ihnen versprochenen Kopfgeldes erhielten. Nach seinem Tod fiel seine 'Befreiungsarmee des Sьdens' langsam auseinander, auch wenn sein offensichtlicher Nachfolger Gildardo Magana und viele andere Gefolgsleute eine politische Laufbahn einschlugen und Zapatas Ziele in der mexikanischen Regierung und Armee weiter verfolgten. Wir mьssen nur eine Entscheidung fдllen, wer zukьnftig die Zapatistas anfьhren soll, Jesъs Capistrбn oder Gildardo Magana ? Beide sind offenkundig geeignet fьr die Position.;We wczesnym 1919 r. nieporozumienia narosіy pomiкdzy naszymi oficerami Gonzбlezem and Guajardo. Emiliano Zapata, gdy dowiedzia?si?o tej sytuacji, napisa?list do Guajardo, zapraszaj№c go do przyі№czenia si?do Zapatistуw. Szcz?liwie dla nas, list przechwyci?Gonzбlez, ktуry zaszantaїowa?Guajardo i zauwaїy?w tej sytuacji okazj?do organizacji zasadzki na Zapat? Guajardo, po tym jak pokaza?Zapacie swoj?lojalnoњж zabijaj№c zdrajc? byіego dowуdc?Zapatistуw, Victoriano Barcen? zaaranїowa?spotkanie z Zapat?w hacjendzie Chinameca, podczas ktуrego mia?dostarczy?tak bardzo potrzebn?amunicj? Kiedy Zapata pojawi?si?na spotkaniu, 10 kwietnia 1919 r., straїnik zaprezentowa?mu dostaw? ale po trzecim dџwiкku rogu, otworzyli ogie?do Zapaty z odlegіoњci kilku krokуw, zabijaj№c go na miejscu. Guajardo zabra?jego ciaіo do Cuautli aby odebra?nagrod? ale prawdopodobnie otrzyma?tylko poіow?obiecanej sumy. Po њmierci Zapaty Wyzwoleсcza Armia Poіudnia powoli rozpadіa si? chocia?nastкpca Zapaty Gildardo Magaсa i wielu innych zwolennikуw Zapaty kontynuowaіo kariery polityczne jako reprezentanci jego idei i postulatуw. Jest waїne, by zdecydowa?teraz kto poprowadzi dalej Zapatistуw.Gildardo Magaсa Cerda i Jesъs Capistrбn s?dwoma wiod№cymi postaciami: obaj nadaj?si?do tego zadania, ale kogo wybierze Junta?;A comienzos de 1919 desacuerdos ocurieron entre Gonzбlez y Guajardo, y despues de aprender de estos, Zapata le escribio una carta a Guajardo, preguntadole si queria entrar a los Zapatistas. La carta fue interceptada por Gonzбlez quien chantajeo a Guajardo la uso como una oportunidad para crear una emboscada para Zapata. Guajardo, despues de mostrarle su lealtad a Zapata ejecutando a un lider Zapatista traidor, Victoriano Barcena, hizo una reunion con Zapata en la Hacienda Chinameca en el cual el les iva a dar municiones muy necesitadas. Despues que Zapata llegara, el 10 de Abril de 1919, una guardia de honor le presento armas, pero en la tercera seсal de la trompeta le dispararon a quemarropa, matando a Zapata. Ellos luego llevaron al cuerpo a Cuatla a reclamar la recompenza por su cabeza, cuando ellos han sido reputados de solo recibir la mitad de la recompenza. Siguiendo la muerte de Zapata, el Ejercito de Liberacion del Sur lentamente se disolvio, aunque el heredero en teoria de Zapata conocido como Gildardo Magaсa y muchos otros adherentes de Zapata fueron a varias carreras politicas como representativos de causas Zapatistas y posiciones en el ejercito Mexicano y el govierno. Ahora es necesario decidir quien va liderar a los Zapatistas. Gildardo Magaсa Cerda y Jesъs Capistrбn son las dos opciones mas populares: los dos son capaces, A quien va a elegir la junta?;All'inizio del 1919 nacquero delle divergenze tra gli ufficiali Gonzбlez and Guajardo e dopo esserne giunto a conoscenza, Emiliano Zapata scrisse una lettera a Guajardo, chiedendogli di entrare a far parte degli Zapatisti. Fortunatamente per noi, la lettera ?stata intercettata da Gonzбlez che ha ricattato Guajardo e l'ha vista come un'opportunit?per preparare un'imboscata contro Zapata. Guajardo dimostr?la sua lealt?a Zapata uccidendo un importante voltagabbana Zapatista, Victoriano Barcena, e prepar?un incontro con Zapata alla Hacienda Chinameca nella quale avrebbe dovuto fornire equippagimento e munizioni. Dopo l'arrivo di Zapata, il 10 Aprile 1919, una guardia di onore present?le armi dinnanzi a lui, ma al terzo segnale del trombettiere spararono e uccisero Zapta. Portarono poi il suo corpo Cuautla per ottenere la taglia, dove si dice che ottennero solo la met?di quanto promesso. A seguito della morte di Zapata, l'Esercito di Liberazione del Sud inizi?a sciogliersi, sebbene l'erede designato di Zapata Gildardo Magaсa e molti altri sostenitori di Zapata continuarono la propria carriera politica come rappresentanti della causa Zapatista e ottenere posizioni nell'esercito e nel governo messicani. E' ora necessario scegliere chi guider?ora gli Zapatisti. Gildardo Magaсa Cerda e Jesъs Capistrбn sono le due scelte principali: entrambi sono leader capaci, chi verr?scelto dalla giunta?;;;;;;?начале 1919 появились разногласия межд?нашими офицерам?Гонсалезом ?Гу?рд? ?когд?Сапата узна?об этом, он написа?письмо ?которо?пригласи?Гу?рд??себе на службу. ?счасть?для на? эт?письмо было перехвачен?Гонсалесом, которо?стал шантажироват?Гу?рд??заставил ег?придти на собрание Сапатистов ?та?убит?Сапату. 10 апре? 1919 года почетный караул преподнё?Сапате оружие, но по третьему сигнал?караул открыл огон?по Сапате. Ег?тело он?отвезл?Куаутл? гд?потребовал?наград? но им дали половину обещанного. Посл?смерти Сапата Освободительная армия Юг?начала стремительно те?ть свои позици??арми??правительств? Кт?возглави?Сапатистов: Гильдард?Магана ил?Хесу?Капистра?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
