EVT1914_2038620_NAME;Plan of Agua Prieta;Plan d'Agua Prieta;Der 'Plan von Agua Prieta';Plan Agua Prieta;Plan de Agua Prieta;Il Piano di Agua Prieta;;;;;;План Агуа Прьета;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2038620_DESC;The Plan of Agua Prieta is a manifesto drafted and signed by supporters of General Бlvaro Obregуn on 23 April 1920. The Plan repudiated the government of President Venustiano Carranza, using a dispute between the federal government and the Sonora state government over control of the waters of the Rнo Sonora as pretext. In reality the underlying reasons included a string of personal interests and political conflicts, including the defeat of Obregуn and his party in the 1920 presidential election by the civilian Ignacio Bonillas, Carranza's chosen successor. Support for the Plan was widespread across the country: more than three-quarters of the Army rejected Carranza and joined the rebellion. As De la Huerta's Liberal Constitutionalist Army made rapid progress toward Mexico City, Carranza refused to negotiate or surrender and fled the capital by train. A rebel ambush in the early hours of 21 May 1920, reputedly led by Gen. Rodolfo Herrero, left President Carranza dead.;Le Plan d'Agua Prieta est un manifeste rйdig?et sign?par les partisans du Gйnйral Бlvaro Obregуn le 23 avril 1920. Le plan rйpudie le gouvernement du Prйsident Venustiano Carranz, usant comme prйtexte une dispute entre le gouvernement fйdйral et le gouvernement de l'Йtat de Sonora sur le contrфle des eaux du Rнo Sonora. En vйrit? les raisons sous-jacentes incluaient un ensemble d'intйrкts personnels et de conflits politiques, entre autre la dйfaite d'Obregуn et de son parti lors de l'йlection prйsidentielle de 1920, par le civil qu'Ignacio Bonillas Carranza s'йtait choisi comme successeur. Le support pour le plan fut trиs large ?travers tout le pays: plus des trois quarts de l'armйe rejeta Carranza et rejoignit la rйbellion. Tandis que l'Armйe Constitutionnaliste Libйrale de la Huerta avanзait rapidement vers Mexico City, Carranza refusa de nйgocier ou de se rendre, et fuit la capitale en train. Une embuscade rebelle ?l'aube du 21 mai 1920, connue pour avoir йt?conduite par le Gйnйral Rodolfo Herrero, laissa le Prйsident Carranza mort.;Der 'Plan von Agua Prieta' war ein Manifest, das von Unterstьtzern General Бlvaro Obregуn's am 23. April 1920 verцffentlicht wurde. Es lehnte die Regierung von Prдsident Venustiano Carranza ab und nutzte den Streit zwischen der Bundesregierung und der Regierung des Staates Sonora wegen der Wasserrechte am Sonora als Vorwand. In Wirklichkeit waren die Grьnde fьr dieses Manifest ein ganzes Bьndel persцnlicher Interessen und politischer KOnflikte und wohl auch ein Stьck weit Resultat der Frustration, die von der Wahlniederlage Obregуn's gegen Ignacio Bonillas, Caranza's potentiellem Nachfolger herrьhrte. Der 'Plan' fand Widerhall in ganz Mexiko und mehr als drei Viertel der Armee wandte sich gegen Carranza und schloss sich Adolfo de la Huerta's 'Liberalkonstitutionalistische Armee' an. Nachdem auch der Oberbefehlshaber der in Mexiko-Stadt stationierten Truppen, Pablo Gonzбles, zu den Aufstдndischen ьberlief, verliess Prдsident Carranza seine Hauptstadt fluchtartig. Er wurde in einem Rebellenhinterhalt in den Morgenstunden des 21. Mai 1920 erschossen.   ;Plan Agua Prieta jest manifestem sformuіowanym i podpisanym przez zwolennikуw generaіa Бlvaro Obregуna 23 kwietnia 1920 r. Plan wypowiada?posіuszeсstwo rz№dowi Venustiano Carranzy, uїywaj№c jako pretekstu kwesti?kontroli nad wodami rzeki Rнo Sonora. W rzeczywistoњci powodem byіy kwestie osobistych interesуw i konfliktуw, miкdzy innymi poraїka Obregуna i jego partii w wyborach prezydenckich w 1920 r. z r№k Ignacio Bonillasa, wybranego nastкpcy Carranzy. Poparcie dla Planu byіo powszechne w caіym kraju: wiкcej ni?trzy czwarte armii opuњciіo Carranz?i doі№czyіo do rebelii. Gdy Armia Liberalnych Konstytucjonalistуw De la Huerty zbliїaіa si?szybko do Mexico City, Carranza odmуwi?negocjacji lub poddania si?i uciek?ze stolicy poci№giem. Zasadzka rebeliancka nad ranem 21 maja 1920 r., prawdopodobnie autorstwa generaіa Rodolfo Herrero, zakoсczyіa їycie prezydenta Carranzy.;El Plan of Agua Prieta fue un manifesto creado y firmado por simpatizantes del General Бlvaro Obregуn el 23 de Abril de 1920. El Plan repudio al govierno del Presidente Venustiano Carranza, usando una confrontacion entre el govierno federal y el govierno del estado de Sonora sobre control de las aguas del Rнo Sonora como pretexto. En reality las razones secretas incluyeron un grupo de intereses personales y conflictos politicos, incluyendo la perdida de Obergon y su partido en la eleccion presidencial de 1920 por el ciudadano Ignacio Bonillas, el sucesor de Carranza. Soporte por el Plan fue comun por el pais: mas de tres cuartos del ejercito rechazaron a Carranza y se unieron a la rebelion. Mientras que el Ejercito Liberal Constitucionalista de De la Huerta hizo rapido progreso hacia Mexico D.F, Carranza se reuso a negociar o a rendirse y escapo la capital por tren. Una emboscada rebelde en las primeras horas del 21 de Mayo de 1920, repudiadamente liderada por Gen. Rodolfo Herrero, dejo al Presidente Carranza muerto.;Il Piano di Agua Prieta ?un manifesto scritto e firmato dai sosteniori del generale Бlvaro Obregуn il 23 Aprile 1920. Il Piano ripudiava il governo del Presidente Venustiano Carranza, usando come pretesto una disputa tra il governo federale e lo stato di Sonora per il controllo delle acque del Rio Sonora. In realt?le vere ragioni comprendevano interessi personali e conflitti politici, inclusa la sconfitta di Obregуn e del suo partito nelle elezioni presidenziali del 1920 dal civile Ignacio Bonillas, il successore designato di Carranza. Il supporto per il Piano fu abbastanza diffuso in tutto il paese: pi?di tre quarti dell'esercito rifiutarono di obbedire a Carranza e si allearono ai rivoltosi. Mentre l'Esercito Liberale Costituzionalista di De la Huerta faceva rapidi progressi verso Citt?del Messico, Carranza si rifiutava di negoziare o di arrendersi e decise di fuggire la capitale via treno. Carranza fu ucciso in un'imboscata di ribelli nelle prime ore del 21 Maggio 1920, a quanto pare guidata dal generale Rodolfo Herrero.;;;;;;План Агуа Прьета являлся манифестом предложенным ?подписанны?сторонниками генерала Альвар?Обрегона 23 апре? 1920 ?игра?на противореч??межд?федеральны?правительством ?правительством штат?Сонора ?контроле на?водами Ри?Сонора. Наст?щи?причин?заключалис??то? чт?Обрего?проиграл президенстские выборы 1920 года. Боле?трет?арми?перешл?на сторон?Обрегона. Карранса отказался сдаваться ?сбежал из горо?на поезде, но бы?пойман ?убит.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
