EVT1914_2038621_DESC;After defeating Victoriano's Huerta Federal Army, only we and the Constitucionalist survived. Should we submit to their rule and end the bloodshed in Mexico or should we declare war with the hope of becoming the new leaders of Mexico?;Aprиs avoir dйfait l'Armйe Fйdйrale de Victoriano Huerta, seuls nous et les Constitutionnalistes restons. Devrons nous nous soumettre ?leur autorit?et en finir avec le bain de sang, ou devrons nous leur dйclarer la guerre et espйrer ainsi devenir les nouveaux maоtres du Mexique?;Nachdem wir Victoriano Huerta's Bundesarmee geschlagen haben, sind nur noch wir und die Konstitutionalisten ьbrig. Sollen wir uns ihnen ergeben und das Blutvergiessen beenden oder sollen wir ihnen den Krieg erklдren, um die alleinigen Herren Mexikos zu werden ?;Po pokonaniu Armii Federalnej Victoriano Huerty, przetrwaliњmy tylko my i Konstytucjonaliњci. Czy poddamy si?ich wіadzy i zakoсczymy rozlew krwi w Meksyku czy powinniњmy wypowiedzie?im wojn? licz№c na zostanie nowymi przywуdcami Meksyku?;Despues de vencer al Ejercito Federal de Victoriano Huerta, solo nosotros y los Constitucionalistas sobrevivieron. Deberiamos rendirnos a su liderazgo y terminar la guerra en Mexico o declararles la guerra con el proposito de volvernos los nuevos lideres de Mexico?;Dopo la sconfitta dell'Esercito Federale di Victoriano Huerta, solo noi e i Costituzionalisti siamo sopravvissuti. Dobbiamo arrenderci a loro e porre fine allo spargimento di sangue o dobbiamo dichiarare loro guerra con la speranza di diventare i nuovi padroni del Messico?;;;;;;Посл?поражения Федерально?Арми?Уэрт? только мы ?Конституциалисты выжили. Должны ли мы им подчиниться ?закончит?кровопролити??Мексик?ил?попробоват?стат?новыми лидерами страны?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
