EVT1914_2038550_DESC;Besides being a great boost for the morale of our troops, control of Mexico City gives us access to significant industrial and technical resources that we otherwise lack. We'll also be able to start manufacturing some infantry weapons ourselves, even some of the outstanding and worlds first semi-automatic rifles Mondragon M1908.;Outre le fait que cela amйliore le moral de nos troupes, le contrфle de Mexico City nous donne accиs ?des industries et ?des ressources techniques consйquentes qui nous feraient sinon dйfaut. Nous allons pouvoir commencer ?usiner des armes d'infanterie, y compris quelques uns des fantastiques premiers fusils semi-automatiques du monde, les Mondragуn M1908.;Abgesehen davon, da?es es gut fьr die Moral unserer Truppe wдre, wenn wir Mexiko-Stadt kontrollieren wьrden, brauchen wir die technischen und industriellen Ressourcen, die uns die Hauptstadt bieten kann. Wir kцnnen dann endlich anfangen, einige Infantriewaffen selbst zu fertigen, unter anderem die weltweit ersten halbautomatischen Gewehre vom Typ Modragon M1908.;Poza wielkim wsparciem dla morale naszych wojsk, kontrola nad Mexico City daje nam dostкp do znacz№cych zasobуw przemysіowych i technologicznych, ktуrymi w innym wypadku byњmy nie dysponowali. Bкdziemy w stanie rozpocz№ж produkcj?wіasnej broni, w tym egzemplarzy jednych z pierwszych broni pуіautomatycznych њwiata, bardzo udanych karabinуw Mondragon M1908.;Aparte de ser una gran fuente de moral para nuestras tropas, control de Mexico D.F nos da acceso a significantes recursos industriales y tecnicos. Tambien podremos crear algunos rifles por nosotros mismos, hasta creando los mismos Mondragons m1908, unos de los mejores rifles en el mundo.;Oltre a essere una grande spinta per il morale delle nostre truppe, il controllo di Citt?del Messico ci consente l'accesso a importanti risorse tecniche e industriali di cui altrimenti non disporremmo. Saremo anche in grado di iniziare a produrre noi stessi alcune armi per la fanteria, addirittuta alcuni dei primi straordinari fucili semi-automatici Mondragуn M1908.;;;;;;Захват Мехико не только резк?повыси?мораль ?уверенност?наши?войс? но ?да?им возможност?получить новейшее вооружение (полу-автоматические винтовки Мондраго??908) ?доступ ?ресурсам.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
