EVT1914_2038552_DESC;Since we lack the adequate means for producing significant amounts of ammunition and weapons, the enemy is our main source of weapon supplies. Recently our forces managed to capture another cargo of supplies.;Du fait de notre manque de moyens pour produire des munitions et de l'armement en quantitйs suffisantes, l'ennemi est notre principale source de ravitaillement en armes. Rйcemment, nos forces sont parvenues ?capturer une autre cargaison de ravitaillement.;Da wir nicht in der Lage sind, Waffen und Munition selbst herzustellen, sind wir auf das angewiesen, was wir beim Gegner erbeuten kцnnen. Gerade eben haben wir wieder eine grosse Lieferung Nachschub und Munition abgefangen.;Jako їe nie dysponujemy odpowiednimi њrodkami do produkcji znacz№cych iloњci amunicji i broni, nasi wrogowie s?gіуwnym џrуdіem zasobуw militarnych. Ostatnio nasze siіy zdoіaіy zdoby?kolejn?dostaw?broni i amunicji.;Ya que no tenemos los medios adecuados para producir significantes cantidades de municion y armas, el enemigo es nuestra principal fuente de armas. Recientemente nuestras fuerzas pudieron capturar otro cargo de suministros.;A causa della mancanza di adeguati mezzi per produrre significative quantit?di munizioni e materiali, il nemico ?la nostra principali fonte di rifornimenti militari. Recentemente le nostre forze sono riuscite a catturare un'altro carico di rifornimenti.;;;;;;Та?ка??на?не?возможност?нормальн?производит?припас??оружие, главны?источником припасов являет? на?враг. Недавн?наши войска захватил?ещ?один скла??припасам?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
