EVT1914_2038553_DESC;We have several sympathizers in Fбbrica Nacional de Armas, the National arms factory, and whenever they can, they send us some supplies in the form of munitions. It is only a matter of time until they are caught and the smuggling operation is stopped. Historically that happened in 1918.;Nous avons plusieurs sympathisants dans la Fбbrica Nacional de Armas, l'usine nationale d'armement. Dиs qu'ils le peuvent, ils nous font parvenir des munitions. Leur dйcouverte n'est qu'une question de temps, et leurs envois alors cesseront. Historiquement, cela eut lieu en 1918.;Wir haben einige Sympathisanten in der grцssten Munitionsfabrik des Landes, der Fбbrica Nacional de Armas, die immer wieder Munition fьr uns herausschmuggeln. Uns ist klar, da?man sie irgendwann entdecken und verhaften wird. Historisch geschah dies 1918.;Mamy wielu sympatykуw w narodowej fabryce broni, Fбbrica Nacional de Armas, i kiedy tylko mog? przesyіaj?nam oni wsparcie w formie broni. Jest tylko kwesti?czasu, kiedy przemyt zostanie wykryty i bro?przestanie do nas dociera? W rzeczywistoњci nast№piіo to w 1918 r.;Tenemos muchos simpatizantes en la Fбbrica Nacional de Armas, y cuando pueden, nos mandan suministros en la forma de municiones. Es solo una cuestion de tiempo hasta que los encuentren y la operacion de traficamiento es parada. Historicamente eso paso en 1918.;Abbiamo molti simpatizzanti nella Fбbrica Nacional de Armas, la fabbrica nazionale di armi, e appena possono ci mandano dei rifornimenti sotto forma di munizioni. Tuttavia ?solo una questione di tempo prima che vengano scoperti e che il contrabbando venga fermato. Storicamente questo ?avvenuto nel 1918.;;;;;;?на?есть нескольк?стороннико?на Национальной Оружейно?фабрик? ?он?посылают на?то, чт?могу. Эт?лишь вопрос времен? когд?их поймаю??контрабанд?прекратится. Историческ? эт?произошл??1918 году.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
