EVT1914_2193501_NAME;Polish–Soviet War;Guerre russo-polonaise;Der polnisch-russische Krieg;Wojna polsko-sowiecka;Guerra Polaco-Soviйtica;Guerra sovietico-polacca;;;;;;Советско-польск? войн?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2193501_DESC;The Polish–Soviet War was an armed conflict between the Republic of Poland and the Ukrainian People's Republic on one side and Soviet Russia and Soviet Ukraine on the other. The Treaty of Versailles had not defined the frontiers between Poland and Soviet Russia. Moreover, Poland wanted to expand its borders as far east as feasible whereas Lenin saw Poland as the bridge the Red Army had to cross to assist other communist movements and bring about other European revolutions. A conflict was inevitable.;La guerre russo-polonaise fut un conflit arm?entre la Rйpublique de Pologne et la Rйpublique Populaire d'Ukraine d'un cфt? et la Russie Soviйtique et l'Ukraine Soviйtique de l'autre. Le trait?de Versailles n'avait pas dйlimit?les frontiиres entre la Pologne et la Russie Soviйtique. De plus, la Pologne voulait repousser ses frontiиres le plus loin ?l'Est possible, tandis que Lйnine voyait en la Pologne le pont que l'Armйe Rouge devait traverser pour assister les autres mouvements communistes et apporter d'autres rйvolutions en Europe. Le conflit йtait inйvitable.;Der polnisch-russische Krieg war eine Auseinandersetzung zwischen der Republik Polen und der ukrainischen Volksrepublik auf der einen und Sowjetrussland und der Sowjetukraine auf der anderen Seite. Der Vertrag von Versailles hatte die Grenzziehung in diesen Gebieten nicht berьcksichtigt, da der Bьrgerkrieg in Russland noch nicht beendet war. Die polnische Seite war bestrebt, ihr Territorium so weit als mцglich ostwдrts auszudehenen, um eine osteuropдische Konfцderation unter polnischer Fьhrung zu etablieren. Lenin hingegen sah Polen als Hindernis auf dem Weg in das deutsche Reich, in dem er eine proletarische Revolution auszulцsen gedachte. Dieser Interessenkonflikt machte kriegerische Handlungen unvermeidbar. ;Wojna polsko-sowiecka byіa konfliktem zbrojnym pomiкdzy Rzeczpospolit?Polsk?i Ukraiсsk?Republik?Ludow?po jednej stronie, a sowieckimi Rosj?i Ukrain?po drugiej. Traktat Wersalski nie zdefiniowa?granic pomiкdzy Polsk? a Rosj?Sowieck? Co wiкcej, Polska chciaіa rozszerzy?swe granice tak daleko na wschуd jak byіo to moїliwe, podczas gdy Lenin traktowa?j?jako pomost po ktуrym Armia Czerwona przejdzie, by przenieњж rewolucj?na zachуd Europy. Konflikt by?nieunikniony.;La Guerra Polaco-Soviйtica fue un conflicto armado entre la Republica Polaca y la Republica Popular Ucraniana en un lado y Rusia Soviйtica y Ucrania Soviйtica en el otro. El Tratrado de Versalles no habia decidido las fronteras entre Polonia y Rusia Soviйtica. Mas que todo, Polonia queria expandir sus bordes lo mas este posible sin sobreestrecharse mientras que Lenin veia a Polonia como el puente que el Ejercito Rojo tenia que cruzar para ayudar a otros movimientos comunistas y traer la revolucion al resto de Europa. Un conflicto fue inevitable.;La guerra sovietico-polacca ?stato un conflitto armato tra la Repubblica Polacca e la Repubblica Popolare Ucraina da una parte e la Repubblica Socialista Federativa Sovietica Russa e la Repubblica Socialista Sovietica Ucraina dall'altra. Il Trattato di Versailles non aveva infatti definito i confini tra Polonia e Russia Sovietica. Inoltre, la Polonia voleva espandere i suoi confini il pi?a est possibile mentre Lenin vedeva la Polonia come il ponte che l'Armata Rossa doveva attraversare per assistere gli altri movimenti comunisti e fomentare altre rivoluzioni europee. Una guerra era inevitabile.;;;;;;Советско-польск? войн?- вооруженны?конфликт межд?Польше??Украинской Народной Республико??одно?сторон? ?Советско?Россие? Советско?Белоруссие? Советско?Украиной ?другой. Версальски?догово?не обозначи?границ межд?Польше??Советско?Россие? Хо? польские политики ?расходилис?во взгляда?на то, како?именно статус должны имет?восточны?территории бывшей Речи Посполитой ?состав?нового государств? он?единогласн?выступал?за их возвра?по?польский контроль. Советско?правительств? напротив, предполагало установить контроль на?всей территорие?бывшей Российской импери? сделав её (ка?официально заявлялось) плацдармом мирово?революци? Конфликт бы?неизбеже?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2193502_NAME;Offer Peace to the Soviets;Offre de paix au soviйtiques;Friedensangebot an die Sowjets;Zaoferuj Sowietom pokуj;Ofrecerle paz a los Soviйticos;Offri la pace ai Sovietici;;;;;;Предложить ми?Совета?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2193502_DESC;Our offensive into Soviet Union reached its goals, we're now in the position to ask a favorable peace. They will probably accept to give us our rightful core provinces. However, we may decide to push our luck and ask for all our claimed provinces and for an independent Ukraine under our control. They might decide not to accept this proposal though.;Notre offensive ?l'intйrieur de l'Union Soviйtique a atteint ses objectifs. Nous sommes dйsormais en situation pour demander une paix favorable. Ils accepteront certainement de nous restituer nos provinces lйgitimes. Par contre, nous pouvons essayer de tenter notre chance et demander toutes les provinces que nous rйclamons, ainsi qu'une Ukraine indйpendante sous notre contrфle. Dans ce cas, ils peuvent dйcider de ne pas accepter cette proposition.;Unsere Offensive in die Sowjetunion hinein hat ihre Ziele erreicht, so das wir nun aus einer Position der Stдrke heraus in Friedensverhandlungen eintreten kцnnen. Wahrscheinlich wird man uns die uns rechtmдssig zustehenden Provinzen zugestehen, aber wir kцnnen natьrlich auch weit mehr fordern, einschliesslich der Grьndung eines unabhдngigen ukrainischen Staates unter unserer Kontrolle. ;Nasza ofensywa wgі№b Zwi№zku Sowieckiego osi№gnкіa swe cele i moїemy teraz zaї№da?korzystnych dla nas warunkуw pokojowych. Sowieci prawdopodobnie zgodz?si?odda?nam wszystkie nasze ziemie. Moїemy jednak pуjњж dalej w ї№daniach i pragn№ж stworzy?niepodlegі№ Ukrain?w ramach naszych granic. Na t?propozycj?nasz wrуg moїe jednak nie przysta?tak іatwo.;Nuestra ofensiva hacia la Union Soviйtica ha llegado a sus objetivos, ahora estamos en una posicion para una paz favorable. Ellos van a probablemente aceptar a darnos nuestras legitimas tierras. Sin embargo, podemos decidir intentar y preguntar por todas nuestras tierras reclamadas y para una Ucrania independiente bajo nuestro control. Aunque puede que no acepten.;La nostra offensiva contro l'Unione Sovietica ha raggiunto i suoi obiettivi, siamo ora nella posizione di poter chiedere una pace favorevole. E' probabile che accettino di restituirci le nostre legittime province nazionali. Tuttavia, possiamo decidere di sfidare la sorte e chiedere tutte le province che rivendichiamo e di avere un'Ucraina indipendente sotto il nostro controllo. E' possibile per?che non accettino questa proposta.;;;;;;Наше наступлени?на Советски?Союз достигло поставленных целе? теперь мы може?диктоват?условия мира. Скорее всег? он?отдаду?на?те территории, чт?наши по прав? Впроче? мы може?испытать удач??затребоват?вс?наши территориальны?претензи? ?такж?независиму?Украин?по?наши?контроле?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
