EVT1914_2193503_DESC;The Polish Army has led a successful offensive in our territories, our army doesn't seems able to stop them. They have made their peace conditions known, it should be wise to accept them.;L'Armйe Polonaise a men?une offensive victorieuse dans nos territoires, et notre armйe ne semble pas кtre en mesure de l'arrкter. Les polonais ont fait connaоtre leurs conditions, il pourrait кtre sage de les accepter.;Die polnische Armee ist weit auf unser Territorium vorgedrungen und es sieht nicht so aus, als kцnnten wir sie aufhalten. Die polnische Regierung hat uns ihre Bedingungen fьr einen Frieden mitgeteilt. Wir wдren gut beraten, sie zu akzeptieren.;Polska armia dokonaіa pomyslnej ofensywy na naszym terytorium i Armia Czerwona nie jest w stanie jej powstrzyma? Polska wystosowaіa swoje warunki pokoju i rozs№dnie byіoby je przyj№ж.;El ejercito Polaco ha lanzado una ofensiva con suceso en nuestros territorios, nuestro ejercito no parece poder pararlos. Han dado sus condiciones de Paz, seria sabio aceptarlas.;L'Armata Polacca ha condotto una vittoriosa offensiva nei nostri territori, il nostro esercito non sembra in grado di fermarli. Ci hanno fatto sapere le loro condizioni di pace, sarebbe saggio accettarle.;;;;;;Польск? армия провел?успешное наступлени?на наше?земл? наша армия не ?сила?их остановить. Буде?мудр?принять их предложени??мире.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
