EVT1914_2193504_DESC;The Peace of Riga, also known as the Treaty of Riga, was signed in Riga on 18 March 1921, between Poland, Soviet Russia and Soviet Ukraine. The treaty ended the Polish-Soviet War and awarded many provinces to the Republic of Poland.;La paix de Riga, aussi connu sous le nom de Trait?de Riga, a йt?sign??Riga le 18 Mars 1921, entre la Pologne, la Russie Bolchйvique et l'Ukraine Bolchйvique. Le trait?s'est termin?avec la guerre russo-polonaise et a fait gagner de nombreux territoires ?la Rйpublique de Pologne.;Der Friede von Riga, auch Vertrag von Riga, wurde am 18. Mдrz 1921 zwischen der Republik Polen, Sowjetrussland und der Sowjetukraine geschlossen. Dieser Vertrag beendete den polnisch-russischen Krieg und brachte Polen deutliche Gelдndezuwдchse ein.;Pokуj ryski, znany rуwnie?jako Traktat ryski, zosta?podpisany 18 marca 1921 r. w Rydze pomiкdzy Polsk? a sowieckimi Rosj?i Ukrain? Zakoсczy?on Wojn?Polsko-Sowieck?i przekaza?rozlegіe ziemie Rzeczpospolitej Polskiej.;La Paz de Riga, tambien conocida como el Tratado de Riga, fue firmada en Riga el 18 de Marzo de 1921, entre Polonia, Rusia Soviйtica y Ucrania Soviйtica. El tratado termin?la guerra Polaco-Soviйtica y le dio muchas tierras a la Republica Polaca.;La Pace di Riga, conosciuta anche come Trattato di Riga, fu firmata a Riga il 18 Marzo 1921 tra Polonia, Repubblica Sovietica Russa e Repubblica Sovietica Ucraina e ha conferito molte province alla Polonia.;;;;;;Рижски?мирный догово?1921 года - догово?межд?РСФС? БССР ?УССР, ?одно?сторон? ?Польше?- ?другой, подписанны?18 март?1921 ?Риге ?завершивши?советско-польскую войн?(1919 - 1921).;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
