EVT1914_2049539_DESC;The recent coup in the Dominican Republic is threatening US business interests. Dominican Republic's Secretary of War Desiderio Arias recently seized power from President Juan Isidro Jimenes Pereyra, democratically elected two year earlier. We must act quickly to preserve our economic dominance over the Dominican Republic.;Le rйcent coup d'йtat en Rйpublique Dominicaine menace les intйrкts commerciaux US. Le Secrйtaire d'Йtat ?la Guerre de la Rйpublique Dominicaine, Desiderio Arias, s'est rйcemment empar?du pouvoir du Prйsident Juan Isidro Jimenes Pereyra, йlu dйmocratiquement deux ans auparavant. Nous devons agir rapidement pour maintenir notre domination йconomique sur la Rйpublique Dominicaine.;Der vor kurzem erfolgte Staatsstreich in der dominikanischen Republik gefдhrdet unsere wirtschaftlichen Interessen. Der ehemalige Kriegsminister, Desiderio Arias, hat gegen den vor zwei Jahren demokratisch gewдhlten Prдsidenten Juan Isidro Jimenes Pereyra geputscht. Wir mьssen schnell handeln, um unsere wirtschaftliche Vormachtstellung zu schьtzen.;Ostatni przewrуt w Republice Dominikany zagraїa amerykaсskim interesom gospodarczym. Sekretarz ds. Wojny Republiki Dominikany, Desiderio Arias, ostatnio przej№і kontrol?nad krajem od prezydenta Juana Isidro Jimenesa Pereyry, demokratycznie wybranego dwa lata wczeњniej. Musimy dziaіa?szybko, aby zachowa?nasz?gospodarcz?dominacj?nad Republik?Dominikany.;El reciente golpe en la Repъblica Dominicana est?amenazando los intereses de negocios de los EEUU. El Secretario de la Guerra dominicano Desiderio Arias quit?el poder recientemente al presidente Juan Isidro Jimenes Pereyra, elegido democrбticamente dos aсos atrбs. Debemos actuar rбpidamente para preservar nuestro dominio econуmico sobre la Repъblica Dominicana.;Il recente colpo di stato nella Repubblica Dominicana sta minacciando gli interessi economici statunitensi. Il Segretario alla Guerra dominicano, Desiderio Arias, ha recentemente preso il potere dall'ex Presidente Juan Isidro Jimenes Pereyra, eletto democraticamente due anni fa. Dobbiamo agire velocemente per preservare la nostra influenza economica sulla Repubblica Dominicana.;;;;;;Недавний переворо??Доминиканско?Республике угрожает интереса?американског?бизнес? Военны?минист?Доминиканско?Республики Десидери?Ариа?недавн?свер?президента Хуан?Хименеса Исидро Перейр? демократически избранного дв?года наза? Мы должны действоват?быстро, чтоб?сохранит?наше экономическо?господство на?Доминиканско?Республико?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
