EVT1914_2049540_NAME;The Contestado War;La guerre du Contestado;Der Contestado-Krieg;Wojna Contestado;La Guerra de Contestado;La guerra di Contestado;;;;;;Войн?Контестаду;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2049540_DESC;The Contestado War was a conflict between rebel civilians and the Brazilian military forces. The rebels of the Contestado region followed a local healer known as Miguel Lucena Boaventura who soon died in a confrontation with the Military Police. His followers refused to accept his death, however, and believed that he was either alive or would rise again. His story mixed with the Luso-Brazilian belief in supernatural assistance in desperate times. This phenomenon transformed the submissive population into a resolute fighting force. Their attacks on the railway and lumbering operations and the failure of negotiations with federal authorities led to an escalation of hostilities in 1912 and a fierce military campaign that involved 6,000 troops, modern artillery and machine guns. The fighting was spread over a wide area, and the many redoubts of about 20,000 rebels made suppression difficult and also revealed the military's weaknesses. The Contestado was subdued by the end of 1917.;La guerre de Contestado fut un conflit entre des rebelles civils et les forces armйes brйsiliennes. Les rebelles de la rйgion Contestado suivirent un guйrisseur local connu sous le nom Miguel Lucena Boaventura, qui mourut rapidement lors d'une confrontation avec la police militaire. Ses disciples refusиrent nйanmoins d'accepter sa mort, croyant qu'il йtait vivant ou qu'il reviendrait des morts. Son histoire se mйlangea avec la croyance luso-brйsilienne d'assistance surnaturelle dans les moments dйsespйrйs. Ce phйnomиne transforma une population soumise en une force rйsolue ?combattre. Leurs attaques sur le chemin de fer, sur les exploitations forestiиres, et l'йchec des nйgociations avec les autoritйs fйdйrales, conduisirent ?une escalade des hostilitйs en 1912, et ?une campagne militaire fйroce qui impliqua 6 000 troupes, de d'artillerie moderne et des mitrailleuses. Les combats eurent lieu sur une vaste zone, et les nombreuses redoutes d'environ 20 000 rebelles rendit la suppression difficile, et rйvйla aussi les faiblesses de l'armйe. Le Contestado fut vaincue fin 1917.;Der Contestado-Krieg war ein Konflikt zwischen Aufstдndischen und brasilianischen Streitkrдften. Bewohnern der Region Contestado folgten der Fьhrung des Heilers Miguel Lucena Boaventura, der aber schon bald bei einem Zusammenstoss mit der brasiliniaschen Militдrpolizei getцtet wurde. Da die meisten Aufstдndischen sich weigerten, an seinen Tod zu glauben bzw. aufgrund der Luso-brasilianischen Glaubensrichtung seine Wiederaufersthung erwarteten, war die Rebellion damit nicht beendet. Diese Ereignisse rьttelten die ansonsten willfдhrige Bevцlkerung auf und machte sie zu unerschrockenen Kдmpfern. Ihre Angriffe auf Eisenbahnen und Holzfдllerstьtzpunkte sowie fehlgeschlagene Verhandlungen mit der Regierung fьhrten im Jahre 1912 zu einer Eskalation der Feindseligkeiten und zu einem brutalen militдrischen Feldzug, der 6.000 brasilianische Soldaten, moderne Artillerie und Maschinengewehre einschloss. Die Kдmpfe erstreckten sich ьber grosse Gebiete und es war fast unmцglich, die 20.000 gut versteckten Aufstдndischen zu fassen. Die Rebellion konnte erst 1917 niedergeschlagen werden.;Wojna Contestado byіa konfliktem pomiкdzy cywilnymi rebeliantami, a brazylijskim wojskiem. Buntownicy z regionu Contestado byli prowadzeni przez lokalnego uzdrowiciela znanego jako Miguel Lucena Boaventura, ktуry szybko zgin№і w starciach z їandarmeri? Jego zwolennicy nie chcieli zaakceptowa?jego њmierci i wierzyli, їe Boaventura їyje w ukryciu i jeszcze poprowadzi ich do walki z reїimem. Ta historia byіa podsycana przez lokalne wierzenia w udzia?nadnaturalnych mocy w trudnych czasach. Przeksztaіciіo to potuln?zazwyczaj ludnoњж w zdecydowanych wojownikуw. Ich ataki na linie kolejowe i tartaki, w sytuacji niepowodze?w pokojowych negocjacjach z wіadzami federalnymi, doprowadziіy w 1912 r. do eskalacji niepokojуw i koniecznoњci wysіania si?zbrojnych skіadaj№cych si?z 6000 regularnych їoіnierzy, wyposaїonych w karabiny maszynowe i nowoczesnej artylerii. Dziaіania wojenne trwaіy na rozlegіych obszarach i wiele oњrodkуw oporu okoіo 20 000 rebeliantуw byіo trudnych do zdіawienia, co obnaїyіo niemoc brazylijskiej armii. Contestado zostaіo stіumione przed koсcem 1917 r.;La Guerra de Contestado fue un conflicto entre rebeldes civiles y las fuerzas militares brasileсas. Los rebeldes de la regiуn de Contestado seguнan a un curandero local conocido como Miguel Lucena Boaventura, quien pronto muri?en una confrontaciуn con la Policнa Militar. Sus seguidores rehusaron aceptar su muerte, y creyeron que o estaba vivo o se levantarнa de nuevo. Su historia se mezcl?con la creencia luso-brasileсa en ayudas sobrenaturales durante tiempos desesperados. Este fenуmeno transform?a la poblaciуn sumisa en una fuerza combatiente resuelta. Sus ataques a las operaciones del ferrocarril y madereras, y el fracaso de las negociaciones con las autoridades federales llev?a una escalada de las hostilidades en 1912 y a una encarnizada campaсa militar que involucr?6.000 tropas, artillerнa moderna y ametralladoras. La lucha se extendi?por una gran бrea, y los muchos reductos de los cerca de 20.000 rebeldes hicieron difнcil la represiуn, y tambiйn revel?las debilidades de los militares. El Contestado fue sometido para finales de 1917.;La Guerra del Contestado fu un conflitto tra ribelli e forze armate brasiliane. I ribelli della regione del Contestado seguivano un guaritore locale chiamato Miguel Lucena Boaventura che mor?il 22 ottobre 1912 in uno scontro con la polizia militare. I suoi seguaci tuttavia si rifiutarono di accettare la sua morte e iniziarono a credere che fosse ancora vivo o che sarebbe resuscitato. La sua storia si mischi?con la credenza Luso-Brasiliano nell'assistenza del supernaturale in tempi disperati. Questo fenomeno trasform?la sottomessa popolazione in combattenti risoluti. I loro attacchi alla ferrovia e alle attivit?di taglio del legname e il fallimento dei negoziati con le autorit?federali port?allo scoppio delle ostilit?nell'ottobre 1912 e ad un'estesa campagna militare che coinvolse 6 000 soldati, artiglieria moderna e mitragliatrici. I combattimenti avvennero su una vasta area e molti rifugi usati dai circa 20 000 ribelli resero molto difficile la soppressione e mostrarono la debolezza dei militari. La regione del Contestado su sottomesso solo verso la fine del 1916.;;;;;;Войн?Контестаду была конфликтом межд?повстанцам?из граждански??бразильскими вооруженными силами.Повстанц?област?Контестаду последовал?за местны?целителе? известны?ка?Мигель Люсьен Боавентура, которы?вскоре поги??столкновении ?военно?полицией. Однако ег?последовател?отказались принять ег?смерти, счит?, чт?он бы?либо жи? либо воскреснет. Ег?история перемешана ?португал?бразильско?веро??сверхъестественную помоўў ?трудны?времен? Этот феноме?превращает покорное населени??решительну?боевую силу. Их нападения на железную дорогу ?лесопилк? ?такж?провал переговоро??федеральными влас?ми привел??эскалаци?военны?действий ?1912 году ?ожесточенной военно?кампании, ?которо?участвовал?6000 военнослужащих ?современно?артиллерие??пулеметами. Сражен? велись на большо?территории, ?20.000 окопавшихся повстанцев сделал?подавление трудны? ?такж?выявило слабые сторон?военны?Контестаду была покорена ?конц?1917 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
