EVT1914_2193505_DESC;World War I destabilized national borders in Europe. Poland established its independence in 1918, but its borders were not formally determined. The Russian Civil War presented an opportunity for Poland to regain the territories of the former Polish-Lithuanian Commonwealth lost to the Russian Empire during the late 18th century Partitions of Poland. Meanwhile, many in the Soviet leadership desired to export the revolution to the rest of Europe, by military force if necessary, and Poland was seen by them as a land bridge to the West. The Polish-Soviet War ensued, culminating in the 1920 Battle of Warsaw. Both sides were receptive to ending the conflict due to increasing war weariness. After the military setbacks near Warsaw, along with diplomatic pressure by the west, the Soviets were eager to begin peace treaty negotiations. Likewise the Poles, pressured by the League of Nations, were willing to negotiate since as it was nearing exhaustion.;La Premiиre Guerre mondiale dйstabilisa les frontiиres nationales en Europe. La Pologne йtablit son indйpendance en 1918, mais ses frontiиres n'йtaient pas dйterminйes officiellement. La Guerre Civile Russe fut l'occasion pour la Pologne de reprendre les territoires de l'ex-Union polono-lituanienne perdus face ?l'Empire russe pendant les partitions de la Pologne, ?la fin du 18иme. Au mкme moment,  nombreux йtaient ceux qui dans la direction soviйtique voulaientt exporter la rйvolution au reste de l'Europe, par la force militaire si nйcessaire, et la Pologne fut perзu par eux comme lien vers l'Ouest. La guerre polono-soviйtique qui suivit culmina ?la bataille de Varsovie en 1920. La lassitude de la guerre augmentant, les deux parties se montrиrent rйceptives pour finir le conflit. Aprиs les revers militaires ?proximit?de Varsovie, et du fait des pressions diplomatiques exercйes par l'Ouest, les Soviйtiques se montrиrent impatients de commencer les nйgociations de paix. De mкme, les Polonais, pressurйs par la Sociйt?des Nations et proches de l'йpuisement, йtaient prкts ?nйgocier.;Der erste Weltkrieg destabilisierte die politische Situation in Europa. Polen, wenn auch 1918 als Staat neu gegrьndet, hatte zu diesem Zeitpunkt noch keine festgelegten Grenzen. Der russische Bьrgerkrieg bot Polen die Mцglichkeit, die Gebiete aus Zeiten des polnisch-litauischen Commonwealth von Russland zurьckzugewinnen, die es im spдten 18. Jahrhundert verloren hatte. Die sowjetische Fьhrung hingegen wollte den Kommunismus in Richtung Westen exportieren, wenn nцtig mit Gewalt, und betrachtete Polen nur als Landbrьcke nach Westeuropa. So kam es zum polnisch-russischen Krieg, der seinen Hцhepunkt 1920 in der Schlacht um Warschau fand. Nach dieser Schlacht waren beide Seiten nach zwei Jahren Krieg willens, Frieden zu schliessen. Nach den Rьckschlдgen der Schlacht um Warschau und aufgrund diplomatischen Drucks aus dem Westen war die Sowjetunion bereit, in Verhandlungen zu treten. Genauso wurde Polen vom Vцlkerbund gedrдngt, die Feindseligkeiten zu beenden. Die Kдmpfe endeten mit dem Frieden von Riga.;I Wojna Њwiatowa zdestabilizowaіa granice paсstwowe w Europie. Polska odzyskaіa swoj?niepodlegіoњж w 1918 r., ale jej granice pozostawaіy wci№ї nieustalone. Rosyjska wojna domowa oznaczaіa okazj?dla Polski, aby odzyska?terytoria niegdysiejszej Rzeczpospolitej Obojga Narodуw, ktуre to tereny utracono na rzecz Rosji podczas rozbiorуw w II poіowie XVIII wieku. Rуwnoczeњnie wielu sowieckich przywуdcуw pragnкіo eksportu rewolucji do innych krajуw Europy, jeњli byіoby to konieczne, z wykorzystaniem siіy militarnej, a Polska jawiіa im si?jako most prowadz№cy ich wojska na zachуd. W takich okolicznoњciach wybuchіa wojna polsko-sowiecka, ktуrej kulminacja rozegraіa si?w 1920 r. na przedpolach Warszawy. W wyniku wyczerpania wojn?obie strony byіy gotowe do zakoсczenia konfliktu. Po przegranej Bitwie o Warszaw?i pod naciskami dyplomatycznymi Zachodu, Sowieci chкtnie przystali na propozycj?negocjacji pokojowych. Podobnie wyczerpani dziaіaniami obronnymi Polacy, zachкcani przez Lig?Narodуw, oczekiwali podpisania traktatu pokojowego.;La 1a Guerra Mundial desestabiliz?las fronteras nacionales en Europa. Polonia estableci?su independencia en 1918, pero sus fronteras no estaban determinadas formalmente. La Guerra Civil Rusa presentaba una oportunidad a Polonia para recuperar los territorios de la anterior Comunidad Polaco-Lituana que se perdieron ante el Imperio Ruso durante las Particiones de Polonia a finales del siglo 18. Mientras tanto, muchos en el mando soviйtico deseaban exportar la revoluciуn al resto de Europa, por la fuerza militar si era necesario, y Polonia era vista por ellos como un puente terrestre al occidente. Sigui?la Guerra Polaco-Soviйtica, culminando en la Batalla de Varsovia de 1920. Ambos bandos eran receptivos a terminar el conflicto debido a la creciente fatiga bйlica. Despuйs de los reveses militares cerca de Varsovia, junto con la presiуn diplomбtica del occidente, los soviйticos estaban ansiosos en comenzar negociaciones de tratado de paz. De la misma manera los polacos, presionados por la Liga de Naciones, estaban dispuestos a negociar ya que estaban cerca del agotamiento.;La prima guerra mondiale destabilizz?i confini nazionali in Europa. La Polonia si rese indipendente nel 1918, ma i suoi confini non vennero formalmente determinati. La guerra civile russa rappresent?un'opportunit?per la Polonia per riconquistare i territori dell'ex Commonwealth polacco-lituano, annessi all'impero russo durante le partizioni della Polonia della fine del 18 secolo. Nel frattempo, molti nella leadership sovietica desideravano esportare la rivoluzione nel resto d'Europa, con la forza militare, se necessario, e la Polonia veniva da loro vista come un ponte verso l'Occidente. Cos?scoppi?la guerra polacco-sovietica, che si concluse con la battaglia di Varsavia nel 1920. Entrambe le parti si mostrarono sensibili a porre fine al conflitto a causa della stanchezza per la guerra in aumento. Dopo le sconfitte militari vicino a Varsavia, assieme alla pressione diplomatica da parte dell'occidente, i sovietici erano desiderosi di avviare i negoziati del trattato di pace. Allo stesso modo i polacchi, sotto pressione da parte della Societ?delle Nazioni, erano disposti a negoziare poich?anche loro erano esausti a causa della guerra.;;;;;;Перв? мировая войн?разрушил?границ?стра??Европе. Польша обрела свою независимост??1918 году, но ее границ?не были официально определены. Гражданская войн??России представлила?? возможност?для Польши вернут?территории бывшей Речи Посполитой, захваченны?Российской империей ?конц?18 века ?результате разделов Польши. Межд?те? многие ?советско?руководств?желали экспортировать революци??остальну?част?Европы, ?помоўў?военно?силы, если эт?необходимо, ?Польша воспринималась им??качестве сухопутног?мост?на Запа? Кульминацией последовавше?Советско-польской войн? стал??1920 Варшавск? битв? Об?сторон?были готовы ?прекращени?конфликт??связи ?увеличение?усталост?от войн? Посл?того, ка?военны?неудач по?Варшавой, на?ду ?дипломатически?давление?со сторон?Запада, Советы были готовы начать переговоры ?мирном договоре. Точн?та?же по?ки, по?давление?со сторон?Лиги Наци? были готовы ?переговора? будучи на гран?истощения.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
