EVT1914_133011001_DESC;Sun Zhongshan, the founder of the Republic, has denounced our president Yuan Shikai as having betrayed the Republic and has called for active resistance to our regime.;Sun Zhongshan, le fondateur de la Rйpublique, a dйnonc?notre prйsident Yuan Shikai comme traоtre ?la Rйpublique, et a appel??la rйsistance active contre notre rйgime.;Der Grьnder der Republik, Sun Zhongshan, hat unseren Prдsidenten Yuan Shikai als Verrдter an der Rebuplik bezeichnet und zum aktiven Widerstand gegen uns aufgerufen.;Sun Zhongshan, zaіoїyciel Republiki, wypowiedzia?posіuszeсstwo naszemu prezydentowi Yuanowi Shikai'owi, ktуry wedіug niego zdradzi?ideaіy republikaсskie i wezwa?do aktywnego oporu wobec jego reїimu.;Sun Zhongshan, fundador de la Repъblica, ha denunciado a nuestro presidente Yuan Shikai por haber traicionado a la Repъblica y ha pedido una resistencia activa contra nuestro rйgimen.;Sun Zhongshan, il fondatore della Repubblica, ha denunciato il nostro Presidente Yuan Shikai per aver tradito la Repubblica e ha chiesto al popolo di opporsi attivamente al regime.;;;;;;Сунь Чжуншань, основатель республики, осудил нашего президента Юань Шикая, ка?предателя Республики ?призва??активном?сопротивлени?нашему режиму.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
