EVT1914_133011002_DESC;When President Yuan Shikai took over the fledgling Republic of China, its ideological founder Sun Zhongshan fled to Japan. Given that he is fanning the flames of dissent abroad, should we demand his return?;Lorsque le prйsident Yuan Shikai reprit la vascillante jeune Rйpublique de Chine, son fondateur idйologique, Sun Zhongshan,  s'enfuya au Japon. Йtant donn?qu'il attise les flammes de la dissidence depuis l'йtranger, doit-on exiger son retour?;Als Prдsident Yuan Shikai die aufblьhende Republik China ьbernahm, floh ihr ideologischer Grьnder Sun Zhongshan nach Japan. Angenommen, da?er von Japan aus die Unzufriedenheit hier schьrt, sollen wir seine Rьckkehr verlangen ?;Kiedy prezydent Yuan Shikai przejmowa?wіadz?w mіodej Republice Chiсskiej, jej ideologiczny zaіoїyciel, Sun Zhongshan, uciek?do Japonii. Jako їe rozsiewa on nasiona niepokoju za granicami kraju, czy powinniњmy domaga?si?jego powrotu?;Cuando el presidente Yuan Shikai se hizo cargo de la joven Repъblica de China, su fundador ideolуgico huy?a Japуn. Dado que est?llevando las llamas de la disensiуn al extranjero, їdeberнamos demandar su regreso?;Quando il Presidente Yuan Shikai ha preso il potere nella debole Repubblica Cinese, il suo fondatore ideologico Sun Zhongshan ?fuggito in Giappone. Dato che quest'ultimo sta alimentando le fiamme del dissenso anche dall'estero, dovremmo forse provare a chiedere che sia rimpatriato?;;;;;;Когд?президен?Юань Шика?овладе?молодо?Китайско?Республико? ее идеологический основатель Сунь Чжуншань бежа??Японию. Учитыв?, чт?он раздувае?пламя инакомыслия за рубежо? должны ли мы  потребоват?ег?возвращения?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
