EVT1914_133011003_DESC;When President Yuan Shikai took over the fledgling Republic of China, its ideological founder Sun Zhongshan fled to Japan. As a Pan-Asia and republican proponent, Sun Zhongshan was given considerable support by the foreign ministry which hoped his influence would put China firmly in Japan's Sphere of Influence. If his planned rebellion were to be successful, it will create a government much more favorable toward us. If the hypothetical third revolution were to fail, however, it will be better for us to have given in to Yuan's demands for his return instead.;Lorsque le prйsident Yuan Shikai repris la vascillante jeune Rйpublique de Chine, son fondateur idйologique, Sun Zhongshan, s'enfuya au Japon. En tant que promoteur du Pan-Asiatisme et de la rйpublique, Sun Zhongshan reзut un appui considйrable de la part du ministиre des Affaires йtrangиres, qui espиrait que son influence aiderait ?mettre la Chine dans la sphиre d'influence du Japon. Si sa rйbellion prйvue devait rйussir, cela crйerait un gouvernement nous йtant beaucoup plus favorable. Si l'hypothйtique troisiиme rйvolution йchouait, il serait mieux pour nous d'avoir cйd?aux exigences de Yuan et d'avoir renvoy?Sun.;Als Prдsident Yuan Shikai die aufblьhende Republik China ьbernahm, floh ihr ideologischer Grьnder Sun Zhongshan nach Japan. Als ein Befьrworter der Republik und einer Pan-asiatischen Gemeinschaft hatte Sun Zhongshan viel Unterstьtzung seitens des Aussenministeriums bekommen, das hoffte, sein Einfluss wьrde China in die Einflusssphдre Japans bugsierten. Wenn die von ihm geplante Revolution erfolgreich ist, wird seine Regierung uns freundlich gesonnen sein. Wenn sie hingegen fehlschlдgt, haben wir immerhin Yuan's Bitte erfьllt, Sun zurьckgeschickt zu haben.;Kiedy prezydent Yuan Shikai przejmowa?wіadz?w mіodej Republice Chiсskiej, jej ideologiczny zaіoїyciel, Sun Zhongshan, uciek?do Japonii. Jako zwolennik myњli republikaсskiej i panazjatyckiej, Sun Zhongshan otrzyma?znaczne wsparcie z ministerstwa spraw zagranicznych w nadziei, їe jego wpіyw umieњci Chiny na dobre w japoсskiej strefie wpіywуw. Jeњli jego planowana rebelia miaіaby by?pomyњlna, powstaіy w jej wyniku rz№d bкdzie nam przychylniejszy ni?obecny. Jeњli jednak ta hipotetyczna trzecia rewolucja miaіaby si?nie powieњж, lepiej dla nas by byіo jeњlibyњmy ulegli naciskom Yuana i wysіali Suna do China.;Cuando el presidente Yuan Shikai se hizo cargo de la joven Repъblica de China, su fundador ideolуgico huy?a Japуn. Como defensor del panasiatismo y de la repъblica, a Sun Zhongshan se le fue dado un apoyo considerable por el Ministerio del Exterior que esperaba que su influencia pondrнa a China en la Esfera de Influencia de Japуn. Si su rebeliуn es exitosa, crear?un gobierno mucho mбs favorable para nosotros. Si la hipotйtica tercera revoluciуn fallase, serнa mejor ceder a las demandas de Yuan para que regrese.;Quando il Presidente Yuan Shikai ha preso il potere nella debole Repubblica Cinese, il suo fondatore ideologico Sun Zhongshan ?fuggito in Giappone. Dato che quest'ultimo ?un sostenitore del Pan-Asianismo e delle repubblica, Sun Zhongshan ha ricevuto molto supporto dal nostro ministero degli esteri che sperava che la sua influenza potesse mettere la Cina nella sfera d'influenza giapponese. Se la sua ribellione fosse un successo, creerebbe un governo a noi molto pi?favorevole di quello attuale. Se l'ipotetica terza rivoluzione dovesse per?fallire, sarebbe stato meglio per noi aver ceduto alle richieste di rimpatriarlo.;;;;;;Когд?президен?Юань Шика?овладе?молодо?Китайско?Республико? ее идеологический основатель Сунь Чжуншань бежа??Японию.  Поскольк?он бы?стороннико?республики ?па?азиатски?взглядо? Сунь Чжуншану была предложена значительн? поддержк?со сторон?министерства иностранны?де? которо?надеялось, чт?ег?вл?ни?сможет надежн?поместит?Кита??сфер?вл?ния Японии. Если ег?запланированно?восстани?буде?успешным, он?создас?правительств? горазд?боле?дружественно?по отношени??на? Однако, если