EVT1914_133011005_DESC;A show trial was held today in Yuan Shikai's stronghold of Beijing where our national founder Sun Zhongshan was executed. The people demand justice from this tyrant!;Un simulacre de procиs a eu lieu aujourd'hui dans le fief de Yuan Shikai ?Pйkin, o?notre fondateur national Sun Zhongshan a йt?exйcut? Le peuple demande justice !;Heute wurde in Yuan Shikai's Festung bei Peking ein Schauprozess gegen Sun Zhongshan abgehalten, der mit seiner Verurteilung zum Tode endete. Das Volk verlangt Gerechtigkeit.;Pokazowy proces zosta?dzisiaj przeprowadzony w twierdzy Yuana Shikai'a w Pekinie, gdzie zaіoїyciel naszego paсstwa, Sun Zhongshan, zosta?stracony. Ludzie domagaj?si?sprawiedliwoњci od tego tyrana!;Un juicio falso fue celebrado hoy en el baluarte de Pekнn de Yuan Shikai donde el fundador de nuestra naciуn Sun Zhongshan fue ejecutado. ЎLa gente demanda justicia!;Un finto processo ?stato tenuto oggi nella fortezza di Yuan Shikai a Pechino, dove Sun Zhongshan ?stato messo a morte. La gente chiede giustizia a questo tiranno!;;;;;;Показательны?процес?сост?лся сегодня ?оплоте Юань Шикая ?Пекине, гд?бы?казнен основатель наци?Сунь Чжуншань.Люди требую?справедливости от этог?тирана!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
