EVT1914_133011006_DESC;In the early 1900s, Japan sought to become recognized as a rising Great Power. One of their early priorities was to increase their influence in the splintered Chinese factions. As a result of heavy political lobbying and industrial investment, Japan managed to slowly gain control of the Chinese market, which was good for the home economy.;Dans les annйes 1900, le Japon chercha ?se faire rereconnaоtre comme une grande puissance montante. Une de ses premiиres prioritйs fut d'accroоtre son influence parmi les diverses factions chinoise. Suite ?de fortes pressions politiques et ?des investissements industriels, le Japon rйussit progressivement ?prendre le contrфle du march?chinois, ce qui йtait bon pour son йconomie locale.;Zu Beginn des 20. Jahrhunderts trachtete das Kaiserreich Japan danach, als aufstrebende Grossmacht anerkannt zu werden. Eine der Prioritдten war, den Einfluss auf die vielen Splittergruppen in China zu vergrцssern. Politische Einflussnahme und industrielle Investitionen festigten Japans Position in China Stьck fьr Stьck und schuf einen Markt fьr japanische Produkte.;W pierwszych latach XX wieku Japonia pragnкіa uznania swojej pozycji jako Wielkiego Mocarstwa. Jednym z jej wczesnych priorytetуw byіo zwiкkszenie wpіywуw wњrуd podzielonych chiсskich frakcji. W wyniku szeroko zakrojonej dziaіalnoњci lobby politycznego i wielkich inwestycji przemysіowych Japonia powoli zdobywaіa kontrol?nad chiсskim rynkiem, co byіo pozytywne dla krajowej gospodarki.;En los primeros aсos del S.XX, Japуn busc?convertirse en una gran potencia reconocida. Una de sus primeras prioridades fue incrementar su influencia en las facciones chinas desidentes. Como resultado de su dura polнtica y su inversiуn industrial, Japуn se las arregl?para ganar lentamente el control del mercado chino, lo que mejor?su ecomomнa.;All'inizio del 1900, il Giappone aspirava ad essere riconosciuto come Grande Potenza. Una delle prime priorit?fu di aumentare la propria influenza sulle divise fazioni cinesi. Come risultato di pesanti influenze politiche e investimenti industriali, il Giappone riusc?lentamente a prendere il controllo del mercato cinese, un fattore molto positivo per l'economia giapponese.;;;;;;?начале 1900-?годо? Япон? стремилась стат?признанной ка?восходящая великая держав? Один из их ранних приоритето?было усиление свог?вл?ния ?разрозненных китайски?фракция? ?результате ?желого политическог?лоббирован? ?промышленных инвестиций, Японии удалос?постепенно получить контроль на?китайски?рынком, чт?было полезн?для отечественно?экономик?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
