EVT1914_133011007_DESC;Japanese Pan-Asianism developed in an era when nearby Asian nations were consistently suffering from Western expansionism. Pan-Asian thought in Japan began to develop in the late 19th century and was spurred on particularly following the defeat of Russia in the Russo-Japanese War. Proponents such as Tokichi Tarui and Kentaro Oi attempted to promote a Japanese-Korean defense agreement while others supported anti-western revolutionaries in China and Philippine. In the 20th century however, strong ultra-nationalist tendencies in Japanese society slowly changed the meaning of Pan-Asianism toward supporting aggressive expansion and Japanese imperialism, justified as promoting the unification of Asia under Japan against Western civilization.;Le pan-asiatisme japonais se dйveloppa ?une йpoque o?les pays asiatiques voisins avait constamment souffert de l'expansionnisme occidental. La pensйe pan-asiatiquecommenзa ?se dйvelopper au Japon ?la fin du 19иme siиcle, et fut stimulйe en particulier par la dйfaite de la Russie durant la guerre russo-japonaise. Ses partisans, comme Tokichi Tarui et Kentaro Oi,  tentиrent de promouvoir un accord de dйfense nippo-corйenne, tandis que d'autres soutinrent les rйvolutionnaires anti-occidentaux en Chine et aux Philippines. Au 20иme siиcle cependant, de fortes tendances ultra-nationalistes dans la sociйt?japonaise changиrent lentement le sens du pan-asiatisme,  et appuyиrent l'expansion agressive et impйrialiste du Japon, la justifiant par la promotion de l'unification de l'Asie sous le contrфle du Japon contre la civilisation occidentale.;Der japanische Pan-Asiatismus entwickelte sich in einer Zeit, in der die nahegelegenen asiatischen Staaten mehr und mehr unter der Einflussnahme der westlichen Kolonialmдchte zu leiden hatten. Der Gedanke entwickelte sich in Japan seit Ende des 19. Jahrhunderts und wurde durch den Sieg im russisch-japanischen Krieg noch beflьgelt. Seine Befьrworter wie Tokichi Tarui und Kentaro Oi versuchten mit einem japanisch-koreanischen Verteidigungsbьndnis einen Anfang zu machen, wдhrend andere anti-westliche Aufstдnde in China und auf den Philippinen schьrten. Im 20. Jahrhundert hingegen дnderte sich unter dem Einfluss ultra-nationalistischer Gedanken die Definition des Pan-Asiatismus hin zu der Legimitation einer aggressiven Aussenpolitik unter dem Vorwand, ganz Asien unter japanischer Vorherrschaft zu 'vereinen', um alle Asiaten vor der westlichen Zivilisation zu schьtzen.;Japoсski panazjatyzm rozwin№і si?w czasie, gdy kraje tego kontynentu wci№ї borykaіy si?z efektami zachodniego ekspansjonizmu. Idea panazjatyzmu zaczкіa si?rozwija?w koсcu XIX stulecia, a proces ten przyspieszy?po poraїce Rosji w wojnie rosyjsko-japoсskiej. Tacy ludzie jak Tokichi Tarui, czy Kentaro Oi prуbowali urzeczywistni?sojusz obronny z Kore? podczas gdy inni wspierali ruchy rewolucyjne w Chinach i na Filipinach. Jednak w XX wieku rosn№cy w Japonii ultranacjonalizm stopniowo zmienia?znaczenie idei panazjatyzmu, ktуra zaczкіa by?charakteryzowana przez japoсski imperializm i ekspansjonizm i sіuїyіa jako uzasadnienie pomysіu zjednoczenia Azji pod przewodnictwem Japonii i sprzeciwienia si?zachodnim wpіywom.;El panasiatismo japonйs se desarroll?en una era en la que las naciones asiбticas estaban sufriendo el expansionismo occidental. El pensamiento panasiatismo japonйs se empez?a desarrollar a finales del S. XIX y fue estimulado por la derrota de Rusia en la guerra ruso-japonesa. Algunos de su defensores como Tokichi Tarui y Kentaro Oi intentaron un pacto de defensa japonйs-coreano mientras que otros defendнan a los revolucionarios anti-occidentales de China y Filipinas. En el S. XX, fuertes tendencias nacionalistas en la sociedad japonesa cambiaron el significado del panasiatismo hacia una expansiуn agresiva e imperialista japonesa, justificбndolo como la unificaciуn de Asia llevada a cabo por Japуn contra la civilizaciуn occidental.;Il Pan-Asianismo giapponese si svilupp?in un'area dove le vicine nazioni asiatiche stavano costantemente soffrendo a causa dell'espansionismo occidentale. Il pensiero pan-asiatico in Giappone inizi?a svilupparsi sul finire del 19esimo secolo e si intensific?dopo la sconfitta della Russia nella guerra Russo-Giapponese del 1904. Sostenitori come Tokichi Tarui e Kentaro Oi provarono a promuovere accordi di mutua difesa tra Giappone e Corea mentre altri sostenevano rivoluzionari anti-occidentali in Cina e nelle Filippine. Nel 20esimo secolo tuttavia, forti tendenze ultra-nazionaliste nella societ?giapponese iniziarono a cambiare il significato del Pan-Asianismo verso il supporto per un'aggressiva espansione dell'imperialismo giapponese, giustificandolo come promotore dell'unificazione dell'Asia sotto il Giappone contro la civilt?occidentale.;;;;;;Японский паназиатиз?бы?разработан ?эпох? когд???азиатски?стра?пост?нн?страдали от западног?экспансионизма. Па?азиатская мысл??Японии начала развиваться ?конц?19-го века ?получила значительный импуль?особенно посл?поражения России ?русско-японско?войн? Сторонники паназиатизма, таки?ка?Токичи Тару??Кентар?Ои пытались продвигать японо-корейско?оборонно?соглашен?, ? то время ка?другие поддерживали антизападных революционеров ?Кита??Филиппинах. ?20-?веке, однако, сильны?ультра-националистические тенденци??японско?обществе медленно измени?смыс?паназиатизма на поддержк?агрессивного расширен? ?японского империализма, оправдываемого ка?содействие объединени?Азии Японие?против западной цивилизаци?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
