EVT1914_133011008_DESC;Due to our economic dominance in China, a group of business leaders who own factories in China have approached the government urging a quick end to the current 'incident' between our two nations before it becomes a full scale war. They fear their assets will be seized by the Chinese government if war is not averted.;Grвce ?notre domination йconomique en Chine, un groupe de chefs d'entreprises possиdant des usines en Chine a approch?le gouvernement, l'exhortant ?mettre rapidement un terme ?l'actuel 'incident' entre nos deux pays, avant qu'il ne vire ?une guerre ?grande йchelle. Ils craignent que leurs biens ne soient saisis par le gouvernement chinois, si la guerre n'est pas йvitйe.;Einige Geschдftsleute, die in eigenen Betrieben in China Waren fьr den chinesischen Markt produzieren sind an die Regierung herangetreten mit der Bitte, den 'Zwischenfall' zu beenden. Sie befьrchten, da?eine Eskalation hin zu einem Krieg dazu fьhrt, da?die chinesische Regierung ihre Betriebe enteignet.;Z uwagi na nasz?dominacj?gospodarcz?w Chinach, grupa wiod№cych przedsiкbiorcуw, wіaњcicieli fabryk w Chinach, wystosowaіa do rz№du proњb?o szybkie zakoсczenie przeci№gaj№cych si?'incydentуw' miкdzy dwoma krajami, zanim nie doprowadz?one do wojny na peіn?skal? Obawiaj?si? їe japoсskie aktywa usytuowane w Chinach zostan?znacjonalizowane, jeњli dojdzie do eskalacji konfliktu.;Debido a nuestra dominaciуn econуmica en China, un grupo de empresarios que poseнan fбbricas all?han urgido al gobierno a terminar el 'incidente' entre nuestras dos naciones antes de que se convierta en una guerra. Temen que el gobierno chino les quite sus bienes si la guerra no se evita.;Dato il nostro dominio economico sulla Cina, un gruppo di industriali proprietari di fabbriche in Cina hanno contattato il governo per chiedere una veloce soluzione all'incidente che sta compromettendo le relazioni tra le nostre due nazioni prima che diventi una guerra su larga scala. Gli industriali temono che i loro beni verrano confiscati dal governo cinese se la guerr?non sar?evitata.;;;;;;Благодаря нашему экономическому господству ?Кита? группа бизнес-лидеро? которы?владею?заводами ?Кита?обратилась ?правительств??призывам??быстрому завершению текущего 'инцидент? межд?двумя нашими странами, прежде че?эт?перерастет ?полномасштабну?войн? Он?боятся, чт?их активы буду?из?ты китайски?правительством, если не избежать войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
