ltimatum ai cinesi per espandere la nostra influenza nel loro paese e rimuovere tutte le concessioni occidentali da Shangdong. Storicamente, le 21 Richieste furono riviste e ridotte a 13 dopo le proteste delle maggiori potenze mondiali per la politica della Porta Aperta in Cina.;;;;;;?ослабление?центрально?власти Китая, премье?минист?Окум?Шигенобу предложи?направит?секретны?ультиматум китайцам - расширит?сфер?нашего вл?ния ?удалит?любы?западные концесси??Шаньдуне. Историческ?сложилос? чт?21 требование было пересмотрено до 13 требований посл?протесто?со сторон?других крупны?держав ?политике открытых дверей ?Кита?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
