EVT1914_133011017_DESC;Increasing discontent among the people over our authoritarian policies has resulted in the de facto formation of a military junta backing President Yuan Shikai. There is little point in maintaining our republican administration.;Un mйcontentement croissant parmi le peuple au sujet de nos politiques autoritaires a abouti ?la crйation de facto d'une junte militaire soutenant le prйsident Yuan Shikai. Il ne sert ?rien de maintenir notre administration rйpublicaine.;Durch zunehmende Unzufriedenheit ьber unsere authoritдre Politik hat sich eine Militдrjunta gebildet, die Prдsident Yuan Shikai unterstьtzt. Es bringt wenig, unsere Verwaltung aufrechtzuerhalten.;Rosn№ce niezadowolenie poњrуd ludnoњci wywoіane naszymi autorytarnymi decyzjami wywoіaіo koniecznoњж przerodzenia si?rz№dуw prezydenta Yuana Shikai'a w panowanie wojskowej junty. Nie ma ju?sensu utrzymywa?fasadowej administracji republikaсskiej.;Un descontento cada vez mayor entre la gente por nuestras polнticas autoritarias ha llevado a la creaciуn de una junta militar que apoya al presidente Yuan Shikai. Sigue habiendo esperanzas de mantener nuestra administraciуn.;La crescita del malcontento popolare causato dalle nostre politiche autoritarie ha portato alla creazione de facto di una giunta militare che sostiene il Presidente Yuan Shikai;;;;;;Увеличение недовольства народа наше?авторитарной политики привел??фактическому формированию военно?хунт??поддержк?президента Юань Шикая. Мало смысла ?сохранении наше?республиканско?администраци?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
