EVT1914_133011018_DESC;With the Beiyang Army's string of defeats by the southern and rebel forces, various warlords in the Beiyang clique have splintered away from central authority in Beijing due to its perceived weakness. The Anhui Clique was one of those groups. The Anhui Clique was led by Duan Qirui and was the predominant political force in China from 1916-1920. It generally held the nominal position of President of the Republic of China during this time.;Avec la dйfaite de l'armйe de Beiyang par les forces rebelles du sud, divers seigneurs de guerre de la clique Beiyang s'йloignиrent du pouvoir central ?Pйkin en raison de sa faiblesse perзue. La Clique Anhui fut l'un de ces groupes. La Clique Anhui fut dirigйe par Duan Qirui, et fut la force politique dominante en Chine de 1916 ?1920. En gйnйral, elle occupa le poste nominal de Prйsident de la Rйpublique de Chine durant cette pйriode.;Nach einer Reihe von Niederlagen der Beiyang Armeen gegen sьdliche Kriegsherren und Rebellentruppen spalteten sich einige Mitglieder der Beiyang Clique von der Zentralregierung in Peking ab. Eine dieser Gruppen war die Anhui Clique unter der Fьhrung von Duan Qirui, die in der Zeit von 1916 - 1920 die vorherrschende Kraft in der chinesischen Politik war. Generell stellte sie in dieser Zeit den Prдsidenten der Republik China.;Po serii poraїek Armii Beijaсskiej z r№k wojska z Poіudnia i rebeliantуw, rуїni wataїkowie tamtejszej kliki odі№czyli si?od centralnego rz№du w Pekinie, postrzegaj№c go jako sіaby. Klika Anhui byіa jedn?z tych grup. Byіa ona prowadzona przez Duana Quirui'a i byіa wiod№c?siі№ polityczn?w Chinach w latach 1916-1920. On sam przez wiкkszoњж tego okresu zajmowa?nominalne stanowisko Prezydenta Republiki Chiсskiej.;Con las derrotas en cadena del ejйrcito de Beiyang contra los sureсos y fuerzas rebeldes, varios seсores de la guerra de la camarilla de Beiyang se han alejado de la autoridad central de Pekнn debido a su debilidad. La camarilla Anhui es uno de estos grupos. La camarilla Anhui estaba liderada por Duan Qirui y fue la fuerza polнtica predominante en China de 1916-1920. Qirui fue presidente de la Repъblica de China durante este tiempo.;Dopo la serie di sconfitte dell'esercito di Beiyang da parte dei ribelli e delle forze del sud, vari signori della guerra nella fazione di Beiyang si separarono dall'autorit?centrale di Pechino, percependo la sua debolezza. La Cricca dell'Anhui fu uno di questi gruppi. La Cricca dell'Anhui era guidata da Duan Qirui e fu la forza politica dominante in Cina tra il 1916 e il 1920.;;;;;;?поражением Арми?Бэ?на от си?южан ?повстанцев, разные милитарист??клик?Бэ??откололись от центрально?власти ?Пекине из-за ее слабости. Клик?Анхо?была одно?из этих груп? Клик?Аньхой возглавля?Дуан?Цижу? Он?была преобладающе?политической сило??Кита??1916 по 1920. Ка?правил? именно он?контроллировал?номинальну?должност?Президента Республики Кита??эт?время.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
