EVT1914_133011063_DESC;Sichuan was a major flashpoint in the National Protection War as its governor was one of the few southern governors to support the central government. Not all of its military felt that way, which resulted in a battle for control within the province.;Le Sichuan fut un centre d'intйrкt majeur durant la Guerre Nationale de Protection, le gouverneur йtant l'un des quelques gouverneurs du Sud ?soutenir le gouvernement central. Tous dans son armйe ne le ressentait pas ainsi, ce qui entraоna une bataille pour le contrфle de la province.;Sichuan war ein grцsserer Unruheherd im 'National Protection War', da der Gouverneur einer der wenigen sьdlichen Anhдnger der Zentralregierung war. Nicht alle seine Truppen teilten diese politische Meinung und es entbrannten heftige Kдmpfe innerhalb der Region.;Syczuan by?znacz№cym punktem zapalnym w Wojnie o Ochron?Narodu, jako їe jego gubernator by?jednym z niewielu przywуdcуw poіudnia Chin wspieraj№cych rz№d centralny. Cz??wojska byіa temu przeciwna, co spowodowaіo szereg bitew o kontrol?nad t?prowincj?;Sichuan fue el mayor punto de inflamaciуn en la Guerra de Protecciуn Nacional porque su gobernador era uno de los pocos gobernadores del sur que apoyaban al gobierno central. No todos sus militares pensaban lo mismo que йl, lo que caus?una batalla por el control de la provincia.;Il Sichuan ?stato un punto critico nella Guerra di Protezione Nazionale dato che il suo governatore fu uno dei pochi governatori del sud a sostenere il governo centrale. Per?non tutti nelle sue forze armate erano d'accordo con lui, cosa che port?ad una battaglia per il controllo della provincia.;;;;;;Провинция Сычуан?была одно?из главны?го?чи?точе?Войн??защиту Республики, поскольк?ее губернатор бы?одни?из немногих губернаторов южны?провинци? кт?выступил ?поддержк?центрального правительств? Не вс?военны?считал?такж? чт?привел??битв?за контроль ?крае.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,