EVT1914_133011200_DESC;The Republic of China was reformed under the Anhui Clique's control, in a so-called Beiyang Government. While recognized as the official government of China, its actual control was sparse in Southern and Central China. The Zhili Clique, a splinter group of the former Beiyang Army under Yuan Shikai, was led by Feng Guozhang and became the predominant political force in China between 1920 and 1924. Formed in 1916, it comprised of disillusioned and disgruntled members of the former Beiyang Clique who felt mistreated by the Anhui Clique. After a period of struggle, it managed to win over the nominal position of President of the Republic of China after 1920 and almost united China before falling to the Guangzhou government in the Northern Expedition.;La Rйpublique de Chine fut rйformйe sous le contrфle de la Clique du Anhui, durant le soi-disant gouvernement de Beiyang. Bien que reconnu comme йtant le gouvernement officiel de Chine, son contrфle effectif йtait limit?dans le sud et le centre de la Chine. La clique du Zhili, un groupe dissident de l'ancienne armйe de Beiyang sous de Yuan Shikai, et dirigйe par Feng Guozhang, devint la force politique dominante en Chine entre 1920 et 1924. Formйe en 1916, elle se composait de membres dйsabusйs et mйcontents de l'ancienne clique de Beiyang et qui se sentaient maltraitйs par la clique du Anhui. Aprиs une pйriode de lutte, elle rйussit ?gagner le poste nominal du Prйsident de la Rйpublique de Chine ?partir de 1920, et rйussit ?presque unir la Chine avant de tomber face au gouvernement Guangzhou durant l'Expйdition du Nord.;Die Republik China wurde unter Fьhrung der Anhui Clique reformiert und war auch als Beiyang-Regierung bekannt. Auch wenn sie als Zentralregierung anerkannt war, hatte sie doch wenig Gewicht in Zentral- und Sьdchina.  Die Zhili Clique, einer Splittergruppe der frьheren Beiyang Armee unter Yuan Shikai, wurde von Feng Guozhang angefьhrt und war die vorherrschende politische Macht zwischen 1920 und 1924. Gegrьndet wurde sie 1916 und sie vereinte unter sich die unzufriedenen Mitglieder der Beiyang Clique, die sich von der Anhui Clique schlecht behandelt fьhlte. Nach einer Periode der Unruhe und Auseinandersetzungen gelang es ihr dann, sich die Position des Prдsidenten der Republik China zu sichern und schaffte es fast, China unter ihrer Herrschaft zu vereinen. Die nцrdliche Expedition unter Fьhrung der Guangzhou Regierung bereitete dem allerdings ein Ende.;Republika Chiсska zostaіa zreformowana pod kontrol?Kliki Anhui w ramach tzw. Rz№du Beiyang. Pomimo їe by?on uznawany za oficjalny rz№d caіych Chin, faktyczna kontrola nad poіudniowymi i centralnymi Chinami byіa nikіa. Klika Zhili, ktуr?zaіoїyli rebelianccy czіonkowie Armii Beiyang za czasуw Yuana Shikai'a, byіa dowodzona przez Feng Guozhanga i staіa si?wiod№c?siі№ w Chinach pomiкdzy 1920 i 1924 r. Zaіoїona w 1916 r. obejmowaіa zawiedzionych czіonkуw Kliki Beiyang, ktуrzy czuli si?pokrzywdzeni przez dziaіania Kliki Anhui. Po okresie wewnкtrznych walk udaіo si?jej zdoby?nominalne stanowisko Prezydenta Republiki Chiсskiej po 1920 r. i niemal zjednoczyіa ona Chiny zanim nie zostaіa pokonana przez rz№d w Kantonie w ramach Ekspedycji Pуіnocnej.;La Repъblica de China fue reformada bajo el control de la camarilla Anhui, en el llamado Gobierno de Beiyang. Reconocido como el gobierno oficial de China, su control estaba disperso en el sur y centro de China. La camarilla Zhili, un grupo desidente del antiguo ejйrcito de Beiyang que lideraba Yuan Shikai, era liderada por Feng Guozhang y se convirti?en la fuerza polнtica predominante en China entre los aсos 1920 y 1924. Creada en 1916, estaba compuesta de miembros desilusionados de la antigua camarilla de Beiyang que se sentнan maltratados por la camarilla Anhui. Despuйs de un perнodo de lucha, dirigi?la victoria sobre el presidente de la Repъblica de China despuйs de 1920 y casi consegui?unir China antes de la caнda del gobierno Guangzhou en la Expediciуn del Norte.;La  Repubblica di Cina fu riformata sotto il controllo della Cricca Anhui, nel cos?chiamato governo di Beiyang. Sebbene riconosciuto come governo ufficiale della Cina, il suo attuale potere di controllo era scarso nella Cina centrale e del Sud. La Cricca Zhili, un gruppo separato nato dal precedente esercito di Beiyang sotto Yuan Shikai, era guidato da Feng Guozhang e divenne la predominante forza politica in Cina tra il 1920 e il 1924. Fondata nel 1916, la Cricca Zhili comprendeva membri disillusi e scontenti della precedente Cricca di Beiyang che si sentivano maltrattati dalla Cricca Anhui. Dopo un periodo di scontri, la Cricca Zhili riusc?a ottenere la posizione di Presidente della Repubblica di Cina dopo il 1920 e riusc?quasi a riunire la Cina prima di essere sconfitta dal governo di Guangzhou nella Spedizione del Nord.;;;;;;Китайская Республика была преобразован?по?контроле?клик?Аньхой, ?та?называемое бэ?нско?правительств? Несмот? на то, чт?он?было признано ?качестве официального правительств?Китая, ег?фактическая власть была слабой ?Южно??Центрально?Кита? Клик?Чжил? отколовш?? группа быве?бэ?нско?арми?Юань Шикая, возглавляем? Фэно?Гочжаном,стал?преобладающе?политической сило??Кита??период межд?1920 ?1924 гг. Основанн? ?1916 году, он?сост?ла из разочарованных ?недовольны?членов бывшей клик?Бэ?? которы?считал? чт?клик?Анхо??ними обращалась ненадлежащим образо? Посл?период?борьбы, им удалос?получить номинальну?должност?президента Китайско?Республики посл?1920 года ?практическ?объединить Кита? прежде че?проиграт?правительств?Гуанчжоу ?Северной экспедиции.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
