EVT1914_133011300_DESC;Seeing the weakness of the central government, Duan Qirui and other members of the Anhui Clique demanded greater power in the crumbling Great Chinese Empire or else they threatened to rebel along with the National Protection Alliance.;Voyant la faiblesse du gouvernement central, Duan Qirui et d'autres membres de la clique Anhui exigиrent un plus grand rфle dans le branlant Grand Empire Chinois, et menacиrent sinon de se rйvolter avec l'Alliance Nationale pour la Protection.;In Anbetracht der Schwдche der Zentralregierung forderten Duan Qirui und andere Mitglieder der Anhui Clique grцssere Befugnisse innerhalb des chinesischen Reiches, anderfalls sie sich den Rebellen und der 'National Protection' Allianz anschliessen wьrden.;Widz№c sіaboњж rz№du centralnego, Duan Quirui i inni czіonkowie Kliki Anhui domagali si?wiкkszych wpіywуw w upadaj№cym Wielkim Cesarstwie Chiсskim, groї№c w innym przypadku doі№czeniem do rebelii Narodowego Sojuszu Ochronnego.;Viendo la debilidad del gobierno central, Duan Qirui y otros miembros de la camarilla Anhui demandaron mбs poder en el desmoronado Gran Imperio Chino y amenazaron a los rebeldes y a la Alianza de Protecciуn Nacional.;Avendo assistito alla debolezza del governo centrale, Duan Qirui e altri membri della Cricca Anhui chiesero maggior potere all'interno del sempre meno stabile Impero Cinese, minacciando di ribellarsi insieme all'Alleanza di Protezione Nazionale se le loro domande non fossero state esaudite.;;;;;;Ви? слабость центрального правительств? Дуан?Цижу??другие член?клик?Аньхой потребовал?больше власти ?разваливающейся Велико?Китайско?импери? инач?он?угрожали восстать вместе ?Национальным ал?нсом защиты.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
