EVT1914_133011301_DESC;Seeing the weakness of the central government, Duan Qirui and other members of the Anhui Clique demanded greater power in the crumbling Great Chinese Empire or else they threatened to rebel along with the National Protection Alliance. Yuan Shikai has refused our demands for greater representation in the central government.;Voyant la faiblesse du gouvernement central, Duan Qirui et d'autres membres de la clique Anhui exigent un plus grand rфle dans le branlant Grand Empire Chinois, et menacent sinon de se rйvolter avec l'Alliance Nationale pour la Protection. Yuan Shikai a refus?nos demandes d'une plus reprйsentation plus importante au sein du gouvernement.;In Anbetracht der Schwдche der Zentralregierung forderten Duan Qirui und andere Mitglieder der Anhui Clique grцssere Befugnisse innerhalb des chinesischen Reiches, anderfalls sie sich den Rebellen und der 'National Protection' Allianz anschliessen wьrden. Yuan Shikai hat unser berechtigtes Ansinnen zurьckgewiesen.;Widz№c sіaboњж rz№du centralnego, Duan Quirui i inni czіonkowie Kliki Anhui domagali si?wiкkszych wpіywуw w upadaj№cym Wielkim Cesarstwie Chiсskim, groї№c w innym przypadku doі№czeniem do rebelii Narodowego Sojuszu Ochronnego. Yuan Shikai odrzuci?nasze ї№dania dotycz№ce wiкkszych wpіywуw w Pekinie.;Viendo la debilidad del gobierno central, Duan Qirui y otros miembros de la camarilla Anhui demandaron mбs poder en el desmoronado Gran Imperio Chino y amenazaron a los rebeldes y a la Alianza de Protecciуn Nacional. Yuan Shikai ha rechazado nuestras demandas.;Avendo assistito alla debolezza del governo centrale, Duan Qirui e altri membri della Cricca Anhui chiesero maggior potere all'interno del sempre meno stabile Impero Cinese, minacciando di ribellarsi insieme all'Alleanza di Protezione Nazionale se le loro domande non fossero esaudite. Yuan Shikai rifiut?di cedere alle loro richieste di ottenere una maggiore rappresentanza nel governo centrale.;;;;;;Ви? слабость центрального правительств? Дуан?Цижу??другие член?клик?Аньхой потребовал?больше власти ?разваливающейся Велико?Китайско?импери? инач?он?угрожали восстать вместе ?Национальным ал?нсом защиты. Юань Шика?отверг наши требован? ?больше?представленности во власти.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
