EVT1914_133011305_DESC;Having mobilized our army, we should now turn toward seeking diplomatic solutions to curb Anhui Clique's aggressive policies. We can begin by actively opposing the Anhui Clique in the Beiyang Parliament and carefully observing other groups who are sympathetic to our cause.;Ayant mobilis?notre armйe, il nous faudrait dйsormais nous pencher vers la recherche de solutions diplomatiques pour lutter contre les politiques agressives de la clique Anhui. Nous pouvons commencer par nous opposent activement ?la clique Anhui au Parlement de Beiyang, et observer attentivement les rйactions des autres groupes sympathiques ?notre cause.;Nach der prдventiven Mobilisierung unserer Streitkrдfte sollten wir nun nach diplomatischen Mцglichkeiten suchen, die aggressive Politik der Anhui Clique zu zьgeln. Wir kцnnten zum Beispiel im Parlament eine aktive Opposition gegen die Zhili Positionen leben und uns bei anderen Gruppen vorsichtig umhцren, mit wem sie eigentlich symphatisieren.;Po zmobilizowaniu armii, powinniњmy teraz zwrуci?si?ku metodom dyplomatycznym, aby ukrуci?agresywne poczynania Kliki Anhui. Moїemy podj№ж pierwsze kroki oponuj№c przeciwko Klice Anhui w parlamencie Beiyang i ostroїnie obserwuj№c kroki innych grup, ktуre s?naszymi sojusznikami.;Habiendo movilizado nuestro ejйrcito, deberнamos buscar soluciones diplomбticas para frenar las polнticas agresivas de la camarilla Anhui. Podemos empezar por oponernos a la camarilla Anhui en el parlamento de Beiyang y observar cuidadosamente a los otros grupos que apoyen nuestra causa.;Dopo aver mobilitato il nostro esercito, dovremmo ora provare a cercare soluzioni diplomatiche per frenare le politiche aggressive della Cricca Anhui. Possiamo iniziare ad opporci attivamente alla Cricca Anhui nel Parlamento di Beiyang e osservare attentamente quali altri gruppi reagiranno positivamente ai nostri sforzi.;;;;;;Посл?мобилизаци?наше?арми? мы теперь должны начать поис?дипломатического решения, чтоб?обуздать агрессивн