EVT1914_133011306_DESC;Our coalition party, the Zhili Clique, is in full revolt in the Beiyang Parliament They have introduced a vote of no confidence against us! This vote is sure to fail, given the implicit threat of forces loyal to us in the Beiyang Army stated to 'protect' the legislators. Still, allowing their agitation to continue on will surely hurt us in the long run. What should our response to their discontent be?;Notre parti de coalition, la clique Zhili, est en pleine rйvolte au sein du Parlement Beiyang. Ils ont introduit une motion de censure contre nous ! Ce vote est vouйe ?l'йchec, compte tenu de la menace implicite faite par les forces qui nous sont fidиles dans l'armйe de Beiyang de 'protйger' les lйgislateurs. Pourtant, leur permettre de continuer leur agitation va sыrement nous faire du tort dans le long terme. Quelle devrait кtre notre rйponse ?leur mйcontentement ?;Unser Koalitionspartner, die Zhili Clique, hat im Beiyang Parlament ein Misstrauensvotum gegen uns angestrengt. Zwar werden wir diese Abstimmung mit Sicherheit gewinnen, vor allem in Anbetracht der Beiyang Armee, die loyal zu uns steht und die Legislative 'beschьtzt'. Auf der anderen Seite wird uns die Zhili Agitation auf lange Sicht schaden. Wie sollen wir auf ihre Unzufriedenheit reagieren ?;Nasz koalicjant, Klika Zhili, wyst№piіa otwarcie przeciwko parlamentowi Beiyang. Wyst№pili nawet o wotum nieufnoњci wobec nas! Gіosowanie z pewnoњci?si?nie powiedzie, bior№c pod uwag?groџb? jak?stanowi?nasze siіy wobec armii Beiyang, ktуra 'chroni' parlamentarzystуw. Ale przyzwolenie na takie kroki z pewnoњci?nie bкdzie dla nas korzystne. Jaka bкdzie nasza reakcja?;El otro partido de la coaliciуn, la camarilla Zhili, se est?revelando en el parlamento de Beiyang. ЎHan introducido un voto de no confianza contra nosotros! Esta votaciуn va a fallar, debido a la amenaza de fuerzas leales en el ejйrcito de Beiyang para proteger a los legisladores. Dejando que su agitaciуn continъe nos har?daсo en el futuro. їQue deberнamos responder a su descontento?;Il partito con cui siamo alleati, la Cricca Zhili, ?ora in aperta opposizione nei nostri confronti nel Parlamento Beiyang. Hanno presentato una mozione di sfiducia contro di noi! Questa mozione fallir?di sicuro, date le minacce implicite che le forze a noi leali nell'esercito Beiyang hanno espresso promettendo di 'proteggere' i legislatori. Tuttavia, lasciarli continuare con la loro opposizione ci dannegger?nel lungo termine. Quale dovrebbe essere la nostra risposta al crescente malcontento nei nostri confronti?;;;;;;Наши партнеры по коалиции, клик?Чжил? устроили открытый ?те??бэ?нско?парламенте. Он?предложили вынест?на?воту?недоверия! Эт?голосовани?обречено на провал, учитыв? скрыту?угрозу от си? лояльны??на??бэ?нско?арми? 'защитить' законодателе? Те?не мене? если позволит?продолжать эт?агитацию, то эт? безусловно, повредит на??долгосрочной перспектив? Како?буде?на?отве?на их недовольство?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
