EVT1914_133011307_DESC;The Fengtian Clique was one of several mutually hostile cliques or factions that split from the Beiyang Clique in the Republic of China's warlord era. It was named for Fengtian Province (now Liaoning) and led by Zhang Zuolin. The army of Zhang Zuolin was one of the most modern Chinese warlord armies, employing technology that many Chinese warlords did not have such as Renault FT-17 tank and even a large airforce of around 100 aircraft. The Fengtian clique participated in conflicts with the Zhili clique for control of Beijing: the First Zhili-Fengtian War (1922) and the Second Zhili-Fengtian War (1924). The power of the Fengtian Clique began to decrease in the midst of the Northern Expedition, but did not collapse until after the Mukden Incident.;La Clique Fengtian йtait l'un des nombreux clans ou factions hostiles les uns aux autres, rйsultant de l'йclatement de la Clique de Beiyang, durant la pйriode des seigneurs de la guerre de la Rйpublique de Chine. Elle fut nomm?ainsi pour la province de Fengtian (maintenant Liaoning), et fut dirigйe par Zhang Zuolin. L'armйe de Zhang Zuolin йtait l'une des armйes chinoises les plus modernes des seigneurs de la guerre, employant des technologies que de nombreux seigneurs de la guerre n'avaient pas, comme le char Renault FT-17, et mкme une grande armйe de l'air d'environ 100 avions. La clique du Fengtian participa ?des conflits avec la clique du Zhili pour le contrфle de Pйkin: la Premiиre Guerre Zhili-Fengtian (1922) et la deuxiиme Guerre Zhili-Fengtian(1924). La puissance de la clique du Fengtian commenзa ?diminuer au milieu de l'Expйdition du Nord, mais ne s'effondra qu'aprиs l'incident de Moukden.;Die Fengtian Clique, angefьhrt von Zhang Zuolin, war eine der aggressiven Gruppierungen, die sich in der Zeit der Kriegsherren von der Beiyang Clique abgespaltet hat. Sie ist nach der Provinz Fengtiang benannt. Die Armee der Clique war modern ausgerьstet und verfьgte im Gegensatz zu den anderen Kriegsherren ьber Renault FT-17 Panzer und ca. 100 Flugzeuge. Die Fengtian fьhrte zwei Kriege gegen die Zhili Clique um die Kontrolle ьber Peking, den ersten 1922 und den zweiten 1924. Zwar verlor die Fengtian Clique wдhrend der nцrdlichen Expedition viel von ihrer Kampfkraft, brach aber nicht zusammen und exisitierte bis zum Mukden Zwischenfall weiter.;Klika Fengtiaсska byіa jedn?ze wzajemnie wrogich klik, ktуre odі№czyіy si?od Kliki Beiyang w czasie ery wataїkуw w Republice Chiсskiej. Jej nazwa pochodziіa od prowincji Fengtian (obecnie Liaoning), a dowodzona byіa przez Zhanga Zuolina. Jego armia byіa jedn?z najbardziej nowoczesnych armii poњrуd si?wataїkуw i dysponowaіa broni?zazwyczaj niespotykan?w Chinach, np. czoіgami Renault FT-17, a nawet pokaџn?flot?okoіo 100 samolotуw bojowych. Klika Fengtiaсska braіa udzia?w konfliktach z Klik?Zhili o kontrol?nad Pekinem w ramach Pierwszej Wojny Zhili-Fengtiaсskiej (1922 r.) oraz Drugiej Wojny Zhili-Fengtiaсskiej (1924 r.). Potкga Kliki Fengtiaсskiej zaczкіa wygasa?w czasie Ekspedycji Pуіnocnej, ale ostateczne zaіamanie nast№piіo dopiero po Incydencie Mukdeсskim.;La camarilla Fengtian era una de las mъltiples camarillas hostiles o facciones que se separaron de la camarilla de Beiyang en la era de los seсores de la guerra. Eran llamados as?por la provincia Fengtian (ahora Liaoning) y estaba liderada por Zhang Zuolin. El ejйrcito de Zhang Zuolin era uno de los mбs modernos, empleando tecnologнa que muchos seсores de la guerra chinos no tenнan como el tanque Renault FT-17 y una fuerza aйrea de unos 100 aviones. La camarilla Fengtian particip?en conflictos con la camarilla Zhili por el control de Pekнn: la primera guerra Zhili-Fengtian (1922) y la segunda guerra Zhili-Fengtian (1924). El poder de la camarilla Fengtian empez?a disminuir en medio de la Expediciуn del Norte, pero no colaps?hasta despuйs del incidente de Mukden.;La Cricca Fengtian fu una delle varie cricche o fazioni in cui si divise la Cricca Beiyang nell'epoca dei signori della guerra della Repubblica di Cina. Il suo nome derivava dalla provincia Fengtian (ora Liaoning, in Manciuria) ed era guidata da Zhang Zuolin. L'esercito di Zhang Zuolin era uno dei pi?moderni tra i vari eserciti delle cricche cinesi, avendo a disposizione tecnologie che erano sconosciute a molti altri signori della guerra, tra cui carri armati Renault FT-17 e addirittura una forza aerea di circa 100 aeroplani. La Cricca Fengtian partecip?a vari conflitti contro la Cricca Zhili per il controllo di Pechino: in particolare la Prima Guerra Zhili-Fengtian (1922) e la seconda Guerra Zhili-Fengtian (1924). Il potere della Cricca Fengtian inizi?a diminuire durante la Spedizione nel Nord, ma collass?solo in seguito all'incidente di Mukden.;;;;;;Клик?Фэнтянь была одно?из нескольких взаимн?враждебных фракци? которы?отделились от бэ?нско?клик??Китайско?Республике эпох?милитаристов. Он?была назван??чест?провинци?Фэнтянь (ныне ?онин). Во глав?ее ст??Чжан Цзолин? Арми?Чжан Цзолиня была одно?из самы?современно оснащенных сред?китайски?войс?военачальников, используя технологии, которы?были недоступны многим китайски?милитаристам, таки?ка?танк?Renault FT-17 ?даже авиация ?количестве окол?100 самолето? Клик?Фэнтянь участвовал??конфликтах ?кликой Чжил?за управление Пекино? Перв? ?Втор? войн?Чжил?Фэнтянь (1922 ?1924). Сила клик?Фэнтянь начала уменьшаться ?разагр?северной экспедиции, но клик?сохранялась до инцидент?Мукден?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
