EVT1914_133011309_DESC;After building a de facto private army using the Nishihara Loans, Duan Qirui used it to occupy Outer Mongolia. Feeling threatened, Northeastern China's Fengtian clique might seek an alliance with us.;Aprиs avoir construit une armйe, de facto privйe, en utilisant les prкts Nishihara, Duan Qirui l'utilisa pour occuper la Mongolie extйrieure. Se sentant menacйe, la clique Fengtian de Chine du nord-est pourrait bien maintenant rechercher une alliance avec nous.;Nachdem Duan Qirui mit den Mitteln aus dem Nishihara Krediten seine eigene Privatarmee aufgebaut hatte, zog er gegen die дussere Mongolei. Die Fengtiang Clique kцnnte sich dadurch bedroht fьhlen und mцglicherweise ein Bьndnis mit uns eingehen wollen.;Po zbudowaniu de facto prywatnej armii przy uїyciu poїyczek Nishihary, Duan Quirui uїy?jej do zajкcia Mongolii Zewnкtrznej. Czuj№c si?zagroїona, pуіnocno-wschodnio-chiсska Klika Fengtiaсska moїe szuka?sojuszu z nami.;Despuйs de construir un ejйrcito privado usando prйstamos Nishihara, Duan Qirui lo us?para ocupar el exterior de Mongolia. Sintiйndose amenazada, la camarilla Fengtian del norte de China est?buscando una alianza con nosotros.;Dopo aver costruito un de facto esercito privato usando i Prestiti di Nishihara, Duan Qirui lo us?per occupare la Mongolia Esterna. Sentendosi minacciata, la Cricca Fengtian della Cina del nordest potrebbe provare ad allearsi con noi.;;;;;;Посл?создан? де-факт?частно?арми?помоўў?кредитов Нишинара, Дуан?Цижу?использова?ее для захват?Внешне?Монголии. Чувств? угрозу, клик?Фэнтянь Северо-Восточного Китая може?искать союз??нами.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
