EVT1914_133011310_DESC;In November 1919 Zhili clique leader Gen. Wu Peifu met with representatives of Tang Jiyao and Lu Rongting at Hengyang, where they signed a treaty entitled 'Rough Draft of the National Salvation Allied Army'. This formed the basis of a true anti-Anhui clique alliance.;En novembre 1919, le gйnйral Wu Peifu,  chef de la clique Zhili, rencontra les reprйsentants de Tang Jiyao et de Lu Rongting ?Hengyang, o?ils signиrent un trait?intitul?'Esquisse grossiиre de l'Armйe Alliйe de Salut National'. Ceci forma la base d'une vraie alliance anti clique Anhui.;Im November 1919 traf sich der Anfьhrer der Zhili Clique, General Wu Peifu, mit Vertretern von Tang Jiyao und Lu Rongting in Hengyan, wo sie den 'Entwurf zu einer nationen Volksbefreiungsarmee' erarbeiteten und unterzeichneten. Damit war der Grundstein fьr ein echtes anti-Anhui Bьndnis gelegt.;W listopadzie 1919 r. przywуdca Kliki Zhili genera?Wu Peifu spotka?si?z reprezentantami Tang Jiyao i Lu Rongtinga w Hengjangu, gdzie podpisali traktat, stanowi№cy wstкpny akt zaіoїycielski Narodowej Sojuszniczej Armii Ocalenia. Byіo to podstaw?prawdziwego sojuszu klik wymierzonego przeciwko Klice Anhui.;En noviembre de 1919, Wu Peifu lнder de la camarilla Zhili se reuni?con representantes de Tang Jiyao y Lu Rongting en Hengyang, donde firmaron un tratado llamado 'Borrador del Ejйrcito Aliado de Salvaciуn Nacional'. Esto form?las bases de la alianza anti-Anhui.;Nel Novembre 1919 il leader della Cricca dello Zhili, il generale Wu Peifu, si incontr?con rappresentanti di Tang Jiyao e Lu Rongting a Hengyang, dove insieme firmarono un trattato intitolato 'Prima intesa sull'Esercito Alleato di Salvezza Nazionale'. Questo fu l'inizio di una vera alleanza anti-Cricca Anhui.;;;;;;?ноябр?1919 лиде?клик?Чжил?генера??Пэйф?встретил? ?представителями Та?Цзя??Лу Жунтин??Хэнъяне, гд?он?подписал?догово?по?название?'предварительны?проект союзно?арми?Национальног?Спасен?'. Эт?легл??основу истинног?союз?против клик?Аньхой.;x;;,,,,,