EVT1914_133011311_DESC;The Zhili Clique historically favored peaceful reunification with the Southern Government. Given the Anhui Clique's increasingly belligerence stance toward them, perhaps the Southern Government would be inclined to support us in any future struggle? We should send diplomats to find out.;La clique Zhili favorisa historiquement la rйunification pacifique avec le gouvernement du Sud. Compte tenu de l'attitude de plus en plus belliqueuse de la clique Anhui envers eux,  le gouvernement du Sud sera t-il йventuellement enclin ?nous soutenir dans nos luttes ?venir? Nous devrions envoyer des diplomates pour le savoir.;Eigentlich lag der Zhili Clique an einer friedlichen Wiedervereinigung mit der Regierung der sьdlichen Provinzen. In Anbetracht der gegen diese Regierung zunehmend aggressiver auftretenden Anhui Clique kцnnte sie geneigt sein, uns in zukьnftigen Konflikten mit der Anhui zu unterstьtzen. Wor sollten Diplomaten aussenden, um die Lage zu sondieren.;Klika Zhili historycznie preferowaіa pokojowe zjednoczenie z rz№dem poіudniowym. Bior№c pod uwag?rosn№c?agresj?ze strony Kliki Anhui wymierzon?przeciwko nim, by?moїe rz№d poіudniowy bкdzie chcia?nas wesprze?w przyszіym starciu? Powinniњmy wysіa?dyplomatуw, by pomogli nam to ustali?;La camarilla Zhili apoyaba la reunificaciуn pacнfica con el gobierno del Sur. Debido a que la beligerancia de la camarilla Anhui estaba en aumento, їse inclinar?el gobierno del Sur a nuestro favor en una futura lucha? Deberнamos enviar diplomбticos para averiguarlo.;La Cricca Zhili storicamente preferiva una riunificazione pacifica con il governo del Sud. Dato l'atteggiamento sempre pi?ostile e belligerante della Cricca Anhui verso di loro, forse il governo del Sud potrebbe essere propenso a sostenerci in un futuro conflitto? Dovremmo mandare dei diplomatici per sondare la possibilit?;;;;;;Клик?Чжил?на протяжени?всей истори?выступал?за мирное воссоединени??Южны?правительством. Учитыв? вс?боле?воинственную позици?клик?Ан