EVT1914_133011312_DESC;The group sent to approach the Southern Government has been arrested by officials loyal to the Anhui Clique on their way back. It seems we not know their stance toward us in any future struggle against the Anhui Clique.;La dйlйgation envoyйe pour approcher le Gouvernement du Sud, a йt?arrкtйe par des agents fidиles ?la clique Anhui sur le chemin du retour. Il semble que nous ne connaissions pas son attitude envers nous, en cas de lutte future contre la clique Anhui.;Unsere Gesandten, die die Stimmung bei der Regierung der sьdlichen Provinzen ausloten sollten, wurden auf dem Rьckweg von Truppen der Anhui Clique gefangengenommen. Wir wissen immer noch nicht, wie die sьdlichen Provinzen zu uns stehen.;Grupa wysіana na negocjacje z rz№dem poіudniowym zostaіa aresztowana przez przedstawicieli administracji Kliki Anhui w czasie swego powrotu. Wydaje si? їe ewentualne stanowisko rz№du poіudniowego w przyszіej wojnie z Klik?Anhui jest nieznane.;El grupo enviado para acercarse al gobierno del Sur ha sido arrestado por oficiales leales a la camarilla Anhui cuando volvнan. Parece que no sabemos su postura en una futura lucha contra la camarilla Anhui.;Il gruppo inviato a parlare con il governo del Sud ?stato arrestato sulla via del ritorno da ufficiali leali alla Cricca Anhui. Non possiamo quindi sapere se il governo del Sud ci sosterr?in un possibile futuro conflitto con la Cricca Anhui.;;;;;;Группа, посланная сбилизиться ?Южны?правительством, была арестована чиновникам? лояльными ?клик?Аньхой, на обратном пути. Кажется, мы вс?ещ?не знае?их позици?по отношени??на???будуще?борьбе против клик?Аньхой.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
