EVT1914_133011313_DESC;After allying with the Fengtian Clique, the Zhili Clique began courting warlords in southwestern China who had previously been threatened by Duan's Anhui armies.;Aprиs s'кtre alliйe avec la clique Fengtian, la clique Zhili  commenзa ?courtiser les seigneurs de la guerre du sud-ouest de la Chine qui avait dйj?йt?bien menac?par les armйes Anhui de Duan.;Nach dem Bьndnis mit der Fengtian Clique begann Zhili, die Kriegsherren im Sьdwesten zu umwerben, die von Duan's aggressiver Anhui Clique bedroht waren.;Po zawarciu sojuszu z Klik?Fengtiaсsk? Klika Zhili zaczкіa zabiega?o wzglкdy wataїkуw w poіudniowozachodnich Chinach, ktуrzy wczeњniej czuli si?zagroїeni przez armie Duana i Kliki Anhui.;Despuйs de la alianza con la camarilla Fengtian, la camarilla Zhili empez?a cortejar a los seсores de la guerra del suroeste de China que habнan sido previamente amenazados por el ejйrcito de Duan Anhui.;Dopo essersi alleata con la Cricca Fengtian, la Cricca Zhili inizi?a corteggiare i signori della guerra del Sud della Cina che erano stati in precedenza minacciati dall'esercito Anhui di Duan.;;;;;;Посл?союз?? кликой Фэнтянь, клик?Чжил?начала обхаживать военачальников на юг?западе Китая, которы?ране?чувствовал?угрозу анхойски?арми? Дуан?Цижуя.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
