EVT1914_133011314_DESC;In April 1920, while visiting a memorial service at Baoding for soldiers who died in Hunan, one-time presidential-candidate Cao Kun added more warlords to the anti-Anhui clique alliance, including the rulers of Hubei, Henan, Liaoning, Jilin, Heilongjiang, Jiangsu, Jiangxi and Zhili. Shortly after, various Zhili and Fengtian generals signed a denunciation of the Anhui clique and its military arm, the Anfu Club, which was led by Xu Shuzheng and Duan Qirui. This denunciation was circulated through a telegram called Paoting-fu on July 12, 1920.;En avril 1920, lors d'une visite ?un service commйmoratif ?Baoding pour les soldats morts dans le Hunan, le candidat prйsidentiel Cao Kun ajouta d'autres seigneurs de la guerre ?l'alliance contre la clique Anhui, y compris les dirigeants de Hubei, Henan Liaoning, Jilin, Heilongjiang, Jiangxi, Jiangsu et Zhili. Peu de temps aprиs, divers gйnйraux Zhili et Fengtian signиrent une dйnonciation de la clique Anhui et de son bras arm? le Club Anfu, qui йtait dirigйs par Xu Shuzheng et par Duan Qirui. Cette dйnonciation fut distribuйe par le biais d'un tйlйgramme, appel?Paoting-fu, le 12 Juillet 1920.;Anlдsslich einer Gedenkveranstaltung fьr die in Hunan gefallenen Soldaten in Baoding fьgte der ehemalige Prдsidentschaftskandidat Cao Kun im April 1920 dem anti-Anhui Bьndnis weitere Krдfte hinzu. Es waren dies die Herrscher ьber die Regionen Hubei, Henan, Liaoning, Jilin, Heilongjiang, Jiangsu, Jiangxi und Zhili. Kurz darauf verfassten die Generдle der Zhili- und Fengtiang Clique eine Anklageschrift gegen die Anhui Clique und ihren militдrischen Arm, den Anfu Club, unter dem Kommando von Xu Shuzheng und Duan Qirui. Diese Anklage wurde mittels eine Telegramms mit Namen Paoting-Fu am 12. Juli 1920 verbreitet.;W kwietniu 1920 r., w czasie wizyty na uroczystoњciach upamiкtniaj№cych їoіnierzy polegіych w prowincji Hunan, zorganizowanych w Baodingu, niegdysiejszy kandydat na prezydenta, Cao Kun, zwerbowa?kolejnych wataїkуw do sojuszu wymierzonego w Klik?Anhui, w tym przywуdcуw Hubei, Henanu, Jilinu, Heilongjiangu, Jiangsu, Jiangxi i Zhili. Krуtko potem, rуїni generaіowie Zhili i Fengtianu podpisali dokument wzywaj№cy do wyst№pienia przeciwko Klice Anhui i jej wojskowej reprezentacji, Klubowi Anfu, ktуry by?dowodzony przez Xu Shuzhenga and Duan Qirui'a. To wezwanie byіo przesіane za poњrednictwem telegramu, znanego jako Paoting-fu, 12 lipca 1920 r.;En abril de 1920, mientras visitaba un memorial de soldados que murieron en Hunan, el candidato presidencial Cao Kun uni?a mбs seсores de la guerra en la alianza anti-Anhui, incluyendo a los gobernadores de Hubei, Henan, Liaoning, Jilin, Heilongjiang, Jiangsu, Jiangxi y Zhili. Poco despuйs, varios generales Zhili y Fengtian firmaron una denuncia contra la camarilla Anhui y su brazo militar, el Club Anfu, que estaba liderado por Xu Shuzheng y Duan Qirui. Esta denuncia circul?a travйs de una telegrama llamado Paoting-fu el 12 de julio de 1920.;Nell'Aprile 1920, mentre visitava un servizio commemorativo a Baoding in onore dei soldati che erano morti nello Hunan, Cao Kun, in passato candidatosi alla presidenza della Cina, riusc?a coinvolgere altri signori della guerra nell'alleanza contro la Cricca Anhui, tra cui i governatori di Hubei, Henan, Liaoning, Jilin, Heilongjiang, Jiangsu, Jiangxi e Zhili. Poco dopo, alcuni generali dello Zhili e del Fengtian firmarono una denuncia della Cricca Anhui e del suo braccio militare, il Club Anfu, che era guidato da Xu Shuzheng e Duan Qirui. Questa denuncia circol?attraverso un telegramma chiamato Paoting-fu il 12 Luglio 1920.;;;;;;?апреле 1920 года во время посещения поминально?службе ?Баодин??солдатах, которы?погибл??провинци?Хунань, кандидат ?президенты Ца?Кунь привле?многих милитаристов ?союз по борьбе ?кликой Аньхой, ?то?числ?правителей провинци?Хубэ? Хэнань, ?онин, Цзилин? Хэйлунцзя?, Цзянс? Цзянс??Чжил? Вскоре посл?этог? различны?генералы Чжил??Фэнтянь подписал?документ ?денонсации клик?Аньхой ?ее во