EVT1914_133011317_DESC;Obtaining British and American backing, the Zhili and Fengtian cliques had President Xu Shichang dismiss Gen. Xu Shuzheng, the leader of the Mongolia expedition. Having publicly lost face and been undermined by a less powerful but still dangerous pair of ex-allies and hangers-on, Gen. Xu and Duan denounced the actions and prepared for war.;Ayant obtenu les appuis britannique et amйricain, les cliques Zhili et Fengtian poussиrent le prйsident Xu Shichang ?rejeter le gйnйral Xu Shuzheng, le chef de l'expйdition en Mongolie. Ayant publiquement perdu la face et ayant йt?min?par une paire d'ex-alliйs et de parasites moins puissants mais toujours dangereux, le gйnйral Xu Duan dйnonзa leurs actions et se prйpara pour la guerre.;Mit britischer und amerikanischer Rьckendeckung veranlassten die Zhili und die Fengtian, da?Prдsident Xu Shichang seinen General Xu Shuzheng, den Leiter der Kampagne in der дusseren Mongolei, entlдsst. Nach diesem Gesichtsverlust und von den ehemaligen Fьrsprechern im Stich gelassen, bereiten sich der General und Duan jetzt auf einen Krieg vor.;Po uzyskaniu wsparcia brytyjskiego i amerykaсskiego, kliki Zhili i Fengtiaсska skіoniіy prezydenta Xu Shichanga do odwoіania generaіa Xu Shuxhenga, dowуdcy ekspedycji mongolskiej. Trac№c publicznie twarz po wymanewrowaniu przez sіabsze, ale wci№ї groџne siіy dawnych sojusznikуw, genera?Xu i Duan oprotestowali ich akcje i zaczкli si?przygotowywa?do wojny.;Obteniendo respaldo americano y britбnico, las camarillas Zhili y Fengtian habнan rechazado a Xu Shuzheng, lнder de la expediciуn a Mongolia. Despuйs de ver daсada su imagen pъblica y haber sido minado por un par de ex-aliados poco poderosos, Xu y Duan denunciaron las acciones y se prepararon para la guerra.;Avendo ottenuto il supporto britannico e americano, le Cricche dello Zhili e del Fengtian costrinsero il Presidente Xu Shichang a estromettere il generale Xu Shuzheng, il leader della spedizione in Mongolia. Avendo pubblicamente perso la faccia ed essendo stato spodestato da una coppia di avversari meno potenti ma comunque pericolosi, il generale Xu e Duan denunciarono l'accaduto e si prepararono alla guerra.;;;;;;Получи?британскую ?американскую поддержк? клик?Чжил??Фэнтянь заставил?президента Сю? Шичана уволит?генерала Сю?Шучжен? руководите? монгольско?экспедиции. Посл?публично?потери лица, ??подточенными мене?мощной, но вс?ещ?опасно?паро?бывших союзнико??прихлебателе? сило?  генералы Сю??Дуан?осудил?эт?действ? ?начали готовить? ?войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
