EVT1914_133011319_DESC;In early July 1920 the Anhui clique gathered five divisions and four combined brigades to form the so-called National Stabilization Army, with Duan Qirui as its commander-in-chief. The army was deployed in two fronts, the western covering the regions of Zhuozhou, Laishui and Gufan, while the eastern covered the regions of Liang Hamlet and Beiji Temple, just to the west of Poplar Hamlet.\nZhili and allied forces gathered a division and nine combined brigades to form their own 'Traitor Suppression Army' with Wu Peifu as its front-line commander-in-chief. This, too, was deployed on two fronts, with an eastern zone in the region of Poplar Hamlet and a western front in the region of Gaobei Hotel. Meanwhile, Zhang Zuolin ordered a detachment of his troops to enter Shanhaiguan, taking up positions at Machang and Junliangcheng.;Dйbut de juillet 1920, la clique Anhui rassembla cinq divisions et quatre brigades combinйes pour former la soi-disante Armйe Nationale de Stabilisation, avec Duan Qirui comme commandant en chef. L'armйe fut dйployйe sur deux fronts, l'occident couvrant les rйgions de Zhuozhou, Laishui et Gufan, tandis que l'oriantal couvrait les rйgions de Liang Hamlet et de Beiji Temple, juste ?l'ouest de Poplar Hamlet. \n Zhili et les forces alliйes rйunirent une division et neuf brigades combinйes pour former leur propre Armйe de Rйpression du Traоtre, avec Wu Peifu comme commandant en chef en premiиre ligne. Celle-ci aussi fut dйployйe sur deux fronts, avec une zone orientale dans la rйgion de Poplar Hamlet, et un front occidental dans la rйgion de Gaobei Hotel. Pendant ce temps, Zhang Zuolin ordonna ?un dйtachement de ses troupes d'entrer ?Shanhaiguan, et de prendre position ?Masan et Junliangcheng.;Die Anhui Clique stellte im Juli 1920 aus 5 Divisionen und 4 Brigaden die sogenannte 'nationale Stabilisierungsarmee' unter dem Kommando von Duan Qirui auf. Sie wurde auf zwei Frontabschnitte verteilt. Im Westen wurden die Regionen Zhuozhou, Laishui und Gufan, im Osten das Dorf Liang und der Tempel Beiji bei Poplar abgedeckt.\nZhili und seine Verbьndeten stellten eine Division und 9 Brigaden in der 'Verrдterunterdrьckungsarmee' unter dem Kommando von Wu Peifu auf. Auch diese waren auf zwei Abschnitte verteilt, den westlichen am Gaobei Hotel und den цstlichen am Dorf Poplar. Zwischenzeitlich stellte Zhang Zuolin Truppen zur Besetzung Shanhaiguans ab sowie um Positionen bei Machang und Junliangcheng zu gewinnen.;We wczesnym lipcu 1920 r. Klika Anhui zgromadziіa piкж dywizji i cztery mieszane brygady i sformowaіa tzw. Armi?Narodowej Stabilizacji, z Duanem Quirui'em jako jej gіуwnodowodz№cym. Armia zostaіa wysіana na dwa fronty zachodni znajdowa?si?w prowincjach Zhuozhou, Laishui i Gufan, a wschodni w rejonie osady Liang i њwi№tyni Beiji, na zachуd od osady Poplar.\nZhili wraz z siіami sojuszniczymi zgromadziіo dywizj?i dziewiкж mieszanych brygad, nazywaj№c powstaіe siіy 'Armi?Zdіawienia Zdrajcy' i mianowaіo Wu Peifu jako gіуwnodowadz№cego. Ona takїe dziaіaіa na dwуch frontach wschodni znajdowa?si?w rejonie osady Poplar, a zachodni w rejonie hotelu Gaobei. W miкdzyczasie Zhang Zuolin zarz№dzi?oddziaіowi wojska wkroczenie do Shanhaiguanu i zajкcie pozycji w Machangu i Junliangchengu.;A principios de julio de 1920, la camarilla Anhui reuni?cinco divisiones y cuatro brigadas combinadas para formar el llamado Ejйrcito de Estabilizaciуn Nacional, con Duan Qirui como Comandante en Jefe. El ejйrcito fue desplegado en dos frentes, en el oeste cubriendo las regiones de Zhuozhou, Laishui y Gufan mientras que el este cubrieron las regiones de Liang Hamlet y el Templo Beiji.\nLos Zhili y las fuerzas aliadas reunieron una divisiуn y nueve brigadas combinadas para crear su propio ejйrcito: el Ejйrcito para la Represiуn de los Traidores, con Wu Peifu como Comandante en Jefe. Fue despeglado en dos frentes, el del este en la regiуn de la Aldea del Бlamo y el frente oeste en la regiуn de Gaobei. Mientras tanto, Zhang Zuolin orden?que un destacamento de sus tropas avanzase hasta Shanhaiguan, tomando posiciones en Machang y en Junliangcheng.;All'inizio del Luglio 1920 la Cricca Anhui radun?cinque divisioni e quattro brigate per formare il cos?chiamato 'Esercito di Stabilizzazione Nazionale', con Duan Qirui come comandante in capo. L'esercito fu schierato su due fronti, quello occidentale che copriva le regioni Zhuozhou, Laishui e Gufan e quello orientale che copriva le regioni Liang Hamlet e Beiji Temple, appena ad ovest del Poplar Hamlet.\nLo Zhili e i suoi alleati radunarono una divisione e nove brigate per formare 'l'Esercito per la Soppressione del Traditori' con Wu Peifu come comandante in capo. Anche questo fu schierato su due fronti, con la zona orientale nella regione del Poplar Hamlet e il fronte occidentale nella regione di Gaobei Hotel. Nel frattempo, Zhang Zuolin ordin?ad un distaccamento delle sue truppe di entrare a Shanhaiguan, prendendo posizioni a Machang e Junliangcheng.;;;;;;?начале ию? 1920 года клик?Аньхой собрла ?ть дивизи??четыре комбинированны?бригад?для формирован? та?называемой арми?Национальной Стабилизации, ?Дуан?Цижуем ?качестве главнокомандующего. Армия была развернута ?двух направления? охватывающих западные регион?Чжочжо?Лайшуй ?Гуофан? ?то время ка?восточная охватывала регион?поселк????храм?Бейджи ?западу от поселк?Поплар. \n Чжил??союзны?войска собрал?собственну?дивизи??де?ть комбинированны?бригад ?цель?создан? свое?собственно?Арми?по борьбе ?предателями ??Пэйф??качестве главного фронтового командир? Эт?армия такж?была развернута на дв?фронта, ?восточно?зоно??районе поселк?Поплар ??западным фронто??районе отеля Гаобей. Межд?те? Чжан Цзолин?приказал от?ду свои?войс? чтоб?войт??Шанхайгуан? занимая позици??Мача??Юнлианчи?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
