hui na zachodnim froncie zostaіa unicestwiona.;El 17 de julio, Wu Peifu comand?al ejйrcito Zhili en el frente oeste realizando una maniobra atrevida. Flanque?al enemigo para atacar la sede Anhui de la zona oeste. Captur?al Comandante en Jefe del frente de batalla Anhui Qu Tongfeng y a otros de sus oficiales, incluyendo al comandante de la 1a divisiуn. Despuйs de tomar el pueblo de Zhuozhou, Wu persigui?al enemigo hacia Pekнn. Con la excepciуn de la 15a divisiуn, el ejйrcito Anhui del frente oeste fue aniquilado.;Il 17 Luglio, Wu Peifu guid?personalmente il fronte occidentale dell'esercito Zhili, eseguendo una temeraria manovra per aggirare il nemico e attaccare il quartier generale della zona occidentale dell'Anhui. Wu cattur?il comandante dell'esercito Anhui Qu Tongfeng e molti suoi ufficiali, tra cui il comandante della Prima Divisione. Dopo aver preso la citt?di Zhuozhou, Wu insegu?il nemico in ritirata fino a Pechino. Con l'eccezione della 15esima divisione, il resto dell'esercito Anhui sul fronte occidentale fu annientato.;;;;;;17 ию? ?Пэ?фу личн?командовал Западным фронто?арми?Чжил?для выполнен? смелых маневров обхода противника ?цель?атаковат?штаб-квартиру Аньхой западной зоны.Он захватил главного командующего фронто?Аньхой арми?Цю?Тунфэня ?многих из ег?офицеров, ?то?числ?командир?1-?дивизи? Посл?взятия города Чжочжо? Ву преследова?отступающего ?сторон?Пекина противника. За исключение?15-?дивизи? остальная част?арми?Аньхой на западном фронте была уничтожена.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
