EVT1914_133011402_DESC;Faced with widespread opposition, Yuan repeatedly delayed the accession rites to appease his foes, but his prestige was irreparably damaged, and province after province continued to declare their autonomy from Beijing. As a result, funding for Yuan's accession ceremony was cut on March 1 and he formally abandoned monarchism on March 22. Still, this was not enough to appease those with power in Beijing, with most demanding Yuan's resignation.;Face ?une opposition gйnйralisйe, Yuan retarda ?plusieurs reprises les cйrйmonies de couronnement pour apaiser ses ennemis, mais son prestige avait йt?endommag?de maniиre irrйparable, et les provinces continuиrent ?proclamer les unes aprиs les autres leur autonomie par rapport ?Pйkin. Avec comme rйsultat la coupure du financement de la cйrйmonie de couronnement de Yuan le 1er mars, puis son abandon officiel du monarchisme le 22 mars. Pourtant, cela ne suffit pas ?apaiser les dйtenteurs du pouvoir ?Pйkin, la plupart exigeant la dйmission de Yuan.;Weitgefдchterter Widerstand liess Yuan seine Thronbestiegung immer wieder verschieben in der Hoffnung, er kцnne seine Gegner noch beschwichtigen. Sein Image war zu diesem Zeitpunkt aber bereits irreparabel beschдdigt und eine Provinz nach der anderen fiel von der Regierung in Peking ab und erklдrte sich fьr selbststдndig. Auch seine Abkehr von der Monarchie und sein Thronverzicht am 22. Mдrz reichten den Mдchtigen in Peking nicht mehr aus, die nun auch seinen Rьcktritt von allen Дmtern forderten.;Napotykaj№c powszechny opуr, Yuan wci№ї op?nia?termin ceremonii koronacyjnej, aby uspokoi?swoich wrogуw, ale jego presti?zosta?bezpowrotnie osіabiony i prowincja po prowincji jego oponenci deklarowali autonomi?wzglкdem Pekinu. W wyniku tego, organizacj?funduszy ceremonii przerwano 1 marca, a 22 marca Yuan formalnie porzuci?swe monarchistyczne plany. Wci№ї, nie byіo to wystarczaj№ce, aby uspokoi?centra si?w Chinach i Pekinie, ktуrych wiкkszoњж domagaіa si?ust№pienia Yuana.;Afrontado por una amplia oposiciуn, Yuan retras?repetidamente la accesiуn de sus enemigos, pero su prestigio estaba ya muy daсado y provincia tras provincia continuaban declarando la independencia de Pekнn. Como resultado, la financiaciуn para la ceremonia de accesiуn de Yuan se cort?el 1 de marzo y se abandon?el monarquismo el 22 de marzo. Esto no fue suficiente para calmar a aquellos con poder en Pekнn, que pedнan la renuncia de Yuan.;Dovendo affrontare un malcontento diffuso, Yuan ritard?ripetutamente i riti di ascesa al trono per placare i suoi nemici, ma a causa di ci?il suo prestigio fu irrimediabilmente danneggiato e molte province continuarano a dichiarare la propria autonomia da Pechino. Come risultato, i fondi per la cerimonia di ascesa al trono di Yuan furono tagliati il 1 marzo e la monarchia fu formalmente abbandonata il 22 marzo. Tuttavia, questo non fu abbastanza per placare coloro che detenevano il potere a Pechino, dato che molti di loro continuarono a chiedere le dimissioni di Yuan.;;;;;;Столкнувшись ?широко?оппозицией, Юань неоднократно откладывал церемони?инаугураци? чтоб?успокоит?свои?врагов, но ег?престижу бы?нанесе?непоправимый ущер? ? провинция за провинцией продолжали заявлять ?свое?независимост?от Пекина. ?результате церемония была назначен?Юане?на 1 март? ?он формальн?остави?монархизма 22 март? Те?не мене? этог?было недостаточно, чтоб?успокоит?властьимущих ?Пекине, которы??большинств?свое?требовал?отставки Юа?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
