EVT1914_133011403_DESC;Yuan Shikai died of Kidney failure shortly after the end of his failed Great Chinese Empire. Shortly after his death, the power vacuum in the Beiyang government was filled by members of the Anhui Clique who controlled the majority of the remaining military forces.;Yuan Shikai mourut d'insuffisance rйnale peu de temps aprиs l'йchec et la fin de son Grand Empire Chinois. Peu de temps aprиs sa mort, le vide du pouvoir dans le gouvernement de Beiyang fut combl?par les membres de la clique Anhui qui contrфlait la majorit?des forces militaires restantes.;Kurz nach dem Ende seinen chinesischen Reiches starb auch Yuan Shikai, an Nierenversagen. Das dadurch entstandene Machtvakuum in Peking wurde alsbald von Mitgliedern der Anhui Clique gefьllt, die auch die Kontrolle ьber grosse Teile des Militдrs ьbernahmen.;Yuan Shikai zmar?na niewydolnoњж nerek krуtko po poraїce jego projektu Wielkiego Cesarstwa Chiсskiego. Wkrуtce po jego њmierci powstaіa w rz№dzie Beiyang prуїnia zostaіa wypeіniona przez czіonkуw Kliki Anhui, ktуrzy kontrolowali wiкkszoњж z pozostaіych jeszcze si?wojskowych.;Yuan Shikai muri?de insuficiencia renal poco despuйs de su fracasado Gran Imperio Chino. Despuйs de su muerte, el vacнo que dej?en el gobierno de Beiyang fue llenado por miembros de la camarilla Anhui que controlaban la mayorнa de las fuerzas militares restantes.;Yuan Shikai mor?di insufficienza renale poco dopo la fine dela suo fallito Grande Impero Cinese. Poco dopo la sua morte, il vuoto di potere lasciato nel governo di Beiyang fu riempito da parecchi membri della Cricca Anhui che controllava la maggior parte delle rimanenti forze militari.;;;;;;Юань Ши умер от почечной недостаточност?вскоре посл?окончания ег?не удавшейся Велико?Китайско?Импери? Вскоре посл?ег?смерти, вакуум власти ?бэ?нско?правительств?бы?заполнен членам?клик?Аньхой, которы?контролировали большу?част?оставших? военны?си?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,