EVT1914_133011406_DESC;The Yunnan Clique's role in defeating Yuan Shikai combined with the weakness of the Guangdong and Guangxi cliques in the southern alternative government means the Yunnan Clique is now the leader of the Constitutional Protection Movement;Du fait du rфle de la clique Yunnan dans la dйfaite de Yuan Shikai, combinйe ?la faiblesse des cliques Guangdong et Guangxi dans le gouvernement alternatif du sud, font que celle-ci est dйsormais le leader du Mouvement de Protection Constitutionnelle.;Die Rolle der Yunnan Clique beim Sieg ьber Yuan Shikai und die schwindende Bedeutung der Guangxi- und der Guangdong Clique im sьdlichen China lassen nur den Schluss zu, da?Yunnan jetzt die Fьhrung der 'Constitutional Protection' Bewegung ьbernommen hat.;Rola Kliki Junnaсskiej w pokonaniu Yuana Shikai'a poі№czona ze sіaboњci?Kliki Kantoсskiej i Kliki Guangxi na poіudniu oznacza, їe Klika Junnaсska jest teraz liderem Ruchu Ochrony Konstytucji.;El papel de la camarilla de Yunnan es derrotar a Yuan Shikai, combinado con la debilidad de las camarillas de Guangdong y Guangxi en los gobiernos alternativos del sur, la hace ahora lнder del Movimiento de Protecciуn de la Constituciуn.;Il ruolo della Cricca dello Yunnan nello sconfiggere Yuan Shikai, unita alla debolezza delle cricche del Guangdong e del Guangxi nei governi del sud rese la Cricca dello Yunnan leader indiscussa del Movimento di Protezione Costituzionale.;;;;;;Роль клик?Юньнан??разгроме Юань Шикая ?сочетани?со слабость?альтернативног?южного правительств?клик Гуандуна ?Гуанси, позволил?стат?клик?Юньнан??наст?ще?время лидеро?движен? ?защиту Конституци?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
