EVT1914_133011407_DESC;After Yuan Shikai's death, Li Yuanhong became the President and Duan Qirui became the Premier. The Provisional Constitution was reinstated and the parliament convened. However, Li Yuanhong and Duan Qirui had many conflicts, the most glaring of which was over China's entry into World War I. Since the outbreak of the war, China had remained neutral until the United States urged all neutral countries to join the Allies, as a condemnation of Germany's use of unrestricted submarine warfare. Premier Duan Qirui was particularly interested in joining the Allies, because he would then use the opportunity to secure loans from Japan to build up his Anhui Clique army. The two factions in the parliament engaged in ugly debates regarding the entry of China and, in May 1917, Li Yuanhong dismissed Duan Qirui from his government.;Aprиs la mort de Yuan Shikai, Li Yuanhong devint prйsident et Duan Qirui premier ministre. La Constitution Provisoire fut rйtabli et le parlement convoqu? Cependant, Li Yuanhong et Duan Qirui eurent de nombreux conflits, le plus flagrant йtant sur ??l'entrйe de la Chine dans la Premiиre Guerre mondiale. Depuis le dйclenchement de la guerre, la Chine йtait rest?neutre, jusqu'?ce que les Йtats-Unis aient exhort?tous les pays neutres ?se joindre aux Alliйs, un moyen de condamner l'utilisation de la guerre sous-marine totale par l'Allemagne. Le premier ministreDuan Qirui йtait particuliиrement intйress??se joindre aux Alliйs, car il y voyait une occasion de profiter de l'occasion pour obtenir des prкts du Japon, pour construire son armйe de la Clique Anhui. Les deux factions au sein du parlement s'empoignиrent au cours de dйbats particuliиrement laids relatifs ?l'entrйe de la Chine en guerre, et finalement Li Yuanhong renvoya Duan Qirui du gouvernement en mai 1917.;Nach Yuan Shikai's Tod wurde Li Yuanhong Prдsident und Duan Qiui sein Premierminister. Die provisorische Verfassung wurde wieder in Kraft gesetzt und das Parlament nahm seine Arbeit wieder auf. Trotzdem gab es Meinungsverschiedenheiten zwischen Yuanhong und Qirui, die sich vor allem in der Entscheidung ьber den chinesischen Eintritt in den ersten Weltkrieg zeigten. Bei Kriegsausbruch war China neutral geblieben, wurde jetzt aber von den Vereinigten Staaten zum Kriegseintritt gedrдngt, die alle neutralen Staaten wegen des deutschen unbeschrдnkten U-Bootkriegs zum Beitritt zur Entente aufforderten. Premierminister Qirui war durchaus geneigt, da er sich von einem Bьndnisbeitritt japanische Kredite versprach, mit denen er seine Anhui Armee verstдrken wollte. Die beiden Fraktionen im Parlament waren hoffnungslos zerstritten und fьhrten heftige Debatten bis Prдsident Yuanhong seinen Premierminister im Mai 1917 aus der Regierung entliess. ;Po њmierci Yuana Shikaia, Li Yuanhong zosta?prezydentem, a Duan Qirui premierem. Tymczasowa konstytucja zostala przywrуcona i zwoіano chiсski parlament. Jednak wspуіprac?Li Yuanhonga i Duana Quiruia znaczyіo wiele konfliktуw, spoњrуd ktуrych naistotniejszy dotyczy?uczestnictwa Chin w I Wojnie Њwiatowej. Od wybuchu wojny Chiny pozostawaіy neutralne do czasu zanim Stany Zjednoczone zaczкіy naciska?na kraje niezaangaїowane w wojne do opowiedzenia si?przeciwko Niemcom, w reakcji na prowadzon?przez nich nieograniczon?wojn?podwodn? Premier Duan Qirui by?w szczegуlnoњci zainteresowany doі№czeniem do aliantуw poniewa?otwieraіo mu to drog?do kapitaіu poїyczkowego z Japonii w celu zbudowania armii kliki Anhui. Dwie frakcje parlamentarne zaangaїowane byіy w zaїart?debat?na temat wі№czenia si?Chin w wojn?i w maju 1917 r. Li Yuanhong odwoіa?Duana Qiruia ze stanowiska premiera rz№du.;Despuйs de la muerte de Yuan Shikai, Li Yuanhong se convirti?en Presidente y Duan Qirui en Premier. La Constituciуn Provisional fue restituнda y el parlamento convocado. Sin embargo, Li Yuanhong y Duan Qirui tenнan muchos conflicto, el mбs patente de los cuales era sobre el ingreso de China en la 1a Guerra Mundial. Desde el comienzo de la guerra, China habнa permanecido neutral hasta que los Estados Unidos urgieron a todos los paнses neutrales que se unieran a los aliados, como condena al uso por los alemanes de la guerra submarina sin restricciones. El premier Duan Qirui estaba particularmente interesado en unirse a los aliados, porque usarнa entonces esa oportunidad para conseguir prйstamos de Japуn para incrementar su ejйrcito de la camarilla de Anhui. Las dos facciones en el parlamento tomaron parte en debates desagradables concernientes a la entrada de China, y en mayo de 1917 Li Yuanhong destituy?a Duan Qirui de su gobierno.;Dopo la morte di Yuan Shikai, Li Yuanhong divenne presidente e Duan Qirui premier. La Costituzione provvisoria venne ripristinata ed il parlamento convocato. Tuttavia, Li Yuanhong e Duan Qirui avevano molti conflitti, il pi?evidente dei quali fu sull'ingresso della Cina nella Prima Guerra Mondiale. Dopo lo scoppio della guerra, la Cina rimase neutrale fin quando gli Stati Uniti esortarono tutti i paesi neutrali ad unirsi agli Alleati, come condanna per l'uso, da parte tedesca, della guerra sottomarina senza restrizioni. il premier Duan Qirui era particolarmente interessato a far parte degli alleati, perch?avrebbe potuto utilizzare la possibilit?di ottenere prestiti dal Giappone per costruire il suo esercito della Anhui Clique. Le due fazioni in Parlamento si combattereono in aspri dibattiti sull'ingresso della Cina nella guerra e, nel maggio 1917, Li Yuanhong licenzi?Duan Qirui dal suo governo.;;;;;;Посл?смерти Юань Ши, Ли Юанхун стал президенто? ?Дуан?Цижу?стал премьеро? Временная конституция была восстановлен? ?парламен?созван. Те?не мене? межд?Ли Юанхуном ?Дуан?Цижу?было мног?конфликтов, наиболее ярким из которы?бы?вопрос вступлен? Китая ?Первую мирову?войн? ?начале войн?Кита?оставался нейтральны? пока Соединенны?Штат?не призвали вс?нейтральны?страны присоединить? ?союзника? осуждения использовани?Германие?неограниченной подводно?войн? Премье?Дуан?Цижу?бы?особенно заинтересова??присоединени??союзника? поскольк?он собирался использовать возможност?кредитов от Японии до создан? своего арми?Анхойско?клик? Дв?фракци??парламенте устроили уродливы?дебаты относительно вступлен? Китая ?войн? ??ма?1917 года, Ли Юанхун убра?Дуан?Цижу?из своего правительств?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
