EVT1914_133011408_DESC;In May 1917, Li Yuanhong dismissed Duan Qirui from his government. Duan's dismissal caused provincial military governors loyal to Duan to declare independence and to call for Li Yuanhong to step down as the President. A revolt is growing...;En mai 1917, Li Yuanhong renvoya Duan Qirui du gouvernement. Le renvoi causa de nombreux gouverneurs militaires provinciaux fidиles ?Duan ?dйclarer leur indйpendance et ?appeler ?la dйmission de Li Yuanhong de son poste de prйsident. La rйvolte gronde ...;Als Prдsident Yuanhong im Mai 1917 seinen Premierminister Qirui entliess, erklдrten sich einige Provinzgouverneure solidarisch, riefen ihre Unabhдngigkeit aus  und forderten den Prдsidenten zum Rьcktritt auf. Eine Revolte bahnt sich an ...;W maju 1917 r. Li Yuanhong odwoіa?Duana Qiruia ze stanowiska premiera rz№du. Usuniкcie Duana spowodowaіo, їe lokalni gubernatorzy wojskowi lojalni wobec Duana ogіosili niepodlegіoњж i wezwali Li Yuanhonga do ust№pienia z funkcji prezydenta. W Chinach narasta bunt...;En mayo de 1917 Li Yuanhong destituy?a Duan Qirui de su gobierno. La destituciуn de Duan caus?que gobernadores militares provinciales leales a Duan declararan la independencia y pidieran que Li Yuanhong dimitiera como presidente. Un levantamiento est?creciendo...;Nel maggio del 1917, Li Yuanhong licenzi?Duan Qirui dal governo. Il licenziamento di Duan caus?la dichiarazione di indipendenza dei governatori militari provinciali fedeli a Duan e la loro richiesta delle dimissioni di Li Yuanhong dalla carica di presidente. Sta montando una rivolta...;;;;;;?ма?1917 года, Ли Юанхун убра?Дуан?Цижу?из своего правительств? Увольнение Дуан?Цижу?привел??об?влению провинциальным?военными губернаторам? верным?Дуан?Цижу? независимост? которы?призвали Ли Юанхун?уйти ?пост?президента. Восстани?набирает силу...;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
