EVT1914_133011409_DESC;Duan's dismissal caused provincial military governors loyal to Duan to declare independence and to call for Li Yuanhong to step down as the President. Li Yuanhong summoned Zhang Xun to mediate the situation. Zhang Xun had been a general serving the Qing Court and was by this time the military governor of Anhui province.;En mai 1917, Li Yuanhong renvoya Duan Qirui du gouvernement. Le renvoi causa de nombreux gouverneurs militaires provinciaux fidиles ?Duan ?dйclarer leur indйpendance et ?appeler ?la dйmission de Li Yuanhong de son poste de prйsident. Li Yuanhong convoqua Zhang Xun comme mйdiateur. Zhang Xun fut un gйnйral servant la cour Qing, et йtait ?cette йpoque le gouverneur militaire de la province Anhui.;Als Prдsident Yuanhong im Mai 1917 seinen Premierminister Qirui entliess, erklдrten sich einige Provinzgouverneure solidarisch, riefen ihre Unabhдngigkeit aus  und forderten den Prдsidenten zum Rьcktritt auf. Zhang Xun, der Militдrgouverneur von Anhui und frьheres Mitglied des Qing Gerichts, wurde von Prдsident Yuanhong ernannt, die Wogen zu glдtten.;Usuniкcie Duana spowodowaіo, їe lokalni gubernatorzy wojskowi lojalni wobec Duana ogіosili niepodlegіoњж i wezwali Li Yuanhonga do ust№pienia z funkcji prezydenta. Li Yuanhong wezwa?Zang Xuna, aby podj№і si?mediacji w tej sprawie. Zhang Xun by?generaіem, ktуry sіuїy?jeszcze na dworze Qing i by?w tym czasie gubernatorem wojskowym prowincji Anhui.;La destituciуn de Duan caus?que gobernadores militares provinciales leales a Duan declararan la independencia y pidieran que Li Yuanhong dimitiera como presidente. Li Yuanhong convoc?a Zhang Xun para mediar en la situaciуn. Zhang Xun habнa sido un general que sirvi?a la Corte Qing y era entonces el gobernador militar de la provincia de Anhui.;Il licenziamento di Duan caus?la dichiarazione di indipendenza dei governatori militari provinciali fedeli a Duan e la loro richiesta delle dimissioni di Li Yuanhong dalla carica di presidente. Li Yuanhong convoc?Zhang Xun per mediare la situazione. Zhang Xun era stato un generale al servizio della Corte Qing e fu da questo momento il governatore militare della provincia di Anhui.;;;;;;Увольнение Дуан?Цижу?привел??об?влению провинциальным?военными губернаторам? верным?Дуан?Цижу? независимост? которы?призвали Ли Юанхун?уйти ?пост?президента. Ли Юанхун призва?Чжан Сю? стат?посреднико??ситуации. Чжан Сюнь бы?генерало?пр?двор?Ци? ??этом?времен?бы?военны?губернатором провинци?Аньхой.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
