EVT1914_133011410_DESC;On the morning of July 1,1917, the royalist general Zhang Xun took advantage of the Anhui affair's chaos, entered the capital, and proclaimed at 4 am, with a small entourage, the restoration of Pu Yi, who had abdicated the throne on February 12, 1912. The capital police submitted the new government. It later published an edict of restoration that falsified the approval of the president of the republic, Li Yuanhong, to general dismay.;Dans la matinйe du 1 juillet 1917, le gйnйral royaliste Zhang Xun profita du chaos crйй par l'affaire Anhui, entra dans la capitale, et proclama avec un petit entourage ?4 heures du matin la restauration de Pu Yi, qui avait abdiqu?du trфne le 12 Fйvrier 1912. La police de la capitale se soumit au nouveau gouvernement. Plus tard, il publia un йdit de restauration qui falsifiait l'approbation par le prйsident de la rйpublique Li Yuanhong, ?la consternation gйnйrale.;Am Morgen des 1. Juli 1917 nutzte der ehemalige Qing General Zhang Xun die verworrene Lage in der Provinz Anhui, indem er die dortige Hauptstadt besetzte und mit nur wenigen Getreuen die Wiedereinsetzung Pu Yi's verkьndete, der am 12. Februar 1912 abgedankt hatte. Die Polizeieinheiten der Hauptstadt unterstellten sich freiwillig der neuen Regierung. Spдter verцffentlichte sie ein Dokument, in dem Prдsident Yuanhong seine nachtrдgliche Zustimmung zu dem Putsch erteilte. Zu allgemeiner Empцrung handelte es sich dabei um eine Fдlschung.;Rankiem 1 lipca 1917 r. rojalistowski reїim generaіa Zhang Xuna wykorzysta?chaos zwi№zany ze spraw?Anhui, wprowadzi?swoje wojska do stolicy i o 4 nad ranem, wobec niewielkiej grupy zebranej, ogіosi?przywrуcenie cesarza Pu Yi, ktуry abdykowa?12 lutego 1912 r. Stoіeczna policja poddaіa si?nowemu rz№dowi. Opublikowano p?niej sfaіszowany edykt prezydenta Li Yuanhonga, aprobuj№cy jakoby przywrуcenie rz№dуw cesarskich, ku powszechnemu niezadowoleniu.;En la maсana del 1 de julio de 1917, el general monбrquico Zhang Xun sac?provecho del caos del asunto Anhui, ingres?a la capital, y proclam?a las 4 AM, con un pequeсo sйquito, la restauraciуn de Puyi, que habнa abdicado al trono el 12 de febrero de 1912. La policнa de la capital se someti?al nuevo gobierno. Luego public?un edicto de restauraciуn que falsific?la aprobaciуn del presidente de la repъblica, Li Yuanhong, para la consternaciуn gerneral.;La mattina del 1 luglio 1917, il generale realista Zhang Xun, approfittando del caos della vicenda Anhui, entr?nella capitale, e proclam?alle 4 del mattino, con un piccolo seguito, il restauro di Pu Yi, che aveva abdicato al trono il 12 febbraio 1912. La polizia della capitale pass?sotto il controllo del nuovo governo. In seguito venne pubblicato un editto di restauro che falsificava l'approvazione del presidente della repubblica Li Yuanhong, tra lo sgomento generale.;;;;;;На утро 1 ию? 1917 года, генера?монархис?Чжан Сюнь, воспользовалис?хаосом аньхойских де? воше??столиц? ?провозгласил ?4 часа утра, ?небольши?окружением, восстановление Пу ? которы?отрекся от престола 12 февраля 1912. Столичная полиция подчинилас?новому провительств? Позж?он опубликова?указ ?восстановлении, ?фальсифицированным утверждением президенто?республики, Ли Юанхуном, ко всеобщем?смятени?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
