EVT1914_133011411_ACTIONA;The beginning of the end for the monarchists;Le dйbut de la fin pour les monarchistes;Der Anfang vom Ende der Monarchisten;To pocz№tek koсca dla monarchistуw;El principio del fin para los monбrquicos;L'inzio della fine per i monarchici;;;;;;Начало конц?монархисто?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_133011411_DESC;Over the next 48 hours, edicts by monarchists were proclaimed trying to shore the legitimacy of the restoration. As these edicts included falsified statements by president Li, he fled the presidential palace with two of his aides anticipating hostile actions from the public. He first fled to the French embassy and later stayed in the Japanese embassy. Before taking refuge in the Japanese embassy, Li appointed Vice President Feng Guozhang as acting president and restored Duan Qirui as prime minister to defend the republic. Duan immediately took command of the troops stationed in nearby Tianjin. On July 5, 1917 his troops approached the Beijing-Tianjin railway which was 40 kilometers from the capital. Zhang left the capital to meet Republicans, bolstered by a number of Manchu troops, the same day. With almost all of the Northern Army to oppose him and the Republicans having taken control of the 2 main rail lines to the capital, Zhang was forced to retreat.;Au cours des 48 derniиres heures, des йdits ont йt?proclamйs par monarchistes, essayant de consolider la lйgitimit?de la restauration. Comme ces йdits comprenaient des dйclarations falsifiйes du prйsident Li, celui-ci a fui le palais prйsidentiel avec deux de ses aides, en anticipation d'actions hostiles de la part du public. Il a d'abord fui ?l'ambassade franзaise, et, plus tard, ?sйjourn?dans l'ambassade du Japon. Avant de prendre refuge dans l'ambassade japonaise, Li a nomm?le vice-prйsident Feng Guozhang comme prйsident par intйrim, et a restaur?Duan Qirui comme Premier ministre pour dйfendre la rйpublique. Duan a immйdiatement pris le commandement des troupes stationnйes ?proximit?de Tianjin. Le 5 Juillet 1917, sa troupe s'approcha du chemin de fer Beijing-Tianjin, qui йtait ?40 kilomиtres de la capitale. Zhang a quitt?la capitale pour rencontrer les rйpublicains, renforc?par un certain nombre de troupes mandchoues le mкme jour. Avec la quasi-totalit?de l'armйe du Nord pour s'opposer ?lui, et avec les rйpublicains ayant pris le contrфle des 2 principales lignes ferroviaires de la capitale, Zhang a йt?forc?de battre en retraite.;Wдhrend der nдchsten 48 Stunden verцffentlichten die Monarchisten mehrere Schriftstьcke, um die Rechtmдssigkeit der Inthronisierung zu untermauern. Einige dieser Edikte erwiesen sich allerdings als Fдlschungen, so das Prдsident Li in der Erwartung цffentlicher Aufstдnde mit zwei Getreuen erst in die franzцsische, dann in die japanische Botschaft floh. Bevor er sich in die Botschaft zurьckzog, ernannte er den amtierenden Vize-Prдsidenten Feng Guozhang zum neuen Prдsidenten und Duan Qirui wieder zum Premierminister, damit die beiden die Republik schьtzen. Dieser ьbernahm unverzьglich das Kommando ьber die im nahen Tianjin stationierten Truppen und erreichte am 5. July 1917 ca. 40 Kilometer von der Hauptstadt entfernt die Bahnlinie Tianjin - Peking. Am selben Tag verliess Zhang in Begleitung einiger Manchu Verbдnde die Hauptstadt, um sich den Republikanern zu stellen. Als er sah, da?er es mit der gesamten Nord-Armee zu tun hatte, die zudem noch zwei wichtige Bahnlinien in die Hauptstadt kontrollierten, zog er sich zurьck. ;W ci№gu nastкpnych 48 godzin, monarchiњci wydali liczne edykty, maj№ce na celu oparcie w prawie nowej wіadzy. Jako їe wњrуd wydanych dokumentуw wiele nosiіo sfaіszowany podpis prezydenta Li, ten uciek?z paіacu z dwoma wspуіpracownikami, przewiduj№c przewidziane dla niego wrogie posuniкcia. Najpierw uciek?do ambasady francuskiej, ale p?niej przebywa?na terenie ambasady japoсskiej. Przed schronieniem si?w japoсskiej ambasadzie Li mianowa?dotychczasowego wiceprezydenta Feng Guozhanga tymczasowym prezydentem i przywrуci?Duana Quiruia na stanowisko premiera z zadaniem obrony republiki. Duan natychmiast obj№і komend?nad wojskami stacjonuj№cymi w okolicach Tianjinu. 5 lipca 1917 r. wojska te doszіy do linii kolejowej Pekin-Tianjin, w miejscu oddalonym o 40 kilometrуw od stolicy. Zhang opuњci?stolic? aby spotka?republikanуw, upewniony liczebnoњci?wojsk mandїurskich, jeszcze tego samego dnia. Jednak wystкpuj№c przeciw prawie caіej Armii Pуіnocnej i republikanom, ktуrzy kontrolowali dwa gіуwne poі№czenia kolejowe do stolicy, Zhang zosta?zmuszony do ucieczki.;Durante las 48 horas siguientes, se proclamaron edictos por los monбrquicos tratando de apuntalar la legitimidad de la restauraciуn. Como estos edictos incluнan falsas declaraciones del presidente Li, йl huy?del palacio presidencial con dos de sus ayudantes anticipando acciones hostiles del pъblico. Primero huy?a la embajada francesa y lueg?se qued?en la embajada japonesa. Antes de tomar refugio en la embajada japonesa, Li nombr?al vicepresidente Feng Guozhang como presidente en ejercicio y restaur?a Duan Qirui como primer ministro para defender a la repъblica. Duan inmediatamente tom?el comando de las tropas estacionadas en el cercano Tianjin. El 5 de julio de 1917 sus tropas se acercaron al ferrocarril Bijing-Tianjin, que estaba a 40 kms de la capital. Zhang dej?la capital para hacer frente a los republicanos, reforzado por una cantidad de tropas manchъes, ese mismo dнa. Teniendo casi todo el Ejйrcito del Norte en su oposiciуn y los republicanos tomando el control de las 2 principales lнneas ferroviarias a la capital, Zhang fue forzado a retirarse.;Nelle successive 48 ore, editti monarchici vennero proclamati cercando di puntellare la legittimit?del restauro. Poich?questi editti incluso dichiarazioni falsificate del presidente Li, questi lasci?il palazzo presidenziale con due dei suoi aiutanti per anticipare azioni ostili da parte del pubblico. Per prima cosa fugg?all'ambasciata francese e poi a quella giapponese. Prima di trovare rifugio nell'ambasciata giapponese, Li nomin?il Vice Presidente Feng Guozhang come presidente di fatto e rimise Duan Qirui come primo ministro per difendere la repubblica. Duan prese subito il comando delle truppe di stanza nella vicina Tianjin. Il 5 luglio 1917 le sue truppe si avvicinarono alla linea ferroviaria Pechino-Tianjin, a 40 chilometri dalla capitale. Zhang lasci?la capitale per incontrare i repubblicani, con un contingente di truppe Manchu, lo stesso giorno. Con quasi tutto l'esercito del Nord a lui ostile ed i repubblicani con il controllo delle 2 linee ferroviarie principali della capitale, Zhang venne costretto a ritirarsi.;;;;;;?течени?следующи?48 часо? монархистами провозглашалис?указ? пытаясь укрепить законность ресторации. Поскольк?эт?указ?включали фальсифицированные заявлен? президента Ли, он бежа?из президентского дворца ?двумя своими помощникам?ожид? враждебных действий со сторон?общественности. Сначал?он бежа??посольство Франци? ?зате?остался ?японско?посольстве. Прежде че?принять убежищ??посольстве Японии, Ли назначил вице-президента Фэна Гочжан?исполняющим обязанности президента ?восстанови?Дуан?Цижу?на пост?премье?министра для защиты республики. Дуан?сраз?же приня?командование войсками, дислоцированными ?соседнем ?ньцзин? 5 ию? 1917 году войска подошл??Пеки??ньцзинской железной дороге, которая была ?40 километрах от столиц? Чжан покину?столиц? чтоб?встретиться республиканцев, поддержанных ?до?маньчжурских войс? ?то?же день. Почт?вся Северн? армия выступил?против него ?республиканц?взяли контроль на?2 основным?железнодорожными линиями, ведущими ?столиц? Чжан бы?вынужден отступит?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
