EVT1914_133011413_DESC;On the ninth day of the restoration, Zhang resigned from his appointed positions, retaining only the command of his troops, which were surrounded the capital. The imperial court prepared an edict of resignation to the throne but did not dare to proclaim it. Intimidated by the royalist troops, the administration instead began negotiating to try to prevent the assault of the city with foreign embassies mediating between the parties. The lack of agreement and uncertainty about their future prevented an agreement and a general assault on the positions of the monarchists was announced. Should we proceed with the assault, or accept a ceasefire as historic?;Le neuviиme jour de la restauration, Zhang dйmissionna de ses postes, ne conservant que le commandement de ses troupes qui йtaient encerclйs dans la capitale. La cour impйriale avait prйpar?un йdit de rйsignation au trфne, mais n'avait pas os?le proclamer. Intimid?par les troupes royalistes, l'administration tenta ?la place de nйgocier pour tenter de prйvenir l'attaque de la ville, les ambassades йtrangиres servant de mйdiatrices entre les parties. L'absence d'accord et l'incertitude quant ?l'avenir empкchant un accord, un assaut gйnйral sur les positions monarchistes a йt?annonc? Faut-il procйder ?l'assaut ou d'accepter un cessez-le-feu, comme ce fut historiquement le cas ?;Am 9. Tag der Restauration legte Zhang alle politischen Дmter nieder und konzentrierte sich ganz auf seine in der Hauptstadt eingeschlossenen monarchistischen Truppen. Der imperiale Hof bereitete derweil ein Edikt vor, das den Verzicht auf den Thron beinhaltete, wagte es aber nicht, dieses auch zu verцffentlichen. Eingeschьchtert von den monarchistischen Truppen wurden stattdessen Verhandlungen begonnen, die einen Sturm auf die Stadt verhindern sollten, wobei einige auslдndische Botschaften als Gesprдchsvermittler herangezogen wurden. Mangelnde Ьbereinstimmungen der Positionen und Unsicherheiten ьber die zukьnftige Entwicklung verhinderten allerdings eine schnelle Einigung am Verhandlungstisch. Sollen wir den Angriff auf die Stadt durchfьhren oder, wie historisch geschehen, einem Waffenstillstand zustimmen ?;Dziewi№tego dnia po przywrуceniu cesarstwa, Zhang zrezygnowa?z piastowanych stanowisk, opieraj№c si?jedynie na komendzie podlegіych mu wojsk, dokonuj№c oblкїenia stolicy. Rada cesarska przygotowaіa edykt o rezygnacji z tronu, ale nie waїyіa si?go ogіosi? Czuj№c zagroїenie ze strony wojsk rojalistowskich, administracja miasta zaczкіa z poњrednictwem zagranicznych ambasadorуw negocjowa?z wojskiem. Brak porozumienia miкdzy stronami spowodowa?jednak, їe frontalny atak wydawa?si?jedynym rozwi№zaniem. Czy podtrzymamy rozkaz do ataku, czy zgodnie z histori?przystaniemy na propozycj?zawieszenia broni?;En el noveno dнa de la restauraciуn, Zhang renunci?a sus puestos designados, reteniendo sуlo el comando de sus tropas, que estaban rodeadas en la capital. La corte imperial prepar?un edicto de renuncia al trono pero no se atrevi?a proclamarlo. Intimidada por las tropas realistas, la administraciуn empez?en cambio a negociar para tratar de evitar el asalto de la ciudad, con las embajadas extranjeras mediando entre los partidos. La falta de acuerdo y la incertidumbre sobre su futuro evitaron un arreglo y se anunci?un asalto general sobre las posiciones de los monбrquicos. їDebemos proceder con el asalto, o aceptar un cese del fuego como histуricamente?;Il nono giorno della restaurazione, Zhang si dimise dai suoi incarichi politici, mantenendo solo il comando delle truppe, che erano circondate nella capitale. La corte imperiale perpar?un editto di abdicazione, ma non ebbe il coraggio di proclamarlo. Intimidita dalle truppe realiste, l'amministrazione inizi?a negoziare per cercare di evitare l'assalto della citt? con ambasciate straniere a mediare tra le parti. La mancanza di accordo e l'incertezza per il futuro imped?l'accordo e venne quindi annunciato un assalto generale sulle posizioni dei monar