EVT1914_133011416_DESC;Following the failed restoration, politics in the Beiyang Parliment was dominated heavily by the Anhui and Zhili cliques. An uneasy coalition stayed in effect in the months after, but slowly deteriorated over time.;Aprиs l'йchec de la Restauration, la politique au Parliement de Beiyang fut largement dominйe par les cliques Anhui et Zhili. Une difficile coalition resta en vigueur dans les mois qui suivirent, mais se dйgrada lentement au fil du temps.;Nach der fehlgeschlagenen Restauration wurde die Politik im Parlament von Beiyang von den Cliquen aus Anhui und zhili dominiert. Diese unruhige Koaltion hielt fьr mehrere Monate an, wurde aber von Tag zu Tag brьchiger.;Po nieudanej restauracji monarchii, polityka w parlamencie Beiyang zostaіa silnie zdominowana przez kliki Anhui i Zhili. Nieіatwa koalicja utrzymywaіa si?przez dіugie miesi№ce, ale osi№gniкcie porozumienia stawaіo si?coraz trudniejsze.;Siguiendo a la fallida restauraciуn, la polнtica en el Parlamento de Beiyang fue fuertemente dominada por las camarillas de Anhui y de Zhili. Una precaria coaliciуn se mantuvo en funciones en los meses posteriores, pero lentamente se deterior?con el tiempo.;In seguito alla fallita restaurazione, la politica nel parlamento Beiyang venne dominata pesantemente dall'Anhui e dalla Zhili Clique. Questa strana coalizione resse nei mesi successivi, ma si deterir?lentamente nel corso del tempo.;;;;;;Посл?неудачно?реставраци? политика ?Бэ?нско?парламенте значительн?опреде?лась кликам?Аньхой ?Чжил? Непростая коалиц? держалас??течени?нескольких ме?це?посл?этог? но медленно разваливается ?течением времен?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
