EVT1914_133011500_DESC;On August 25, around 100 original members of parliament convened a conference in Guangzhou and passed the resolution on establishing a military government in Guangzhou to protect the Provisional Constitution as the Anhui clique increasingly became authoritarian. The military government consisted of a generalissimo and three field marshals to exercise the administrative rights of the Republic of China. On September 1, 91 members in the Guangzhou parliament voted, and 84 of them voted Sun Zhongshan as the generalissimo. Then they selected the leaders of the National Protection War Tang Jiyao of the Yunnan clique and Lu Rongting of the Old Guangxi clique as marshals, Wu Tingfang as the Minister of Foreign Affairs, Tang Shaoyi as the Minister of Finance (abstained), Cheng Biguang as the Naval Minister, and Hu Hanmin as the Minister of Communications. Sun Zhongshan was inaugurated on September 10, and appointed Li Liejun as the Chief of Staff, Li Fulin as the Commander of the Guards, Xu Chongzhi as staff officer and Chen Jiongming as the Commander of the First Army.;Le 25 aoыt, environ 100 des membres originaux du parlement convoquиrent une confйrence ?Guangzhou, et adoptиrent une rйsolution йtablissant un gouvernement militaire ?Guangzhou pour protйger la Constitution Provisoire, alors que la clique Anhui devenait de plus en plus autoritaire. Le gouvernement militaire se composait d'un gйnйralissime et de trois marйchaux pour exercer les droits d'administration de la Rйpublique de Chine. Le 1er septembre, 91 membres du parlement de Guangzhou votиrent, 84 d'entre eux se portant sur Sun Zhongshan comme gйnйralissime. Puis, ils sйlectionnиrent les dirigeants de la Guerre Nationale de Protection, Jiyao Tang de la clique du Yunnan et Lu Rongting de la clique du Vieux Guangxi comme marйchaux, Wu Tingfang comme ministre des Affaires йtrangиres, Tang Shaoyi comme ministre des Finances (abstenus), Cheng Biguang comme ministre de la Marine, et Hu Hanmin comme ministre des Communications. Sun Zhongshan fut inaugur?le 10 septembre, et il nomma Li Liejun comme chef d'йtat-major, Li Fulin comme commandant de la Garde, Chongzhi Xu comme chef de cabinet, et Chen Jiongming comme commandant de la Premiиre Armйe.;Eine der auslдndischen Botschaften hat verlauten lassen, da?sich Pu Yi jetzt in ihrer Obhut befindet. Offenbar ist es gelungen, Pu Yi nachts aus der 'verbotenen Stadt' zu schmuggeln. Wir werden ihn nicht mehr fьr seine Verbrechen verantwortlich machen, da wir seine Revolte mittlerweile zerschlagen haben. ;25 sierpnia okoіo 100 pierwotnych czіonkуw parlamentуw zwoіaіo konferencj?w Kantonie i uchwaliіo powstanie w tym mieњcie rz№du wojskowego w celu ochrony Tymczasowej Konstytucji, ktуrej zagraїaіy coraz bardziej autorytarne rz№dy kliki Anhui. Rz№d by?stworzony przez generalissimusa i trzech marszaіkуw polnych, wykonuj№cych zadania administracyjne Republiki Chiсskiej. 1 wrzeњnia 91 czіonkуw parlamentu oddaіo swe gіosy, spoњrуd ktуrych 84 opowiedziaіo si?za mianowaniem Sun Zhongshana na najwyїsze stanowisko. Nastкpnie nast№pi?wybуr liderуw Narodowej Wojny Obronnej, Tanga Jiyao z kliki Junnanu i Lu Rongtinga ze starej kliki Guangxi jako marszaіkуw, Wu Tingfanga jako ministra spraw zagranicznych, Tanga Shaoyi jako ministra finansуw (ust№pi?, Chenga Biguanga jako ministra marynarki wojennej i Hu Hanmina jako ministra komunikacji. Sun Zhongshan zosta?uroczyњcie zainaugurowany 10 wrzeњnia i mianowa?Li Liejuna jako szefa sztabu, Li Fulina jako dowуdc?gwardii, Xu Chongzhiego jako oficera sztabu i Chen Jiongminga jako dowуdc?Pierwszej Armii.;El 25 de agosto, cerca de 100 miembros originales del parlamento convocaron una conferencia en Guangzhou y aprobaron la resoluciуn para establecer un gobierno militar en Guangzhou que protegiese la Constituciуn Provisional, dado que la camarilla de Anhui se volvнa autoritaria. El gobierno militar consistнa en un generalнsimo y tres mariscales de campo para ejercer los derechos administrativos de la Repъblica de China. El 1 de septiembre, 91 miembros del parlamento de Guangzhou votaron, y 84 de ellos votaron por Sun Zhongsgan como generalнsimo. A continuaciуn eligieron a los lнderes de la Guerra de Protecciуn Nacional, Tang Jiyao de la camarilla de Yunnan y Lu Rongting de la Vieja camarilla de Guangxi como mariscales, Wu Tingfang como Ministro de Asuntos Exteriores, Tang Shaoyi como Ministro de Finanzas (abstenciуn), Cheng Biguang como Ministro Naval, y Hu Hanmin como Ministro de Comunicaciones. Sun Zhongshan fue investido el 10 de septiembre, y nombr?a Li Liejun como Jefe del Estado Mayor, Li Fulin como Comandante de los Guardias, Xu Chongzhi como oficial de estado mayor y Chen Jiongming como Comandante del Primer Ejйrcito.;Il 25 agosto, circa 100 membri del parlamento originale convocarono una conferenza a Guangzhou ed approvarono una risoluzione sulla creazione di un governo militare a Guangzhou per proteggere la Costituzione provvisoria, dato che l'Anhui Clique diventava sempre pi?autoritaria. Il governo militare consisteva in un generalissimo e tre marescialli per l'esercizio dei diritti amministrativi della Repubblica di Cina. Il 1 settembre, votarono 91 membri del parlamento di Guangzhou ed 84 di loro scelsero Sun Zhongshan come generalissimo. Poi scelsero i leader della guerra di protezione nazionale Tang Jiyao dello Yunnan e Lu Rongting della Vecchia Guangxi Clique come marescialli, Wu Tingfang come ministro degli Esteri, Tang Shaoyi come ministro delle finanze (astenuto), Cheng Biguang come Ministro della Marina ed Hu Hanmin come ministro delle Comunicazioni. Sun Zhongshan inaugur?il suo mandato il 10 settembre, nominando Li Liejun a capo di stato maggiore, Li Fulin a comandante delle Guardie, Xu Chongzhi a ufficiale di stato maggiore e Chen Jiongming a comandante della Prima Armata.;;;;;;25 август?окол?100 первоначальных членов парламента провел?конференци??Гуанчжоу ?приняли решени??создании военного правительств??Гуанчжоу для защиты Временно