iуn de los otros partidos en en Yuan legislativo. ;Quando la Cricca Anhui dichiar?guerra al governo di Guangzhou guidato da Sun Zhongshan, la Cricca Zhili non sostenne Duan Qirui nella suo tentativo di riunificare il paese. Al contrario, la Cricca Zhili cerc?di mediare una risoluzione pacifica per ottenere la riunificazione. Tuttavia ottenere il mandato per guidare i negoziati di pace richiese molto tempo per convincere gli altri partiti nello Parlamento Yuan.;;;;;;Когд?клик?Аньхой об?вила войн?правительств?Гуанчжоу во глав??Сунь Чжуншане? клик?Чжил?не поддержала Дуан?Цижуя ?ег?стремлении ?воссоединени? Вместо этог? клик?Чжил?пыталась быть  посреднико??поиске мирног?пути для воссоединения. Получени?мандатан?переговоры ?мире, однако, потребуе?некоторого времен??убеждения других партий ?законодательно?Юане.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
