l Partido Revolucionario Chino, que estaba liderado por el gobierno de Guangzhou, tenнa requisitos estrictos de lealtad como juramentos hacia el Jefe de Estado para incrementar la disciplina de partido y prevenir otro fracaso como la segunda revoluciуn. Esta polнtica aument?el descontento y fue derrocado por un grupo liderado por la camarilla Guangxi. Sun Zhongshan fue expulsado del poder y huy?a Shanghai.;La costituzione originale del Partito Rivoluzionario Cinese, che ha guidato il Movimento di Guangzhou, aveva dei requisiti molto severi sulla lealt? tra cui giuramenti a Sun Zhongshan e rilevazione delle impronte digitali in modo da aumentare la disciplina interna del partito e prevenire un altro fallimento come la seconda rivoluzione. Questo politica cre?per?sempre pi?malcontento e fu presto revocata da un gruppo guidato dalla Cricca dello Guangxi. Sun Zhongshan fu perci?estromesso dal potere e fugg?a Shangai.;;;;;;Первоначальн?Китайская революционная парт?, возглавляем? правительствам Гуанчжоу, строго требовал?лояльност? ?виде клятв?Сунь Чжуньшан??снятия отпечатков пальце??це??повышения партийно?дисциплины ?предотвращен? очередного провал? каки?была втор? революция. Эт?требован? част?вызывали недовольство, ?вскоре были отменены группо?во глав??кликой Гуанси. Сунь Чжуньшан?бы?отстране?от власти ?бежа??Шанхай;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
