EVT1914_133011514_DESC;When the Guangxi coup ousted the first Head of State of the Guangzhou, he fled to the Nationalist stronghold of Shanghai. In 1919, he founded the Chinese Nationalist Party and soon returned to Guangdong and re-assumed the role of Head of State.;Lorsque le coup d'йtat Guangxi renversa le premier Chef d'Йtat de Guangzhou, celui-ci fuya vers le bastion nationaliste de Shanghai. En 1919, il fonda le Parti Nationaliste Chinois, et revint rapidement ?Guangdong pour y r?assumer le rфle de Chef de l'Йtat.;Nachdem der Guangxi Coup das erste Staatsoberhaupt der Guangzhou entmachtet hatte, floh es in die Hochburg der Nationalisten, Shanghai. Im Jahre 1919 grьndete er die chinesische nationalistische Partei und kehrte bald darauf als Staatsoberhaupt nach Guangdong zurьck.;Kiedy pucz Guangxi doprowadzi?do obalenia pierwszej gіowy paсstwa w Kantonie, uciek?on do centrum ruchu nacjonalistycznego, Szanghaju. W 1919 r. zaіoїy?tam Chiсsk?Parti?Nacjonalistyczn?i wkrуtce powrуci?do Guangdongu, gdzie ponownie obj№і stanowisko gіowy paсstwa.;Cuando los Guangxi dieron el golpe de Estado, expulsaron al primer Jefe de Estado de los Guangzhou que huy?a Shanghai que era una fortaleza nacionalista. En 1919, fund?el Partido Nacionalista Chino y pronto volvi?a Guangdong y reasumi?el papel de Jefe de Estado.;Quando il colpo di stato della Cricca dello Guangxi estromesse il primo Capo di Stato dello Guangzhou, quest'ultimo fugg?verso la roccaforte nazionalista a Shangai. Nel 1919, egli fond?il Partito Nazionalista Cinese (Kuomintang) e torn?a Guangdong, riprendendosi il ruolo di Capo di Stato.;;;;;;Когд?переворото?Гуанси бы?свергнут первый глав?государств?Гуанчжоу, он бежа??Шанхай, опло?нацоналистов. ?1919 году он основа?китайску?националистическую партию ?вскоре вернул? ?провинци?Гуанду??внов?взя?на се? роль глав?государств?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
