EVT1914_133011517_DESC;The Guangxi-Yunnan War was a conflict between the Chinese Revolutionary Party and Chinese Nationalist Party with that of the Guangxi Clique over which group would have political dominance in the Guangzhou Government.;La guerre Guangxi-Yunnan fut un conflit entre le Parti Rйvolutionnaire Chinois et le Parti Nationaliste Chinois, pour savoir quel groupe dominerait politiquement au sein du gouvernement Guangzhou.;Der Guangxi-Yunnan Krieg wurde gefьhrt zwischen der chinesischen revolutionдren und der chinesischen nationalistischen Partei auf der einen und der Guangxi Clique auf der anderen Seite. Es ging dabei um die Macht in der Guangzhou Regierung.;Wojna Guangxi i Junnanu byіa konfliktem pomiкdzy Chiсsk?Parti?Rewolucyjn?i Chiсsk?Parti?Nacjonalistyczn? a ich odpowiednikami w Klice Guangxi o to, ktуra z grup zdobкdzie dominacj?w rz№dzie kantoсskim.;La guerra Guangxi-Yunnan fue un conflicto entre el Partido Revolucionario Chino y el Partido Nacionalista Chino contra la camarilla Guangxi para dominar el gobierno Guangzhou.;La Guerra Guangxi-Yunnan fu un conflitto tra il Partito Rivoluzionario Cinese e il Partito Nazionalista Cinese da una parte e la Cricca dello Guangxi dall'altra per decidere quale gruppo avrebbe dominato il governo dello Guangzhou.;;;;;;Войн?Гуанду?Юаньнань была конфликтом межд?китайско?революционно?партие??китайско?националистической партие? ?то? которо? из груп?буде?имет?политическое господство ?правительств?Гуанчжоу.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
