EVT1914_133011518_DESC;In 1920, Chen Jiongming drove Lu Rongting and the Old Guangxi clique out of Guangdong, in the First Yue-Gui War. In 1921 Chen pushed into Guangxi, starting the Second Yue-Gui war, forcing Lu Rongting to step down in July 1921. By August, Chen had occupied Nanning and the rest of Guangxi. Chen Jiongming and the Cantonese forces occupied Guangxi until April 1922. Their occupation was largely nominal because armed bands of Guangxi loyalists began to gather under local commanders, calling themselves the Self-government Army.;En 1920, Chen Jiongming йconduit Lu Rongting et la clique du Vieux Guangxi de Guangdong, lors de la Premiиre Guerre Yue Gui. En 1921, Chen pйnйtra dans le Guangxi, commenзant la Seconde guerre Yue Gui, forзant Lu Rongting ?dйmissionner en juillet 1921. En Aoыt, Chen avait occup?Nanning et le reste du Guangxi. Chen Jiongming et les forces cantonaises occupиrent Guangxi jusqu'en avril 1922. Leur occupation йtait largement symbolique, car des bandes armйes de loyalistes Guangxi commencиrent ?se rassembler sous des commandants locaux, se faisant appeler l'Armйe d'auto-dйtermination.;Im ersten Yue-Gui Krieg 1920 vertrieb Chen Jiongming die alte Guangxi Clique unter Lu Rongting aus Guangdong. Ein Jahr spдter,1921, stiess er im zweiten Yue-Gui Krieg nach Guangxi vor und zwang damit Lu Rongting im Juli 1921 zum Rьcktritt. Im August besetzte er dann Nanning und dne Rest von Guangxi. Die Besetzung dauerte bis zum April 1922 an, war aber grцsstenteils rein formaler Natur, da sich Guangxi Loyalisten unter lokalen Kommandeuren als bewaffnete Banden zusammenfanden und sich unter dem Namen 'Selbstregierungsarmee' zum Widerstand formierten.;W 1920 r. Chen Jiongming wypar?Lu Rongtinga i Star?Klik?Guangxi z Guangdongu w ramach Pierwszej Wojny Yue-Gui. W 1921 r. Chen kontynuowa?kampani?na terenach Guangxi, daj№c pocz№tek Drugiej Wojnie Yue-Gui i zmuszaj№c Lu Rongtinga do ust№pienia w lipcu 1921 r. Do sierpnia Chenowi udaіo si?zaj№c Nanning i reszt?Guangxi. Chen Jiongming i siіy kantoсskie okupowaіy Guangxi do kwietnia 1922 r. Ich okupacja byіa w duїej mierze symboliczna poniewa?uzbrojone bandy lojalistуw Guangxi zaczкіy si?zbiera?prowadzone przez lokalnych dowуdcуw, nazywaj№cych samych siebie Armi?Samorz№dow?;En 1920, Chen Jiongming llev?a Lu Rongting y a la antigua camarilla Guangxi fuera de Guangdong, en la primera guerra Yue-Gui. En 1921, Chen embisti?en Guangxi, empezando la segunda guerra Yue-Gui, forzando a Lu Rongting a ceder el puesto en julio de 1921. En agosto, Chen habнa ocupado Nanning y el resto de Guangxi. Chen Jiongming y las fuerzas cantonesas ocuparon Guangxi hasta abril de 1922. Su ocupaciуn fue larga porque bandas de lealistas Guangxi empezaron a reunirse bajo comandantes locales, llamбndose el ejйrcito del autogobierno.;Nel 1920, Chen Jiongming espulse Lu Rongting e la Vecchia Cricca dello Guangxi fuori da Guangdong, nella prima guerra Yue-Gui. Nel 1921 Chen invase il Guangxi, iniziando la seconda Guerra Yue-Gui, obbligando Lu Rongting a dare le dimissioni nel luglio 1921. In Agosto, Chen occup?Nanning e il resto dello Guangxi. Chen Jiongming e le forze Cantonesi occuparono il Guangxi fino all'Aprile 1922. La loro occupazione fu in gran parte nominale perch?bande armate di lealisti Guangxi iniziarono a raggrupparsi intorno a comandanti locali, dandosi il nome di 'Esercito di autogoverno'.;;;;;;?1920 году Чэнь Цзюнми?выдави?Лу Жунтин??Старую клик?Гуанси из Гуандуна, во время первой войн?Юэ-Гу? ?1921 году Чэнь вторгся ?Гуанси, начиная второю войн?Юэ-Гу? заставив Лу Жунтин?уйти ?отставку ?июле 1921 года. ?август? Чэнь за??Наньни??остальну?част?Гуанси. Чэнь Цзюнми??кантонские войска удерживали Гуанси до апре? 1922 года. Их оккупация была ?основном лишь номинально? потому чт?вооруженны?банд?стороннико?Гуанси начали собирать? по?знамен?местны?командиров, называющих се? армией самоуправлен?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
