EVT1914_133011520_DESC;The Guangxi Clique has won in the South China civil war!;La clique Guangxi a gagn?la guerre civile en Chine du Sud !;Die Guangxi Clique hat den Bьrgerkrieg in Sьdchina gewonnen.;Klika Guangxi wygraіa w wojnie domowej w poіudniowych Chinach!;ЎLa camarilla Guangxi ha ganado la guerra civil en el sur de China!;Il Guangxi vince la guerra civile nel Cina del Sud!;;;;;;Клик?Гуанси победила ?гражданско?войн?Южного Китая!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_133011523_DESC;Following the establishment of a rival government in Guangzhou and recent instability of the Beiyang government, the warlords of the Hunan Clique have decided to join the Southern Chinese government!;Suite ?la mise en place d'un gouvernement rival ?Guangzhou, et du fait de l'instabilit?rйcente du gouvernement Beiyang, les seigneurs de guerre de la clique du Hunan ont dйcid?de rejoindre le Gouvernement Chinois du Sud !;Wegen der Grьndung der Guangzhou Regierung und der in letzter Zeit instabilen Beiyang Regierung hat sich die Hunan Clique sich entschlossen, sich der sьdchinesischen Regierung anzuschliessen.;Po utworzeniu rywalizuj№cego z naszym rz№du w Kantonie, bior№c pod uwag?ostatni?niestabilnoњж w szeregach rz№du Beiyang, wataїkowie z Kliki Hunan zdecydowali si?przyі№czy?do rz№du poіudniowochiсskiego.;ЎSiguiendo el establecimiento de un gobierno rival en Guangzhou y la reciente inestabilidad del gobierno de Beiyang, los seсores de la guerra de la camarilla Huan han decidido unirse a China del sur!;A seguito della creazione di un governo rivale a Guangzhou e della recente instabilit?del governo di Beiyang, i signori della guerra della Cricca dello Hunan hanno deciso di entrare nel governo del Sud!;;;;;;Посл?создан? соперничающего правительств??Гуанчжоу ?учитыв? недавнюю нестабильность бэ?нского правительств? милитарист?клик?Хунань решили присоединить? ?правительств?Южного Китая!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_133011600_DESC;Foreign embassies in Beijing have made an offer regarding aid against their enemy in the current war. They understand that we are currently in a period of civil instability and do not expect us to contribute military aid. Instead, they ask that thousands of Chinese workers be sent abroad to sustain their war industry. In return, they are offering the return of sovereignty over Shangdong.;Les ambassades йtrangиres ?Beijing nous ont fait une offre en matiиre d'aide dans leur guerre contre leurs ennemis. Ils comprennent que nous soyons actuellement dans une pйriode d'instabilit?civile, et ne compte pas sur nous pour leur apporter une aide militaire. Au lieu de cela, ils demandent que des milliers de travailleurs chinois soient envoyйs ?l'йtranger pour soutenir leur industrie de guerre. En йchange, ils offrent le retour de la souverainet?sur Shangdong.;Auslдndische Botschaften in Peking haben uns ein Angebot bezьglich Hilfe gegen ihre Feinde im gegenwдrtigen Krieg gemacht. Sie verstehen, da?wir uns in einer politisch instabilen Lage befinden und erwarten keine militдrische Unterstьtzung. Sie erbitten nur die Unterstьtzung einiger tausend Arbeiter fьr die Arbeit in ihren Fabriken. Im Gegenzug bieten sie uns die Souverдnitдt ьber Shangdong.;Zagraniczne ambasady w Pekinie zіoїyіy ofert?dotycz№c?pomocy przeciwko ich wrogom w trwaj№cej obecnie wojnie. Wszyscy rozumiej? їe znajdujemy si?aktualnie w okresie wewnкtrznej niestabilnoњci i nie oczekuj? їe udzielimy bezpoњredniej pomocy wojskowej. Oczekuj?natomiast, їe chiсscy robotnicy zostan?wysіani za granic?w celu wsparcia ich przemysіu wojskowego. W zamian za to oferuj?nam zwrot Shangdongu.;Las embajadas extranjeras en Pekнn han hecho una oferta para ayudarles contra el enemigo. Entienden que estamos en un periуdo de inestabilidad civil y no esperan que contribuyamos con ayuda militar. Piden que trabajadores chinos sean enviados al extranjero para mantener la industria de guerra. A cambio nos devuelven la soberanнa de Shangdong;Ambasciate straniere a Pechino hanno fatto un'offerta chiedendo il nostro aiuto nella loro guerra. Loro comprendono che siamo attualmente in un periodo di instabilit?civile e non si aspettano un nostro contributo militare. Invece di questo, chiedono che migliaia di lavoratori Cinesi vengano mandati all'estero per sostenere le loro industrie. In cambio, ci offrono il ritorno della nostra sovranit?sullo Shangdong.;;;;;;Иностранны?посольства ?Пекине предложени?касательно помощи против своего враг??текуще?войн? Он?понимают, чт?мы находимся ?период?гражданско?нестабильности, ?не ожидаю?от на?участия своими вооруженными силами. Вместо этог?он?предлагают, чт?ты?чи китайски?рабочи?буду?отправлены за границ?для поддержания свое?военно?промышленности. ?свою очеред? он?предлагают возвращени?суверенитета на?Шаньду?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_133011601_DESC;The May Fourth Movement was an anti-imperialist cultural and political movement. It started with student demonstrations in Beijing on May 4,1919, protesting the Chinese government's weak response to the Treaty of Versailles, especially the Shandong Problem. It quickly escalated across the nation in strikes and protests which threatened to crash the entire economy. Unfortunately, there was little the government historically could have achieved in the short run to soothe the protesters.;Le Mouvement du Quatre Mai йtait un mouvement anti-impйrialiste, culturel et politique. Il commenзa par des manifestations d'йtudiants ?Pйkin, le 4 mai 1919, pour protester contre la faible rйaction du gouvernement chinois au trait?de Versailles, en particulier le problиme de Shandong. Il dйgйnйra rapidement dans tout le pays, par des grиves et des manifestations qui menacиrent d'effondrement toute l'йconomie. Malheureusement, il n'y avait guиre de chose que le gouvernement aurait pu historiquement rйaliser dans le court terme pour calmer les manifestants.;Die 'Bewegung des 4. Mai' war eine anti-imperialistische, kulturelle und politische. Sie begann mit Studentenunruhen am 4. Mai 1919 in Peking, bei denen gegen die unbefriedigende Reaktion der chinesischen Regierung auf den Vertrag von Versialles, speziell die Regelung der Shangdong-Frage, protestiert wurde. Die Unruhen verbreiteten sich schnell in Form von Streiks und Demonstrationen ьber das ganze Land und drohten die Wirtschaft zum Zusammenbruch zu bringen. Es gab allerdings nichts, was die Regierung kurzfristig hдtte unternehmen kцnnen, um die Wogen zu glдtten.;Ruch 4 Maja by?antyimperialistycznym ruchem kulturalnym i politycznym. Jego pocz№tkiem byіy demonstracje studenckie w Pekinie 4 maja 1919 r., sprzeciwiaj№ce si?sіabej reakcji chiсskiego rz№du w stosunku do postanowie?Traktatu Wersalskiego, w szczegуlnoњci wobec Problemu Shangdongu. Szybko przerodziіy si?one w strajki i protesty na terenie caіego kraju, ktуre zagroziіy gospodarce w skali paсstwa. Niestety, rz№d w krуtkim okresie czasu nie dysponowa?їadnymi њrodkami, ktуre mogіyby zadoњжuczyni?ї№daniom protestuj№cych.;El Movimiento del Cuatro de Mayo fue un movimiento cultural y polнtico anti-imperialista. Empez?con manifestaciones estudiantiles en Pekнn el 4 de mayo de 1919, protestando por la dйbil respuesta del gobierno chino al Tratado de Versalles, especialmente con el problema Shangdong. Rбpidamente se sucedieron huelgas a lo largo de toda la naciуn que amenazaban la economнa. Histуricamente, habнan pocas posibilidades de que el gobierno pudiese sofocar las protestas en un corto plazo.;Il Movimento del Quattro Maggio fu un movimento politico e culturale anti-imperialista. Nacque dalle dimostrazioni di studenti a Pechino il 4 maggio 1919 che protestavano contro la debole risposta del governo cinese al Trattato di Versailles, in particolare al problema dello Shangdong. Le proteste si diffusero presto in tutto il paese tramite scioperi e rivolte che minacciarono di affondare l'economia. Sfortunatamente, il governo non avrebbe comunque potuto ottenere molto in tempi brevi per calmare i rivoltosi.;;;;;;Движение Четвертого мая было антиимпериалистическим культурным ?политическим движение? Вс?началось ?демонстрации студенто??Пекине 4 мая 1919 года, протестующих против слабой реакция китайского правительств?по поводу Версальского договора, ?частност? по проблеме Шаньду? Он?быстро превратилось ?забастовки ?протесты по всей стране , которы?угрожают крахом всей экономик? ?сожалени? мало чт?правительств?историческ?могл?добить? ?краткосрочно?перспектив? чтоб?успокоит?протестующих.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
