EVT1914_133011603_DESC;With the end of Yuan Shikai's Great Chinese Empire, divisions within the various factions in the opposition led to the end of the National Protection Alliance. A hardline faction of the Nationalist Party, the Constitutional Protection Party, retreated to Guangdong forming the Constitutional Protection Movement (CPM). Central provinces on the other hand rejoined the central government of Beijing. Cai E, the leader of the rebellion, returned to his home province of Yunnan.;Avec la fin du Grand Empire Chinois de Yuan Shikai, les divisions au sein des diffйrentes factions de l'opposition conduisit ?la fin de l'Alliance de Protection Nationale. Une faction extrйmiste du Parti de Protection Constitutionnelle du Parti Nationaliste se retira ?Guangdong, tandis que les provinces centrales rejoignirent le gouvernement central de Pйkin. Cai E, le chef de la rйbellion, retourna dans sa province natale du Yunnan.;Mit dem Ende von Yuan Shikai's chinesischem Reich zerfiel auch die 'National Protection Alliance'. Die Hardliner der nationalistischen Partei, die 'Constitutional Protection Party', zog sich nach Guangdong zurьck und bildete dort die 'Constitutional Protection Movement', kurz CPM. Auf der anderen Seite wiederum schlossen sich einige Provinzen in Zentralchina Peking an. Cai E, der Anfьhrer der Rebellion, kehrte in seine Heimatprovinz Yunnan zurьck.;Wraz z koсcem Wielkiego Cesarstwa Chiсskiego Yuana Shikai'a, podziaіy wewn№trz rуїnych frakcji opozycyjnych doprowadziіy do upadku Sojuszu Ochrony Narodu. Frakcja radykaіуw wewn№trz Partii Nacjonalistycznej i Partii Ochrony Konstytucji uciekіy do Kantonu, tworz№c tam Ruch Ochrony Konstytucji. Prowincje centralne Chin przyі№czyіy si?z powrotem do obszarуw kontrolowanych przez rz№d centralny w Pekinie. Cai E, przywуdca rebelii, powrуci?do swej ojczystej prowincji, Junnanu.;Con el fin del Gran Imperio Chino de Yuan Shikai, hubo divisiones dentro de varias facciones de la oposiciуn que llevaron al fin de la Alianza de Protecciуn Nacional. Una lнnea dura del Partido de Protecciуn de la Constituciуn una facciуn del Partido Nacionalista, se retir?a Guangdong mientras que las provincias centrales se unieron al gobierno central de Pekнn. Cai E, lнder de la rebeliуn, regres?a un provincia natal, Yunnan.;Con la fine del Grande Impero Cinese di Yuan Shikai, le divisioni interne tra le varie fazioni portarono alla fine dell'Alleanza di Protezione Nazionale. Un intransigente fazione del Partito Nazionalista, il Partito per la Protezione della Costituzione, si ritir?a Guangdon formando il Movimento di Protezione Costituzionale. Le province centrali invece tornarono a far parte del governo centrale di Pechino. Cai E, il leader della rivolta, torn?a casa sua nello Yunnan.;;;;;;?окончанием Велико?китайско?импери?Юань Шикая, противореч? ?рамках различны?оппозиционны?фракци?привел??конц?Национальног?союз?защиты. Парт? по защите Конституци? радикальная фракция националистической партии, отступилак ?провинци?Гуанду? ?то время ка?центральны?провинци?присоединились ?центральному правительств??Пекине. Ца?? лиде?восстания, вернул? ?свою родную провинци?Юньнан?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
