EVT1914_133011610_DESC;China was promised the return of concessions in Shangdong in return for participation in the Great War. After the war, however, foreign occupation of Shangdong continued. This became a major political issue in China after the Treaty of Versailles, inspiring the May Fourth Movement which had a crippling impact on the Chinese economy and government.;Il fut promis ?la Chine le retour des concessions de Shangdong en йchange de sa participation ?la Grande Guerre. Aprиs la guerre, toutefois, l'occupation йtrangиre de Shangdong continua. Cela est devint un enjeu politique majeur en Chine aprиs le trait?de Versailles, inspirant le Mouvement du Quatre Mai qui eut un impact dйvastateur sur l'йconomie chinoise et sur le gouvernement.;China wurde die Rьckgabe Shangdong's versprochen, wenn es auf Seiten der Entente in den Krieg eintrдte. Nach dem Krieg allerdings hielt die Fremdherrschaft in Shangdong an. Dieses nicht gehakltene Versprechen der Entente fьhrte zu grossen politischen Unruhen in china und war Grundlage fьr die Grьndung der 'Bewegung des 4. Mai', die mit ihren Protestaktionen sowohl Regierung als auch Wirtschaft stark schwдchten.;Chinom w czasie wojny obiecano zwrot koncesji w Shangdongu w zamian za wsparcie okazane w okresie walk. Po wojnie jednak zagraniczna okupacja Shangdongu byіa kontynuowana. Staіo si?to kluczow?kwesti?chiсskiej polityki po Traktacie Wersalskim, ktуra zainspirowaіa Ruch 4 Maja, ktуry mia?niszcz№cy wpіyw na stabilnoњж i dobrobyt Chin.;A China se le prometi?que se le devolverнa Shangdong por la participaciуn en la Gran Guerra. Pero despuйs de la guerra, la ocupaciуn extranjera continuaba. Esto se convirti?en uno de los problemas principales en China despuйs del Tratado de Versalles, inspirando al Movimiento del Cuatro de Mayo lo que tuvo un gran impacto para la economнa y el gobierno chino.;Alla Cina era stata promessa la restituzione delle concessioni nello Shangdong in cambio della partecipazione alla Grande Guerra. Dopo la fine del conflitto, tuttavia, l'occupazione straniera dello Shangdon continu? Questo divenne un importante problema politico in Cina dopo il Trattato di Versailles, ispirando il Movimento del Quattro Maggio che ebbe un devastante impatto sull'economia e sul governo cinesi.;;;;;;Кита?было обещан?возвращени?концесси??Шаньдуне ?обме?на участи??Первой Мирово? Посл?войн? однако, иностранная оккупация продолжилась. Эт?стал?главно?политической проблемо??Кита?посл?Версальского соглашение, вдохновляя движение Четвертого мая, которо?было сокрушительным ударом по китайско?экономик??правительств?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
