EVT1914_133011611_DESC;May Fourth Protests have finally begun to die down. A small group of protesters remain, but it seems as if people are slowly returning back to their daily lives.;Les Protestations du Quatre Mai ont enfin commenc??se calmer. Un petit groupe de manifestants reste, mais il semble que les gens soient en train de retourner ?leur vie quotidienne.;Die 'Bewegung des 4. Mai' wird langsam schwдcher. Es verbleiben zwar noch einige Protestler, aber der GroЯteil der Bevцlkerung ist zu seinem tдglichen Leben zurьckgekehrt.;Protesty 4 Maja w koсcu zaczкіy zamiera? Maіe grupy protestuj№cych pojawiaj?si?jeszcze tu i уwdzie, ale wydaje si?їe wiкkszoњж ludzi powrуciіa ju?do ich codziennych obowi№zkуw.;Las protestas del Cuatro de Mayo han empezado a calmarse. Queda un pequeсo grupo de manifestantes, pero parece que la gente est?volviendo a su vida diaria.;Le proteste del Quattro Maggio stanno finalmente calando. Un piccolo gruppo di contestatori ?ancora attivo, ma sembra che il popolo stia lentamente tornando alla sua normale quotidinit?;;;;;;Протесты Четвертого мая наконе?начали утихат? Остает? небольшая группа протестующих, но кажется, люди постепенно возвращают? обратн??повседневной жизн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
