EVT1914_133011613_DESC;Historically, Beiyang China joined the T. Entente but did not contribute greatly in terms of military force. Rather, in exchange for non military aid (such as workers to fill France's industries), the Beiyang Chinese authority was promised the return of Shangdong concessions. Should we ask our embassy in Beijing to begin negotiations for China's entry on our side of the war?;Historiquement, la Chine de Beiyang adhйra ?la Triple Entente, mais ne contribua pas beaucoup en terme de force militaire. Au contraire, en йchange d'une aide non-militaire (comme des travailleurs pour remplir les industries en France), l'autorit?de Beiyang promit le retour des concessions Shangdong. Devrions-nous demander ?notre ambassade ?Beijing d'entamer des nйgociations pour faire entrer la Chine en guerre de notre cфt??;Die Beiyang Regierung trat zwar der Entente bei, leistete aber keinen grossen militдrischen Beitrag zum Krieg. Stattdessen beschrдnkte sie sich auf die Unterstьtzung der Franzosen, indem sie Arbeitskrдfte und Rohstoffe fьr deren Industrie bereitstellten, um dafьr die Konzessionen ьber Shangdong zurьckzuerhalten. Sollen wir unsere Botschaft in Peking bitten, ьber einen chinesischen Kriegseintritt zu verhandeln ?;Historycznie, Chiny Beiyang doі№czyіy do Trуjporozumienia, ale nie przysіuїyіy mu si?militarnie w duїym stopniu. Raczej, w zamian za innego rodzaju pomoc (jak wysіanie robotnikуw w celu zapeіnienia francuskich fabryk), rz№d Beiyang otrzyma?przyrzeczenie zwrotu koncesji w Shangdongu. Czy powinniњmy poprosi?nasz?ambasad?w Pekinie, aby rozpoczкіa negocjacje ukierunkowane na udzia?Chin w wojnie po naszej stronie?;Histуricamente, Beiyang se uni?a la T. Entente pero no contribuy?con fuerzas militares. A cambio de su ayuda (como trabajadores para llenar las fбbricas de Francia), se le prometi?a la autoridad de Beiyang que se le devolverнan las concesiones de Shangdong. їDeberнamos pedir a nuestra embajada en Pekнn empezar negociaciones para que China entre en la guerra a nuestro lado?;Storicamente, la Cina di Beiyang entr?nella Triplice Intesa ma non contribu?particolarmente dal punto di vista militare. Piuttosto, in cambio di aiuti non militari (come lavoratori per riempire le fabbriche francesi), all'autorit?di Beitang fu promesso il ritorno della concessione di Shangdong. Dobbiamo chiedere alla nostra ambasciata a Pechino di iniziare i negoziati per portare la Cina dalla nostra parte del conflitto?;;;;;;Историческ?сложилос?та? Бэ?нски?Кита?присоединился ?Антант? но не ?значительной степен??точк?зрен? вооруженны?си? Скорее, речь шл??на невоенно?помощи (например, ?рабочи? чтоб?заполнит?нужд?промышленности Франци?. Бэ?нски?китайски?влас??обещал?возвращени?концесси?Шаньду? Должны ли мы просит?наше посольство ?Пекине начать переговоры по вступлению Китая ?войн?на наше?сторон?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
