iosi, sono disposti a mandarci lavoratori cinesi per sostituire lavoratori tedeschi che potrebbero essere cos?mandati al fronte. Inoltre, ci offrono le concessioni che attualmente sono possedute dalla Triplice Intesa.;;;;;;Соперник?китайского правительств?предложили на?секретны?герман?китайски?пакт. ?обме?на технологическу?помоўў против бэ?нско?власти ?обещаний военно?помощи, ка?только мы одержи?победу, он?готовы ?отправке рабочи??нашу страну для того, чтоб?освободить люде?для войн? ?такж?передать вс?текущи?торговые концесси? принадлежащи?Антант?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
