EVT1914_133011623_DESC;The Beiyang authority in China was promised the return of concessions in Shangdong following its support of the Entente in the Pacific theater. At the same time, Japan was also promised these concessions by the United Kingdom. As Japan contributed more toward the Entente and had greater influence, historically it was awarded these territories which led to the Chinese Delegation's refusal to sign the treaty.;Les autoritйs de Beiyang en Chine reзurent la promesse du retour des concessions de Shangdong suite ?leur support de l'Entente dans le thйвtre du Pacifique. Dans le mкme temps, le Japon reзut йgalement la promesse de ces concessions par le Royaume-Uni. Comme le Japon contribua davantage ?l'Entente, et qu'il avait plus d'influence, il reзut historiquement ces territoires, ce qui conduisit au refus par la dйlйgation chinoise de signer le trait?;Der Beiyang Regierung wurde die Rьckgabe der Konzessionen ьber Shangdong zugesagt, wenn sie sich am Kampf der Entente im Pazifik beteiligt. Zur selben Zeit wurde Japan exakt das gleiche zugesagt. Da Japan aber mehr zum Kriegsverlauf beigetragen hatte und diplomatisch mehr Gewicht besass, bekam es diese Konzessionen zugesprochen. Die Beiyang Delegation verweigerte daraufhin den Beitritt zur Entente;Wіadze Beiyangu w Chinach otrzymaіy obietnic?uzyskania wpіywуw w Shandongu w wyniku udzielenia pomocy Entencie na pacyficznym teatrze dziaіa? Rуwnoczeњnie Japonia rуwnie?otrzymaіa podobne obietnice ze strony Wielkiej Brytanii. Poniewa?strona japoсska bardziej przysіuїyіa si?zwyciкstwu oraz miaіa wiкksze wpіywy w regionie, ostatecznie wspomniane terytoria historycznie zostaіy przyznane Japonii, co doprowadziіo do odrzucenia propozycji traktatu pokojowego przez chiсsk?delegacj?;A la autoridad de Beiyang en China se le prometi?la devoluciуn de concesiones en Shangdong despuйs de su apoyo a la Entente en el teatro del Pacнfico. Al mismo tiempo, a Japуn tambiйn se le prometieron estas concesiones por parte del Reino Unido. Como Japуn contribuy?mбs a la Entente y tenнa mayor influencia, histуricamente se le concedieron estos territorios, lo que llev?a que la delegaciуn china rehusara firmar el tratado.;All'autorit?di Beiyang in Cina fu promesso il ritorno delle concessioni di Shangdong in cambio del suo appoggio all'Intesa nel teatro del Pacifico. Allo stesso modo, queste concessioni furono promesse anche al Giappone da parte del Regno Unito. Dato che il Giappone contribu?di pi?allo sforzo bellico dell'Intesa ed ebbe una maggiore influenza, storicamente venne premiato con questi territori, questo port?al rifiuto della delegazione cinese a firmare il trattato.;;;;;;Бэ?нски?влас???Кита?было обещан?возвращени?концесси??Шаньдуне пр?поддержк?Антант?на Тихоокеанско?театре. ?эт?же время Англ? такж?пообщела эт?концесси?Японии. Поскольк?Япон? сделал?больше для Антант??имел?больше?вл?ни? историческ?именно он?была удостоен?этих территорий, чт?привел??отказу китайско?делегаци?подписат?догово?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
