nes por parte del Reino Unido. Como Japуn contribuy?mбs a la Entente y tenнa mayor influencia, histуricamente se le concedieron estos territorios, lo que llev?a que la delegaciуn china rehusara firmar el tratado.;All'autorit?di alternativa in Cina fu promesso il ritorno delle concessioni di Shangdong in cambio del suo appoggio all'Intesa nel teatro del Pacifico. Allo stesso modo, queste concessioni furono promesse anche al Giappone da parte del Regno Unito. Dato che il Giappone contribu?di pi?allo sforzo bellico dell'Intesa ed ebbe una maggiore influenza, storicamente venne premiato con questi territori;;;;;;Альтернативным влас???Кита?было обещан?возвращени?концесси??Шаньдуне пр?поддержк?Антант?на Тихоокеанско?театре. ?эт?же время Англ? такж?пообщела эт?концесси?Японии. Поскольк?Япон? сделал?больше для Антант??имел?больше?вл?ни? историческ?именно он?была удостоен?этих территорий, чт?привел??отказу китайско?делегаци?подписат?догово?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
