EVT1914_133011626_DESC;Due to nationalistic tensions within the Beiyang territories, their observing delegates to the Versailles treaty has stepped forward with numerous proposals for mutual benefit. They seek the return of concessions in Shangdong. In return, they offer us extended leases on former British and Portugal territory in the port cities of Aomen and Xianggang, rights to preferential treatment in the coastal cities, and leases on Port Arthur if we ally with them against Japan and Russia. Lastly, we can return de jure control of the territories to Beiyang as a sign of goodwill while remaining de facto in control of the economies there. Of course, we can always rebuke their proposals and keep Shangdong, possibly seizing the southern port cities for ourselves.;En raison de tensions nationalistes au sein des territoires de Beiyang, leurs dйlйguйs d'observation au sein du Trait?de Versailles sont intervenus avec de nombreuses propositions pour un bйnйfice mutuel. Ils veulent le retour des concessions de Shangdong. En retour, ils nous offrent des baux de longues durйes, sur les territoires anciennement britannique et portugais, dans les villes portuaires de Aomen et de Xianggang, des droits ?un traitement prйfйrentiel dans les villes cфtiиres, et des baux ?Port Arthur si nous nous allions avec eux contre le Japon et la Russie. Enfin, nous pouvons retourner le contrфle de jure de ces territoires ?Beiyang comme signe de bonne volont? tout en gardant de facto le contrфle йconomique de ces zones. Bien sыr, nous pouvons toujours rйpousser leurs propositions, garder Shangdong, et йventuellement saisir les villes portuaires du sud pour nous-mкmes.;Durch nationalistische Spannungen innerhalb der Beiyang Territorien motiviert kamen deren Delegierte wдhrend der Friedensverhandlungen von Versailles mit Vorschlдgen zu beiderseitigem Nutzen auf uns zu. Sie ersuchen um die Rьckgabe der Konzessionen fьr Shandong und bieten uns im Gegenzug die Verpachtung der ehemaligen britischen und portugiesischen Basen in den Stдdten Aomen und Xianggan an. Desweiteren gewдhren sie uns besondere Rechte in den Kьstenstдdten, insbesondere Port Arthur, wenn wir mit ihnen ein Bьndnis gegen Russland und Japan eingehen. Zumindest kцnnten wir als Zeichen des guten Willens die Konzessionen de jure zurьckgeben, wдhrend wir de facto nach wie vor die Kontrolle ьber die Wirtschaft dort behalten. Alternativ kцnnen wir natьrlich auch die Konzessionen behalten und die in Frage kommenden Stьtzpunkte einfach besetzen.;Z uwagi na napiкcia nacjonalistyczne na terytoriach Beiyangu, ich obserwatorzy wysіani na obrady traktatu wersalskiego zaczкli artykuіowa?rozmaite propozycje ukierunkowane na wspуlne dobro. Pragn?oni uzyskania kontroli nad Shandongiem. W zamian, s?gotowi udzieli?szeroko zakrojonych uprawnie?na wiele lat, w terytoriach bкd№cych wczeњniej koloniami Wielkiej Brytanii i Portugalii. Dotyczyіo to portowych miast Aomen i Xianggang, oraz Portu Arthur, o ile jesteњmy w sojuszu przeciwko Japonii i Rosji. Wreszcie, moїemy przekaza?formaln?kontrol?Beiyangowi, jako gest dobrej woli, pozostawiaj№c tam nasze wpіywy biznesowe. Oczywiњcie, zawsze pozostaje moїliwoњж odrzucenia wszelkich propozycji i pozostania w Shandongu na dobre, pozostawiaj№c przy tym dla siebie poіudniowe miasta portowe.;Debido a tensiones nacionalistas dentro de los territorios de Beiyang, sus delegados observadores en el Tratado de Versalles han ofrecido varias propuestas para beneficio mutuo. Buscan la devoluciуn de concesiones en Shangdong. A cambio, nos ofrecen arrendamientos extendidos de territorio anteriormente britбnico y portuguйs en las ciudades puerto de Aomen y Xianggang, derechos a tratamiento preferencial en las ciudades costeras, y arrendamientos en Port Arthur si nos aliamos a ellos en contra de Japуn y Rusia. Por ъltimo, podemos devolver el control de jure de los territorios a Beiyang como un signo de buena voluntad, mientras permanecemos de facto controlando las economнas all? Por supuesto, siempre podemos reprocharlos por sus propuestas y quedarnos con Shangdong, tomando posiblemente las ciudades portuarias del sur para nosotros mismos.;A causa di tensioni nazionalistiche nei territori Beiyang, i delegati osservatori al trattato di Versailles hanno fatto un passo avanti con numerose proposte di reciproco vantaggio. Cercano il ritorno delle concessioni di Shangdong. In cambio, ci offrono contratti d'affitto estesi sui territori ex britannici e ed ex portoghesi nelle citt?portuali di Aomen e Xianggang, diritti al trattamento preferenziale nelle citt?costiere, ed affitti a Port Arthur, se ci alleiamo con loro contro il Giappone e la Russia. Infine, dovremo restituire il controllo de jure dei territori a Beiyang come segno di buona volont? pur rimanendo di fatto controllori dell'economia. Naturalmente, possiamo sempre rigettare le loro proposte e mantenere Shangdong, magari porendendo anche le citt?portuali del sud per noi.;;;;;;?связи ?межнационально?напряженность?на бэ?нски?территор?? их делегаты-наблюдател?Версальского соглашен? выступил??многочисленным?предложениями для взаимной выгоды. Он?добивают? возвращения концесси??Шаньдуне. ?свою очеред? он?предлагают на?расширенну?аренду бывших британских ?португальски?территорий ?портовых города?Аомэнь ??нган, прав?на льготное исползование прибрежных городо??аренду Порт-Артура, если мы заключим ?ними союз против Японии ?России. Наконе? мы може?вернут?де-юр?контроль на?территор?ми ?Бэ?не ?качестве знак?доброй воли, сохраняя пр?этом де-факт?существующий контроль на?экономикой. Конечн? мы всегда може?отвергнуть их предложения ?сохранит?Шаньду? возможно, захватив южны?портовые городадля се?.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
