EVT1914_133011629_DESC;Reports of protests in China have filtered out of our embassy there. It seems the people are protesting Chinese concessions awarded to the victorious powers of the Great War. Should we intervene and put diplomatic pressure for the peaceful resolution of this issue?;Des rapports sur les protestations en Chine ont filtr?de notre ambassade l?bas. Il semble que les gens protestent au sujet des concessions chinoises attribuйes aux puissances victorieuses de la Grande Guerre. Faut-il intervenir et exercer une pression diplomatique pour rйsoudre pacifiquement ce problиme ?;Unserer Botschaft wurden Berichte ьber chinesische Protestaktionen zugespielt. Es scheint, da?sich der Unmut gegen die chinesischen Konzessionen an die Sieger des grossen Krieges richtet. Sollen wir eingreifen und diplomatischen Druck aufbauen , um diese Angelegenheit friedlich beizulegen ?;Wieњci o protestach w Chinach wydostaіy si?poprzez nasz?ambasad? Wydaje si? їe protesty dotycz?faktu, їe chiсskie koncesje przypadіy krajom zwyciкskim w Wielkiej Wojnie. Czy powinniњmy interweniowa?i wywrze?nacisk dyplomatyczny w celu uzyskania pokojowego rozwi№zania tej sprawy?;Informes de protestas en China han sido filtrados en nuestra embajada. Parece que la gente est?protestando por las concesiones chinas dadas a las potencias victoriosas de la Gran Guerra. їDeberнamos intervenir y poner presiуn diplomбtica para llegar a una soluciуn pacнfica?;Rapporti sulle proteste in Cina sono giunti alla nostra ambasciata locale. Sembra che il popolo stia protestando contro il fatto che le concessioni cinesi siano state affidate ai vincitori della Grande Guerra. Dobbiamo intervenire e fornire una pressione diplomatica per una risoluzione pacifica di questo problema?;;;;;;Из нашего посольства ?Кита?поступаю?доклад??протеста??стране. Кажется, чт?наро?протестует, чт?китайски?концесси?присуждены державам-победительница?Первой мирово?войн? Должны ли мы вмешаться ?применит?дипломатическо?давление для мирног?р