EVT1914_133011800_DESC;The second revolution led by the KMT ended before it really even started. Southern provinces loyal to the KMT cause did not heed the call for revolt. Only a small group of loyalists in Shanghai commanded by Huang Xing, Chen Qimei, and Bai Wenwei rose up. They were quickly crushed by forces loyal to the central government. Unfortunately, most of Sun Zhongshan's followers have fled overseas to Japan where they continue to support opposition to our government.;La deuxiиme rйvolution dirigйe par le KMT se termina avant mкme d'avoir vraiment commenc? Les provinces du sud fidиles ?la cause du KMT n'ont pas tenu compte de l'appel ?la rйvolte. Seul un petit groupe de loyalistes ?Shanghai, command?par Huang Xing Chen et Qimei Bai Wenwei se rйvoltиrent. Ils furent rapidement йcrasйs par les forces fidиles au gouvernement central. Malheureusement, la plupart des disciples de Sun Zhongshan ont fui ?l'йtranger, au Japon, d'o?ils continuent ?soutenir l'opposition au gouvernement.;Die zweite Revolution, angefьhrt von der KMT, war vorbei, noch bevor sie so recht begonnen hatte. Die sьdlichen Provinzen, die eigentlich der KMT gegenьber loyal waren, folgten dem Aufruf zur Revolution nicht. Nur eine kleine Gruppe in Shanghai unter Huang Xing, Chen Qimei und Bai Wenwei erhob sich, wurde aber schnell von Truppen der Zentralregierung zerschlagen. Unglьcklicherweise konnte die meisten Gefolgsleute Sun Zhongshan's nach Japan fliehen, von wo aus sie den Kampf fortsetzen werden.;Druga rewolucja prowadzona przez KMT zakoсczyіa si? zanim si?na dobre rozpoczкіa. Poіudniowe prowincje, lojalne wobec KMT, nie pod№їyіy za wezwaniem do rebelii. Tylko maіa grupa lojalistуw z Szanghaju, dowodzona przez Huang Xinga, Chen Qimei'a, and Bai Wenwei'a, zdecydowaіa si?na dziaіanie. Szybko zostaіa ona jednak pokonana przez siіy lojalne wobec rz№du centralnego. Niestety, wiкkszoњж zwolennikуw Sun Zhongshana uciekіa do Japonii, gdzie kontynuowaіa dziaіania opozycyjne wobec naszego rz№du.;La segunda revoluciуn liderada por el KMT termin?incluso antes de empezar. Las provincias del sur leales a la causa del KMT no hicieron caso a las revueltas. Solo un pequeсo grupo de lealistas en Shanghai comandados por Huang Xing, Chen Qimei y Bai Wenwei se levantaron. Fueron rбpidamente aplastados por las fuerzas leales al gobierno central. Desafortunadamente, la mayorнa de los seguidores de Sun Zhongsan han huido a Japуn donde siguen apoyando a la oposiciуn de nuestro gobierno.;La seconda rivoluzione guidata dal Kuomintang (KMT) si ?conclusa prima di essere davvero iniziata. Le province del sud leali alla causa del KMT non hanno risposto alla sua richiesta di ribellarsi. Solo un piccolo gruppo di rivoluzionari a Shanghai sotto il comando di Huang Xing, Chen Qimei e Bai Wenwei si ?ribellato. Questi ultimi sono stati per?rapidamente sconfitti dalle forze leali al governo centrale. Sfortunatamente, molti dei sostenitori di Sun Zhongshan sono scappati oltremare verso il Giappone dove continuano a sostenere l'opposizione al nostro governo.;;;;;;Втор? революция по?руководством Гоминьдана закончилас?прежде, че?он?действительн?началась. Южны?провинция? лояльны?Гоминьдану, не требовалос?даже призыв??восстани? Лишь небольшая группа лоялистов ?Шанхае по?командование?Хуан Сина, Чэнь Цимея, ?Ба?ВенВ? организовали сопротивлени? Он?были быстро раздавлены силами, лояльными центрально?власти. ?сожалени? большинств?последователей Сунь Чжунша? бежали за границ??Японию, гд?он?по-прежнему поддерживают оппозици?нашему правительств?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
