EVT1914_133011803_DESC;The Chinese Reorganization Gold Loan was a bargain made by the central government with western powers that cost the people millions in return for recognition of the Beijing government. In addition, much of the money was squandered due to corruption. Historically, this led to great resentment within China by the people at western powers. The United States was the only country that did not participate in this scheme.;Le Prкt d'Or ?la Rйorganisation Chinoise fut un accord pass?par le gouvernement central avec les puissances occidentales, qui coыta des millions au peuple, en йchange de la reconnaissance du gouvernement de Pйkin. En outre, une grande partie de l'argent fut gaspill?d??la corruption. Historiquement, cela conduisit ?un grand ressentiment au sein de la Chine contre les puissances occidentales. Les Etats-Unis furent le seul pays ?ne pas participer ?ce programme.;Die chinesischen 'Reorganisations-Anleihen' waren ein Handel, den die chinesische Regierung abschloss im Gegenzug fьr eine Anerkennung durch die westlichen Grossmдchte. Da dieser Handel das chinesische Volk Millionen kostete und noch dazu die meisten Einahmen daraus in der Korruption versickerten, wuchs die Antipathie gegen den Westen. Die Vereinigten Staaten waren die einzige Grossmacht, die sich an diesem Handel nicht beteiligte.  ;Chiсska Poїyczka Reorganizacyjna w Zіocie byіa ofert?zіoїon?przez rz№d centralny paсstwom zachodnich, ktуra kosztowaіa narуd miliony w zamian za uznanie pekiсskiego rz№du za reprezentanta kraju. Dodatkowo, znaczna cz??њrodkуw przepadіa w wyniku korupcji. Historycznie, doprowadziіo to do duїej niechкci Chiсczykуw wobec zachodnich mocarstw. Stany Zjednoczone byіy jedynym z nich, ktуre nie uczestniczyіo w tym schemacie.;El prйstamo de oro chino fue un acuerdo del gobierno central con las potencias occidentales para el reconocimiento del gobierno de Pekнn. Mucho de ese dinero fue despilfarrado debido a la corrupciуn. Esto caus?gran disensiуn en China. Estados Unidos fue el ъnico paнs que no particip?en este proyecto.;Il 'Chinese Reorganization Gold Loan' fu un accordo tra il governo centrale cinese e le potenze occidentali che cost?al popolo milioni di yuan in cambio del riconoscimento per il governo di Pechino. Inoltre, molto del denaro fu sperperato a causa della corruzione. Storicamente, questo port?a molto malcontento in China nei confronti delle potenze occidentali. Gli Stati Uniti furono l'unico paese a non partecipare a questo accordo.;;;;;;Китайски?Реорганизационны?Золото?Кредит бы?сделко?центрального правительств??западным?державам? которая стоила народных миллионо??обме?на признани?правительств??Пекине. Кром?того, большая част?дене?была упущен?из-за коррупци? Историческ?сложилос?та? эт?привел??большому негодовани??Кита?по отношени??народа?западных держав. Соединенны?Штат?были единственной страно? которая не принимал?участия ?этой схем?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
