EVT1914_133011804_DESC;The time has come to pay for the 5 percent interest payment owed to foreign governments. Given our weak economy, however, paying back western powers will result in reduced domestic investment. On the other hand, refusing to pay the debt may cause foreign powers to act against our nation.;Le temps est venu de payer les 5 pour cents dintйrкts dыs aux gouvernements йtrangers. Cependant, compte tenu de notre faible йconomie, rembourser les puissances occidentales se traduira par un investissement domestique rйduit. D'autre part, refuser de payer la dette peut entraоner les puissances йtrangиres ?agir contre notre nation.;Die Zinsen fьr die 'Reorganisations-Anleihen' werden fдllig. Entweder zahlen wir die auslдndischen Mдchte aus, was unsere eigene, ohnehin schwache Wirtschaft noch weiter schwдchen wьrde oder wir verweigern die Zahlung, was durchaus Sanktionen zur Folge haben kann.;Przyszed?czas na spіat?piкcioprocentowych odsetek od kapitaіu, ktуry jesteњmy winni zachodnim paсstwom. Bior№c pod uwag?mizerny stan naszej gospodarki, zapіata naleїnych њrodkуw doprowadzi do zmniejszenia inwestycji krajowych. Z drugiej strony, odmowa zapіaty moїe skіoni?mocarstwa zagraniczne do wyst№pienia przeciwko nam.;Ha llegado la hora de pagar con el interйs del 5 por ciento, lo que debнamos a los gobiernos extranjeros. Debido a nuestra dйbil economнa, pagar a las potencias occidentales causar?la reducciуn de la inversiуn nacional. Por otro lado, negarse a pagar la deuda puede hacer que las potencias extranjeras actъen contra nosotros.;E' giunto il momento di pagare il 5 percento di interesse che dobbiamo ai governi stranieri. Data la debolezza della nostra economia, tuttavia, pagare il debito potrebbe portare a ridotti investimenti interni. D'altra parte, rifiutare di pagare il debito pu?portare le potenze straniere ad agire contro il nostro paese.;;;;;;Пришло время платит?5 процентные выплат? причитающихся иностранны?правительствам. Учитыв? нашу слабую экономик? однако, погашени?долг?западным державам приведет ?снижению внутренних инвестиций. ?другой сторон? если мы откажемся платит?долг? то эт?може?привести иностранны?держав??действов??против нашего народа.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
