EVT1914_133011805_DESC;The time has come to repay the whole of our debt owed to foreign governments. Given our weak state, however, paying back western powers will result in reduced domestic investment.;Le temps est venu de rembourser la totalit?de notre dette envers les gouvernements йtrangers. Cependant, compte tenu de notre йtat ??de faiblesse, rembourser les puissances occidentales se traduira par un investissement domestique rйduit.;Die Rьckzahlung der 'Reorganisations-Anleihen' wird fдllig. Wenn wir die auslдndischen Mдchte auszahlen, schwдcht das unsere ohnehin schwache Wirtschaft noch weiter.;Przyszed?czas na spіat?caіego dіugu, ktуry jesteњmy winni zagranicznym rz№dom. Bior№c pod uwag?mizerny stan naszej gospodarki, zapіata naleїnych њrodkуw doprowadzi jednak do zmniejszenia inwestycji krajowych.;Ha llegado la hora de pagar toda la deuda que debemos a los gobiernos extranjeros. Debido a nuestro dйbil estado, pagar a las potencias occidentales causar?la reducciуn en inversiуn nacional.;E' giunto il momento di ripagare l'intero nostro debito ai governi stranieri. Dato il nostro stato attuale tuttavia, pagare il debito potrebbe portare a ridotti investimenti interni.;;;;;;Пришло время полность?погасить долг иностранны?правительствам. Учитыв? нашу слабую экономик? однако, погашени?долг?западным державам приведет ?снижению внутренних инвестиций.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_133011807_DESC;When the Qing Dynasty fell, the newly formed Republic of China assumed vast debts owed to foreign countries as a result of western diplomatic pressure. This ensured that a vast majority of new government funds went to the service of past debt. This got so bad that additional loans had to be taken out for reconstruction, many of which were poorly supervised and lost to graft. Should we assume our past debt?;Lorsque la dynastie Qing tomba, la nouvelle Rйpublique de Chine assuma les sommes йnormes dыes aux pays йtrangers en raison de la pression diplomatique occidentale. La consйquence fыt que la grande majorit?des nouveaux fonds gouvernementaux servait au service de la dette passйe. Ceci devint tellement mauvais que des prкts supplйmentaires durent кtre pris pour la reconstruction, dont beaucoup furent mal surveillйs et perdus. Faut-il repenser notre dette passйe?;Als die Qing Dynastie zerfiel und die neu gegrьndete chinesische Republik die Amtsgeschдfte ьbernahm, ьbernahm sie auch die Schulden bei den westlichen Grossmдchten. Dadurch bedingt wurde der grцsste Teil des Staatseinkommens fьr den Schuldendienst benцtigt. Um ьberhaupt handlungsfдhig zu bleiben, mussten neue Kredite aufgenommen und Bonds ausgegeben werden, die allerdings nur spдrlich kontrolliert wurden und oft der Korruption zum Opfer fielen. Sollen wir zu unseren alten Schulden stehen ?;Kiedy upadіa Dynastia Qing, nowo sformowana Republika Chiсska przejкіa olbrzymie dіugi winne innym krajom z uwagi na nacisk dyplomatyczny krajуw zachodnich. Sprawiіo to, їe znacz№ca wiкkszoњж њrodkуw, ktуrymi dysponowa?nowy rz№d, przeznaczana byіa na obsіug?starych dіugуw. Doprowadziіo to do tak zіej sytuacji, їe kolejne poїyczki musiaіy by?zaci№gane na odbudow?kraju, cz??ktуrych to њrodkуw byіa nastкpnie џle zarz№dzana lub malwersowana. Czy powinniњmy przej№ж dіug naszych poprzednikуw?;Cuando la Dinastнa Qing cay? la reciйn creada Repъblica de China asumi?las deudas que debнa a los paнses extranjeros por la presiуn diplomбtica occidental. Esto hizo que una mayorнa de los fondos del nuevo gobierno fuesen para pagar la deuda. Se puso tan mal, que tuvieron que pedir prйstamos adicionales para la reconstrucciуn, de los cuбles muchos estaban mal supervisados y algunas no se llegaron a implementar. їDeberнamos asumir nuestra deuda pasada?;Quando la dinastia Qing cadde, la nuova Repubblica Cinese si assunse i debiti dovuti ai paesi stranieri su pressione della diplomazia occidentale. Questo per?obblig?a usare la maggioranza dei fondi del nuovo governo per ripianare i debiti passati. La situazione si aggrav?a tal punto che fu necessario chiedere ulteriori prestiti per finanziare la ricostruzione, molti dei quali furono sperperati. Dobbiamo assumerci l'onere di pagare i debiti dei governi passati?;;;;;;Посл?свержения династии Ци?  образовавш?? Китайская Республика признала огромные долг?пере?зарубежным?странами ?результате западног?дипломатического давлен?. Эт?гарантировал? чт?подавляющее большинств?новы?государственны?средст?были бы направлены на обслуживание прошлы?долгов. Ситуац? была настольк?удручающей, чт?дополнительные кредит?должны были быть взяты на реконструкци?предыдущих. Многие из новы?кредитов плох?контролировались ?уходил?на взятк? Должны ли мы признать на?прошлы?долг?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
