EVT1914_2007501_NAME;Sovnarkom formed;Le Sovnarkom est crйй;Die Grьndung der Sovnarkom;Utworzenie Sownarkomu;Sovnarkom ha sido creado;La creazione del Sovnarkom;;;;;;Сформирова?СовНарКо?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007501_DESC;Traditionally, a government is a council of ministers nominated by a ruler or by a president, but the Bolsheviks saw this as a bourgeois institution, and wanted to create what they thought a new government of workers and peasants, a 'soviet' government. The role and structure of the Sovnarkom was formalized in the 1918 Constitution of the RSFSR. The Sovnarkom of the RSFSR was responsible to the Congress of Soviets for the 'general administration of the affairs of the state'. The constitution enabled the Sovnarkom to issue decrees carrying the full force of law when the Congress was not in session. The Congress then routinely approved these decrees at its next session. Each People's Commissar was head of a commissariat and had several deputies and a collegium which functioned as a deliberative body to advise the commissar. The Chairman of the Council of People's Commissars, also elected by the Congress, had a function similar to that of a prime minister. The first Chairman of the Sovnarkom was Vladimir Lenin.;Traditionnellement, un gouvernement est un conseil des ministres dйsign?par un dirigeant ou par un prйsident, mais les bolcheviks virent en cela une institution bourgeoise et voulurent crйer ce qu'ils pensaient кtre un nouveau gouvernement d'ouvriers et de paysans, un gouvernement 'soviйtique'. Le rфle et la structure du Sovnarkom furent formalisйs dans la Constitution de 1918 de la RSFSR. Le Sovnarkom de la RSFSR йtait responsable devant le Congrиs des Soviets de l''administration gйnйrale des affaires de l'Йtat'. La constitution permit au Sovnarkom de prendre des dйcrets ayant force de loi, lorsque le Congrиs n'йtait pas en session. Le Congrиs approuva ensuite rйguliиrement ces dйcrets lors de la session suivante. Chaque Commissaire du Peuple йtait ?la tкte d'un commissariat, et avait plusieurs dйputйs ainsi qu'un collиge qui fonctionnaient comme un organe charg?de conseiller le Commissaire. Le Prйsident du Conseil des Commissaires du Peuple, йgalement йlu par le Congrиs, avait un rфle similaire ?celui de Premier ministre. Le premier Prйsident du Sovnarkom fut Vladimir Lйnine.;Traditionell ist eine Regierung eine Versammlung von Ministern, die von einem Herrscher oder Prдsidenten nominiert wird, was aber von den Bolschewiken als bьrgerliche Einrichtung abgelehnt wurde. Ihrer Meinung nach sollte eine Regierung aus 'Arbeiter- und Bauernrдten' bestehen, einem 'Soviet'. Die Rolle und Funktion der Sovnarkom war in der Verfassung der RSFSR von 1918 festgeschrieben. Die Sovnarkom war dem Kongress der Soviets fьr die 'generelle Verwaltung der Staatsangelegenheiten' verantwortlich. Die Verfassung gestattete es der Sovnarkom Dekrete und Gesetze zu erlassen, die dann spдter vom Kongress nachtrдglich genehmigt wurden. Jeder Volkskommissar fьhrte ein Kommissariat, hatte mehrere Stellvertreter und verfьgte ьber einen Stab von Experten, die ihn berieten. Der Vorsitzende des Rates der Volkskommissare wurde vom Kongress gewдhlt und ist einem Premierminister vergleichbar. Der erste Vorsitzende der Sovnarkom war Vladimir Lenin.;Tradycyjnie, rz№d jest rad?ministrуw, nominowanych przez wіadc?lub prezydenta, ale bolszewicy postrzegali rz№d jako instytucj?burїuazyjn?i pragnкli stworzy?co? co uwaїali za nowy typ rz№du robotnikуw i chіopуw, rz№d 'sowiecki'. Rola i struktura Sownarkomu zostaіa sformalizowana w Konstytucji Rosyjskiej Federacyjnej SRR 1918 r. Sownarkom RFSRR by?odpowiedzialny przez Kongresem Sowietуw za 'ogуln?administracj?spraw paсstwa'. Konstytucja uprawniaіa Sownarkom do wydawania dekretуw z peіn?moc?prawa, kiedy Kongres nie obradowa? Kongres zwyczajowo zatwierdza?takie dekrety na swojej nastкpnej sesji. Kaїdy komisariat by?prowadzony przez komisarza ludowego, ktуremy towarzyszyіo kilku zastкpcуw oraz kolegium, stanowi№ce ciaіo doradcze. Przewodnicz№cy Rady Komisarzy Ludowych, rуwnie?wybierany przez Kongres, peіni?funkcj?analogiczn?do stanowiska premiera. Pierwszy przewodnicz№cym Sownarkomu by?Wіodzimierz Lenin.;Tradicionalmente, un gobierno es un concilio de ministros nombrados por un gobernante o por un presidente, pero los Bolcheviques vieron en esto una instituciуn burguesa, y querнan crear lo que ellos querнan, un gobierno de trabajadores y campesinos, un gobierno 'soviйtico'. El papel y la estructura del Sovnarkom fue formalizado en la Constituciуn de 1918 de la Repъblica Socialista Federativa Soviйtica de Rusia. El Sovnarkom de la RSFSR fue responsable del congreso de soviйticos por la administraciуn general de los asuntos del Estado. La constituciуn permiti?al Sovnarkom emitir decretos pudiendo aplicar la ley cuando el congreso no estuviese en una sesiуn. El congreso aprob?estos decretos en su siguiente sesiуn. Cada Comisario Popular era el jefe de un comisariado y tenнa varios diputados y un colegio que funcionaba como cuerpo deliberativo para aconsejar al comisario. El Presidente del Concilio de Comisarios Populares, elegido por el congreso, tenнa una funciуn similar al primer ministro. El primer presidente del Sovnarkom fue Lenin. ;Tradizionalmente, un governo ?un gruppo di ministri nominati da un regnante o da un presidente, ma i Bolscevichi considerarono questa come un'istituzione borghese e decisero di creare quello che consideravano un nuovo governo di lavoratori e contadini, un governo 'sovietico'. Il ruolo e la struttura del Sovnarkom furono formalizzate nella costituzione della Repubblica Socialista Federativa Sovietica Russa (RSFSR) del 1918. Il Sovnarkom della RSFSR era responsabile davanti al Congresso dei Soviet per l'amministrazione generale degli affari dello stato. La costituzione dava al Sovnarkom il potere di emettere decreti con il pieno potere della legge quando il Congresso non era in sessione. Il Congresso poi sistematicamente approvava questi decreti nella sessione successiva. Ciascun Commissario del Popolo era a capo di un commissariato e aveva parecchi vice e un collegio che funzionava come corpo deliberativo per consigliare il commissario. Il Presidente del Consiglio dei Commissari del Popolo, anch'egli eletto dal Congresso, aveva funzioni simili a quelle di un primo ministro. Il primo Presidente del Sovnarkom fu Vladimir Lenin.;;;;;;Традиционн? правительств?было совето?министро? выдвинутых правителем ил?президенто? но большевики рассматривал?эт?ка?буржуазный институт, ?хоте?создат? ка?он?думали, ново?правительств?рабочи??крестья? 'советско? правительств? Роль ?структур?Совнаркома была оформлен??1918 году Конституцинй РСФС? СН?РСФС?бы?ответственен пере?съездо?Совето?за 'обще?управление делами государств?. Конституция позволил?Совнаркому издавать декрет? обладвающи?полной сило?закона, ?то время когд?заседания съезда не проводятся. Съез?зате?регу?рн?одоб??эт?указ?на свое?следующе?сессии. Каждый Народный комиссар возглавля?комиссариа??имел нескольк?заместителей, ?такж?коллегию, которая функционировал??качестве совещательного органа для консультирован? комиссар? Председатель Совета Народных Комиссаров, такж?избираемый съездо? бы?функциональн?схож ?премье?министра. Первым председателе?Совнаркома бы?Владимир Лени?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
