EVT1914_2007502_NAME;Dissolution of the Imperial Army;Dissolution de l'Armйe Impйriale;Die Auflцsung der zaristischen Armee;Rozwi№zanie Armii Cesarskiej;Disoluciуn del ejйrcito imperial;Dissoluzione dell'Esercito Imperiale;;;;;;Роспус?арми?импери?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007502_DESC;The Order 1, issued by the Petrograd Council of Soviets, became a nightmare for the old Imperial Army. That order allowed soldiers to disobey 'reactionary' and 'conservative' officers, allowed regular soldiers to elect their commanders and deleted all the military structures that kept the Tsarist army alive. The soldiers, exhausted by a long 4-year positional war, went out of control - army was rotting day by day - thousands of soldiers deserted, killed their officers, burnt their barracks, left their positions or became German prisoners. All fronts became unstable and all military actions with such an army lost any sense. Those commanders, who wanted to return the discipline to the regiments, were brutally killed. So, the Imperial Army was no more - it became a band of deserters and vandals who didn't obey their officers and didn't listen to any orders.;L'ordonnance numйro 1 йmise par le Conseil des Soviets de Pйtrograd devint un cauchemar pour l'ancienne armйe impйriale. Cette ordonnance autorisait les soldats ?dйsobйir aux officiers 'rйactionnaires' et 'conservateur', autorisait les soldats rйguliers ?йlire leurs chefs, et supprimait toutes les structures militaires qui gardaient l'armйe tsariste en vie. Les soldats, йpuisйs par 4 longues annйes de guerre de position, devinrent hors de contrфle - armйe devenait de plus en plus pourrie chaque jour passant - des milliers de soldats dйsertиrent, tuиrent leurs officiers, brыlиrent leurs casernes, quittиrent leurs positions, ou se rendirent aux allemands. Tous les fronts devinrent instable, et toute action militaire avec une telle armйe perdit tout sens. Les commandants qui ramener la discipline dans les rйgiments furent sauvagement assassinйs. Ainsi, l'armйe impйriale n'йtait plus - elle devint un groupe de dйserteurs et de vandales qui n'obйissaient plus ?leurs officiers et n'йcoutaient plus les ordres.;Befehl Nummer 1 des Petrograder Soviets wurde zu einem Albtraum fьr die zaristische Armee. Dieser Befehl erlaubte allen Armeeangehцrigen, die Befehle 'reaktionдrer' oder 'konservativer' Offiziere zu missachten und ihre Vorgesetzten selbst zu wдhlen, womit die militдrische Struktur, die die zaristischen Streitkrдfte zusammenhielt, zerstцrt wurde. Die Soldaten, nach einem 4-jдhrigen Stellungskrieg vцllig erschцpft, gerieten ausser Kontrolle, erschossen ihre Offiziere, steckten ihre Kasernen in Brand, desertierten oder wurden von den deutschen Streitkrдften gefangengenommen. Sдmtliche Fronten brachen zusammen und planmдssige militдrische Aktionen wurden zum Ding der Unmцglichkeit. Diejenigen Kommandeure, die versuchten Ruhe und Ordnung wiederherzustellen, wurden ermordet. Die einst starke und stolze Armee lцste sich in unkontrollierbare Banden von Deserteuren und Vandalen auf.;Rozkaz #1, wydany przez Piotrogrodzk?Rad?Sowietуw, sta?si?przekleсstwem starej Armii Cesarskiej. Rozkaz ten pozwala?їoіnierzom na wypowiedzenie posіuszeсstwa 'reakcyjnym' i 'konserwatywnym' oficerom, zezwala?їoіnierzom na wybуr ich wіasnych dowуdcуw i usuwa?wszystkie struktury militarne, ktуre trzymaіy przy їyciu armi?carsk? Їoіnierze, wyczerpani dіug?czteroletni?wojn?pozycyjn? zachowywali si?w niekontrolowany sposуb - armia marniaіa w oczach - tysi№ce їoіnierzy zdezerterowaіo, zabijaj№c oficerуw, pal№c koszary, opuszczaj№c pozycje obronne lub id№c w niemieck?niewol? Wszystkie fronty staіy si?niestabilne, a planowanie akcji wojskowych takiej armii straciіo sens. Ci dowуdcy, ktуrzy powracali by zaprowadzi?dyscyplin?w szeregach, byli bezlitoњnie zabijani. Armia Cesarska przestaіa faktycznie istnie?- staіa si?band?dezerterуw i wandali, ktуrzy nie sіuchali rozkazуw i wydaj№cych je oficerуw.;La Orden No. 1 emitida por el Concilio Soviйtico de Petrogrado, se convirti?en una pesadilla para el Ejйrcito Imperial. Esa orden permiti?a los soldados desobedecer a los oficiales 'reaccionarios' y 'conservadores', permiti?a los soldados regulares elegir a sus comandantes y eliminar todas las estructuras militares que mantenнan al ejйrcito del Zar vivo. Los soldados, cansados por una guerra larga, se salieron de control, el ejйrcito estaba cada vez peor - miles de soldados desertaron, mataron a sus oficiales, quemaron sus barcos, dejaron sus posiciones o se convirtieron en prisioneros de los alemanes. Todos los frentes empezaron a ser inestables y todas las acciones militares perdieron el sentido. Los comandantes que querнan la vuelta de la disciplina de los regimientos, fueron asesinados. El Ejйrcito Imperial fue eliminado, se convirti?en una banda de desertores y vбndalos que no obedecieron a sus oficiales y no escucharon ninguna de sus ordenes.;L'Ordine #1, emesso dal Consiglio dei Soviet di San Pietroburgo, divenne un incubo per il vecchio Esercito Imperiale. Quell'ordine permetteva ai soldati di disobbedire agli ufficiali 'reazionari' e 'conservatori', permetteva ai soldati di eleggere i propri comandanti e cancell?tutte le strutture militari che avevano permesso all'esercito Zarista di sopravvivere. Questi soldati, esausti da 4 anni di guerra di posizione, andarono fuori controllo con l'esercito che andava decomponendosi giorno dopo giorno: migliaia di soldati disertarono, uccisero i propri ufficiali, bruciarono le proprie caserme, lasciarono le posizioni o divennero prigionieri dei Tedeschi. Tutti i fronti divennero instabili e ogni iniziativa militare non aveva pi?senso con l'esercito in questo stato. Quei comandanti che cercarono di imporre un ritorno della disciplina furono brutalmente uccisi. Cos? l'Esercito Imperiale cess?di esistere e si trasform?in una banda di disertori e banditi che non obbedivano agli ufficiali e non ascoltavano gli ordini.;;;;;;Приказ ?1, выданной Петроградски?совето?рабочи??крестьянски?депутато? стал кошмаром для старой императорско?арми? Этот приказ позволил солдатам не подчинять? 'реакционны? ?'консервативным' офицерам, позволяя солдатам избирать свои?командиров ?удаляя вс?военны?структур? которы?позволяли существовать царско?арми?Солдат? измученные долгой 4-летней позиционно?войной, вышл?из-по?контро? - армия разваливалас?вс?сильне??каждым днем - ты?чи солдат дезертировал? убивал?свои?офицеров, сжигал?свои казарм? оставляли свои позици?ил?становилис?немецким?военнопленными. Вс?фронты стал?неустойчивым??вс?военны?действ? ?тако?армией поте?ли всяки?смыс? Те командир? которы?вернут?дисциплину подразделени? были жесток?убит? Таки?образо? императорско?армия больше не было - он???стал?группо?дезертиров ?вандалов, которы?не слушалис?свои?офицеров ?не подчинялись никаки?приказам;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007503_NAME;The economy is collapsing!;L'йconomie s'effondre !;Der Feind bricht zusammen;Gospodarka upada!;ЎLa economнa est?colapsando!;L'economia sta collassando!;;;;;;Экономик?разваливается!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007503_DESC;Most of factories are without work, as all workers are participating in the revolution and don't want to get back to their duty. Former Imperial discipline and industrial connections are now ruined, a lot of factories and plants are destroyed by the rebels, so now our economy is in a one huge collapse, and it would be very difficult to find any solution against this problem.;La plupart des usines sont sans travail alors que tous les travailleurs participent ?la rйvolution et ne veulent pas retourner accomplir leur devoir. La discipline impйriale et les anciennes connexions industrielles sont maintenant ruinйes, un grand nombre de fabriques et d'usines sont dйtruites par les rebelles. Notre йconomie est dйsormais en chute libre, et il sera trиs difficile de trouver une solution ?problиme.;Die meisten Fabriken liegen still, da die Arbeiter an der Revolution teilnehmen und nicht daran denken, ihre Pflichten zu erfьllen. Die frьhere Disziplin ist dahin, viele Fabriken wurden von Aufstдndischen zerstцrt und rings um uns herum versinkt die Welt im Chaos. Es wird дusserst schwierig werden, die Situation zu bereinigen.;Wiкkszoњж fabryk nie pracuje, a robotnicy bior№cy udzia?w rewolucji nie chc?powrуci?na stanowiska. Niegdysiejsza carska dyscyplina i wspуіpraca gaікzi przemysіu jest w ruinie, wiele fabryk jest zdemolowanych przez rebeliantуw, co stawia nasz?gospodark?na skraju przepaњci i trudno bкdzie cokolwiek z t?sytuacj?zrobi?;La mayorнa estбn sin trabajo, los trabajadores estбn participando en la revoluciуn y no quieren volver a su trabajo. La antigua disciplina Imperial y las conexiones industriales estбn ahora en la ruina, muchas fбbricas y plantas han sido destrozadas por los rebeldes, por lo que nuestra economнa est?cayendo y ser?muy difнcil encontrar una soluciуn contra este problema.;La maggior parte delle nostre fabbriche sono senza dipendenti, tutti i lavoratori stanno partecipando alla rivoluzione e non vogliono tornare a fare il proprio dovere. La precedente disciplina imperiale e le connessioni industriali sono ora rovinate, molte fabbriche e impianti sono stati distrutti dai ribelli, cos?ora la nostra economia ?collassata e sar?molto difficile trovare una soluzione a breve termine del problema.;;;;;;Большинств?заводо?не работает, та?ка?вс?рабочи?участвую??революци??не хо??возвращать? ?свои?обязаннос?? Бывших императорски?по?дков ?производственных связе??наст?ще?время больше не? многие фабрик??заводы были уничтожены повстанцам? та?чт?теперь наша экономик?находится находится ?сост?ни?полног?крах? ?очен?трудно найт?како?либо решени?этой проблемы.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007504_NAME;The Railway War;La Guerre du Rail;Der Eisenbahnkrieg;Wojna kolejowa;La Guerra del Ferrocarrill;La guerra della ferrovia;;;;;;Железнодорожная войн?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007504_DESC;The Railway War is caused by the collapse of our industry - there are revolts of railwaymen and peasants everywhere. All our railroads are under attack - and revolters are aggressively opposing any peace negotiations. Now every Soviet train is in danger - we should deal with these revolts as fast as possible.;La Guerre du Rail est causйe par l'effondrement de notre industrie. Il y a des rйvoltes de cheminots et de paysans partout. Tous nos chemins de fer sont attaquйs, et les rйvoltйs s'opposent agressivement ?toute nйgociation de paix. Maintenant, tous les trains soviйtiques sont en danger. Nous devons faire face ?ces rйvoltes aussi vite que possible.;Der Eisenbahnkrieg findet aufgrund des Zusammenbruchs der Industrie statt. Die Eisenbahner und die Bauern streiken ьberall, greifen unsere Zьge an und weigern sich, mit uns zu verhandeln. Jeder unserer Zьge ist in Gefahr, ьberfallen zu werden. Wir mьssen diese Bedrohung schnellstens eliminieren. ;Wojna kolejowa jest spowodwana przez upadek naszego przemysіu - wszкdzie maj?miejsce rewolty kolejarzy i chіopуw. Wszystkie linie kolejowe s?celem atakуw, a rewolucjoniњci sprzeciwiaj?si?jakimkolwiek negocjacjom. Teraz kaїdy sowiecki poci№g jest zagroїony - i musimy temu zarazi?jak najszybciej to moїliwe.;La Guerra del Ferrocarril est?siendo causada por la ruina de nuestra industria, hay revueltas de los trabajadores del ferrocarril y campesinos por todas partes. Todos nuestros ferrocarriles estбn bajo ataque y los rebeldes se oponen a cualquier negociaciуn de paz. Todos los trenes soviйticos estбn en peligro, deberнamos negociar con estos rebeldes los mбs rбpido posible.;La guerra della ferrovia fu causata dal collasso dell'industria: ci sono ovunque rivolte di ferrovieri e contadini. Tutte le nostre ferrovie sono sotto attacco e i ribelli si stanno opponendo con decisioni ad ogni negoziato di pace. Ora ogni treno sovietico ?in pericolo, dovremmo occuparci di queste rivolte il pi?presto possibile.;;;;;;Железнодорожная войн?вызван?коллапсо?отрасл?- повстюду восставшие железнодорожники ?крестьяне. Вс?наши железные дороги нахо?тся по?атакой - ?восставшие настроен?агрессивно против любы?мирных переговоро? Теперь каждый советски?поез?находится ?опасност?- мы должны разобраться ?этим?восстаниями ка?можн?быстре?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007505_NAME;Dissolution of the Constituent Assembly;Dissolution de l'assemblйe constituante;Die Auflцsung der verfassungsgebenden Versammlung;Rozwi№zanie Zgromadzenia Konstytucyjnego;Disoluciуn de la Asamblea Constituyente;La dissoluzione dell'Assemblea Costituente;;;;;;Роспус?Учредительного Собран?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007505_DESC;It was thus clear that, dominated by Right SRs who thought Russia unready for Soviet power, the Constituent Assembly was opposed to Soviet government and would not agree to new elections. In a recess, a special meeting of the Bolsheviks and Left SRs decided to dissolve the Assembly. The Deputy People's Commissar for Naval Affairs Fyodor Raskolnikov read a prepared statement and the Bolsheviks and Left SRs walked out. Around 4 a.m., the Commandant of the Tauride Palace, an Anarchist sailor called A. G. Zheleznyakov, approached Chernov and said: 'The guard is tired. I propose that you close the meeting and let everybody go home'.;Il йtait donc clair que, dominйe par les socialistes-rйvolutionnaires de droite qui pensaient que la Russie n'йtait pas prкte pour le pouvoir soviйtique, l'Assemblйe constituante s'opposa au gouvernement soviйtique, et n'accepterait pas de nouvelles йlections. Durant une pause, une rйunion spйciale des bolcheviks et des SR de gauche dйcida de dissoudre l'Assemblйe. Le Commissaire du Peuple Adjoint pour les Affaires navale, Raskolnikov Fiodor, lu une dйclaration prйparйe, et les bolcheviks et les SRs de gauche sortirent. Aux alentours de 4 heures, le commandant du palais de Tauride, un marin anarchiste nomm?A.G. Zheleznyakov, approcha Tchernov et lui dit: 'La garde est fatigu? Je vous propose de lever la sйance et de laisser tout le monde rentrer ?la maison'.;Es wurde daraufhin deutlich, dass die verfassungsgebende Versammlung - welche durch die gemдЯigten Sozialisten dominiert wurde und damit Russland als nicht bereit fьr die Sowjetherrschaft ansah - sich einer Sowjetregierung entgegenstellen wьrde und keine neuen Wahlen zulassen wьrden. Die Bolschewiken und radikalen Sozialisten zogen sich daraufhin zu Beratungen zurьck und entschieden, die Versammlung aufzulцsen. Der stellvertretende Volkskommissar fьr Marineangelegenheiten, Fyodor Raskolnikov, gab eine im Vorfeld verfasste Erklдrung ab und die Bolschewiken und radikalen Sozialisten verlieЯen den Raum. Um etwa vier Uhr morgens trat der Kommandant des Tauride-Palasts, ein anarchistischer Matrose genannt A. G. Zheleznyakov, an Chernov heran und sagte: 'Die Wache ist mьde. Ich schlage vor, Sie schlieЯen die Versammlung und lassen alle nach Hause gehen.';Staіo si?jasne, їe zdominowane przez prawicowych eserowcуw, uwaїaj№cych їe Rosja nie jest gotowa na sowiecki model rz№dуw, Zgromadzenie Kontytucyjne nie zgodzi si?na nowe wyboru. W sytuacji impasu specjalne posiedzenie bolszewikуw i lewicowych eserowcуw zdecydowaіo si?na rozwi№zanie Zgromadzenia. Zastкpca komisarza ludowego ds. marynarki wojennej, Fiodor Raskolnikow, odczyta?przygotowane oњwiadczenie i bolszewicy wraz z lewicowymi eserowcami opuњcili Zgromadzenie. Okoіo 4 nad ranem komendant Paіacu Taurydzkiego, anarchistyczny marynarz znany jako A.G. Їeleџniakow, zwrуci?si?do Czernowa ze sіowami: 'Gwardia jest zmкczona. Proponuj? byњcie zamknкli spotkanie i pozwolili wszystkim pojњж do domu.';Era evidente que, dominados por los SR de derechas que pensaban que Rusia no estaba preparada para el poder soviйtico, la Asamblea Constituyente se oponнa al gobierno soviйtico y no aceptarнa unas nuevas elecciones. En un descanso, en una reuniуn de los Bolcheviques y los SR de izquierdas decidieron disolver la Asamblea. El Comisario Popular de Asuntos Navales, Fyodor Raskolnikov, ley?una declaraciуn preparada y los Bolcheviques y los SR de izquierdas salieron de all? Alrededor de las 4 AM, el comandante del Palacio Taъride, un marinero anarquista llamado A.G. Zheleznyakov, se acerc?a Chernov y dijo: 'La guardia est?cansada. Propongo que acabes la reuniуn y dejes que se vayan todos a casa'.;Era perci?chiaro che, essendo dominata dai Socialisti Rivoluzionari (SR) che pensavano che la Russia non fosse pronta al potere dei Soviet, l'Assemblea Costituente si opponeva al governo dei Soviet e non avrebbe concesso nuove elezioni. Durante un momento di chiusura dell'Assemblea, un incontro speciale tra Bolscevichi e Socialisti Rivoluzionari di sinistra decise di dissolvere l'Assemblea. Il ViceCommissario del Popolo per gli Affari Navali Fyodor Raskolnikov lesse un discorso preparato e i Bolscevichi e i Socialisti Rivoluzionari di sinistra si allontanarono. Verso le 16, il Comandante del Palazzo di Tauride, un marinaio anarchico di nome A. G. Zheleznyakov, si avvicin?a Chernov e disse 'Le guardie sono stanche. Suggerisco di chiudere l'incontro e lasciare che tutti vadano a casa'.;;;;;;Таки?образо? было ясн? чт??Учредительно?собрании доминируют правые эсер? считавши? чт?Росс? не готова ?советско?власти. Он?были против советского правительств ?не согласилис?бы на новы?выборы. ?перервые специально?заседани?большевико??левы?эсеров приняло решени??роспуске Ассамбле? Заместител?нарком?по морски?дела?Федо?Раскольников прочитал подготовленное заявление, посл?чего большевики ?левы?эсер?вышл? Окол?4 часо?утра, комендан?Таврического дворца, анархист матрос  Железня? подоше??Чернов??сказал: 'Караул уста? ?предлага?ва?закрыт?заседани??пуст?вс?идут домо?'.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007506_NAME;Decrees on Land;Dйcret sur la terre;Das Dekret bezьglich des Landbesitzes;Dekrety o Ziemi;Decretos sobre la tierra;Decreti sui terreni;;;;;;Декрет ?Земл?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007506_DESC;(1) Landed proprietorship is abolished forthwith without any compensation.\n(2) The landed estates, as also all crown, monastery, and church lands, with all their livestock, implements, buildings and everything pertaining thereto, shall be placed at the disposal of the volost land committees and the uyezd Soviets of Peasants' Deputies pending the convocation of the Constituent Assembly.\n(3) All damage to confiscated property, which henceforth belongs to the whole people, is proclaimed a grave crime to be punished by the revolutionary courts. The uyezd Soviets of Peasants' Deputies shall take all necessary measures to assure the observance of the strictest order during the confiscation of the landed estates, to determine the size of estates, and the particular estates subject to confiscation, to draw up exact inventories of all property confiscated and to protect in the strictest revolutionary way all agricultural enterprises transferred to the people, with all buildings, implements, livestock, stocks of produce, etc.\n(4) The following peasant Mandate, compiled by the newspaper Izvestia Vserossiiskogo Soveta Krestyanskikh Deputatov from 242 local peasant mandates and published in No. 88 of that paper (Petrograd, No. 88, August 19, 1917), shall serve everywhere to guide the implementation of the great land reforms until a final decision on the latter is taken by the Constituent Assembly.;(1) Toute propriйt?fonciиre est abolie immйdiatement, sans aucune compensation. \n(2) Tout bien foncier, de mкme que toute terre des йglises et des monastиres de la couronne, avec tout leur bйtail, ouvrages, bвtiments ainsi que tout ce qui s'y rapporte, doit кtre plac??la disposition des comitйs Volost de la terre et des dйputйs Uyedzs des Soviets des paysans, en attendant la convocation de l'Assemblйe constituante. \n(3) Tout dommage ?des biens confisquйs appartenant dйsormais au peuple, est proclam?crime grave puni par les tribunaux rйvolutionnaires. Les dйputйs Uyedzs des Soviets des paysans prendront toutes les mesures nйcessaires pour assurer le respect de l'ordre le plus strict durant la confiscation des terres seigneuriales, pour dйterminer la taille des domaines et ceux soumis ?confiscation, pour dresser des inventaires exacts de tous les biens confisquйs, et pour protйger dans la voie la plus rйvolutionnaire possible toutes les entreprises agricoles transfйrйes au peuple, avec tous les bвtiments, les ouvrages, les troupeaux, les stocks de produits etc. \n(4) Le mandat suivant des paysans, compil?par le journal Izvestia Vserossiiskogo Soveta Deputatov Krestyanskikh ?partir de 242 mandats paysans locaux, et publi?dans le numйro 88 de ce document (Petrograd n ?88 du 19 aoыt 1917), doit servir partout pour guider la mise en њuvre des grandes rйformes agraires jusqu'?ce qu'une dйcision finale sur celle-ci soit prise par l'Assemblйe constituante.;(1) GroЯgrundbesitz ist fortan ohne Kompensation abgeschafft. \n(2) Die Landanwesen sowie alle Kron-, Kloster- und Kirchenlande nebst ihrem Vieh, ihrer Bebauung und allem Dazugehцrigen sind dem Volost Landkommitee und den Vertretern des Uyezd-Bauernsowjets bis zur Einberufung der verfassungsgebenden Versammlung zur Verfьgung zu stellen. \n(3) Jeglicher Schaden an konfisziertem Eigentum, welches von nun an dem gesamten Volk gehцrt, ist hiermit als Kapitalverbrechen deklariert und von den Revolutionsgerichten zu bestrafen. Die Vertreter des Uyezd-Bauernsowjets sollen alle notwendigen MaЯnahmen treffen um sicherzustellen, dass strikte Ordnung wдhrend der Konfiszierung des Landbesitzes und der GrцЯenbestimmung der Anwesen  sowie bei der Erstellung von Inventarlisten jeglichen beschlagnahmten Besitzes gewahrt wird. Es ist ьberdies sicherzustellen, dass jegliche Agrarbetriebe und deren zugehцrige Bauwerke, Vieh und Produkte im Sinne der Revolution an das Volk ьbergeben werden. \n(4) Das folgende Bauernmandat, dass durch die Zeitung Izvestia Vserossiiskogo Soveta Krestyanskikh Deputatov aus 242 lokalen Bauernmandaten zusammengestellt und in Ausgabe Nr. 88 verkьndet wird, soll in jeglichem Belang der Umsetzung der groЯen Landreformen dienlich sein, bis eine endgьltige Entscheidung in dieser Sache durch die verfassungsgebende Versammlung getroffen wird.;(1) Posiadіoњж ziemska jest od tego momentu zabroniona bez jakichkolwiek kompensat.\n(2) Wіoњci ziemskie, takїe ziemie koronne, klasztorne i koњcielne, oraz caіy ich inwentarz, wyposaїenie, budynki i wszystko co do nich przynaleїy, bкd?przekazane we wіadanie woіoњci, komitetуw ziemskich, i ujezdуw, sowieckich przedstawicieli chіopskich, po zwoіaniu Zgromadzenia Konstytucyjnego.\n(3) Jakiekolwiek zniszczenia dokonane na konfiskowanym maj№tku, ktуry od tego momentu przynaleїy do ogуіu ludnoњci, bкd?traktowane jako najciкїsze zbrodnie, karane przez s№dy rewolucyjne. Ujezdy, sowieckie przedstawicielstwa chіopskie, powezm?wszystkie potrzebne њrodki, aby zapewni?najpeіniejszy porz№dek w czasie konfiskaty posiadіoњci, aby mуc okreњli?rozmiar wіoњci, ich granice i dokіadnie okreњli?list?konfiskowanych dуbr i przedmiotуw, chroni№c w najpeіniejszym stopniu wszystkie budynki, przynaleїnoњci, zwierzкta, zapasy, przekazywane ludnoњci, itp.\n(4) Niniejszy Mandat chіopski zosta?zebrany przez gazet?'Izwiestia Wszerossijskiego Sowieta Krestiaсskich Deputatуw' na podstawie 242 lokalnych mandatуw chіopskich i opublikowane w nr 88 tej gazety (Piotrogrуd, nr 88, 19 sierpnia 1917 r.) i bкdzie sіuїy?jako instrukcja postкpowania przy stosowaniu wielkich reform ziemskich do czasu ostatecznej decyzji Zgromadzenia Konstytucyjnego.;(1) La propiedad de tierra se deroga inmediatamente sin ninguna compensaciуn. \n(2) Las tierras de los terratenientes, como tambiйn las de la corona, monasterios, y tierras de la Iglesia, con todo su ganado, herramientas, edificios y todo lo que les pertenece, ser?puesto a disposiciуn del comit?de tierras de los vуlost y a las diputaciones soviйticas de campesinos pendiente de la convocaciуn de la Asamblea Constituyente. \n(3) Daсar las propiedades confiscadas, que pertenecen al pueblo, es declarado como un crimen grave por las cortes revolucionarias. Las diputaciones soviйticas de campesinos tomaran todas las medidas necesarias para asegurar el cumplimiento de la orden durante la confiscaciуn de tierras, determinando el tamaсo de las fincas, y que fincas estбn sujetas a confiscaciуn, para redactar inventarios exactos de todas las propiedades confiscadas y proteger de una forma estricta todas las empresas agrнcolas transferidas al pueblo, con todos los edificios, herramientas, ganado, existencias de productos, etc. \n(4) El siguiente mandato campesino, compilado por el periуdico Izvestia Vserossiiskogo Soveta Krestyanskikh Deputatov de 242 mandatos campesinos y publicados en la ediciуn n?88 de ese periуdico (Petrogrado, N?88, 19 de Agosto, 1917) servir?en todas partes para orientar la implementaciуn de las gran reformas agrarias hasta que la decisiуn final sea tomada por la Asamblea Constituyente.;(1) La propriet?privata dei terreni ?immediatamente abolita senza alcun risarcimento.\n(2) I terreno del governo, della corona, dei monasteri, della chiesa, con tutti i loro attrezzi, bestiame, edifici e tutto quanto ad essi pertinenti, saranno posti a disposizione dei comitati e dei Soviet dei contadini in attesa della convocazione dell'Assemblea Costituente.\n(3) Eventuali danni di ogni tipo alle propriet?confiscate, che d'ora in poi appartengono al popolo, verranno considerati come un crimine grave che sar?punito dalle corti rivoluzionarie. I deputati dei Soviet dei Contadini prenderanno tutte le misure necessarie per assicurare l'osservanza della disciplina pi?stretta durante la confisca dei terreni, per determinare le dimensioni dei terreni e, in particolare i terreni che saranno confiscati, per determinare l'esatto inventario di tutto ci?che verr?confiscato e per proteggere col metodo rivoluzionario pi?severo tutti gli strumenti agricoli trasferiti al popolo, tra cui edifici, strumenti, bestiame, scorte di prodotti, etc.\n(4) Il seguente Mandato dei contadini, compilato dal giornale Izvestia Vserossiiskogo Soveta Krestyanskikh Deputatov da 242 mandati di contadini locali e pubblicato nel No. 88 di quel giornale (San Pietroburgo, No. 88, 19 Agosto 1917), servir?ovunque come guida per l'implementazione della grande riforma terriera finch?una decisione finale a riguardo non verr?presa dall'Assemblea Costituente.;;;;;;1) Помещичья собственност?на земл?отме?ет? немедленно бе?всякого выкупа. /n/n 2) Помещичь?имен?, равн?ка?вс?земл?удельные, монастырские, церковны? со всем их живы??мертвы?инвентарем, усадебными постройкам??всем?принадлежнос?ми, перехо???распоряжени?Волостны?Земельны?Комитето??Уездны?Совето?Крестьянски?Депутато?впредь до разрешен? Учредительны?Собрание?вопрос??земл? /n/n 3) Какая бы то ни была порч?конфискуемог?имуществ? принадлежащего отныне всем?народу, об?вляет? ?жким преступление? караемым революционны?судо? Уездны?Советы Крестьянски?Депутато?принимаю?вс?необходимы?меры для соблюден? строжайшег?по?дк?пр?конфискаци?помещичьих имений, для определения того, до какого размер?участк??каки?именно подлежат конфискаци? для составления точной опис?всег?конфискуемог?имуществ??для строжайшей революционно?охраны всег?перехо?щего ?народу хо?йств?со всем?постройкам? оруд?ми, скотом, запасами продукто??проч. /n/n ) Для руководств?по осуществлени?велики?земельны?преобразований, впредь до окончательного их решения Учредительны?Собрание? должен повсюд?служит?следующи?крестьянски?нака? составленный на основани?242 местны?крестьянски?наказо?редакцие?'Известий Всероссийского Совета Крестьянски?Депутато? ?опубликованный ?номере 88 этих 'Известий' (Петрогра? ?88, 19 август?1917 ?). /n/n 5) Земл??довы?крестья???довы?казако?не конфискуют?.;x;;
EVT1914_2007507_NAME;War communism - phase one;Communisme de guerre - phase 1;Der Kriegskommunismus,  Phase I;Komunizm wojenny - pierwsza faza;Comunismo de guerra - fase uno;Comunismo di guerra - fase uno;;;;;;Военны?коммуниз?- перв? фаза;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007507_DESC;War communism was the economic and political system that was adopted by the Bolsheviks with the aim of keeping towns and the Red Army supplied with weapons and food, in conditions in which all normal economic mechanisms and relations were being destroyed by the war. We're approaching the first phase of war communism to reindustrialize our country and return at least 25percent of our industrial and military might.;Le communisme de guerre йtait le systиme йconomique et politique qui fut adopt?par les bolcheviks dans le but de garder les villes et l'Armйe Rouge approvisionnйe en armes et en nourriture, alors que toutes les relations et les mйchanismes йconomiques normaux avaient йt?dйtruits par la guerre. Nous approchons de la premiиre phase du communisme de guerre pour rйindustrialiser notre pays, pour retourner ?au moins 25 pour cent de notre puissance industrielle et militaire.;Kriegskommunismus war das von den Bolschewiken ьbernommene wirtschaftliche und politische System der jungen Sowjetunion mit dem Ziel, die kontrollierten Stдdte und die Rote Armee in einer Zeit des kriegsbedingten, totalen Kollapses aller normalen Wirtschaftsablдufe mit Waffen und Nahrung zu versorgen. Wir nдhern uns nun dem Beginn der ersten Phase des Kriegskommunismus mit dem Ziel unser Land zu reindustrialisieren und mindestens 25 Prozent der einstigen Wirtschafts- und Militдrmacht Russlands wiederherzustellen.;Komunizm wojenny by?systemem ekonomiczno-politycznym, ktуry zosta?zaadoptowany przez bolszewikуw w celu dostarczenia zapasуw broni i їywnoњci dla miast i Armii Czerwonej, w sytuacji gdy normalne mechanizmy spoіeczne i polityczne byіy zniszczone przez wojn? W tym momencie rozpoczynami pierwsz?faz?komunizmu wojennego, ktуra pozwoli zreindustrializowa?kraj i osi№gn№ж przynajmniej jedn?czwart?naszego potencjaіu produkcyjnego i wojskowego.;El comunismo de guerra fue el sistema polнtico y econуmico adoptado por los Bolcheviques con el objetivo de mantener pueblos y el Ejйrcito Rojo suministr?armas y comida, con la economнa y las relaciones destrozadas por la guerra. Estamos acercбndonos a la primera fase del comunismo de guerra para reindustrializar nuestro paнs y volver al 25 por ciento de nuestro poder industrial y militar.;Il comunismo di guerra era il sistema politico ed economico che fu adottato dai Bolscevichi con lo scopo di mantenere le citt?e l'Armata Rossa rifornite di armi e cibo, in condizioni in cui tutte le relazioni e i normali meccanismi economici venivano distrutti dalla guerra. Ci stiamo avvicinando alla prima fase del comunismo di guerra, ovvero re-industrializzare il paese e riprenderci almeno il 25 percento della nostra potenza industriale e militare.;;;;;;Военны?коммуниз?бы?экономическо??политической системой, принято?большевиками ?цель?поддержания снабжения городо??Красно?Арми?оружие??едой, ?условия? когд?вс?нормальные экономически?механизм??отношения были разрушен?войной. Мы приближаем? ?первой фазе военного коммунизма по восстановлению промышленности наше?страны, чтоб?вернут?ка?миниму?25 проценто?наше?промышленной ?военно?мощи.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007508_NAME;Prodrazvyorstka;Prodrazvyorstka;Prodrazvyorstka;Prodrazwiorstka;Prodrazvyorstka;Prodrazvyorstka;;;;;;Продразверстка;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007508_DESC;In 1918, the center of the Soviet Russia was cut off from the most important agricultural regions of the country. The reserves of bread were running short, causing hunger among the urban population, where support for the Bolshevik government was strongest. In order to satisfy the minimal food needs, the Soviet government introduced a strict control over the food surpluses of the prosperous rural households. Since many peasants were extremely unhappy with this policy and tried to resist it, they were branded as 'saboteurs' of the bread monopoly of the state and advocates of the free 'predatory', 'speculative' trade. Lenin believed that prodrazvyorstka was the only possible way to procure sufficient amounts of bread and other agricultural products for the population of the cities during the war.;En 1918, le centre de la Russie soviйtique fut coupйe des rйgions agricoles les plus importantes du pays. Les rйserves de pain vinrent ?manquer, provoquant la faim parmi la population urbaine, l?o?le soutien pour le gouvernement bolchevique йtait la plus forte. Afin de satisfaire les besoins minimum de nourriture, le gouvernement soviйtique introduisit un contrфle strict sur les excйdents alimentaires des mйnages ruraux prospиres. De nombreux paysans йtant extrкmement mйcontents de cette politique et ayant essay?de rйsister, ils furent qualifiйs de 'saboteurs' du monopole йtatique du pain, et de dйfenseurs du libre-commerce 'prйdateur' et 'spйculatif'. Lйnine croyait que la prodrazvyorstka йtait le seul moyen possible de procurer des quantitйs suffisantes de pain et d'autres produits agricoles ?la population urbaine durant la guerre.;Im Jahre 1918 war das Zentrum Sowjetrusslands von den wichtigsten Agrarsektoren des Landes abgeschnitten. Die Brotreserven gingen zur Neige, was zu Hunger unter der Stadtbevцlkerung, den Epizentren bolschewistischer Unterstьtzung, fьhrte. Um den minimalen Nahrungsbedarf zu decken, fьhrte die Sowjetregierung eine strikte Kontrolle ьber den Nahrungsьberschuss der wohlstдndigen Landbesitzer ein. Viele russische Bauern waren extrem unglьcklich ьber diese Politik und versuchten sich ihr zu widersetzen. Sie wurden von den Revolutionдren als 'Saboteure' am Brotmonopol des Staates und als Advokaten des rдuberischen Spekulationshandels deklassiert. Lenin glaubte, dass die Prodrazvyorstka der einzig mцgliche Weg war, um die Stadtbevцlkerung wдhrend des Krieges sicher mit Brot zu versorgen.;W 1918 r. centralne obszary Rosji Sowieckiej zostaіy odciкte od najwiкkszych rejonуw rolniczych kraju. Zapasy chleba wyczerpywaly si? powoduj№c klкsk?gіodu w miastach, gdzie poparcie dla bolszewikуw byіy najsilniejsze. W celu zaspokojenia minimum їywieniowego, rz№d sowiecki wprowadzi?surow?kontrol?nad nadwyїkami їywnoњciowymi dobrze prosperuj№cych gospodarstw chіopskich. Poniewa?wiкkszoњж rolnikуw zdecydowanie sprzeciwiaіa si?takiej polityce i prуbowaіa si?jej opiera? okreњlono ich jako 'sabotaїystуw' paсstwowego monopolu produkcji chleba i zwolennikуw 'spekulacji' i 'їerowania na biedzie'. Lenin uwaїa? їe prodrazwiorstka byіa jedynym moїliwym sposobem na uzyskanie dostaw їywoњci dla miast w celu zapewnienia potrzebnego minimum.;En 1918, el centro de la Rusia Soviйtica fue aislado de las regiones agrнcolas mбs importantes del paнs. Las reservas de pan se estaban agotando, causando una hambruna entre la poblaciуn urbana, donde el apoyo al gobierno Bolchevique era mбs grande. Para satisfacer las necesidades alimenticias bбsicas, el gobierno soviйtico introdujo un control estricto sobre los excedentes de comida de las zonas rurales prуsperas. Ya que muchos campesinos estaban descontentos con esta polнtica e intentaron oponerse a ello, fueron llamados 'saboteadores' del monopolio del pan del Estado y partidarios del comercio especulativo. Lenin crey?que la prodrazvyorstka era la ъnica manera posible de procurar suficientes cantidades de pan y otros productos agrнcolas para la poblaciуn de las ciudades durante la guerra.;Nel 1918, il centro della Russia Sovietica fu separato dalle pi?importanti regioni agricole del paese. Le scorte di pane stavano per finire, causando carestie nella popolazione urbana, dove il sostegno per il governo Bolscevico era pi?forte. Per soddisfare le minime necessit?di cibo, il governo sovietico introdusse un severo controllo sulle eccedenze di cibo nelle prosperose tenute di campagna, confiscando quanto riteneva necessario. Dato che molti contadini erano estremamente scontenti a causa di questa politica e cercavano di resisterla, furono marchiati come 'sabotatori' della monopolio di stato sul pane e difensori di un libero commercio 'predatorio' e 'speculativo'. Lenin credeva che la prodrazvyorstka fosse l'unico modo possibile per procurarsi abbastanza pane e altri prodotti agricoli per le popolazioni cittadine durante la guerra.;;;;;;?1918 году цент?советско?России бы?отреза?от важнейши?сельскохозяйственны?районо?страны.Запасы хлеб?были на исходе, вызывая голо?сред?городского населения, гд?была сильна поддержк?большевистског?правительств? Для того чтоб?удовлетворит?минимальны?потребност??продовольствии, советско?правительств?ввел?жестки?контроль на?излишкам?продовольств? из богаты?сельских хо?йств. Поскольк?многие крестьяне были крайне недовольны этой политико??пытались сопротив?ть?, он?были заклеймены ка?'саботажник? хлебно?монополи?государств??сторонники свободно?'хищническо?, 'спекулятивной' торговли. Лени?считал, чт?продразверстка была единственн?возможны?способом обеспечить достаточно?количество хлеб??других сельскохозяйственны?продукто?для городского населения во время войн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007509_NAME;War communism - phase two;Communisme de guerre - phase 2;Der Kriegskommunismus, Phase II;Komunizm wojenny - druga faza;Comunismo de guerra - fase dos;Comunismo di guerra - fase due;;;;;;Военны?коммуниз?- втор? фаза;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007509_DESC;War communism was the economic and political system that was adopted by the Bolsheviks with the aim of keeping towns and the Red Army supplied with weapons and food, in conditions in which all normal economic mechanisms and relations were being destroyed by the war. We're approaching the second phase of war communism, which of course will be unpopular. But it will allow us to continue fighting well in the Civil War, to supply our Army and keep our economy stable. We all should sacrifice something for the Revolution!;Le communisme de guerre йtait le systиme йconomique et politique qui fut adopt?par les bolcheviks dans le but de garder les villes et l'Armйe Rouge approvisionnйes en armes et en nourriture, alors que toutes les relations et les mйchanismes йconomiques normaux avaient йt?dйtruits par la guerre. Nous approchons de la deuxiиme phase du communisme de guerre, qui sera bien sыr impopulaire. Mais elle nous permettra de continuer ?lutter pendant la guerre civile, ?approvisionner notre armйe, et ?garder notre йconomie stable. Nous devrions tous sacrifier quelque chose pour la Rйvolution !;Kriegskommunismus war das von den Bolschewiken ьbernommene wirtschaftliche und politische System der jungen Sowjetunion mit dem Ziel, die kontrollierten Stдdte und die Rote Armee in einer Zeit des kriegsbedingten, totalen Kollapses aller normalen Wirtschaftsablдufe mit Waffen und Nahrung zu versorgen. Wir nдhern uns nun dem Beginn der zweiten Phase des Kriegskommunismus, welche natьrlich unbeliebt bei der Bevцlkerung sein wird. Sie wird uns jedoch erlauben, den Kampf im Bьrgerkrieg fortzusetzen, unsere Armee zu versorgen und die Wirtschaft stabil zu halten. Jedermann sollte ein Opfer fьr die Revolution erbringen!;Komunizm wojenny by?systemem ekonomiczno-politycznym, ktуry zosta?zaadoptowany przez bolszewikуw w celu dostarczenia zapasуw broni i їywnoњci dla miast i Armii Czerwonej, w sytuacji gdy normalne mechanizmy spoіeczne i polityczne byіy zniszczone przez wojn? Dochodzimy do realizacji drugiej fazy komunizmu wojennego, pomimo jego oczywistej niepopularnoњci. Pozwoli nam to jednak prowadzi?dalej wojn?domow? wyїywi?armi?i ustabilizowa?gospodark? Trzeba poњwiкci?si?dla dobra Rewolucji!;El comunismo de guerra fue el sistema polнtico y econуmico que fue adoptado por los Bolcheviques con el objetivo de mantener pueblos y el Ejйrcito Rojo suministr?armas y comida, con la economнa y las relaciones destrozadas por la guerra. Estamos acercбndonos a la segunda fase del comunismo de guerra, que por supuesto ser?impopular. Pero nos permitir?continuar luchando en la guerra civil, suministrar a nuestro ejйrcito y mantener nuestra economнa estable. ЎDebemos sacrificar algo por la Revoluciуn!;Il comunismo di guerra era il sistema politico ed economico che fu adottato dai Bolscevichi con lo scopo di mantenere le citt?e l'Armata Rossa rifornite di armi e cibo, in condizioni in cui tutte le relazioni e i normali meccanismi economici venivano distrutti dalla guerra. Ci stiamo avvicinando alla seconda fase del comunismo di guerra, che sar?ovviamente impopolare ma ci permetter?di continuare a combattere nella Guerra Civile, rifornendo il nostro esercito e stabilizzando la nostra economia. Tutti noi dovremo sacrificare qualcosa per la rivoluzione;;;;;;Военны?коммуниз?бы?экономическо??политической системой, принято?большевиками ?цель?поддержания снабжения городо??Красно?Арми?оружие??едой, ?условия? когд?вс?нормальные экономически?механизм??отношения были разрушен?войной. Мы приближаем? ко втором?этап?военного коммунизма, которы? конечн? буде?непопу?рным. Но эт?позволит на?продолжить борьбу ?гражданско?войн? обеспечить нашу арми??держат?стабильной нашу экономик? Мы вс?должны че?то жертвовать для революци?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007510_NAME;War communism - phase three;Communisme de guerre - phase 3;Der Kriegskommunismus, Phase III;Komunizm wojenny - trzecia faza;Comunismo de guerra - fase tres;Comunismo di guerra - fase tre;;;;;;Военны?коммуниз?- трет? фаза;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007510_DESC;War communism was the economic and political system that was adopted by the Bolsheviks with the aim of keeping towns and the Red Army supplied with weapons and food, in conditions in which all normal economic mechanisms and relations were being destroyed by the war. We're approaching the third phase of this policy - a final one, which will be a last step to the victory of Bolshevism! We should have no mercy or sentiments when our industry needs resources and our army needs supplies. We will make our industry strong!;Le communisme de guerre йtait le systиme йconomique et politique qui fut adopt?par les bolcheviks dans le but de garder les villes et l'Armйe Rouge approvisionnйe en armes et en nourriture, alors que toutes les relations et les mйchanismes йconomiques normaux avaient йt?dйtruits par la guerre. Nous approchons de la troisiиme phase de cette politique - celle qui sera la derniиre menant ?la victoire du bolchevisme! Nous ne devrions avoir aucune piti?et aucun sentiment quand notre industrie a besoin de ressources et que notre armйe a besoin d'approvisionnements. Nous allons rendre notre industrie forte!;Kriegskommunismus war das von den Bolschewiken ьbernommene wirtschaftliche und politische System der jungen Sowjetunion mit dem Ziel, die kontrollierten Stдdte und die Rote Armee in einer Zeit des kriegsbedingten, totalen Kollapses aller normalen Wirtschaftsablдufe mit Waffen und Nahrung zu versorgen. Wir nдhern uns nun dem Beginn der dritten und finalen Phase dieser Politik, welche den Sieg des Bolschewismus sicherstellen wird! Wir dьrfen keine Gnade oder Mitgefьhl zeigen, wenn unsere Industrie Ressourcen und unsere Armee Waffen benцtigten. Unsere Industrie wird mдchtig werden!;Komunizm wojenny by?systemem ekonomiczno-politycznym, ktуry zosta?zaadoptowany przez bolszewikуw w celu dostarczenia zapasуw broni i їywnoњci dla miast i Armii Czerwonej, w sytuacji gdy normalne mechanizmy spoіeczne i polityczne byіy zniszczone przez wojn? Zbliїamy si?do zrealizowania trzeciej i ostatniej fazy tej polityki, ktуra bкdzie jednoczeњnie ostatnim krokiem do zwyciкstwa bolszewizmu! Nie powinniњmy mie?jakichkolwiek skrupuіуw lub oporуw, kiedy nasz przemys?i armia potrzebuj?surowcуw. Uczynimy je silnymi!;El comunismo de guerra fue el sistema polнtico y econуmico que fue adoptado por los Bolcheviques con el objetivo de mantener pueblos y el Ejйrcito Rojo suministr?armas y comida, con la economнa y las relaciones destrozadas por la guerra. Estamos acercбndonos a la tercera fase del comunismo de guerra - la ъltima de las polнticas, Ўque ser?el ъltimo paso para la victoria del Bolcheviquismo! ЎNo debemos tener piedad ni sentimientos cuando nuestra industria necesite recursos y nuestro ejйrcito necesite suministros!. ЎHaremos a nuestra industria fuerte!;Il comunismo di guerra era il sistema politico ed economico che fu adottato dai Bolscevichi con lo scopo di mantenere le citt?e l'Armata Rossa rifornite di armi e cibo, in condizioni in cui tutte le relazioni e i normali meccanismi economici venivano distrutti dalla guerra. Ci stiamo avvicinando alla terza fase di questa politica, quella finale: sar?l'ultimo passo verso la vittoria del Bolscevismo! Non mostreremo piet?o sentimenti quando le nostre industrie avranno bisogno di risorse e il nostro esercito avr?bisogno di rifornimenti. Questa render?il nostro paese molto pi?forte!;;;;;;Военны?коммуниз?бы?экономическо??политической системой, принято?большевиками ?цель?поддержания снабжения городо??Красно?Арми?оружие??едой, ?условия? когд?вс?нормальные экономически?механизм??отношения были разрушен?войной. Мы приближаем? ?третьему этап?этой политики - окончательному, чт?буде?последни?шаго??победе большевизм? Мы не должны пр?влять жалост? когд?наша промышленность нуждается ?ресурсах, ?наша армия - ?снабжени? Мы сделае?нашу промышленность сильно?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007511_NAME;New Economy Policy;La Nouvelle Politique Йconomique (NEP);Eine neue Wirtschaftspolitik;Nowa Polityka Ekonomiczna;Nueva polнtica econуmica;La Nuova Politica Economica;;;;;;Новая Экономическая Политика;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007511_DESC;The laws sanctioned the co-existence of private and public sectors such as middle class people, which were incorporated in the NEP, which on the other hand was a state oriented 'mixed economy'.\nThe state, after starting to use the NEP, migrated away from Communist ideals and started the modernizing of the economy, but this time, with a more free-minded way of doing things. The Soviet Union stopped upholding the idea of nationalizing certain parts of industries. Some kinds of foreign investments were expected by the Soviet Union under the NEP, in order to fund industrial and developmental projects with foreign exchange or technology requirements.\nThe move towards modernization rested on one main issue, transforming the Soviet Union into a modern industrialized society, but to do so the Soviet Union had to reshape its preexisting structures, namely its agricultural system and the class structure that surrounded it.;Les lois sanctionnaient la coexistence des secteurs public et priv? tels que la classe moyenne, qui furent incorporйes dans la NEP (Nouvelle Politique Йconomique), qui йtait d'autre part une 'йconomie mixte'orientйe d'йtat. \n L'йtat, aprиs avoir commenc??utiliser la NEP, s'йloigna des idйaux communistes, et commenзa la modernisation de l'йconomie, mais avec cette fois-ci une maniиre de faire les choses plus libre d'esprit. L'Union Soviйtique cessa de dйfendre l'idйe de la nationalisation de certaines parties de l'industrie. Certaines formes d'investissements йtrangers йtaient attendus par l'Union soviйtique durant la NEP, afin de financer des projets industriels et de dйveloppement, avec des йchanges internationaux ou des besoins technologiques. \n Le mouvement vers la modernisation reposait sur un sujet fondamental, la transformation de l'Union soviйtique en une sociйt?industrialisйe moderne. Mais pour que cela soit le cas, l'Union soviйtique devait remodeler ses structures prйexistantes, ?savoir son systиme agricole et la structure de classe qui l'entourait.;Die Neue Wirtschaftspolitik (NWP) war eine staatlich orientierte Mischwirtschaft, welche die Koexistenz eines privaten neben dem цffentlichen Sektor genehmigte. \nDer Staat, nachdem er die Kernforderungen der NWP ьbernommen hatte, wanderte von kommunistischen Idealen ab und begann mit der Modernisierung der Wirtschaft, dieses mal allerdings mit einer freieren Wahl der Mцglichkeiten. Die Sowjetunion beendete ihre Politik der Verstaatlichung verschiedener Industriebereiche. Zur Finanzierung der NWP setzte die Sowjetunion auf auslдndisches Investitionskapital, um die Industrie- und Entwicklungsprojekte mit Devisen zu finanzieren und notwendiges, technologisches Wissen zu akquirieren. \nDer Gang in Richtung Modernisierung und hin zu einem modernen Industriestaat wurde vor allem durch ein Hauptproblem behindert: die Umorganisierung des Agrarsystem und der Widerstand der Klassenstruktur die es umgab.;Nowe prawa sankcjonowaіy wspуіistnienie sektora prywatnego i publicznego, w ktуrych mogіa dziaіa?klasa њrednia. Prawa te znano jako NEP (Now?Polityk?Ekonomiczn? i wprowadzaіy one zorientowan?na sektor paсstwowy 'gospodark?mieszan?.\nPaсstwo, po wprowadzeniu NEP-u, odciкіo si?od radykalnych ideaіуw komunizmu i rozpoczкіo modernizacj?gospodarki, wykorzystuj№c zdrowy rozs№dek. Zwi№zek Sowiecki porzuci?ide?nacjonalizacji caіego przemysіu. Pozwoliіo to na dziaіanie inwestycji z kapitaіem zagranicznym, ktуre finansowaіy projekty rozwojowe i zapewniaіy nowemu paсstwu napіyw technologii.\nRuch w kierunku modernizacji opiera?si?na d№їeniu do przeksztaіcenia Zwi№zku Sowieckiego w nowoczesne spoіeczeсstwo industrialne, ale aby to osi№gn№ж, naleїaіo przeksztaіci?istniej№ce struktury, mianowicie struktur?klasow?systemu rolniczego paсstwa.;Las leyes sancionaban la co-existencia de sectores pъblicos y privados como la clase media, que estaban incorporados en la NEP, y por otro lado era un estado orientado en una economнa mixta.\nEl estado, despuйs de empezar a usar la NEP, se alej?de los ideales comunistas y empez?a modernizar la economнa, pero esta vez por un camino mбs libre al hacer cosas. La Uniуn Soviйtica par?de atender una idea de nacionalizaciуn de ciertas partes de la industrias. Algъn tipo de inversiones extranjeras eran esperadas por la Uniуn Soviйtica bajo la NEP, para financiar los proyectos industriales y de desarrollo con divisas o requisitos tecnolуgicos.\nEl movimiento hacia la modernizaciуn se basaba en un asunto principal, transformar la Uniуn Soviйtica en una sociedad industrial moderna, pero para hacerlo, la Uniуn Soviйtica tenнa que remodelar sus estructuras preexistentes, es decir, su sistema agrнcola y la clase estructural que la rodeaba.;La Nuova Politica Economica (NPE) fu introdotta da Lenin nel 1921 per risollevare l'economia russa danneggiata dal comunismo di guerra. La NPE era un'economia mista orientata allo stato che autorizz?la coesistenza del settore privato e del settore pubblico e ripristin?la propriet?privata e il libero mercato in alcuni settori dell'economia, mantenendo comunque le industrie sotto il controllo dello stato.\nLo stato, dopo aver iniziato a usare la NPE, si allontan?dagli ideali comunisti e inizi?a modernizzare l'economia, stavolta in maniera pi?libera e meno forzata rispetto al passato. L'Unione Sovietica smise di sostenere l'idea di nazionalizzare certe parti delle industrie e alcuni tipi di investimenti stranieri furono autorizzati dala NPE, in modo da fornire fondi a progetti di sviluppo economico e industriale.\nLo spostamento verso la modernizzazione si fondava su un obiettivo principale, ovvero la trasformazione dell'Unione Sovietica in una moderna societ?industriale, ma per fare questo l'Unione Sovietica dovette cambiare le sue strutture preesistenti, in particolare il sistema agricolo e la struttura di classe che lo sosteneva.;;;;;;Эт?законы санкционировал?сосуществовани?частного ?государственного секторов, ?то?числ??люде?среднего класса, которы?были включены ?НЭ? чт?можн?характеризоват?ка?'смешанну?экономик?.сост?ни?ориентированны? \n Государств? посл?начала использования НЭПа, отошло от коммунистических идеало??начало модернизацию экономик? но на этот ра?боле?свободны?способом. Советски?Союз приостановил национализацию некоторы?отраслей промышленности. Иностранны?инвестиции ожидалис?Советски?Союзом ?рамках НЭПа, чтоб?финансироват?развитие промышленности ?проектов развит? ?помоўў?иностранно?валюты ил?технологий. \n Движение ?модернизации превращало Советски?Союз ?современно?индустриальное общество , но для этог?Советски?Союз бы?вынужден изменить свою прежню?структур? ?именно - сельскохозяйственну?систем??классову?структур? которая окружали ее.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007512_NAME;Creation of the Red Army;Crйation de l'Armйe Rouge;Die Schaffung der Roten Armee;Utworzenie Armii Czerwonej;Creaciуn del Ejйrcito Rojo;La creazione dell'Armata Rossa;;;;;;Создание Красно?Арми?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007512_DESC;The Council of People's Commissars decided to form the Red Army. Their conception was that it should be 'formed from the class-conscious and best elements of the working classes'. All citizens of the Russian republic over the age of 18 were eligible. Its specific role was the defense of the achievements of the October Revolution, the Soviet Power and Socialism. Enlistment was conditional upon 'guarantees being given by a military or civil committee functioning within the territory of the Soviet Power or by Party or Trade Union committees or, in extreme cases, by two persons belonging to one of the above organizations'. In the event of an entire unit wanting to join the Red Army, a collective guarantee and the affirmative vote of all its members would be necessary.;Le Conseil des Commissaires du Peuple dйcida de crйer l'Armйe Rouge. Sa conception est de la former '?partir des йlйments conscients des classes, et des meilleurs йlйments de la classe ouvriиre. Tous les citoyens de la rйpublique russe et вgйs de plus de 18 ans йtaient йligibles. Son rфle spйcifique йtait la dйfense des acquis de la Rйvolution d'Octobre, du pouvoir soviйtique et du socialisme. L'enrфlement йtait subordonnйe aux 'garanties accordйe par un comit?militaire ou civil fonctionnant sur le territoire couvert par la puissance soviйtique, ou par des comitйs du Parti ou des syndicats, ou, dans des cas extrкmes, par deux personnes appartenant ?l'une des organisations nommйes ci-dessus'. Dans le cas d'une unit?entiиre souhaitant rejoindre l'Armйe rouge, une garantie collective et le vote affirmatif de tous ses membres serait nйcessaire.;Der Rat der Volkskommissare hat die Schaffung der Roten Armee beschlossen. Dem Konzept nach sollte sie aus den 'klassenbewussten' und 'besten Elementen der Arbeiterklasse' erhoben werden. Allen Bьrger der Russischen Republik ьber dem 18. Lebensjahr war der Beitritt mцglich. Ihre Aufgabe war die Verteidigung der Errungenschaften der Oktoberrevolution, der Sowjetmacht und des Sozialismus.  Der Eintritt war von Garantien eines militдrischen oder zivilen Komitees im Wirkungsbereich der Sowjetmacht oder eines Partei- oder Gewerkschaftskomitees abhдngig. In Extremfдllen wurden gar die Garantien von zwei Mitgliedern einer der oben genannten Organisationen gefordert. Fьr den Fall dass eine ganze Einheit der Roten Armee beitreten wollte, so war eine Kollektivgarantie und ein positives Votum aller Mitglieder der betreffenden Einheit notwendig.;Rada Komisarzy Ludowych zadecydowaіa o utworzeniu Armii Czerwonej. Leї№ca u podstaw tej decyzji koncepcja mуwiіa, їe naleїy stworzy?j?ze 'њwiadomych klasowo najlepszych przedstawicieli klasy pracuj№cej'. Wszyscy obywatele Republiki Rosyjskiej, ktуrzy ukoсczyli 18 lat, mogli wcieli?si?w szeregi armii. Jej szczegуlnym zadaniem byіa obrona osi№gniкж Rewolucji Paџdziernikowej, wіadzy sowieckiej i socjalizmu. Zaci№g by?warunkowy, oparty na 'gwarancji komitetu wojskowego lub cywilnego wіadzy sowieckiej lub komуrki partyjnej lub zwi№zkowej, lub w wyj№tkowych wypadkach dwуch osуb naleї№cych do jednej z tych organizacji'. W sytuacji, gdy caіa jednostka wojskowa chciaіa przyі№czy?si?do Armii Czerwonej, wspуlna gwarancja i gіosy wszystkich czіonkуw byіy konieczne.;El Concilio de Comisarios Populares decidi?crear el Ejйrcito Rojo. Su concepto fue que deberнa estar formado de elementos con conciencia de clase y lo mejor de la clase trabajadora. Todos los ciudadanos de la repъblica rusa que tienen mбs de 18 aсos pueden ser elegibles. Su papel es la defensa de los logros de la Revoluciуn de Octubre, el poder soviйtico y el socialismo. En el caso de que una unidad quiera unirse al Ejйrcito Rojo, ser?necesario los votos afirmativos de todos sus miembros.;Il Consiglio dei Commissari del Popolo decise di creare l'Armata Rossa. Secondo loro avrebbe dovuto essere 'formata dai migliori elementi della classe proletaria dotati di una coscienza di classe'. Tutti i cittadini della Repubblica russa con almeno 18 anni di et?erano candidati idonei. Il suo ruolo specifico fu la difesa delle conquiste della Rivoluzione d'Ottobre, il Potere dei Soviet e il Socialismo. L'arruolamento era condizionato dalla 'approvazione fornita da un comitato militare o civile nel territorio sotto il potere dei Soviet oppure dal Partito oppure da un comitato di sindacati oppure, in casi estremi, da due persone appartenenti ad almeno una di queste organizzazioni'. Se un'intera unit?volesse entrare a far parte dell'Armata Rossa, un'autorizzazione collettiva e il voto positivo di tutti i suoi membri sar?necessario.;;;;;;Сове?Народных Комиссаров реши?создат?Красну?Арми? Их концепция заключалас??то? чт?Красная Армия должна 'формируовать? из сознательных ?передовы?элементо?рабочего класса'. Вс?граждане Российской республики ?возрасте старше 18 ле?признавались пригодными ?военно?службе. Особ? роль Красно?арми?была ?защите завоеваний Ок?брьско?революци? советско?власти ?социализма. Зачисление на службу требовал?'гарантии военного ил?гражданского органа, функционирующего на советско?территории, либо парт? ил?профсоюзного комитета ил? ?крайне?случае, двух ли? принадлежащи??одно?из вышеуказанны?организаци? ?случае, когд?цело?подразделени?желало присоединить? ?Красно?Арми? необходм?была коллективн? гарант? ?голоса всех ее членов.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007513_NAME;Order N.228;Ordre N.228;Befehl Nr. 228;Rozkaz N.228;Orden No.228;Ordine n. 228;;;;;;Приказ N.228;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007513_DESC;Our revolutionary army badly needs good and efficient commanders, but most of our military leaders are good only for political meetings and street revolts, they don't know how to lead a real front-scale warfare. According to comrade Trotsky, it could be useful for our newborn Red Army to use former Tsarist officers and generals as specialist personnel and instructors for our staffs. However, a lot of talented commanders won't agree to join the army of the Revolution.;Notre armйe rйvolutionnaire a grandement besoin de commandants bons et efficaces, mais la plupart de nos chefs militaires ne sont rйellement bons que pour les rйunions politiques et les rйvoltes de  rue. Ils ne savent pas vraiment comment mener une vйritable guerre ?large йchelle. Selon le camarade Trotsky, il pourrait кtre utile pour notre toute nouvelle Armйe Rouge d'utiliser d'anciens officiers et gйnйraux tsaristes comme personnel spйcialis?et comme instructeurs pour nos йtats-majors. Toutefois, un grand nombre de commandants talentueux ne seront pas d'accord pour rejoindre l'armйe de la Rйvolution;Unsere Revolutionsarmee braucht dringend gute und effiziente Kommandeure, aber die meisten unserer militдrischen Anfьhrer sind nur fьr politische Veranstaltungen oder StraЯenscharmьtzel geeignet. Sie wissen nicht, wie man einen echten Krieg gegen eine andere Armee fьhrt. Genosse Trotsky zufolge kцnnte es sich als nьtzlich erweisen, wenn wir fьr unsere neugeborene Rote Armee ehemalige Offiziere und Generдle des Zarenreiches als Spezialisten und Instrukteure fьr unsere Stдbe rekrutieren. Viele der talentierten Kommandeure wьrde den Beitritt zur Roten Armee wahrscheinlich jedoch ablehnen.;Nasza rewolucyjna armia desperacko potrzebuje dobrych i efektywnych dowуdcуw, ale wiкkszoњж z naszych wojskowych komisarzy nadaje si?tylko na spotkania polityczne lub do awantur ulicznych i nie wiedz?jak poprowadzi?armi?na prawdziwym placu boju. Towarzysz Trocki proponuje, by do naszej nowopowstaіej Armii Czerwonej wciela?byіych oficerуw carskich i generaіуw jako specjalistуw i instruktorуw. Pomimo tego, wielu utalentowanych dowуdcуw nie zgodzi si?wspomуc rewolucyjn?armi?;A nuestro ejйrcito revolucionario le hace mucha falta comandantes buenos y eficientes, pero la mayorнa de nuestros lнderes militares sуlo sirven para reuniones polнticas y disturbios callejeros, no saben cуmo conducir un enfrentamiento bйlico de la escala de un frente. De acuerdo con el camarada Trotsky, podrнa ser ъtil para el reciйn nacido Ejйrcito Rojo usar antiguos oficiales y generales Zaristas como personal especializado e instructores para nuestro mando. Sin embargo, muchos comandantes talentosos no estarбn de acuerdo con unirse al ejйrcito de la Revoluciуn.;Il nostro esercito rivoluzionario ha una forte necessit?di comandanti bravi ed efficienti, ma molti dei nostri comandanti militari sono buoni soltanto per incontri politici e rivolte di strada, non hanno idea di come guidare una vera guerra su vasta scala. Secondo il compagno Trotsky, potrebbe essere utile per la nostra neonata Armata Rossa usare ufficiali e generali del vecchio Esercito Zarista come personale specializzato e come istruttori per il nostro personale. Tuttavia, molti talentuosi comandanti non vorrano entrare nell'esercito rivoluzionario in ogni caso.;;;;;;Наша революционная армия сейчас особенно нуждается ?эффективны??талантливы?командирах, чтоб?вест?войн??наши?врагом. Но ?сожалени? большая част?наши?военачальников хороша лишь для того, чтоб?произносит?речи на митингах ?вест?уличны??тежи, ?не командоват?фронтами ?руководить реальным?военными действ?ми. Согласно решени?товарища Троцкого, могл?бы быть полезн?привлечь ?нашу новорожденну?Красну?арми?бывших царски?офицеров ?генерало?ка?военспецов ?инструкторов для штабов. ?другой сторон? большая част?этих военны?настроен?крайне контрреволюционн?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007514_NAME;Mass levy;Levйe en masse;Die Massenrekrutierungen;Masowy pobуr;Reclutamiento en masa;Coscrizione di massa;;;;;;Массовый призыв;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007514_DESC;Socialistic Motherland is in danger, how comrade Lenin said. Red Army needs more manpower to be ready for battle. We don't have enough volunteers to form normal-sized divisions and corps. Comrades from the Sovnarkom believe, that the only chance to make the Red Army competent is to start a mass levy campaign amongst the workers and peasants of our country.;La Mиre Patrie socialiste est en danger, ainsi que le camarade Lйnine l'a dit. L'Armйe Rouge a besoin de plus de personnel pour кtre prкt pour la bataille. Nous n'avons pas assez de bйnйvoles pour former des divisions et des corps de taille normale. Les camarades de la Sovnarkom croient que la seule solution pour rendre l'Armйe rouge compйtente est de lancer une campagne de levйe en masse parmi les ouvriers et les paysans de notre pays.;Das sozialistische Mutterland ist in Gefahr, wie Kamerad Lenin sagte. Die Rote Armee benцtigt mehr Soldaten um kampfbereit zu sein, aber wir haben nicht genьgend Freiwillige um Divisionen und Korps in NormalgrцЯe zu formen. Die Genossen vom Sovnarkom glauben, dass die einzige Chance um die Rote Armee kompetent werden zu lassen darin besteht, dass wir eine Masseneinberufung unter den Arbeitern und Bauern unseres Landes starten.;Socjalistyczna ojczyzna jest w niebezpieczeсstwie, jak gіosi towarzysz Lenin. Armia Czerwona potrzebuje wiкcej їoіnierzy, by by?gotowa na bуj. Nie mamy wystarczaj№co duїo ochotnikуw, by sformowa?normalne dywizje i korpusy wojska. Towarzysze z Sownarkomu uwaїaj? їe jedyn?drog?do zasilenia Armii Czerwonej jest masowa kampania wcielania do niej robotnikуw i chіopуw w caіym kraju.;La Madre Patria socialista est?en peligro, tal como el camarada Lenin dijo. El Ejйrcito Rojo necesita mбs personal para estar listo para la batalla. No tenemos suficientes voluntarios como para formar divisiones y cuerpos de tamaсo normal. Los camaradas del Sovnarkom creen que la ъnica oportunidad de hacer competente al Ejйrcito Rojo es iniciar una campaсa de reclutamiento en masa entre los trabajadores y campesinos de nuestro paнs.;La Madrepatria socialista ?in pericolo, come ha detto il compagno Lenin. L'Armata Rossa ha bisogno di pi?soldati per essere pronta alla battaglia, ma non abbiamo abbastanza volontari per formare reggimenti e divisioni di dimensioni normali. I compagni del Sovnarkom credono che la nostra unica possibilit?per rendere l'Armata Rossa competente sia di iniziare una campagna di coscrizione di massa tra i lavoratori e i contadini del nostro paese.;;;;;;Социалистическое Отечеств??опасност? ка?сказал недавн?товари?Лени? Красно?арми?нужн?горазд?больше личног?состав? чтоб?он?была готова отразить любу?капиталистическу?агрессию. ?на?недостаточно добровольцев, чтоб?укомплектовывать полнокровные дивизи??корпус? Товарищи из Совнаркома полагают, чт?единственный шанс сделат?Красну?арми?боеспособной - начать массовый призыв сред?подходящи?по возрасту ?кондиц??рабочи??крестья?наше?страны.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007515_NAME;Peasants' rebellion;Rйvolte des paysans;Der Bauernaufstand;Rebelia chіopska;Rebeliуn campesina;La rivolta dei contadini;;;;;;Крестьянски?восстания;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007515_DESC;The peasants always were quite conservative and counter-revolutional, but now they show their true face. Revolution is in danger and we have to behave quite brutally to save our Motherland, but these peasants can't understand that Prodrazvyorstka, mass levies and military communism policy is vital for our industry. They want to keep their bread and they want to make money on it. Kulaks' scum leaders raised massive rebellions in Tambov region and the other central governorates. The Red Army will crush these speculant bastards!;Les paysans ont toujours йt?trиs conservateurs et contre-rйvolutionnaires, mais ils montrent maintenant leurs vrais visages. La rйvolution est en danger, et nous devons nous comporter assez brutalement pour sauver notre patrie, mais ces paysans ne peuvent pas comprendre que la Prodrazvyorstka, les levйes en masse et la politique de communisme de guerre, est vital pour notre industrie. Ils veulent garder leur pain, et ils veulent en plus en gagner de l'argent. La racaille des dirigeants koulaks a lev?des rйbellions massives dans la rйgion de Tambov et dans les autres gouvernorats centraux. L'Armйe Rouge va йcraser ces salauds de spйculateurs !;Die Bauern waren schon immer recht konservativ und konterrevolutionдr, aber jetzt zeigen sie ihr wahres Gesicht! Die Revolution ist in Gefahr und wir mьssen brutal vorgehen um unser Vaterland zu retten. Diese Bauern verstehen einfach nicht, dass Prodrazvyorstka, Masseneinberufungen und Kriegskommunismus vital fьr unsere Industriestдrke sind. Sie wollen ihr Brot behalten und am liebsten noch einen Profit daraus schlagen! Dieser Abschaum von Kulaken hat eine massive Rebellion in der Tambov-Region und anderen zentralen Bezirken angezettelt. Die Rote Armee wird diese Spekulantenbastarde zermalmen!;Chіopi byli zawsze doњж konserwatywni i kontrrewolucyjni, ale teraz pokazuj?swe prawdziwe oblicze. Rewolucja jest zagroїona i musimy dziaіa?z peіn?brutalnoњci? aby uchroni?nasz?Ojczyzn?przez ludzi, ktуrzy nie akceptuj?prodrazwiorstki, masowego poboru i polityki komunistycznej, tak waїnych dla dziaіania przemysіu i wojska. Chc?zatrzyma?dla siebie swуj chleb i jeszcze si?na tym wzbogaci? Przeklкci przywуdcy rebelii kuіackiej w rejonie Tambowa i innych guberni chwycili za bro? Armia Czerwona zgniecie tych znienawidzonych spekulantуw!;Los campesinos siempre fueron bastante conservadores y contrarrevolucionarios, pero ahora revelan su verdadera naturaleza. La revoluciуn est?en peligro y tenemos que comportarnos cruelmente para salvar a nuestra Madre Patria, pero estos campesinos no pueden comprender que Prodrazvyorstka, reclutamientos en masa y una polнtica de comunismo militar son vitales para nuestra industria. Quieren quedarse con su pan y quieren ganar dinero con йl. La escoria de los lнderes kulбks empezaron rebeliones masivas en la regiуn de Tambov y las otras gobernaciones centrales. ЎEl Ejйrcito Rojo aplastar?a estos bastardos especuladores!;I contadini sono sempre stati abbastanza conservatori e antirivoluzionari, ma ora hanno mostrato il loro vero volto. La Rivoluzione ?in pericolo e dobbiamo comportarci brutalmente per salvare la Madrepatria, ma questi contadini non capiscono che la Prodrazvyorstka, la coscrizione di massa e il comunismo di guerra sono politiche necessarie per il nostro paese. Loro vogliono tenersi il proprio pane e usarlo per guadagnare soldi. I leader dei Kulaki hanno organizzato grandi rivolte nella regione di Tambov e negli altri governatorati centrali. L'Armata Rossa distrugger?questi bastardi speculatori!;;;;;;Крестьяне всегда были довольно реакционны??консервативным классо? чт?не ра?встречал?небывало?непр?ти?революционного движен?. Теперь же он?показали свое истинное лицо. Революция ?опасност??мы должны действоват?жёстко - но крестьяне не понимают, чт?военны?коммуниз? продразвёрстки ?воинские призыв?жизненно необходимы для функционирован? наше?экономик? Вместо этог?он?хо??держат?свой хлеб пр?себе ?торговат?им. Кулацкие вожаки подняли восстания на Тамбовщине ??других центральны?гуерния? Красная армия разгроми?этих спекулянтских мразей!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007516_NAME;Tambov rebellion;La rйvolte de Tambov;Der Tambov-Aufstand;Rebelia tambowska;Rebeliуn de Tambov;La ribellione di Tambov;;;;;;Тамбовское восстани?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007516_DESC;Tambov peasants, led by an SR activist Ilya Antonov, launched a disastrous rebellion against the Soviet power. Antonovschina (Antonov's supporters) became a nightmare for our country. Comrade Trotsky believes that we shouldn't have any mercy to these kulaks who killed so many Soviet officials and participated in a full-scale counter-revolutionary act. Antonov and his peasant army will be destroyed by any means, even if we have to use poisonous gases (like comrade Tukhachevsky wants), we will crush this riot. No one will escape from our punishment, Tambov will become Soviet once again!;Les paysans de Tambov, dirig?par le militant Socialiste Rйvolutionnaire Ilya Antonov, ont lanc?une rйbellion dйsastreuse contre le pouvoir soviйtique. Les Antonovschinas (les partisans d'Anotonov) sont devenus pour notre pays un cauchemar. Le camarade Trotsky pense que nous ne devrions pas avoir de piti?pour ces koulaks qui ont tu?tant de fonctionnaires soviйtiques, et qui ont particip??un acte contre-revolutionnaire ?une grande йchelle. Tous les moyens seront bons  pour dйtruire Antonov et son armйe paysanne, mкme si nous devons utiliser des gaz toxiques (ainsi que le veut le camarade Toukhatchevsky). Nous allons йcraser cette rйvolte ! Nul n'йchappera ?notre punition, Tambov redeviendra soviйtique !;Bauern der Provinz Tambov, angefьhrt durch den Sozialisten Ilya Antonov, haben einen fьr uns desastrцsen Aufstand gegen die Sowjetmacht begonnen. Die Antonovschina (Unterstьtzer Antonovs)  sind zu einem Albtraum fьr unser Land geworden! Genosse Trotsky glaubt, dass wir keinerlei Mitleid mit diesem Kulakenabschaum haben sollten, der so viele Sowjetoffizielle getцtet und sich an die Spitze der Konterrevolution gestellt hat. Antonov und seine Bauernarmee werden mit allen Mitteln aufgehalten - Nein, vernichtet! - werden, auch wenn dies den Einsatz von Giftgas erfordert, so wie von Genosse Tukhachevsky gewollt. Wir werden diesen Aufstand zerschlagen und niemand wird sich der gerechten Strafe entziehen! Tambov wird bald wieder sowjetisch werden!;Tambowscy chіopi, dowodzeni przez eserowskiego aktywist? Ili?Antonowa, rozpoczкli fataln?w skutkach rebeli?przeciwko wіadzy sowieckiej. Antonowszczyna (zwolennicy Antonowa) stali si?postrachem caіego kraju. Towarzysz Trocki uwaїa, їe nie powinniњmy okazywa?їadnej litoњci dla kuіakуw prowadz№cych otwart?kontrrewolucyjn?wojn? Antonow i jego chіopi bкd?pokonani wszelkimi sposobami, nawet jeњli bкdziemy musieli uїy?gazu bojowego (jak chce towarzysz Tuchaczewski), zdіawimy to powstanie. Nikt nie ucieknie od kary, Tambow bкdzie na powrуt sowiecki!;Los campesinos de Tambov, liderados por un activista del SR llamado Ilya Antonov, iniciaron una rebeliуn desastrosa contra el poder soviйtico. Los Antonovschina (los partidarios de Antonov) se han vuelto una pesadilla para nuestro paнs. El camarada Trotsky cree que no deberнamos tener piedad hacia estos kulбks que mataron a tantos oficiales soviйticos y participaron en un acto contrarrevolucionario a gran escala. Antonov y su ejйrcito campesino serбn destruнdos por todos los medios, aъn si tenemos que usar gases venenosos (como quiere el camarada Tukhachevsky) aplastaremos este motнn. ЎNadie escapar?a nuestro castigo, Tambov ser?soviйtico de nuevo!;I contadini di Tambov, guidati dall'attivista SR Ilya Antonov, hanno lanciato una disastrosa ribellione contro il potere dei Soviet. Antonovschina (i sostenitori di Antonov) sono diventati un incubo per il nostro paese. Il compagno Trotsky pensa che non dovremmo avere alcuna piet?per questi kulaki che hanno ucciso cos?tanti ufficiali sovietici e hanno partecipato in un atto contro-rivoluzionario su larga scala. Antonov e i suoi contadini saranno distrutti con ogni mezzo necessario, elimineremo questa sommossa anche tramite l'uso di gas velenosi (come vuole il compagno Tukhachevsky). Nessuno sfuggir?alla nostra punizione, Tambov torner?presto sotto il controllo dei Soviet!;;;;;;Тамбовские крестьяне, ведомы?эсеровским активистом Илье?Антоновы? начали ужасающе?по силе восстани?против советско?власти. Антоновщин?стал?кошмаром для нашего государств? Товари?Троцки?уверен, чт?мы не должны имет?ни малейшей пощады по отношени??этим кулака? убивши?стол?мног?представителей советско?власти ?участовавшим ?полномасштабно?контрреволюционном акте. Антоно?со свое?крестьянско?армией буде?уничтоже?любыми средствами, даже если на?придет? использовать отравляющие газы (ка?планируе?товари?Тухачевски?, мы сокрушим этот ?те? Никт?не избежи?нашегоправосуд?, ?Тамбовск? губерн? скор?снов?станет советско?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007517_NAME;Kronstadt rebellion;La rйvolte de Kronstadt;Der Kronstadt-Aufstand;Powstanie kronsztadzkie;Rebeliуn de Kronstadt;La ribellione di Kronstadt;;;;;;Кронштадтски??те?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007517_DESC;Russian seamen always were a powerhouse of the revolutionary movement - since the rebellion on Potemkin battleship in 1905. During the February and October revolution the seamen from Baltic fleet were our main armed unit in Petrograd. But they always were too anarchistic to follow the right path to communism, which made them very unstable. The seamen of Kronstadt became corrupted by SR propaganda and decided to depose our legitimate Soviet government by force. Currently their base, Kronstadt, a little island in St. Petersburg's bay, is in flames of this dangerous revolt, and the rebels are trying to enter the capital! We cannot agree with their demands - the rebellion should be smashed immediately!;Les marins russes ont toujours йt?un centre de puissance du mouvement rйvolutionnaire, depuis la rйbellion de cuirass?Potemkine de 1905. Lors des rйvolutions de fйvrier et d'octobre, les marins de la flotte de la Baltique furent notre principale unit?armйe ?Petrograd. Mais ils furent toujours trop anarchiques pour suivre le chemin correct vers le communisme, ce qui les rendait trиs instables. Les marins de Kronstadt ont йt?corrompus par la propagande Socialiste-Rйvolutionnaire, et ont dйcid?de renverser notre lйgitime gouvernement soviйtique par la force. En ce moment, leur base de Kronstadt, une petite оle dans la baie de Saint-Pйtersbourg, est enflammйe par cette rйvolte dangereuse, et les rebelles tentent d'entrer dans la capitale ! Nous ne pouvons pas cйder sur leurs exigences, la rйbellion doit кtre brisйe immйdiatement !;Russische Matrosen waren schon immer ein Zugpferd der Revolutionsbewegung, spдtestens seit der Rebellion auf dem Panzerkreuzer Potemkin in Odessa im Jahre 1905. Wдhrend der Februar- und Oktoberrevolution waren die Matrosen der baltischen Flotte unsere Hauptstreitkrдfte in Sankt Petersburg. Sie waren allerdings schon immer viel zu anarchistisch eingestellt um den rechten Pfad zum Kommunismus zu finden - eine Tatsache, die viel zu 'instabil' macht. Die Matrosen von Kronstadt wurden durch die Propaganda der Sozialisten korrumpiert und wollen nun unsere legitime Sowjetregierung mit Gewalt stьrzen! Ihre momentane Basis, Kronstadt, eine kleine Insel in der Bucht von Sankt Petersburg, steht durch die Revolte in Flammen und die Rebellen versuchen sich Zugang zur Hauptstadt zu verschaffen. Wir kцnnen ihren Forderungen nicht nachgeben - ihre Rebellion muss umgehend zerschlagen werden!;Marynarze rosyjscy byli zawsze ostoj?ruchu rewolucyjnego - od czasu powstania na pancerniku Potiomkin w 1905 r. W czasie Rewolucji Lutowej i Paџdziernikowej marynarze z floty baіtyckiej byli naszym gіуwnym oddziaіem w Piotrogrodzie. Ale przy wszystkich swoich zasіugach, byli zbyt anarchistycznie by dali si?uj№ж w karby paсstwowego komunizmu. Eserowska propoganda wprowadziіa zamieszanie w ich szeregach i zdecydowali si?oni na obalenie sowieckiego rz№du siі№. Ich baza, Kronsztadt, maіa wysepka w zatoce petersburskiej, jest terenem groџnej rewolty, a rebelianci prуbuj?dosta?si?do stolicy! Nie moїemy przysta?na ich ї№dania - rebeli?trzeba?zdіawi?natychmiast!;Los marineros rusos siempre fueron un puntal del movimiento revolucionario, desde la rebeliуn del acorazado Potemkin en 1905. Durante las revoluciones de febrero y octubre, los marineros de la flota bбltica fueron nuestra principal unidad armada en Petrogrado. Pero siempre fueron demasiado anarquistas como para seguir el verdadero camino al comunismo, lo que los hizo muy inestables. Los marineros de Kronstadt fueron corrompidos por propaganda del SR y decidieron deponer por la fuerza a nuestro gobierno soviйtico legнtimo. ЎActualmente su base, Kronstadt, una pequeсa isla en la bahнa de San Petersburgo, es presa de las llamas de esta revuelta peligrosa, y los rebeldes estбn tratando de ingresar en la capital! ЎNo podemos aceptar sus demandas, la rebeliуn debe ser aplastada inmediatamente!;I marinai russi sono sempre stati una roccaforte del movimento rivoluzionario, a partire dall'ammutinamento della corazzata Potemkin nel 1905. Durante le rivoluzioni di Febbraio e di Ottobre i marinai della Flotta del Baltico sono stati la nostra principale forza armata a San Pietroburgo. Tuttavia, sono sempre stati troppo anarchici per seguire il corretto sentiero del comunismo, cosa che li rese molto instabili. I marinai della Kronstadt sono stati corrotti dalla propaganda SR e hanno deciso di deporre il nostro legittimo governo Sovietico con la forza. Al momento la loro base, Kronstadt, una piccola isola nella baia di San Pietroburgo, ?infiammata da questa pericolosa rivolta e i ribelli stanno cercando di entrare nella capitale! Non possono arrenderci alle loro richieste - la rivolta deve essere soppressa immediatamente!;;;;;;Руские матрос?всегда были локомотиво?революционного движен? со времен восстания на броненосце 'Потемкин' ?1905-?году. Во время Февральско??Ок?брьско?революци?матрос??Балтийског?флот?были наше?главно?вооруженно?сило??уличны?столкновен???Петрограде. Ув? матрос?всегда были слишко?разнузданн??анархичн? чтоб?следоват?верном?коммунистическом?пати, чт?сделал?их очен?нестабильным? Матрос?Кронштадта уж?давн?разьеден?эсеровской пропагандо??сейчас он?предприняли попытк?свергнут?законное советско?правительств?сило? Сейчас их база, Кронштад? уж?об?та пламенем контрреволюционног??тежа, ?повстанц?матрос?пытают? пробиться ?столиц? ?на?не?никаки?осноаний соглашаться ?их требован?ми - ?те?должен быть подавлен ка?можн?скорее!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2001573_DESC;Germany didn't answer our call for Swiss neutrality, whereas the French did. It's a clear violation of the 1815 Treaty of Paris, and a Casus Belli for us.;L'Allemagne n'a pas rйpondu ?notre appel concernant la neutralit?suisse, alors que les Franзais l'ont fait. Il s'agit d'une violation flagrante du trait?de Paris de 1815, et pour nous un casus belli.;Deutschland hat, im Gegensatz zu Frankreich, unseren Ruf zur Wahrung der schweizer Neutralitдt nicht beantwortet. Dies ist ein eindeutiger Versto?gegen den Vertrag von Paris von 1815 und ein Kriegsgrund fьr uns.;Niemcy nie odpowiedzieli na nasze wezwanie do uhonorowania neutralnoњci Szwajcarii, podczas gdy Francuzi to zrobili. To jawne pogwaіcenie Traktatu Paryskiego z 1815 r., ktуre stwarza dla nas casus belli.;Alemania no contest?nuestra demanda para mantener la neutralidad suiza, mientras que los franceses si. Es una clara violaciуn del Tratado de Parнs de 1815 y un casus belli para nosotros.;La Germania non ha risposto al nostro richiamo sulla neutralit?della Svizzera, mentre la Francia lo ha fatto. E' una chiara violazione del Trattato di Parigi del 1815 e un buon Casus Belli per noi.;;;;;;Герман? не ответила на на?призыв ?нейтралитету Швейцари?ка?эт?сделал?французы. Эт?явное нарушени?Парижского договора 1815 года, ?Casus Belli для на?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2001574_DESC;Germany decided to declare war on France. The Entente Cordiale, that we signed with France in 1904, recognizes each others Colonies and Spheres of Influence, but that Agreement doesn't compel us to declare War on Germany. Perhaps it is better to continue with our 'splendid isolation' and don't involve ourselves in another European conflict.;L'Allemagne a dйcid?de dйclarer la guerre ?la France. L'Entente Cordiale que nous avons sign?avec la France en 1904 reconnaоt les colonies et autres sphиres d'influence de chacun, mais cet accord ne nous oblige pas ?dйclarer la guerre ?l'Allemagne. Peut-кtre est-il prйfйrable de continuer dans notre 'Splendide isolement' et de ne pas nous engager dans un nouveau conflit europйen.;Das deutsche Reich hat sich dazu entschieden Frankreich den Krieg zu erklдren. Die Entente Cordiale, die wir mit Frankreich im Jahre 1904 unterschrieben haben, sorgt fьr Anerkennung der Kolonien, ihrer Grenzen und der Einflusssphдren unserer beider Lдnder, verpflichtet uns allerdings nicht dazu, den Deutschen den Krieg zu erklдren. Vieleicht ist es besser unsere Politik der Isolation fortzusetzen und uns nicht in einen weiteren europдischen Konflikt hineinziehen zu lassen.;Niemcy zdecydowaіy si?wypowiedzie?wojn?Francji. Sojusz Entente Cordiale, podpisany z Francj?w 1904 r. uznaje kolonie i strefy wpіywуw kaїdej ze stron, ale nie zmusza nas do wypowiedzenia wojny Niemcom. By?moїe bardziej opіaca nam si?kontynuowa?nasz?'wygodn?izolacj? i nie angaїowa?si?w kolejny europejski konflikt.;Alemania decidi?declarar la guerra a Francia. La Entente Cordiale, que firmamos con Francia en 1904, reconoce cada una de las colonias y esferas de influencia, pero ese acuerdo no nos obliga a declararle la guerra a Alemania. Quizбs es mejor continuar con nuestro esplйndido aislamiento y no involucrarnos en otro conflicto europeo.;La Germania ha deciso di dichiarare guerra alla Francia. L'Intesa Cordiale, che abbiamo firmato con la Francia nel 1904, riconosce le colonie e le sfere di influenza di entrambe le nostre nazioni, ma quell'accordo non ci obbliga a dichiarare guerra alla Germania. Forse dovremmo continuare con il nostro 'splendido isolamento' e non coinvolgerci in un altro conflitto europeo.;;;;;;Герман? решила об?вить войн?Франци? Tройственно?согласие (Антант?, подписанно??1904-?году, признавало колони??сфер?вл?ния союзнико? но он?не позволяет на?об?вить Германии войн? Пожалу? буде?лучш?продолжать нашу политику 'блес?ще?изоляци? ?не влезат??очередно?европейски?конфликт.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
