EVT1914_2145531_DESC;General Otto Liman von Sanders, the head of the German military mission to the Ottoman Empire, has left our country today to return home, together with the other German military leaders.;Le Gйnйral Otto Liman von Sanders, qui dirigeait la mission militaire allemande dans l'Empire Ottoman a quitt?notre pays, ainsi que l'ensemble des officiers allemands de la mission. ;Generalleutnant Otto Liman von Sanders, Kopf der deutschen Militдrmission im osmanischen Reich, hat unser Land heute verlassen um nach Hause zurьckzukehren. Mit ihm gehen auch die anderen deutschen Militдrs.;Genera?Otto Liman von Sanders, szef niemieckiej misji wojskowej w Imperium Ottomaсskim, opuњci?dzisiaj nasz kraj, aby powrуci?do domu, wraz z innymi niemieckimi dowуdcami.;El general Otto Liman von Sanders, el jefe de la comisiуn militar alemana en el Imperio Otomano, ha dejado hoy nuestro paнs para volver a casa, junto con otros lнderes militares alemanes.;Il Generale Otto Liman von Sanders, il capo della missione militare tedesca presso l'Impero Ottomano, ha lasciato oggi il nostro paese per tornare a casa, insieme agli altri ufficiali militari tedeschi.;;;;;;Генера?Отто Лима?фо?Сандер? глав?германской военно?миссии ?Османско?импери? сегодня остави?нашу страну чтоб?вернуться на родину, вместе ?другим?немецким?военачальникам?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
