EVT1914_2191583_DESC;The German military mission to the Ottoman Empire has returned home today. General Otto Liman von Sanders, the head of the mission, together with the other German military leaders, has just arrived in Berlin and is ready to receive his next assignment.;Le Gйnйral Otto Liman von Sanders, qui dirigeait la mission militaire allemande dans l'Empire Ottoman est rentr?en Allemagne, ainsi que l'ensemble des officiers allemands de la mission, o?ils attendent leurs nouvelles affectations. ;Die deutsche Militдrmission im osmanischen Reich ist nach Hause zurьckgekehrt. Generalleutnant Otto Liman von Sanders, Kopf der Militдrmission, sowie weitere Militдrs sind soeben in Berlin eingetroffen und bereit fьr neue Befehle.;Niemiecka misja wojska w Imperium Ottomaсskim powrуciіa dzisiaj do kraju. Genera?Otto Liman von Sanders, szef misji, wraz z innymi dowуdcami, przybyli do Berlina i s?gotowi do dalszej sіuїby krajowi.;La comisiуn militar alemana en el Imperio Otomano ha vuelto hoy a casa. El general Otto Liman von Sanders, jefe de la comisiуn, juntos con otros lнderes militares alemanes, acaban de llegar a Berlнn y estбn preparados para recibir su siguiente tarea.;La missione militate tedesca presso l'Impero Ottomano ?tornata a casa oggi. Il Generale Otto Liman von Sanders, il capo della missione, insieme agli altri ufficiali tedeschi, ?arrivato oggi a Berlino ed ?pronto a ricevere il suo prossimo incarico.;;;;;;Немецк? военная мисс? ?Османско?импери?вернулас?на родину сегодня. Генера?Отто Лима?фо?Сандер? глав?миссии, вместе ?другим?немецким?военачальникам? только чт?прибыл ?Берлин ?гото?принять своё следующе?назначение.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
