EVT1914_2145532_DESC;A major power (which is currently at war with Germany and the Central Powers) decided to declare war on us. In this situation, we might try to ally with Germany and join the Central Powers. After all, the enemy of my enemy is my friend.;Une puissance majeure en guerre avec les puissances centrales vient йgalement de nous dйclarer la guerre. Dиs lors, nous devrions sans doute conclure une alliance militaire avec les puissances centrales. L'ennemi de mon ennemi n'est-il pas en effet mon ami ? ;Eine GroЯmacht, die sich momentan im Krieg mit Deutschland und den Mittelmдchten befindet,  hat uns den Krieg erklдrt. In dieser Situation sollten wir vielleicht versuchen, uns mit dem Deutschen Reich zu verbьnden und den Mittelmдchten beizutreten. Es heiЯt schlieЯlich, dass der Feind meines Feindes mein Freund ist.;Jedno z mocarstw (ktуre aktualnie jest w stanie wojny z Niemcami i paсstwami centralnymi) wypowiedziaіo nam wojn? W tej sytuacji, moїemy sprуbowa?wejњж w sojusz z Niemcami i sta?si?jednym z paсstw centralnych. W koсcu wrуg mojego wroga jest moim przyjacielem.;Una gran potencia (la cual est?actualmente en guerra con Alemania y las Potencias Centrales) decidi?declararnos la guerra. En esta situaciуn, podemos intentar aliarnos con Alemania y unirnos a las Potencias Centrales. Despuйs de todo, el enemigo de mi enemigo es mi amigo.;Una potenza mondiale (che si trova gi?in guerra con la Germania e gli Imperi Centrali) ha deciso di dichiarci guerra. In questa situazione, potremmo provare ad allearci con la Germania ed entrare negli Imperi Centrali. Dopotutto, il nemico del mio nemico ?mio amico.;;;;;;Великая держав?(которая ?наст?ще?время ?сост?ни?войн??Германие??Центральными державам? решила об?вить на?войн? ?этой ситуации, мы могл?бы попытать? вступить ?союз ?Германие??присоединить? ?Центральны?державам. ?конц?концов, враг моег?враг?мо?друг.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,