EVT1914_2191584_DESC;The Ottomans are now at war with one of our enemies and they have decided that it would be beneficial for them to join the Central Powers. It looks like a good proposal, to fight the same enemy together!;Les Ottomans йtant en guerre avec l'un de nos ennemis, ils souhaitent rejoindre notre alliance militaire. Nous devrions accepter cette proposition et unir nos forces face ?nos ennemis ! ;Das osmanische Reich befindet sich seit kurzem im Krieg mit unseren Feinden und ein Beitritt zu den Mittelmдchten scheint fьr alle Seiten vorteilhaft. Den selben Feind gemeinsam zu bekдmpfen scheint ein gutes Angebot zu sein.;Ottomanowie s?teraz w stanie wojny z jednym z naszych przeciwnikуw i zdecydowali, їe korzystne bкdzie dla nich przyі№czenie si?do paсstw centralnych. Wygl№da to na dobr?ofert? walczy?wspуlnie z tym samym wrogiem!;Los otomanos estбn en guerra con uno de nuestros enemigos y han decidido que serнa beneficioso para ellos unirse a las Potencias Centrales. ЎParece una buena propuesta, luchar contra el mismo enemigo juntos!;Gli Ottomani sono ora in guerra con uno dei nostri nemici e hanno deciso che converrebbe loro entrare negli Imperi Centrali. Sembra un ottima proposta, combattere insieme lo stesso nemico!;;;;;;Сейчас Османы ?сост?ни?войн??одни?из наши?врагов, ?он?решили, чт?для ни?буде?выгодн?присоединить? ?Центральны?державам. Эт?выгляди?хороши?предложением, для того чтоб?чтоб?обьединить усил? ?борьбе ?общи?врагом!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
