EVT1914_2145533_DESC;The reinforcements for our army have finally arrived!;Les renforts sont enfin arrivйs et rejoignent les rangs de notre armйe ! ;Die Verstдrkungen fьr unsere Armee sind endlich eingetroffen!;Dodatkowe oddziaіy dla naszej armii wreszcie przybyіy!;ЎLos refuerzos para nuestro ejйrcito han llegado!;I rinforzi per il nostro esercito sono finalmente arrivati!;;;;;;Подкреплен? для наше?арми?наконе?то здес?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
