EVT1914_2007519_DESC;Among his comrades, Lenin was notable for working almost ceaselessly, fourteen to sixteen hours daily, occupied with minor, major, and routine matters. However, the mental strains of leading a revolution, governing, and fighting a civil war aggravated the physical debilitation consequent to the two bullet wounds that he suffered in 1918 from two attempted assassinations.\nIn May 1922, Lenin suffered the first of three strokes, which left him unable to speak for weeks, but he managed to recover in a few months. However, in December 1922 he suffered a second stroke that partly paralyzed his right side and forced him to withdraw from active politics. In March 1923, he suffered the third stroke that rendered him mute and bed-ridden until his death. Lenin finally died on 21 January 1924, at 53 years of age.;Lйnine йtait connu pour son immense capacit?de travail, de quatorze ?seize heures par jour. L'usure psychologique engendrйe par les annйes de rйvolution et de guerre civile ont aggrav?un йtat de sant?dйj?compromis par les sйquelles laissйes par deux tentatives d'assassinat en 1918.\nEn mai 1922, Lйnine a subi la premiиre de ses trois attaques, qui lui a фt?l'usage de la parole pendant plusieurs semaines et dont il ne se remettra qu'aprиs plusieurs mois. Une deuxiиme attaque paralysa tout son cфt?droit en dйcembre 1922 et le contraint de se retirer de la vie politique. Une troisiиme attaque le cloua ?son lit, muet, de mars 1923 jusqu'?sa mort, le 21 janvier 1924, ?53 ans. ;Unter seinen Genossen war Lenin dafьr bekannt fast ohne Unterlass zu arbeiten - vierzehn bis sechzehn Stunden am Tag, ob wichtige, unwichtige oder Routineaufgaben. Doch die geistige Belastung der Anfьhrer einer Revolution zu sein und das Regieren und Ausfechten eines gewaltigen Bьrgerkrieges haben seine physische Behinderung durch die Schusswunden der beiden Attentatsversuche von 1918  nur verschlimmert. \n Im May 1922 erlitt Lenin den ersten von drei Schlaganfдllen, der es ihm ьber Wochen unmцglich machte zu sprechen. Nach einigen Monaten erholte er sich, erlitt aber kurz darauf im Dezember 1922 einen weiteren Schlaganfall, der seine rechte Seite teilweise lдhmte und ihn dazu zwang, sich aus dem politischen Geschehen zurьckzuziehen. Im Mдrz 1923 erlitt er seinen dritten Schlaganfall, der ihn bis zu seinem Tod taub und bettlдgerig werden lie? Lenin starb schlieЯlich am 21. Januar 1924 im Alter von 53 Jahren.;Wњrуd swoich towarzyszy Lenin wyrуїnia?si?tym, їe pracowa?niemal bez wytchnienia, od czternastu do szesnastu godzin dziennie, zajmuj№c si?rzeczami wiкkszymi, mniejszymi lub zgoіa drobiazgowymi tematami. Jednak wysiіek intelektualny zwi№zany z przywуdztwem rewolucji, rz№dzeniem i prowadzeniem wojny domowej, pogorszyіy uіomnoњci fizyczne spowodowane dwoma ranami postrzaіowymi ktуre wynikaіy z dwуch zamachуw na Lenina w 1918 r.\nW maju 1922 r. Lenin przeїy?pierwszy z trzech zawaіуw, po ktуrym przez wiele tygodni nie by?w stanie mуwi? ale po kilku miesi№cach odzyska?zdrowie. Jednak drugi zawa? w grudniu 1922 r., cz?ciowo sparaliїowa?praw?cz??ciaіa Lenina i zmusi?go do wycofania si?z aktywnej polityki. W marcu 1923 r. Lenin przeszed?trzeci zawa? po ktуrym utraci?mow?i pozosta?przykuty do іуїka a?do њmierci. Lenin zakoсczy?їycie w wieku 53 lat, 21 stycznia 1924 r.;Entre sus camaradas, Lenin fue respetado por trabajar casi sin descanso, de catorce a dieciseis horas diarias, ocupado con diferentes materias. Sin embargo, los estragos mentales de liderar un revoluciуn, gobernar y luchar en una guerra civil agravaron su debilidad fнsica debida a las dos heridas de bala que sufri?en 1918 en dos intentos de asesinato.\nEn mayo de 1922, Lenin sufri?el primero de tres golpes, que le dej?incapaz de hablar durante semanas, pero se recuper?en unos pocos meses. Sin embargo, en diciembre de 1922 sufri?un segundo golpe que le paraliz?parcialmente su lado derecho y le forz?a retirarse de la polнtica. En marzo de 1923, sufri?el tercer golpe que lo dej?mudo y postrado en la cama hasta su muerte. Lenin muri?el 21 de enero de 1924 a los 53 aсos.;Lenin era noto per lavorare quasi costantemente, dalle quattordici alle sedici ore al giorno, occupato da problemi minori, maggiori e di routine. Tuttavia, lo sforzo mentale necessario a guidare una rivoluzione, governare e combattere una guerra civile aggravarono la debilitazione fisica dovuta alle due ferite da proiettile che aveva sofferto nel 1918 in due tentativi di assassinio.\nNel maggio 1922, Lenin soffr?il primo di tre ictus, che lo lasci?incapace di parlare per settimane, anche se riusc?a recuperare in pochi mesi. Tuttavia, nel Dicembre 1922 fu colpito da un secondo ictus che paralizz?parzialmente il lato destro del suo corpo e lo costrinse a ritirarsi dalla politica attiva. Nel Marzo 1923 fu colpito dal terzo ictus che lo rese muto e lo costrinse a letto fino alla sua morte. Lenin mor?il 21 Gennaio 1924, a 53 anni di et?;;;;;;Сред?ег?товарище? Лени?отличался почт?беспрерывной работо? от четырнадцати до шестнадцат?часо??день, за?ты?решением небольши? серьёзны??рутинных вопросов. Те?не мене? психическо?напряжени?ведения революци? управлен?, ?гражданско?войн?усугубил?физическое истощени?появившее? посл?двух пулевы?ранени? перенесённых посл?двух покушени??1918 году.\n?ма?1922 года Лени?перене?первый из трех ударов, посл?которого он бы?не ?сост?ни?говорить ?течени?недель, но ем?удалос?восстановить ?течени?нескольких ме?це? Те?не мене? ?декабр?1922 года он перене?второй инсуль? частично парализова?ег?правую сторон??заставил?ег?отказать? от активной политической деятельност? ?март?1923 года он перене?третий инсуль? которы?остави?ег?немы??приковал ?постел?до само?смерти. Лени?умер 21 января 1924 года, ?возрасте 53 ле?;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007520_NAME;Foundation of USSR;Crйation de l'URSS ;Die Grьndung der UdSSR;Powstanie ZSRR;Fundaciуn de la URSS;La creazione dell'URSS;;;;;;Основани?СССР;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007520_DESC;On December 29,1922, a conference of delegations from the Russian SFSR, the Transcaucasian SFSR, the Ukrainian SSR and the Byelorussian SSR approved the Treaty of Creation of the USSR and the Declaration of the Creation of the USSR. These two documents were confirmed by the 1st Congress of Soviets of the USSR and signed by heads of delegations on December 30, 1922.\nThe Treaty on the Creation of the USSR legalized the creation of a union of several Soviet republics in the form of the Union of Soviet Socialist Republics, or Soviet Union. On the 31st of January 1924, the Second Congress of Soviets of the Soviet Union ratified the 1924 Soviet Constitution which legitimated the December 1922 Treaty on the Creation of the USSR.;Le 29 dйcembre 1922, une convention regroupant des dйlйgations des rйpubliques soviйtiques de Russie, de Transcaucasie, d'Ukraine et de Biйlorussie approuva le trait?portant crйation de l'URSS et la dйclaration de crйation de l'URSS. Ces deux textes ont йt?confirmйs par le premier Congrиs des Soviets de l'URSS et sign?par les prйsidents des dйlйgations le 30 dйcembre 1922.\nLe trait?portant crйation de l'URSS permit de valider la crйation d'une fйdйration de rйpubliques soviйtiques, dйnommйe Union des Rйpubliques Socialistes Soviйtiques (URSS) ou Union Soviйtique. le 31 janvier 1924, le deuxiиme Congrиs des Soviets ratifia la Constitution de 1924 relative ?l'organisation des pouvoirs en URSS. ;Am 29. Dezember 1922 stimmte eine Konferenz der Delegationen der russischen sozialistisch-fцderativen Sowjetrepublik (RSFSR), der transkaukasischen SFSR, der ukrainischen SFSR und der weiЯrussischen SFSR dem Grьndungsvertrag der Union der sozialistischen Sowjetrepubliken (UdSSR) sowie die Proklamation derselben zu. Beide Dokumente wurden durch den ersten Sowjetkongress der UdSSR bestдtigt und von den Anfьhrern der Delegationen am 30. Dezember 1922 unterschrieben. \nDer Vertrag zur Grьndung der UdSSR legalisierte damit die Schaffung eines Bundesstaates sozialistischer Sowjetrepubliken unter einer gemeinsamen Unionsregierung.  Am 31. Januar 1924 trat der zweite Sowjetkongress zusammen und ratifizierte die sowjetische Verfassung von 1924 und legitimierte damit schlieЯlich endgьltig den Grьndungsvertrag von 1922.;29 grudnia 1922 r. konferencja delegatуw Rosyjskiej FSRR, Zakaukaskiej FSRR, Ukraiсskiej SRR i Biaіoruskiej SRR zaaprobowaіy Traktat o Powstaniu ZSRR i Deklaracj?o Powstaniu ZSRR. Te dwa dokumenty zostaіy potwierdzone przez Pierwszy Kongres Sowietуw ZSRR i podpisane przez przewodnicz№cych delegacji 30 grudnia 1922 r.\nTraktat o Powstaniu ZSRR zalegalizowa?zaіoїenie unii poszczegуlnych republik sowieckich w formie Zwi№zku Socjalistycznych Republik Radzieckich, lub te?Zwi№zku Radzieckiego. 31 stycznia 1924 r. Drugi Kongres Sowietуw Zwi№zku Radzieckiego ratyfikowa?sowieck?konstytucj?1924 r., ktуra legitymizowaіa Traktat o Powstaniu ZSRR z grudnia 1922 r.;El 29 de diciembre de 1922, una conferencia de delegaciones de la RSFSR, la SFSR Transcaucбsica, la SSR Ucraniana y la SSR Bielorrusa aprobaron el Tratado de Creaciуn de la URSS y la Declaraciуn de Creaciуn de la URSS. Estos dos documentos fueron confirmados por el 1er Congreso Soviйtico de la URSS y firmado por los jefes de las delegaciones el 30 de diciembre de 1922.\nEl Tratado de la Creaciуn de la URSS legaliz?la creaciуn de la uniуn de varias repъblicas soviйticas para formar la URSS o Uniуn Soviйtica. El 31 de enero de 1924, el 2o Congreso Soviйtico de la Uniуn Soviйtica ratific?la Constituciуn Soviйtica de 1924 que legitim?en diciembre de 1922 el Tratado de la Creaciуn de la URSS.;Il 29 Dicembre 1922, una conferenza con delegati della RSS (Repubblica Socialist Sovietica) Russa, la RSS Transcaucasica, la RSS Ucraina e la RSS Bielorussa approv?il Trattato di Creazione dell'URSS e la Dichiarazione sulla Creazione dell'URSS. Questi due documenti furono confermati dal Primo Congresso dei Soviet dell'URSS e firmati dai capi delle delegazioni il 30 Dicembre 1922.\nIl Trattato di Creazione dell'URSS legalizz?la creazione di un'unione di parecchie Repubbliche Sovietiche nella forma dell'Unione delle Repubbliche Socialiste Sovietiche, o Unione Sovietica. Il 31 Gennaio 1924, il Secondo Congresso dei Soviet dell'Unione Sovietica ratific?la Costituzione Sovietica del 1924 che legittim?il Trattato del Dicembre 1922.;;;;;;29 декабря 1922 года, конференция делегаци?из русского РСФС? ЗСФС? Украинской СС??Белорусско?СС?утвердил?догово??создании СССР ?Декларацию ?создании СССР. Эт?дв?документ?были утверждены первым съездо?Совето?СССР ?подписан?главам?делегаци?30 декабря 1922 года.\nДогово??создании СССР узаконил создание объединения нескольких советски?республи??форм?Союз?Советски?Социалистических Республи? ил?Советского Союз? На 31 января 1924 года второй съез?Совето?СССР ратифицирова??1924 году советску?конституци? которая узаконил?Догово??создании СССР от декабря 1922 года.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007521_NAME;Seek a soft peace with Germany;Demander une paix douce ?l'Allemagne ;Der sanfte Frieden mit dem deutschen Reich;Poszukiwanie pokoju z Niemcami;Buscar la paz con Alemania;Cerca una pace favorevole coi tedeschi;;;;;;Постараться заключит??гкий ми??Германие?x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
EVT1914_2007521_DESC;After obtaining power in Russia in the October Revolution, the Bolshevik Party decided to immediately make peace with the German Empire and the Central Powers, as they had promised the Russian people before the Revolution. On 26 October 1917, Vladimir Lenin signed the 'Decree on Peace', which called 'upon all the belligerent nations and their governments to start immediate negotiations for peace' and proposed an immediate withdrawal of Russia from World War I. The Bolsheviks demanded 'peace without annexations or indemnities' (therefore offering neither territory nor money), but the Germans answered demanding the independence of Finland, Poland and the Baltic States.;Aprиs avoir pris le pouvoir lors de la Rйvolution d'Octobre, le Parti bolchйvik dйcida de signer un trait?de paix avec les puissances centrales pour respecter la promesse faite au peuple russe de cesser les hostilitйs. Le 26 octobre 1917, Vladimir Lйnine signa le 'Dйcret sur la Paix', appelant 'toutes les nations belligйrantes et leur gouvernement ?entamer immйdiatement des nйgociations de paix' et de retirer leurs troupes de Russie. Les Bolchйviks demandиrent une paix sans annexion ni indemnitйs mais les Allemands exigиrent l'indйpendance de la Finlande, de la Pologne et des Etats Baltes. ;Nach der Machterlangung in Russland wдhrend der Oktoberrevolution entschied sich die bolschewistische Partei dazu, umgehend in Friedensverhandlungen mit dem deutschen Reich und den Mittelmдchten zu treten, wie es dem russischen Volk vor der Revolution versprochen wurde. Am 26. Oktober 1917 unterschrieb Vladimir Lenin das Friedensdekret, welches alle kriegstreibenden Nationen und ihre Regierungen zu sofortigen Friedensverhandlungen aufrief und den russischen Rьckzug aus dem Ersten Weltkrieg vorschlug. Die Bolschewiken verlangten einen 'Frieden ohne Annexionen oder Schadensersatz', doch die Deutschen bestanden auf eine Unabhдngigkeit Finnlands, Polens und der baltischen Staaten Estland, Lettland und Litauen. ;Po zdobyciu wіadzy w Rosji w Rewolucji Paџdziernikowej, partia bolszewicka planowaіa natychmiast podpisa?pokуj z Cesarstwem Niemieckim i paсstwami centralnymi, tak jak obiecywaіa ludowi rosyjskiemu przez rewolucj? 26 paџdziernika 1917 r. Wіodzimierz Lenin podpisa?'Dekret o Pokoju', ktуry wzywa?'wszystkie wojuj№ce narody i ich rz№dy by rozpoczкіy natychmiastowe negocjacje na rzecz pokoju' i zaproponowa?natychmiastowe wycofanie Rosji z I Wojny Њwiatowej. Bolszewicy ї№dali pokoju bez 'aneksji i kontrybucji' (tym samym nie oferuj№c koncesji terytorialnych lub finansowych). Niemcy odpowiedzieli ї№daj№c uznania niepodlegіoњci Finlandii, Polski i krajуw baіtyckich.;Despuйs de obtener poder en Rusia en la Revoluciуn de Octubre, el Partido Bolchevique decidi?hacer la paz con el Imperio Alemбn y las Potencias Centrales, como habнan prometido a los rusos antes de la Revoluciуn. El 26 de octubre de 1917, Lenin firm?el 'Decreto de Paz', que llam?a todas las naciones beligerantes y sus gobiernos a empezar inmediatamente las negociaciones de paz y propus?una retirada de Rusia de la 1a Guerra Mundial. Los Bolcheviques demandaron una paz sin anexiones o indemnizaciones (sin ofrecer ni territorios ni dinero), pero los alemanes demandaron la independencia de Finlandia, Polonia y los Estados Bбlticos.;Dopo aver ottenuto il potere in Russia con la Rivoluzione d'Ottobre, il Partito Comunista decise di provare a fare pace con l'Impero Tedesco e gli Imperi Centrali, come aveva promesso al popolo russo prima della rivoluzione. Il 26 ottobre 1917, Vladimir Lenin firm?il 'Decreto sulla pace' che chiedeva 'a tutte le nazioni belligeranti e ai loro governi di iniziare immediatamente negoziati di pace' e propose un immediato ritiro della Russia dalla Prima Guerra Mondiale. I Bolscevichi chiedevano una pace 'senza annessioni e senza indennit? (quindi non offrendo n?territori n?denaro), ma i tedeschi risposero chiedendo l'indipendenza di Finlandia, Polanda e Paesi Baltici.;;;;;;Посл?получения власти ?России ?Ок?брьско?революци? парт? большевико?решила немедленно заключит?ми??Германской империей ?Центральными державам? ка?он?обещал?русскому народу до революци? 26 ок?бря 1917 года ? ? Лени?подписал 'Декрет ?мире', которая призывал 'всем воюющи?народа??их правительствам начать немедленно переговоры ?мире' ?предложи?немедленного вывода России из Первой мирово?войн? Большевики потребовал?'ми?бе?аннексий ?контрибуци? (поэтом?не предлагали ни территории, ни дене?, но немц?ответили требование?независимост?Финляндии, Польши ?стра?Балтии.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
