EVT1914_2007523_DESC;Peace negotiations began on December 22,1917, a week after the conclusion of an armistice between Russia and the Central Powers, at Brest-Litovsk. In February 1918 the Germans made their final offer, demanding the independence of Finland, Poland and the Baltic States. Frustrated with continued German demands for cessions of territory, Leon Trotsky, Bolshevik People's Commissar for Foreign Affairs and head of the Russian delegation, on February 10 1918, announced Russia's withdrawal from the negotiations and unilaterally declared the ending of hostilities, a position summed up as 'no war ?no peace'.;Les nйgociations de paix commencиrent le 22 dйcembre 1917, soit une semaine seulement aprиs la signature ?Brest-Litovsk d'un armistice entre la Russie et les puissances centrales. En fйvrier 1918, les Allemands formulиrent leur ultime proposition, exigeant l'indйpendance de la Finlande, de la Pologne et des Etats Baltes. Face ?une telle intransigeance, Lйon Trostky, commissaire du peuple aux affaires йtrangиres et prйsident de la dйlйgation russe, annonзa le 10 fйvrier 1918 le retrait de la Russie des nйgociations et proclama unilatйralement la fin des hostilitйs. Cette position fut rйsumйe sous la formule 'Ni guerre, ni paix!' ;Die Friedensverhandlungen begannen am 22. Dezember 1917, eine Woche nach dem Waffenstillstand zwischen Russland und den Mittelmдchten, in Brest-Litovsk. Im Februar 1918 machten die Deutschen ihr finales Angebot und forderten die Unabhдngigkeit von Finnland, Polen und den baltischen Staaten. Frustriert durch die fortschreitenden deutschen Forderungen nach Gebietsabtretungen kьndigte der bolschewistische Volkskommissar fьr ДuЯeres und Kopf der russischen Delegation, Leon Trotsky, den Rьckzug Russlands aus den Verhandlungen und die einseitige Erklдrung der Einstellung aller Feindseligkeiten an und schuf damit eine Position, die sich mit 'weder Krieg - noch Frieden' zusammenfassen lдsst.;Negocjacje pokojowe rozpoczкіy si?22 grudnia 1917 r., w tydzie?po zawieszeniu broni pomiкdzy Rosj?i paсstwami centralnymi, w Brzeњciu Litewskim. W lutym 1918 r. Niemcy zіoїyli ostateczn?ofert? ї№daj№c niepodlegіoњci Finlandii, Polski i krajуw baіtyckich. Sfrustrowany ci№gіymi ї№daniami niemieckimi koncesji terytorialnych, Lew Trocki, bolszewicki komisarz ludowych do spraw zagranicznych i przewodnicz№cy delegacji rosyjskiej, 10 lutego 1918 r. ogіosi?wycofanie Rosji z negocjacji i jednostronnie zadeklarowa?koniec dziaіa?wojennych, stan ktуry moїna opisa?jako 'brak wojny - brak pokoju'.;Las negociaciones de paz empezaron el 22 de diciembre de 1917, un semana despuйs de que el armisticio entre Rusia y las Potencias Centrales finalizase, en Brest-Litovsk. En febrero de 1918 los alemanes hicieron su oferta final, demandaron la independencia de Finlandia, Polonia y los Estados Bбlticos. Frustados con las continuas demandas alemanas para las cesiones de territorio, Leon Trotsky, el Comisario Popular Bolchevique de Asuntos Exteriores y jefe de la delegaciуn rusa, el 10 de febrero de 1918, anunci?la retirada de Rusia de las negociaciones y declar?el fin de las hostilidades, una posiciуn conocida como 'ni guerra, ni paz'.;I negoziati di pace iniziarono il 22 Dicembre 1917, una settimana dopo la conclusione di un armistizio tra la Russia e gli Imperi Centrali, a Brest-Litovsk. Nel Febbraio 1918 i Tedeschi fecero la loro offerta finale, chiedendo l'indipendenza di Finlandia, Polonia e Paesi Baltici. Frustrati dalle continue richiese territoriali dei tedeschi, Leon Trotsky, Commissario Bolscevico del Popolo per gli Affari Esteri e capo della delegazione russa, il 10 Febbraio 1918 annunci?il ritiro russo dai negoziati e dichiar?unilateralmente la fine delle ostilit? una posizione riassunta come 'nessuna guerra - nessuna pace'.;;;;;;Мирные переговоры начались 22 декабря 1917 года ?Брес?Литовске, чере?неделю посл?заключен? перемирия межд?Россие??Центральными державам? ?феврал?1918 года немц?сделал?своё окончательно?предложени? треб? независимост?Финляндии, Польши ?стра?Балтии. Разочаровавшис??продолжающих? требован??территориальны?уступо? 10 февраля 1918 года, Ле?Троцки? большевистский народный комиссар иностранны?де??глав?делегаци?России, об?ви??выходе России из переговоро???односторонне?по?дк?об?ви?окончани?военны?действий, за??позици?'ни войн?- ни мира'.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
