EVT1914_2007524_DESC;The Germans refused our generous peace offer. They will pay for this decison, with their blood!;Les Allemands ont refus?notre gйnйreuse proposition de paix. Ils en paieront le prix par le sang ! ;Die Deutschen haben unser groЯzьgiges Friedensangebot abgelehnt. Sie werden fьr diese Entscheidung mit ihrem Blut bezahlen.;Niemcy odrzucili nasz?szczodr?ofert? Zapіac?teraz za swуj upуr krwi?;Los alemanes rechazan nuestra generosa oferta de paz. ЎPagarбn por esta decisiуn, con su sangre!;I tedeschi hanno rifiutato la nostra generosa offerta di pace. Pagheranno per questa decisione con il loro sangue!;;;;;;Немц?отклонил?наше предложени??мире. За эт?решени?он?заплатя?свое?кровью!;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
