EVT1914_2007526_DESC;When Soviet Russia withdrew from the peace negotiations on February 10, 1918 and unilaterally declared the ending of hostilities ('no war ?no peace'), the Central Powers answered by repudiating the armistice on February 18, 1918. Then they launched a major offensive (Operation Faustschlag), encountering virtually no resistance, and seized most of Ukraine, Belarus and the Baltic countries.\nSigning a formal peace treaty was then the only option in the eyes of the Bolsheviks, because the Russian army was demobilized and the newly formed Red Guards were incapable of stopping the advance. The Soviets accepted a peace treaty and the formal agreement, the Treaty of Brest-Litovsk, was ratified on 6 March.\nThe treaty, signed between Soviet Russia on the one side and the German Empire, Austria-Hungary, Bulgaria and Ottoman Empire on the other, marked Russia's final withdrawal from World War I. In all, the treaty took away territory that included a quarter of the Russian Empire's population, a quarter of its industry and nine-tenths of its coal mines.;Lorsque la Russie Soviйtique se retira le 10 fйvrier 1918 des nйgociatiosn de paix et proclama unilatйralement la fin des hostilitйs, les puissances centrales rйpondirent en dйnonзant l'armistice sign?quelques mois plus tфt. L'Allemagne lanзa alors une offensive de grand style (Opйration 'Faustschlag') qui lui permit de prendre le contrфle d'une grande partie de l'Ukraine, de la Biйlorussie et des Etats Baltes.\nAccepter de signer un trait?de paix fыt alors la seule alternative pour les Bolchйviks, l'armйe russe йtant dйmobilisйe et les Gardes rouges pas encore suffisamment puissantes pour stopper l'avance allemande. Les Soviйtiques acceptиrent alors le trait?de Brest-Litovsk, ratifi?le 6 mars.\nCe trait?marqua formellement le retrait de la Russie du premier conflit mondial. Il amputa la Russie de vastes territoires, du quart de sa population et de son industrie et de neuf dixiиmes de ses mines de charbon. ;Als sich Sowjetrussland am 10. Februar 1918 aus den Friedensverhandlungen zurьckzog und einseitig die Einstellung aller Feindseligkeiten verkьndete ('weder Krieg, noch Frieden'), verwarfen die Mittelmдchte den wenige Wochen zuvor geschlossenen Waffenstillstand am 18. Februar 1918. In einer groЯangelegten Offensive, genannt Operation Faustschlag, besetzten sie faktisch ohne Gegenwehr groЯe Teile der Ukraine, WeiЯrusslands und der baltischen Staaten. \nDie Unterzeichnung eines formalen Friedensvertrags war die einzige Option in den Augen der Bolschewiken, da die russische Armee demobilisiert und die neugebildete Rote Garde unfдhig war, die vorrьckenden Verbдnde der Mittelmдchte aufzuhalten. Die Sowjets akzeptierten den Friedensvertrag von Brest-Litovsk, welcher am 6. Mдrz ratifiziert wurde. \nDer Vertrag, unterschrieben von Sowjetrussland auf der einen und dem deutschen Reich, Цsterreich-Ungarn, Bulgarien und dem osmanischen Reich auf der anderen Seite, bedeutete schlieЯlich Russlands endgьltigen Austritt aus dem ersten Weltkrieg. Insgesamt nahm der Vertrag dem jungen Sowjetrussland ein Viertel der russischen Bevцlkerung, ein Viertel seiner Industrie sowie neun-zehntel aller Kohleminen. ;Kiedy Rosja Sowiecka wycofaіa si?z negocjacji pokojowych 10 lutego 1918 r. i jednostronnie zadeklarowaіa koniec dziaіa?wojennych ('brak wojny - brak pokoju'), paсstwa centralne odpowiedziaіy wypowiedzeniem zawieszenia broni 18 lutego 1918 r. Rozpoczкіa si?wtedy wielka ofensywa (Operation Faustschlag), ktуra napotkaіa praktycznie brak oporu i doprowadziіa do zajкcia wiкkszoњci Ukrainy, Biaіorusi i krajуw baіtyckich.\nSigning a formal peace treaty was then the only option in the eyes of the Bolsheviks, because the Russian army was demobilized and the newly formed Red Guards were incapable of stopping the advance. The Soviets accepted a peace treaty and the formal agreement, the Treaty of Brest-Litovsk, was ratified on 6 March.\nThe treaty, signed between Soviet Russia on the one side and the German Empire, Austria-Hungary, Bulgaria and Ottoman Empire on the other, marked Russia's final withdrawal from World War I. In all, the treaty took away territory that included a quarter of the Russian Empire's population, a quarter of its industry and nine-tenths of its coal mines.;Cuando la Uniуn Soviйtica se retir?de las negociaciones de paz el 10 de febrero de 1918 y declar?unilateralmente el fin de las hostilidades ('ni guerra, ni paz'), las Potencias Centrales repudiaron el armisticio el 18 de febrero de 1918. Despuйs lanzaron una gran ofensiva (Operaciуn Faustschlag), sin encontrarse con casi resistencia, y tomaron la mayor parte de Ucranнa, Bielorrusia y los paнses Bбlticos.\nFirmar un tratado de paz fue la ъnica opciуn en los ojos de los Bolcheviques, porque el ejйrcito ruso estaba desmovilizado y la reciйn creada Guardia Roja era incapaz de parar el avance. Los soviйticos aceptaron un tratado de paz y un acuerdo formal, el Tratado de Brest-Litovsk, fue ratificado el 6 de marzo.\nEl tratado, firmado entre la Uniуn Soviйtica por un lado y el Imperio Alemбn, Austria-Hungrнa, Bulgaria y el Imperio Otomano por otro, marc?la retirada final de Rusia de la 1a Guerra Mundial. El tratado quit?territorios que incluнan un cuarto de la poblaciуn del Imperio Ruso, un cuarto de su industria y nueve dйcimas partes de sus minas de carbуn.;Quando la Russia Sovietica si ritir?dai negoziati di pace il 10 Febbraio 1918 e dichiar?unilateralmente la fine delle ostilit?('nessuna guerra - nessuna pace'), gli Imperi Centrali risposero ripudiando l'armistizio il 18 Febbraio 1918. Dopodich? lanciarono una grande offensiva (Operazione Faustschlag), incontrando quasi nessuna resistenza, e occuparono gran parte di Ucraina, Bielorussia e Paesi Baltici.\nFirmare una trattato di pace formale divenne quindi l'unica opzione agli occhi dei Bolscevichi, dato che l'esercito russo era stato demobilizzato e la recentemente formate Guardie Rosse non erano in grado di fermare l'avanzata. I Sovietici accettarono un trattato di pace e l'accordo formale, il Trattato di Brest-Litovsk, fu ratificato il 6 Marzo.\nIl trattato, firmato tra la Russia Sovietica da una parte e Impero Tedesco, Austria-Ungheria, Bulgaria e Impero Ottomano dall'altra, segn?il ritiro definitivo della Russia dalla Prima Guerra Mondiale. Il trattato trasferiva territori che includevano un quarto della popolazione dell'Impero Russo, un quarto delle sue industrie e nove decimi delle sue miniere di carbone.;;;;;;Когд?Советская Росс? отказалась от мирных переговоро?10 февраля 1918 года ?односторонне?по?дк?об?ви?об окончани?военны?действий ('ни войн?- ни мира'), Центральны?держав?ответили, отказавшис?от перемирия 18 февраля 1918 года. Он?начали крупно?наступлени?(операц? Faustschlag), не встреч? практическ?никакого сопротивления, ?захватил?большу?част?Украин? Белоруссии ?стра?Балтии.\nПодписание формальног?мирног?договора стал?единственным варианто??глазах большевико? потому чт?русская армия бы?демобилизована ?создаваемая Красная Армия была не ?сост?ни?остановить наступлени? Советы приняли условия мирног?договора ?официально?соглашение, Брес?Литовски?мирный догово? было ратифицировано 6 март?  Догово? подписанны?межд?Советско?Россие? ?одно?сторон? ?Германской империей, Австро-Венгрией, Болгарие??Османско?импере??другой сторон? отмети?окончательны?выхо?России из Первой мирово?войн? ?итог? по условия?договора, была забран?территор?, которая включала четверть населения русски?импери? четверть промышелнных мощносте??де?ть де?ты?угольных шахт.;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
