EVT1914_2007531_DESC;The Left Socialist-Revolutionaries, which had supported the Bolshevik Party in the Soviet Government since the revolution of October 1917, resigned their positions in protest at the signing of the Treaty of Brest-Litovsk.\nBy using their positions within the Cheka (the secret police), the Left SRs managed to assassinate the German Ambassador in Moscow, Count Wilhelm von Mirbach, on July 6, 1918. The Leadership of the Left SRs incorrectly believed this assassination would lead to a widespread popular uprising in support of their aims. They claimed to be leading an uprising against the peace with Germany and not necessarily against the Bolsheviks and soviet power. The main rebel force was a detachment commanded by Dmitry Ivanovich Popov and consisting of about 1 800 revolutionaries that started the insurrection by bombarding the Kremlin with artillery. The Bolsheviks reacted quickly and launched a successful counterattack which led to the arrest of the revolters. The result of the Left SR Uprising was the suppression of the Left SRs, the last major independent party other than the Bolsheviks, leaving the Bolsheviks as the only party in government.;Les socialistes rйvolutionnaires, qui soutenaient le Parti bolchйvik depuis la Rйvolution d'Octobre 1917, se retirиrent du gouvernement pour montrer leur opposition ?la signature du trait?de Brest-Litovsk.\nJouant de leur influence au sein de la police secrиte, la Tchйka, les socialistes rйvolutionnaires parvinrent ?assassiner l'ambassadeur Allemand ?Moscou, le Comte Wilhelm von Mirbach, le 6 juillet 1918. Ils pensиrent, ?tort, que cette assassinat dйclencherait une vaste mobilisation populaire venant ?leur soutien. Ils ne prйtendaient pas tant s'opposer au pouvoir des Soviets, mais au seul choix de cesser les hostilitйs. La principale force rebelle йtait commandйe par Dimitry Ivanovitch Popov et regroupait 1,800 rйvolutionnaires qui utilisиrent de l'artillerie pour bombarder le Kremlin. Les bolchйviks rйagirent promptement et arrкtиrent les rebelles. Le Parti socialiste rйvolutionnaire fut ensuite interdit, ce qui fit du Parti bolchйvik le seul parti prenant part au gouvernement. ;Die radikalen sozialistischen Revolutionдre, welche die bolschewistische Partei seit Anfang der Revolution im Oktober 1917 in der sowjetischen Regierung unterstьtzt hatten, traten als Reaktion auf die Unterschrift des Vertrags von Bresk-Litovsk von ihren Posten zurьck. \nDurch ihre Kontakte innerhalb der Cheka (der Geheimpolizei), war es den Sozialisten mцglich, den deutschen Botschafter in Moskau, Graf Wilhelm von Mirbach, am 6. Juli 1918 zu ermorden. Die Fьhrung der radikalen Sozialisten nahm fдlschlicherweise an, dass der Anschlag zu einem groЯangelegten Aufstand zu ihren Gunsten fьhren wurde, in der Tat mobilisierten sich aber nur wenige Krдfte. Man kьndigte an, dass sich der Aufstand weniger gegen die Bolschewisten und die Sowjetmacht und mehr gegen den Friedensschluss mit Deutschland richten wьrde. Die Hauptstreitmacht der Rebellen war eine Abteilung unter dem Kommando von Dmitry Ivanovich Popov und bestand aus etwa 1.800 Revolutionдren, die ihre Rebellion mit Artilleriebeschuss auf den Kreml begannen. Die Bolschewisten reagierten zьgig und starteten einen erfolgreichen Gegenangriff, der zu einer Verhaftung der Revoluzzer fьhrte. Als Reaktion auf den Aufstand wurden die verbliebenen Radikalsozialisten, die letzte verbleibende politische Macht neben den Bolschewisten, entmachtet, was den Bolschweisten zur absoluten Macht im Staate verhalf.;Lewicowi eserowcy, ktуrzy wspierali parti?bolszewick?w rz№dzie sowieckim od czasu rewolucji w paџdzierniku 1917 r., zrezygnowali z peіnionych funkcji w geњcie protestu po podpisaniu Traktatu w Brzeњciu Litewskim.\nUїywaj№c swoich wpіywуw w Czece (tajnej policji), lewicowi eserowcy dokonali zabуjstwa niemieckiego ambasadora w Moskwie, hrabiego Wilhelma von Mirbacha, 6 lipca 1918 r. Przywуdcy lewicowych eserowcуw bікdnie przypuszczali, їe to zabуjstwo przysporzy im powszechnego poparcia spoіecznego. Gіosili, їe poprowadz?powszechne powstanie przeciwko pokojowi z Niemcami, niekoniecznie w opozycji do bolszewikуw i wіadzy sowieckiej. Gіуwn?siі№ rebelianck?by?oddzia?dowodzony przez Dmitrija Iwanowicza Popowa, skіadaj№cy si?z 1 800 rewolucjonistуw, ktуry rozpocz№і insurekcj?bombarduj№c Kreml ze swoich dzia? Bolszewicy szybko zareagowali, dokonali udanego kontrataku i aresztowali rewolucjonistуw. W wyniku krуtkotrwaіego powstania zdіawiono wpіywy lewicowych eserowcуw, ktуrzy byli ostatni?duї№ parti?niezaleїn?wobec bolszewikуw, pozostawiaj№c bolszewikуw jako jedyn?parti?w rz№dzie.;Los Socialistas-Revolucionarios de izquierdas, que habнan apoyado al Partido Bolchevique en el Gobierno Soviйtico desde la revoluciуn de Octubre de 1917, renunciaron a sus cargos en protesta por la firma del Tratado Brest-Litovsk.\nUsando sus cargos dentro de la Checa (la policнa secreta), los SR de izquierdas dirigieron el asesinato del Embajador alemбn en Mosc? el Conde Wilhelm von Mirbach, el 16 de julio de 1918. El mando de los SR de izquierdas crey?que este asesinato llevarнa a un levantamiento popular generalizado en apoyo a sus objetivos. Reclamaron estar liderando un levantamiento contra la paz con Alemania y no contra los Bolcheviques y el poder soviйtico. La principal fuerza rebelde estaba comandada por Dmitry Ivanovich Popov y consistнa en 1800 revolucionarios que empezaron la insurreciуn bombardeando el Kremlin con artillerнa. Los Bolcheviques reaccionaron rбpidamente y lanzaron un exitoso contraataque que llev?al arresto de los rebeldes. El resultado del levantamiento de los SR de izquierdas fue la supresiуn del Partido SR de izquierdas, el mayor partido independiente, despuйs del Bolchevique, dejбndolos como el ъnico partido en el gobierno.;I Socialisti Rivoluzionari di Sinistra, che avevano sostenuto il Partito Comunista Bolscevico nel governo dei Soviet fin dalla rivoluzione dell'Ottobre 1917, diedero le dimissioni in segno di protesta alla firma del Trattato di Brest-Litovsk.\nUsando le proprie posizioni all'interno della Cheka (la polizia segreta), i SR di Sinistra riuscirono ad assassinare l'ambasciatore tedesco a Mosca, il Conte Wilhelm von Mirbach, il 6 Luglio 1918. I leader dei SR di Sinistra pensavano a torto che questo assassinio avrebbe portato a diffuse proteste popolari in supporto dei loro obiettivi e dichiararono di stare guidando una rivolta contro la pace con la Germania e non necessariamente contro i Bolscevichi e il potere dei Soviet. La principale forza di ribellione era una distaccamento guidato da Dmitry Ivanovich Popov che comprendeva circa 1 800 rivoluzionari che iniziarono la rivolta bombardando il Cremlino con l'artiglieria. I Bolscevichi reagirono prontamente e lanciarono un contrattacco che port?all'arresto dei rivoltosi. Il risultato della rivolta fu la soppressione dei SR di Sinistra, l'ultimo grande partito indipendente oltre ai Bolscevichi, lasciando i Bolscevichi come unico partito nel governo.;;;;;;Левы?Эсер? которы?поддерживали большевистскую партию ?советско?правительств?посл?революци?ок?бря 1917 года, подали ?отставку со свои?позици??знак протеста против подписан? Брес?Литовкског?мирног?договора. Используя свои позици??ЧК, левы?эсер?смогли убит?германског?посл??Москве граф?Вильгельма фо?Мирбах?6 ию? 1918 года. Руководств?левы?эсеров ошибочно считал? чт?эт?убийство може?привести ?широкому народном?восстани??поддержк?их целе? Он?утверждали, чт?восстани?против мира ?Германие??не обязательно против большевико??советско?власти. Основные силы повстанческого от?да находились по?командование?Дмитрия Иванович?Попова ?сост?ли примерно из 1 800 революционеров, которы?начали восстани??артиллерийской бомбардировк?Крем?. Большевики быстро отреагировал??начали успешную контратаку, которая привел??аресту восставших. Результато?восстания левы?эсеров было исчезновение последне?крупно?независимо?политической силы, оставляя большевико? единственной партие??правительств?