ns_peace_conference_desc;After the Provisional Government of ROC was established, the revolutionaries divided into two factions, some militants wanted to keep fighting and others want to negotiate with Yuan Shikai and end this war. Yuan Shikai knew about this and he wasn't loyal to the Qing but to himself, so he sent Tang Shaoyi to meet with the delegation of the Provisional Government. It is the time that we have to decide what to do.;;;;;;;;;;;;x;;,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,,
