desc_CHIE6;After the Boxer Rebellion the Qing Empire was forced to sign the Xinchou Treaty with the 11 Great Powers and had to pay a huge amount of indemnity.,This led to a considerable loss in the treasury and national sovereignty.  Some revolutionaries took the opportunity to recruit members and spread their ideals.,The Empire was already tottering.
